CREATE TABLE `CityRecord` (
  `city` varchar(30) NOT NULL,
  `confirmedCount` int NOT NULL DEFAULT '0',
  `country` varchar(30) NOT NULL,
  `createdAt` date NOT NULL DEFAULT '1970-01-01',
  `curedCount` int NOT NULL DEFAULT '0',
  `deadCount` int NOT NULL DEFAULT '0',
  `id` varchar(30) NOT NULL,
  `province` varchar(30) NOT NULL,
  `recordAt` date NOT NULL DEFAULT '1970-01-01',
  `sourceUrl` text NOT NULL,
  `suspectedCount` int NOT NULL DEFAULT '0',
  `updatedAt` date NOT NULL DEFAULT '1970-01-01',
  `virus` varchar(30) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `province` (`province`),
  KEY `city` (`city`),
  KEY `virus` (`virus`),
  KEY `country` (`country`),
  CONSTRAINT `CityRecord_ibfk_1` FOREIGN KEY (`province`) REFERENCES `Province` (`id`) ON DELETE RESTRICT,
  CONSTRAINT `CityRecord_ibfk_2` FOREIGN KEY (`city`) REFERENCES `City` (`id`) ON DELETE RESTRICT,
  CONSTRAINT `CityRecord_ibfk_3` FOREIGN KEY (`virus`) REFERENCES `VirusInfo` (`id`) ON DELETE RESTRICT,
  CONSTRAINT `CityRecord_ibfk_4` FOREIGN KEY (`country`) REFERENCES `Country` (`id`) ON DELETE RESTRICT
