INSERT INTO `News` VALUES ('2020年2月10日0时-24时，海南省报告新型冠状病毒肺炎新增确诊病例6例，新增重症病例0例，新增死亡病例0例，新增重症病例转轻症病例1例，新增出院病例0例；新增确诊病例中，海口市1例、三亚市4例、万宁市1例；新增重症病例转轻症病例中，万宁市1例。','2020-02-11','ck6hgxc8v0000s27c22bdfvkv','海南卫健委','海南省','2020-02-11','http://wst.hainan.gov.cn/swjw/rdzt/yqfk/index.html','','海南新增确诊病例6例，累计142例','2020-02-11'),('2月10日12时至24时，云南省报告新型冠状病毒肺炎新增确诊病例为零。全省累计报告确诊病例149例，除治愈出院者外，现均在定点医院接受隔离治疗。现有危重3例，重症15例，治愈出院19例，疑似病例109例，无死亡病例。\n','2020-02-11','ck6hgxc8x0001s27c8uaj3t1s','人民日报','云南省','2020-02-11','http://m.weibo.cn/2803301701/4470743900993985','','云南无新增确诊，累计确诊149例','2020-02-11'),('2020年2月10日10时至11日9时，内蒙古自治区报告无新冠肺炎新增确诊病例。新增疑似病例2例。截至2月11日9时，内蒙古自治区累计报告新冠肺炎确诊病例58例，重症病例3例，危重病例5例，出院病例5例。','2020-02-11','ck6hgxc8y0002s27c37920i4f','内蒙古卫健委','内蒙古自治区','2020-02-11','http://wjw.nmg.gov.cn/doc/2020/02/11/291565.shtml','','内蒙古无新增确诊，累计确诊58例','2020-02-11'),('2月10日0时至24时，本市新增5例新冠肺炎确诊病例。1例有湖北及其他省份接触史；3例为确诊病例的密切接触者；1例无湖北接触史。均已送至定点医疗机构进行救治。现有疑似病例236例，新增密切接触者37例，累计确定密切接触者1502例，其中677例已解除医学观察。出院4例，死亡1例。        截至2月10日24时,本市累计确诊病例342例。其中出院48例，死亡3例，291例在定点医院进行隔离治疗。\n                            \n                ','2020-02-11','ck6hgxc8y0003s27c77qxhymh','北京卫健委','北京市','2020-02-10','http://wjw.beijing.gov.cn/xwzx_20031/xwfb/202002/t20200211_1627700.html','','北京新增确诊5例，累计确诊342例','2020-02-11'),(' 截至2020年2月10日24时，西藏自治区累计报告新型冠状病毒感染的肺炎确诊病例1例。现有确诊病例1例，重症病例0例，死亡病例0例，出院病例0例。目前，确诊患者生命体征平稳。其密切接触者已全部解除医学隔离。','2020-02-11','ck6hgxc8y0004s27ce9rr68kh','西藏卫健委','西藏自治区','2020-02-09','http://wjw.xizang.gov.cn/xwzx/wsjkdt/202002/t20200211_132042.html','','西藏无新增确诊，累计确诊1例','2020-02-11'),('2020年2月10日0-24时，青海省报告新型冠状病毒肺炎新增确诊病例0例，新增重症病例2例，新增死亡病例0例，新增出院病例0例。当日无新增确诊病例和疑似病例。截至2月10日24时，青海省累计报告新型冠状病毒肺炎确诊病例18例，其中：重症病例3例，死亡病例0例，出院病例3例。累计确诊病例中，西宁市15例，海北州3例，尚有15例确诊患者住院治疗。','2020-02-11','ck6hgxc8y0005s27c5deh5gde','青海卫健委','青海省','2020-02-10','https://wsjkw.qinghai.gov.cn/ztbd/yqjk/yqtb/2020/02/11/1581387578350.html','','青海无新增确诊，累计确诊18例','2020-02-11'),('截至2月11日10时，陕西新增6例新冠肺炎确诊病例，新增疑似病例71例。新增确诊病例中，西安市6例。陕西累计报告新冠肺炎确诊病例219例（31例治愈出院）。全省现有疑似病例389例。','2020-02-11','ck6hgxc8y0006s27c8yu29vtj','陕西卫健委','陕西省','2020-02-10','http://sxwjw.shaanxi.gov.cn/art/2020/2/11/art_9_67931.html','','陕西新增确诊6例，累计确诊219例','2020-02-11'),(' 截至2月10日20时，甘肃新增3例新型冠状病毒肺炎确诊病例。新增确诊病例中，兰州市2例、平凉市1例。新增治愈出院5例。甘肃累计报告新型冠状病毒肺炎确诊病例86例，累计治愈出院21例，累计死亡病例2例，63例在定点医院进行隔离治疗。兰州市19例、天水市11例、平凉市8例、定西市6例、甘南州6例、陇南市4例、白银市4例、庆阳市3例、张掖市1例、临夏州1例。现有重型病例7例，危重型病例1例。\n		','2020-02-11','ck6hgxc8y0007s27cf5m64i12','甘肃卫健委','甘肃省','2020-02-10','http://wsjk.gansu.gov.cn/single/11218/83962.html','','甘肃新增确诊病例3例，累计86例','2020-02-11'),('2020年2月10日0-24时,湖南省报告新型冠状病毒肺炎新增确诊病例33例,新增重症病例5例,新增死亡病例0例,新增出院病例27例。截至2月10日24时,湖南省累计报告新型冠状病毒肺炎确诊病例912例,累计报告重症病例122例,现有重症病例62例,死亡病例1例,出院病例213例。目前追踪到密切接触者22969人,已解除医学观察15683人,尚有7286人正在接受医学观察。\n			','2020-02-11','ck6hgxc8y0008s27c2dx462sm','湖南卫健委','湖南省','2020-02-11','http://wjw.hunan.gov.cn/wjw/qwfb/202002/t20200211_11175774.html','','湖南新增确诊33例，累计确诊912例','2020-02-11'),('2月10日0-24时，我省新型冠状病毒肺炎新增确诊病例12例，新增治愈出院病例6例，无新增死亡病例。截至2月10日24时，我省累计报告新型冠状病毒肺炎确诊病例417例，涉及21个市（州）、125个县（市、区）。417名确诊患者中，正在住院隔离治疗334人（其中危重17人），已治愈出院82人，死亡1人。当日解除医学观察1388人，现有6104人正在接受医学观察。','2020-02-11','ck6hgxc8y0009s27c13yc6tyi','四川卫健委','四川省','2020-02-10','http://wsjkw.sc.gov.cn/scwsjkw/gggs/2020/2/11/51b4573f2ff744d7b943dcfca0276e33.shtml','','四川新增确诊12例，累计确诊417例','2020-02-11'),('2月10日0—24时，福建省报告新增新型冠状病毒肺炎确诊病例6例。其中：厦门市3例（海沧区2例、湖里区1例）；漳州市1例（长泰县1例）；泉州市1例（丰泽区1例）；南平市1例（浦城县1例）。新增治愈出院病例4例。\n截至2月10日24时，福建省累计报告新型冠状病毒肺炎确诊病例267例。目前确诊、疑似病例的密切接触者已解除医学观察5389人，尚有3117人正在接受医学观察。 ','2020-02-11','ck6hgxc8z000as27ce26h8nek','福建卫健委','福建省','2020-02-11','http://wjw.fujian.gov.cn/ztzl/gzbufk/yqtb/202002/t20200211_5192923.htm','','福建新增确诊病例6例，累计267例','2020-02-11'),('2020年2月10日0-24时，新疆（含兵团）报告新型冠状病毒肺炎新增确诊病例6例，新增死亡病例0例，新增出院病例0例。截至2月10日24时，新疆（含兵团）累计报告新型冠状病毒肺炎确诊病例55例（新疆维吾尔自治区39例、新疆生产建设兵团16例），现有重症病例11例、危重症病例5例；累计死亡病例0例，累计出院病例0例。目前尚有3842人正在接受医学观察。','2020-02-11','ck6hgxc8z000bs27chjpo4x2l','新疆卫健委','新疆维吾尔自治区','2020-02-11','http://www.xjhfpc.gov.cn/info/2070/18299.htm','','新疆新增确诊6例，累计确诊55例','2020-02-11'),('2020年2月10日12—24时，上海市排除新型冠状病毒肺炎疑似病例56例；新增确诊病例3例，均为本市常住人口。具体情况如下： 截至2月10日24时，上海市已累计排除疑似病例1186例，发现确诊病例302例。确诊病例中，男性158例，女性144例；年龄最大88岁，最小7月龄；143例有湖北居住或旅行史，24例有湖北以外地区居住或旅行史，132例有相关病例接触史，3例正在流行病学调查中；外地来沪人员97例，本市常住人口205例。目前，233例病情平稳，10例病情危重，10例重症，48例治愈出院，1例死亡。尚有180例疑似病例正在排查中。 \n          \n           \n       ','2020-02-11','ck6hgxc8z000cs27cat6geixz','上海卫健委','上海市','2020-02-10','http://wsjkw.sh.gov.cn/xwfb/20200211/d4f8535e123943959675ff120d8cb367.html','','上海新增确诊病例3例，累计302例','2020-02-11'),('2020年2月10日0-24时，江苏省报告新型冠状病毒肺炎新增确诊病例23例。其中，轻型病例7例，普通型病例16例。新增出院病例12例。截至2月10日24时，江苏省累计报告新型冠状病毒肺炎确诊病例515例。','2020-02-11','ck6hgxc8z000ds27c9cia9ncv','江苏卫健委','江苏省','2020-02-11','http://wjw.jiangsu.gov.cn/art/2020/2/11/art_7290_8967924.html','','江苏新增23例，累计515例','2020-02-11'),(' 2020年2月10日12—24时，全省新型冠状病毒肺炎新增确诊病例9例,新增治愈出院病例3例。截至2月10日24时，全省累计报告新型冠状病毒肺炎病例118例。','2020-02-11','ck6hgxc8z000es27cejbt2zxs','贵州卫健委','贵州省','2020-02-11','http://www.gzhfpc.gov.cn/ztzl_500663/xxgzbdgrdfyyqfk/yqdt/202002/t20200211_48345381.html','','贵州新增确诊9例，累计确诊118例','2020-02-11'),('2020年2月10日0-24时,黑龙江省报告新型冠状病毒感染的肺炎新增确诊病例29例。新增出院病例12例。新增重症病例8例。新增死亡病例1例。新增疑似病例77例。截至2月10日24时,黑龙江省报告新型冠状病毒感染的肺炎确诊病例360例，现有重症病例52例。死亡病例8例。治愈出院病例27例。现有疑似病例181例。\n\n\n	全省当日发热门诊诊疗人数1928人。目前追踪到密切接触者10800人, 已解除医学观察6492人，尚有4348人正在接受医学观察。\n		','2020-02-11','ck6hgxc8z000fs27c5pbmdi4f','黑龙江卫健委','黑龙江省','2020-02-10','http://wsjkw.hlj.gov.cn/index.php/Home/Zwgk/show/newsid/7771/navid/42/stypeid/','','黑龙江新增确诊29例，累计确诊360例','2020-02-11'),('2020年2月10日12-24时，山东省报告新型冠状病毒肺炎新增确诊病例20例，累计确诊病例486例(含重症病例18例，危重症病例9例，治愈出院71例，死亡病例1例);新增疑似病例13例，现有疑似病例66例。截至目前，追踪到密切接触者13119人，已解除医学观察9410人，诊断为疑似或确诊241例，尚有3468人正在接受医学观察。详见下表(单位:例):备注:根据要求，按病例确诊时医院所在县区统计。\n         \n            \n              \n   \n        \n            \n            \n            \n				\n					\n						 \n\n						\n					\n			\n          ','2020-02-11','ck6hgxc8z000gs27cgl8xeiw2','山东卫健委','山东省','2020-02-09','http://wsjkw.shandong.gov.cn/ztzl/rdzt/qlzhfkgz/tzgg/202002/t20200211_2518566.html','','山东新增确诊20例，累计确诊486例','2020-02-11'),('2020年2月10日0-24时，浙江省报告新型冠状病毒肺炎新增确诊病例25例，新增出院病例50例。截至2月10日24时，浙江省累计报告新型冠状病毒肺炎确诊病例1117例，现有重症病例87例（其中危重30例），出院病例 250 例。\n   \n','2020-02-11','ck6hgxc8z000hs27c7kqa7zdv','浙江卫健委','浙江省','2020-02-11','https://www.zjwjw.gov.cn/art/2020/2/11/art_1202101_41899040.html','','浙江新增确诊25例，累计确诊1117例','2020-02-11'),('2020年2月10日0-24时，安徽省报告新增确诊病例30例，新增疑似病例33例，新增治愈出院病例15例，新增死亡病例1例。新增确诊病例中，合肥3例、淮北1例、宿州2例、蚌埠8例、阜阳7例、淮南1例、六安2例、马鞍山1例、芜湖1例、铜陵2例、安庆2例，均病情平稳。截至2月10日24时，安徽省累计报告确诊病例860例，累计治愈出院病例88例，累计死亡病例4例，累计医学观察密切接触者18667人。','2020-02-11','ck6hgxc8z000is27c99p17h0r','安徽卫健委','安徽省','2020-02-11','http://wjw.ah.gov.cn/news_details_54806.html','','安徽新增确诊病例30例，累计860例','2020-02-11'),('2020年2月10日0时至24时，山西省报告新增新型冠状病毒肺炎确诊病例3例，累计确诊病例122例。新增治愈出院1例，累计治愈出院26例。现有在院隔离治疗96例，其中重症12例，危重症5例。目前累计追踪到密切接触者3332人，当日解除医学观察152人，共有985人正在接受医学观察。\n			\n							\n							\n						','2020-02-11','ck6hgxc8z000js27cbm823pw1','山西卫健委','山西省','2020-02-10','http://wjw.shanxi.gov.cn:80/wjywl02/24821.hrh','','山西新增确诊3例，累计确诊122例','2020-02-11'),('2020年2月10日0—24时，河北省报告新型冠状病毒肺炎新增确诊病例21例，其中，保定市4例、沧州市4例、张家口市4例、唐山市3例、石家庄市2例、廊坊市2例、秦皇岛市2例。新增治愈出院病例6例，其中，沧州市2例、衡水市2例、保定市1例、邯郸市1例。新增疑似病例15例。截至2月10日24时，河北省累计报告确诊病例239例，其中死亡2例，现有重症病例21例，累计治愈出院41例。现有疑似病例44例。目前累计追踪到密切接触者8138人，当日解除隔离医学观察497人，现有3633人正在接受隔离医学观察。                                                                                                \n','2020-02-11','ck6hgxc90000ks27c47s6an3d','河北卫健委','河北省','2020-02-10','http://www.hebwst.gov.cn/index.do?id=397919&templet=content&cid=3714','','河北新增确诊21例累计239例','2020-02-11'),('  2020年2月10日0-24时，河南省新增新型冠状病毒肺炎确诊病例32例,新增出院病例29例，新增死亡病例1例。截至2月10日24时，全省累计报告新型冠状病毒肺炎确诊病例1105例，现有重症病例60例，现有危重病例31例，累计死亡病例7例，累计治愈病例198例。','2020-02-11','ck6hgxc90000ls27c9xks6pwx','河南卫健委','河南省','2020-02-10','http://hnwsjsw.gov.cn/contents/854/48232.shtml','','河南新增确诊32例，累计确诊1105例','2020-02-11'),('2月10日0-24时，全省新增确诊病例1例（长春市）。截至2月10日24时，全省累计报告确诊病例81例，累计治愈出院13例（长春市6例，吉林市2例，延边州2例，四平市1例，松原市1例，公主岭市1例），死亡1例（四平市），现在院隔离治疗确诊病例67例。\n','2020-02-11','ck6hgxc90000ms27c6euxcc63','吉林卫健委','吉林省','2020-02-10','http://www.jl.gov.cn/szfzt/jlzxd/yqtb/202002/t20200211_6835226.html','','吉林新增确诊1例，累计确诊81例','2020-02-11'),('2020年2月10日0时-24时，湖北省新增新冠肺炎病例2097例，全省新增死亡103例，新增出院427例。截至2020年2月10日24时，湖北省累计报告新冠肺炎病例31728例，全省累计死亡974例，病死率3.07%，目前仍在院治疗25087例，，均在定点医疗机构接受隔离治疗。现有疑似病例16687人，其中集中隔离17259人（含临床确诊病例），当日排除3390人。累计追踪密切接触者144279人，尚在接受医学观察76207人。','2020-02-11','ck6hgxc90000ns27c8vqm6fek','人民网','湖北省','2020-02-10','http://m.weibo.cn/2286908003/4470669633093808','','湖北新增确诊2097例','2020-02-11'),('2020年2月10日12—24时，重庆市报告新冠肺炎新增确诊病例13例，新增重型病例3例，重型病例转普通型病例1例，新增出院病例6例。\n','2020-02-11','ck6hgxc90000os27c5aszbvc8','人民网','重庆市','2020-02-10','http://m.weibo.cn/2286908003/4470676528701588','','重庆新增13例累计486例','2020-02-11'),('重庆6名患者经定点医疗机构医护人员精心诊治和护理，专家组评估，认为符合国家卫生健康委最新的新型冠状病毒肺炎确诊病例解除隔离和出院标准，于今日出院。目前，全市共有66名新型冠状病毒肺炎患者治愈出院。\n            \n        ','2020-02-11','ck6hgxc90000ps27cdw046kqp','重庆卫健委','重庆市','2020-02-10','http://wsjkw.cq.gov.cn/yqxxyqtb/20200210/253280.html','','重庆又有6例确诊病例痊愈出院，目前共有66例出院 ','2020-02-11'),('2月10日0时至12时，云南省报告新型冠状病毒肺炎新增确诊病例8例。全省累计报告确诊病例149例，除治愈出院者外，现均在定点医院接受隔离治疗。\n','2020-02-11','ck6hgxc90000ss27c6oqe8ybm','人民网','云南省','2020-02-10','http://m.weibo.cn/2286908003/4470472907699424','','云南新增8例，累计确诊149例','2020-02-11'),('湖北省卫健委官网今日通报，2月9日0时至24时，全省新增新型冠状病毒感染的肺炎病例2618例、死亡91例、出院356例。全省累计报告确诊病例29631例、已治愈出院1795例、死亡871例。相比8日排除疑似病例1128人，9日排除7194人，排除速度大幅加快。 \n','2020-02-11','ck6hgxc90000ts27cgiog1zgg','人民日报','湖北省','2020-02-10','http://m.weibo.cn/2803301701/4470458756364219','','湖北排除疑似病例速度加快，一天排除7194','2020-02-11'),('北京市又有7例新冠肺炎患者，经过医护人员精心治疗后，符合出院标准，于2月9日先后从地坛医院、佑安医院、解放军总医院第五医学中心出院。截至2月9日24时,北京市累计确诊病例337例。目前，北京市死亡2例，出院44例，291例在定点医院进行隔离治疗，其中危重型17例。','2020-02-11','ck6hgxc90000us27cfe9hedxv','北京卫健委','北京市','2020-02-09','http://wjw.beijing.gov.cn/xwzx_20031/xwfb/202002/t20200210_1627442.html','','北京市新增7例，累计确诊病例337例','2020-02-11'),('2020年2月10日0—12时，重庆市报告新冠肺炎新增确诊病例5例，新增出院病例9例。截至2月10日12时，重庆市累计报告新冠肺炎确诊病例473例；现有重型病例34例，危重型病例22例，死亡病例2例，出院病例60例。累计追踪到密切接触者15770人，已解除医学观察9231人，尚有6539人正在接受医学观察。','2020-02-11','ck