疗队乘坐41架次包机陆续抵汉。这是疫情以来，机场迎接运输保障医疗队人数最多的一天。他们将以“一省包一市”的方式，支持湖北省16个市的疫情防控救治工作。','2020-02-11','ck6hgxc910013s27c7jwn5ulw','人民日报','全国','2020-02-10','http://m.weibo.cn/2803301701/4470396948428039','','一省包一市强援抵达：41架包机近6000人同天抵达武汉','2020-02-11'),('农业农村部新闻办公室2月9日发布，四川省南充市西充县发生一起家禽H5N6亚型高致病性禽流感疫情。经国家禽流感参考实验室确诊，西充县某养殖场饲养的家禽发生H5N6亚型高致病性禽流感疫情，养殖场存栏家禽2497只，发病死亡1840只。疫情发生后，当地按照有关要求已扑杀家禽2261只，全部病死和扑杀家禽均已无害化处理。\n','2020-02-11','ck6hgxc910014s27c3hyu36yd','人民网','四川省','2020-02-10','http://m.weibo.cn/2286908003/4470363641408700','','四川发生一起H5N6禽流感疫情','2020-02-11'),('【#西藏连续11天无新增病例#】西藏自治区卫健委今天上午发布新型冠状病毒感染的肺炎疫情情况：截至2月9日24时，西藏累计报告新型冠状病毒感染的肺炎确诊病例1例，重症病例0例，死亡病例0例，出院病例0例。目前，这名来自武汉的张姓患者生命体征平稳，其密切接触者已于2月8日全部解除医学观察。因此，西藏自治区已经连续11天没有新增确诊病例或疑似病例报告。\n','2020-02-11','ck6hgxc910015s27cc9qobi37','人民日报','西藏自治区','2020-02-10','http://m.weibo.cn/2803301701/4470368846986588','','西藏连续11天无新增病例','2020-02-11'),('【#广东新增确诊31例#，#广东累计确诊1151例#】截至2月9日24时，全省累计报告新冠肺炎确诊病例1151例。2月9日当天全省新增确诊病例31例。新增确诊病例中，广州市9例、中山市5例、深圳市4例、惠州市3例、佛山市3例、珠海市2例、江门市2例、东莞市2例、茂名市1例。另有疑似病例169例。有3158名密切接触者正在接受医学观察。\n','2020-02-11','ck6hgxc910016s27c8gzad8f6','人民日报','广东省','2020-02-10','http://m.weibo.cn/2803301701/4470357731409503','','广东新增确诊31例，累计确诊1151例','2020-02-11'),('2月9日0—24时，福建省报告新增新型冠状病毒肺炎确诊病例11例。累计报告新型冠状病毒肺炎确诊病例261例（危重型8例、重型13例，无死亡病例）。福州市63例，厦门市28例，漳州市16例，泉州市42例，三明市13例，莆田市51例，南平市18例，龙岩市6例，宁德市24例，累计治愈出院病例35例，目前住院病例226例。目前，确诊、疑似病例的密切接触者已解除医学观察4772人，尚有3185人正在接受医学观察。\n                ','2020-02-11','ck6hgxc920017s27c9sc3ajx2','福建卫健委','福建省','2020-02-10','http://wjw.fujian.gov.cn/ztzl/gzbufk/yqtb/202002/t20200210_5192203.htm','','福建新增确认病例11例， 累计261例','2020-02-11'),('  2020年2月9日0-24时，河南省新增新型冠状病毒肺炎确诊病例40例,新增出院病例38例。新增确诊病例中，信阳市15例（含固始县5例）、驻马店市7例、郑州市4例、周口市3例、平顶山市2例、洛阳市2例、新乡市2例（含长垣市1例）、濮阳市1例、安阳市1例、商丘市1例、南阳市1例、焦作市1例。截至2月9日24时，全省累计报告新型冠状病毒肺炎确诊病例1073例，现有重症病例63例，现有危重病例31例，累计死亡病例6例，累计治愈病例169例。目前累计追踪到密切接触者24627人，2月9日已解除观察3890人，诊断为疑似56人，共有10199人正在接受医学观察。      ','2020-02-11','ck6hgxc920018s27c3qhk3keh','河南卫健委','河南省','2020-02-09','http://hnwsjsw.gov.cn/contents/854/48218.shtml','','河南新增确诊病例40例，累计1073例','2020-02-11'),('【#江苏新增确诊24例#，#江苏累计确诊492例#】2020年2月9日0-24时，江苏省报告新型冠状病毒肺炎新增确诊病例24例。其中，轻型病例4例，普通型病例20例。新增出院病例21例。新增确诊病例中，南京市7例、无锡市3例、徐州市4例、苏州市2例、南通市1例、连云港市3例、淮安市2例、盐城市1例、泰州市1例。截至2月9日24时，江苏省累计报告新型冠状病毒肺炎确诊病例492例。出院病例72例。确诊病例中，南京市78例、无锡市41例、徐州市60例、常州市31例、苏州市77例、南通市33例、连云港市35例、淮安市46例、盐城市18例、扬州市18例、镇江市12例、泰州市31例、宿迁市12例。重型病例中，南京市1例、徐州市1例、苏州市1例、南通市1例、盐城市1例。危重型病例中，徐州市1例、连云港市1例、淮安市1例。目前，江苏省追踪到密切接触者10296人，已解除医学观察5070人，尚有5226人在接受医学观察。\n','2020-02-11','ck6hgxc920019s27ce7gq7uzv','人民日报','江苏省','2020-02-10','http://m.weibo.cn/2803301701/4470348474967272','','江苏新增确诊24例，累计确诊492例','2020-02-11'),('【#湖南新增确诊41例#，#湖南累计确诊879例#】2020年2月9日0-24时，湖南省报告新型冠状病毒肺炎新增确诊病例41例，新增重症病例9例，新增死亡病例0例，新增出院病例 27例。其中:  新增确诊病例中，长沙市8例、株洲市3例、湘潭市3例、邵阳市2例、岳阳市9例、常德市6例、益阳市7例、永州市1例、娄底市2例。    截至2月9日24时，湖南省累计报告新型冠状病毒肺炎确诊病例879例，累计报告重症病例117例，现有重症病例65例，死亡病例1例，出院病例186例。目前追踪到密切接触者22289人，已解除医学观察14154人，尚有8135人正在接受医学观察。（王云娜）','2020-02-11','ck6hgxc92001as27c3qi2gcg8','人民日报','湖南省','2020-02-10','http://m.weibo.cn/2803301701/4470344088149566','','湖南新增确诊41例，累计确诊879','2020-02-11'),('2020年2月9日14—24时，全省新型冠状病毒肺炎新增确诊病例10例,新增治愈出院病例0例。其中：新增确诊病例中，贵阳市3例、遵义市4例、铜仁市1例、黔东南州1例、黔南州1例。截至2月9日24时，全省累计报告新型冠状病毒肺炎病例109例。其中，45例有武汉旅居史，7例有武汉外湖北其他地区旅居史，9例有湖北以外地区旅居史；治愈出院7例，病情平稳80例，重症14例，危重症7例，死亡1例；男性57例，女性52例；年龄最大87岁，最小1个月。\n        ','2020-02-11','ck6hgxc92001bs27ccffab2eb','贵州卫健委','贵州省','2020-02-10','http://www.gzhfpc.gov.cn/ztzl_500663/xxgzbdgrdfyyqfk/yqdt/202002/t20200210_48158684.html','','贵州新增确诊病例10例，累计109例','2020-02-11'),('#新冠肺炎最新动态#【#上海新增2例累计295例#】2020年2月9日12—24时，上海市排除新型冠状病毒感染的肺炎疑似病例60例；新增确诊病例2例，均为本市常住人口。截至2月9日24时，上海市已累计排除疑似病例1062例，发现确诊病例295例。确诊病例中，男性155例，女性140例；年龄最大88岁，最小7月龄；141例有湖北居住或旅行史，24例有湖北以外地区居住或旅行史，127例有相关病例接触史，3例正在流行病学调查中；外地来沪人员97例，本市常住人口198例。目前，230例病情平稳，10例病情危重，10例重症，44例治愈出院，1例死亡。尚有223例疑似病例正在排查中。@上海发布\n','2020-02-11','ck6hgxc92001cs27cdilv3v1x','人民网','上海市','2020-02-10','http://m.weibo.cn/2286908003/4470330343075872','','上海新增2例累计295例','2020-02-11'),('【#江西首次报告死亡病例#】2020年2月9日0-24时，江西省报告新型冠状病毒肺炎新增确诊病例32例，新增死亡病例1例，新增治愈出院病例30例。新增确诊病例中，南昌市11例、新余市5例、上饶市5例、宜春市4例、赣州市2例、九江市1例、萍乡市1例、鹰潭市1例、吉安市1例、抚州市1例。新增治愈出院病例中，南昌市8例、新余市5例、上饶市5例、赣州市4例、宜春市4例、抚州市2例、九江市1例、吉安市1例。新增死亡病例为赣州市1例（林某某，女，79岁）。截至2月9日24时，江西省累计报告新型冠状病毒肺炎确诊病例771例（核减宜春市1例），其中重症病例57例，治愈出院病例102例，死亡病例1例。目前追踪到密切接触者19427人，解除医学观察9735人，尚有9692人正在接受医学观察。网页链接\n','2020-02-11','ck6hgxc92001ds27c5h5uccg9','人民网','江西省','2020-02-10','http://m.weibo.cn/2286908003/4470345400136039','','江西首次报告死亡病例','2020-02-11'),('#新冠肺炎最新动态#【安徽新增51例累计830例 #安徽新增死亡病例2例#】2020年2月9日0-24时，安徽省报告新增确诊病例51例，新增疑似病例61例，新增危重病例1例，新增治愈出院病例14例，新增死亡病例2例。新增确诊病例中，合肥11例、亳州5例、宿州3例、蚌埠11例、阜阳7例、淮南1例、滁州1例、六安3例、芜湖1例、宣城1例、铜陵1例、池州3例、安庆3例，除危重病例外，其余均病情平稳。截至2月9日24时，安徽省累计报告确诊病例830例，累计治愈出院病例73例，累计死亡病例3例，累计医学观察密切接触者17384人。\n','2020-02-11','ck6hgxc92001es27cf4yqabkj','人民网','安徽省','2020-02-10','http://m.weibo.cn/2286908003/4470342653651769','','安徽新增51例累计830例','2020-02-11'),('【#浙江新增确诊29例#，#浙江累计确诊1092例#】2020年2月9日0-24时，浙江省报告新型冠状病毒肺炎新增确诊病例29例，新增出院病例28例。其中：新增确诊病例中，杭州市2例、宁波市3例、温州市16例、嘉兴市2例、绍兴市3例、台州市3例；新增出院病例中，杭州市12例、宁波市2例、温州市8例、嘉兴市2例、金华市2例、台州市2例。截至2月9日24时，浙江省累计报告新型冠状病毒肺炎确诊病例1092例（杭州市核减12例），现有重症病例80例（其中危重24例），累计出院201例。全省共追踪到密切接触者30795人，当日解除医学观察2508人，尚有13293人正在接受医学观察。\n','2020-02-11','ck6hgxc92001fs27ccipldcyi','人民日报','浙江省','2020-02-10','http://m.weibo.cn/2803301701/4470343387414762','','浙江新增确诊29例，累计确诊1092例','2020-02-11'),('【#青海连续4天无新增病例#】2020年2月9日0-24时，青海省报告新型冠状病毒肺炎新增确诊病例0例，新增重症病例0例，新增死亡病例0例，新增出院病例0例。当日无新增确诊病例和疑似病例。截至2月9日24时，青海省累计报告新型冠状病毒肺炎确诊病例18例，其中：重症病例1例，死亡病例0例，出院病例3例。累计确诊病例中，西宁市15例，海北州3例，尚有15例确诊患者住院治疗。目前累计追踪到密切接触者433人，已解除医学观察45人，尚有388人正在接受医学观察。\n','2020-02-11','ck6hgxc92001gs27c5qn01sun','央视新闻','青海省','2020-02-10','http://m.weibo.cn/2656274875/4470340275604941','','青海连续4天无新增病例','2020-02-11'),('2月9日0-24时，我省新型冠状病毒肺炎新增确诊病例19例，新增治愈出院病例16例，无新增死亡病例。新增确诊病例中，甘孜州6例、成都市3例、达州市3例、遂宁市2例、泸州市1例、绵阳市1例、南充市1例、巴中市1例、凉山州1例。新增治愈出院病例中，攀枝花市4例、成都市3例、宜宾市3例、绵阳市1例、广元市1例、南充市1例、雅安市1例、资阳市1例、凉山州1例。截至2月9日24时，我省累计报告新型冠状病毒肺炎确诊病例405例，涉及21个市（州）、124个县（市、区）。405名确诊患者中，正在住院隔离治疗328人（其中危重18人），已治愈出院76人，死亡1人。当日解除医学观察1079人，现有6912人正在接受医学观察。\n\