2例、随州市1049例、荆州市1045例、襄阳市1019例、黄石市805例、宜昌市749例、鄂州市725例、荆门市641例、咸宁市507例、十堰市481例、仙桃市416例、天门市217例、恩施州187例、潜江市85例、神农架林区10例。全省累计治愈出院1795例。全省累计死亡871例，病死率2.94%，现有疑似病例18438人，其中集中隔离14388人，当日排除7194人。累计追踪密切接触者132555人，尚在接受医学观察73127人。网页链接\n','2020-02-11','ck6hgxc93001qs27cb29u0ybr','人民网','湖北省','2020-02-09','http://m.weibo.cn/2286908003/4470306825261900','','湖北新增确诊2618例，累计确诊29631例','2020-02-11'),('#新冠肺炎最新动态#【#重庆新增18例累计468例#】2020年2月9日12—24时，重庆市报告新冠肺炎新增确诊病例18例，新增重型病例6例，重型病例转危重型病例1例，新增危重型病例1例，新增出院病例10例。新增确诊病例中，万州区12例、江北区1例、九龙坡区1例、渝北区1例、合川区1例、垫江县1例、巫山县1例；新增重型病例中，万州区1例、江北区1例、长寿区1例、合川区1例、大足区2例；重型病例转危重型病例为万州区1例；新增危重型病例为渝中区1例；新增出院病例中，万州区3例、合川区1例、开州区3例、云阳县2例、巫溪县1例。截至2月9日24时，重庆市累计报告新冠肺炎确诊病例468例；现有重型病例34例，危重型病例22例，死亡病例2例，出院病例51例。累计追踪到密切接触者15668人，已解除医学观察9114人，尚有6554人正在接受医学观察。网页链接\n','2020-02-11','ck6hgxc93001rs27c7oarbpsy','人民网','重庆市','2020-02-09','http://m.weibo.cn/2286908003/4470315701002755','','重庆新增18例累计468例','2020-02-11'),('有研究提出穿山甲可能是新冠病毒的中间宿主，中国工程院院士、省新冠肺炎疫情防控科研攻关组专家、华中农业大学教授陈焕春表示：新冠病毒可能存在多个中间宿主。当今#人类新发传染病78%与野生动物有关#，要尽量少养野生动物，更不能吃野生动物。 \n','2020-02-11','ck6hgxc93001ss27ccfhaewsz','人民日报','全国','2020-02-09','http://m.weibo.cn/2803301701/4470167864009106','','专家：新冠病毒可能存在多个中间宿主','2020-02-11'),('2020年2月9日17时至19时，辽宁省锦州市新增1例新型冠状病毒肺炎确诊病例,为普通型病例。截至2020年2月9日19时， 辽宁省累计报告新型冠状病毒肺炎确诊病例107例，治愈出院12例。','2020-02-11','ck6hgxc94001ts27ccfvf7c7f','辽宁卫健委','辽宁省','2020-02-09','http://wsjk.ln.gov.cn/wst_zdzt/xxgzbd/yqtb/202002/t20200209_3737099.html','','辽宁省锦州市新增1例新型冠状病毒肺炎确诊病例','2020-02-11'),('据山东省卫健委网站9日消息，2月8日12至24时，山东省报告新型冠状病毒感染的肺炎死亡病例1例，这也是山东省首例。据悉，患者李某某，女，85岁，既往有糖尿病、高血压、冠心病、心功能衰竭、子宫肌瘤等病史。','2020-02-11','ck6hgxc94001us27c7a9lg8i7','人民日报','山东省','2020-02-09','http://m.weibo.cn/2803301701/4470091523664901','','山东出现首例死亡病例','2020-02-11'),('截至2月9日12时，全省累计报告新型冠状病毒感染的肺炎确诊病例1131例。9日当天0-12时全省新增确诊病例11例。新增确诊病例中，广州市3例、深圳市2例、江门市2例、佛山市2例、茂名市1例、惠州市1例。\n                        ','2020-02-11','ck6hgxc94001vs27c1aw4g67a','广东卫健委','广东省','2020-02-09','http://wsjkw.gd.gov.cn/xxgzbdfk/yqtb/content/post_2888906.html','','广东省新增确诊病例11例','2020-02-11'),('2020年2月9日0—12时，重庆市报告新冠肺炎新增确诊病例4例，新增出院病例2例。新增确诊病例中，万州区1例、大足区1例、忠县2例；新增出院病例中，巴南区1例、长寿区1例。\n        ','2020-02-11','ck6hgxc94001ws27cfm0j5rd8','重庆卫健委','重庆市','2020-02-08','http://wsjkw.cq.gov.cn/yqxxyqtb/20200209/252980.html','','重庆市报告新冠肺炎新增确诊病例4例','2020-02-11'),('据广东省卫健委通报，截至2月9日12时，广东省累计报告新型冠状病毒感染的肺炎确诊病例1131例。9日当天0-12时广东省新增确诊病例11例。新增确诊病例中，广州市3例、深圳市2例、江门市2例、佛山市2例、茂名市1例、惠州市1例。','2020-02-11','ck6hgxc94001xs27ccnel90ha','人民日报','广东省','2020-02-09','http://m.weibo.cn/2803301701/4470089334080151','','广东新增确诊病例11例','2020-02-11'),('国家卫健委新闻发言人米锋：从昨晚到现在，又有辽宁大连、锦州两支医疗队的千余名医生和护士告别家人，赶赴武汉，支援雷神山医院的患者救治工作。截至目前，国家卫生健康委累计从全国调派11921名医护人员驰援湖北。致敬疫情前线医护人员！ \n','2020-02-11','ck6hgxc94001ys27canpu14h5','央视新闻','全国','2020-02-09','http://m.weibo.cn/2656274875/4470077833245348','','全国累计调派11921名医护人员驰援湖北','2020-02-11'),('2月9日0时至12时，云南省报告新型冠状病毒肺炎新增病例1例（昆明市）。全省累计报告确诊病例141例，除治愈出院者外，现均在定点医院接受隔离治疗。现有危重3例，重症14例，治愈出院18例，疑似病例127例，密切接触者医学观察2886人，无死亡病例。','2020-02-11','ck6hgxc94001zs27c0lu636bm','云南卫健委','云南省','2020-02-08','http://ynswsjkw.yn.gov.cn/wjwWebsite/web/doc/UU158123176127641423','','云南省报告新型冠状病毒肺炎新增病例1例','2020-02-11'),('至2月9日6时，天津市新增新冠肺炎确诊病例2例，累计确诊病例90例。第89例患者，女，34岁，居住于天津市宝坻区史各庄镇，宝坻百货大楼男装区临时销售人员，无武汉旅行或工作史。\n','2020-02-11','ck6hgxc940020s27cajryh004','天津卫健委','天津市','2020-02-08','http://wsjk.tj.gov.cn/art/2020/2/9/art_87_70703.html','','天津市新增2例确诊病例 累计确诊病例90例','2020-02-11'),('2020年2月9日0-12时，山东省报告新型冠状病毒肺炎新增确诊病例9例，累计确诊病例444例(含重症病例26例，危重症病例7例，治愈出院53例，死亡病例1例);新增疑似病例8例，现有疑似病例85例。\n         \n            \n              \n   \n        \n            \n            \n            \n				\n					\n						 \n\n						\n					\n			\n          ','2020-02-11','ck6hgxc940021s27c87nse42c','山东卫健委','山东省','2020-02-08','http://wsjkw.shandong.gov.cn/ztzl/rdzt/qlzhfkgz/tzgg/202002/t20200209_2517573.html','','山东省报告新型冠状病毒肺炎新增确诊病例9例','2020-02-11'),('专家回应气溶胶传播：目前#新型冠状病毒通过气溶胶传播尚无证据。中国疾控中心传染病处研究员冯录召：气溶胶传播是指飞沫在空气悬浮过程中失去水分而剩下的蛋白质和病原体组成的核，形成飞沫核，可通过气溶胶形式造成远距离传播。目前，尚没有证据显示新型冠状病毒通过气溶胶传播。目前主要的传播途径还是呼吸道飞沫传播和接触传播，气溶胶和粪—口等传播途径尚待进一步明确。\n','2020-02-11','ck6hgxc940022s27cet75fzbx','央视新闻','全国','2020-02-09','http://m.weibo.cn/2656274875/4470058505888969','','新型冠状病毒通过气溶胶传播尚无证据','2020-02-11'),('快递会传播新型冠状病毒吗？据中国疾病预防控制中心疾控科普 ：一般情况下，快递运输过程被污染可能性较小，目前尚未有因接收快递而感染的报道。在有新冠肺炎传播的地区，为避免接触风险，接收快递时最好佩戴口罩和手套，处理完包裹要及时摘下手套并用流水洗手或使用手消毒剂。\n','2020-02-11','ck6hgxc940023s27c0n11eecr','人民日报','全国','2020-02-09','http://m.weibo.cn/2803301701/4470056836381397','','快递运输过程被污染可能性较小','2020-02-11'),('山东省教育厅发布通知，决定山东再次延迟开学时间。高等学校、技师学院、中职学校（含技工学校）和普通中小学、幼儿园，2月底前不开学。具体开学时间，将视疫情防控进展情况，经科学评估并确定，提前向社会公布。','2020-02-11','ck6hgxc940024s27c5gya0nr4','人民日报','山东省','2020-02-09','http://m.weibo.cn/2803301701/4470045659226334','','山东2月底前不开学','2020-02-11'),('2月8日0时至24时，本市新增11例新冠肺炎确诊病例。截至2月8日24时,本市累计确诊病例326例。其中出院37例，死亡2例，287例在定点医院进行隔离治疗。','2020-02-11','ck6hgxc950025s27cgbi2bdnf','北京卫健委','北京市','2020-02-08','http://wjw.beijing.gov.cn/xwzx_20031/xwfb/202002/t20200209_1626973.html','','北京新增确诊11例，累计确诊326例','2020-02-11'),(' 2月8日0—24时，福建省报告新增新型冠状病毒肺炎确诊病例11例。截至2月8日24时，福建省累计报告新型冠状病毒肺炎确诊病例250例','2020-02-11','ck6hgxc950026s27c1epahgix','福建卫健委','福建省','2020-02-09','http://wjw.fujian.gov.cn/xxgk/gzdt/wsjsyw/202002/t20200209_5192015.htm','','福建新增确诊11例，累计确诊250例    ','2020-02-11'),('国家发改委、财政部、工信部9日发布通知，支持生产《政府兜底采购收储的产品目录（第一批）》所列疫情防控重点医疗物资的企业抓紧释放已有产能，进一步增加产量，尽快实现满负荷复工复产。实施疫情防控重点医疗物资政府兜底采购收储，对《产品目录》中企业多生产的重点医疗防护物资，全部由政府兜底采购收储。\n','2020-02-11','ck6hgxc950027s27cd7gbg18f','人民网','全国','2020-02-09','http://m.weibo.cn/2286908003/4470008782399540','','国家发改委：第一批政府兜底采购收储产品目录公布','2020-02-11'),('2月8日0-24时，全省新增确诊病例9例。截至2月8日24时，全省累计报告确诊病例78例，累计治愈出院5例，现在院隔离治疗确诊病例72例。\n','2020-02-11','ck6hgxc950028s27c49esbavg','人民网','吉林省','2020-02-09','http://m.weibo.cn/2286908003/4469981770930700','','吉林新增确诊9例，累计确诊78例','2020-02-11'),('2020年2月8日12-24时，山东省报告新型冠状病毒肺炎新增确诊病例19例，累计确诊病例435例(含重症病例26例，危重症病例6例，治愈出院50例，死亡病例1例)。','2020-02-11','ck6hgxc950029s27c6tp15hd5','山东卫健委','山东省','2020-02-07','http://wsjkw.shandong.gov.cn/ztzl/rdzt/qlzhfkgz/tzgg/202002/t20200209_2517459.html','','山东新增确诊19例，累计确诊43