469383659749','','云南新增确诊2，累计确诊140','2020-02-11'),('2020年2月8日0时至24时，山西省报告新增新型冠状病毒肺炎确诊病例12例。截至2月8日24时，山西省11个市累计报告新型冠状病毒肺炎确诊病例115例。','2020-02-11','ck6hgxc9w002zs27c3naa6aio','山西卫健委','山西省','2020-02-08','http://wjw.shanxi.gov.cn/wjywl02/24775.hrh','','山西新增确诊12，累计确诊115','2020-02-11'),('2020年2月8日0时-24时，湖北省新增新型冠状病毒肺炎病例2147例。截至2020年2月8日24时，湖北省累计报告新型冠状病毒肺炎病例27100例。\n','2020-02-11','ck6hgxc9w0030s27cfw3o7vmu','人民日报','湖北省','2020-02-08','http://m.weibo.cn/2803301701/4469940054769086','','湖北新增确诊2147，累计确诊27100','2020-02-11'),('2020年2月8日0时至24时，山西省报告新增新型冠状病毒肺炎确诊病例12例。截至2月8日24时，山西省11个市累计报告新型冠状病毒肺炎确诊病例115例。','2020-02-11','ck6hgxc9w0031s27cgome2y97','山西卫健委','山西省','2020-02-08','http://wjw.shanxi.gov.cn:80/wjywl02/24775.hrh','','山西新增确诊12，累计确诊115','2020-02-11'),('2月8日元宵夜，500名医护人员从大连出发乘四架包机飞赴武汉，以全力支援湖北医疗救治。据悉，2月9日，另500名医护人员也将从沈阳出发驰援武汉。他们舍弃团圆的元宵节，奔赴疫情一线，致敬疫情中的逆行者，愿平安凯旋！\n','2020-02-11','ck6hgxc9w0032s27cgqavclqg','人民网','全国','2020-02-08','http://m.weibo.cn/2286908003/4469819564546724','','辽宁500名医护元宵夜飞赴武汉','2020-02-11'),('2020年2月8日13时至18时，辽宁省新增2例新型冠状病毒肺炎确诊病例,其中沈阳市1例、锦州市1例，均为普通型病例。沈阳市治愈出院1例。\n截至2020年2月8日18时，辽宁省累计报告新型冠状病毒肺炎确诊病例105例，治愈出院8例。105例确诊病例中，沈阳市26例、大连市16例、鞍山市3例、本溪市3例、丹东市7例、锦州市10例、营口市1例、阜新市7例、辽阳市3例、铁岭市3例、朝阳市6例、盘锦市11例、葫芦岛市9例。\n目前97名在治患者均在定点医疗机构隔离治疗，其中重型病例14例，危重型病例1例。 97名在治患者中，67例病例为输入性病例，30例病例为本地感染病例。\n目前累计追踪到密切接触者1944人，已解除医学观察1113人，现有788人正在接受医学观察,43人正在追踪中。\n\n                   \n    \n                \n                  \n                    \n                     \n                  \n                \n      \n        ','2020-02-11','ck6hgxc9w0033s27c1xuf1mh2','辽宁卫健委','辽宁省','2020-02-08','http://wsjk.ln.gov.cn/wst_zdzt/xxgzbd/yqtb/202002/t20200208_3736669.html','','辽宁新增确诊2例，累计确诊105例','2020-02-11'),('2月8日，经过宁夏新型冠状病毒肺炎诊疗组精心治疗，经专家组会诊后，在医护人员护送下，宁夏10名新冠肺炎确诊患者今日正式解除隔离，治愈出院。\n','2020-02-11','ck6hgxc9w0034s27c7j3p275w','人民网','宁夏回族自治区','2020-02-08','http://m.weibo.cn/2286908003/4469772286619509','','宁夏新增10例治愈出院','2020-02-11'),('武汉雷神山医院各项准备工作正有序进行中，今日将交付使用，首批医疗队员已经进驻，全力救治已确诊的新型冠状病毒肺炎患者。雷神山医院开设1500张床位、32个病区，除重症病区外，病房均为2人间。该院只设住院不设门诊。\n','2020-02-11','ck6hgxc9x0036s27c7syv76ma','人民日报','湖北省','2020-02-08','http://m.weibo.cn/2803301701/4469762527051423','','雷神山医院今日交付使用','2020-02-11'),('日本横滨附近海域，搭乘了3700多人的“钻石公主号”游轮上目前有64人确诊感染新冠肺炎。感染人数持续增加，游轮上的全部人员被要求在船上隔离14天。\n','2020-02-11','ck6hgxc9x0038s27cbs764np5','央视新闻','','2020-02-08','http://m.weibo.cn/2656274875/4469745598201538','','日本邮轮累计确诊64人','2020-02-11'),('截至2月8日12时，全省累计报告新型冠状病毒感染的肺炎确诊病例1095例。8日当天0-12时全省新增确诊病例20例。新增确诊病例中，惠州市6例、佛山市4例、深圳市3例、广州市3例、茂名市2例、珠海市1例、江门市1例。\n                            \n                        ','2020-02-11','ck6hgxc9z0039s27c7jdy0ej1','广东卫健委','广东省','2020-02-08','http://wsjkw.gd.gov.cn/xxgzbdfk/yqtb/content/post_2888193.html','','广东新增确诊20例，累计确诊1095例','2020-02-11'),('2020年2月7日22时至2月8日13时，辽宁省新增4例新型冠状病毒感染的肺炎确诊病例,其中大连市2例，1例为普通型病例、1例为重型病例；辽阳市1例，为普通型病例；锦州市1例，为普通型病例。\n截至2020年2月8日13时，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例103例，治愈出院7例。\n目前累计追踪到密切接触者1923人，已解除医学观察1113人，现有767人正在接受医学观察,43人正在追踪中。\n\n                   \n    \n                \n                  \n                    \n                     \n                  \n                \n      \n        ','2020-02-11','ck6hgxc9z003as27ceixjfbqd','辽宁卫健委','辽宁省','2020-02-08','http://wsjk.ln.gov.cn/wst_zdzt/xxgzbd/yqtb/202002/t20200208_3736524.html','','辽宁新增确诊4例，累计确诊103例','2020-02-11'),('今天，上海疫情防控工作发布会介绍：卫生防疫专家强调，目前可以确定的新冠肺炎传播途径主要为直接传播、气溶胶传播和接触传播。直接传播是指患者喷嚏、咳嗽、说话的飞沫，呼出的气体近距离直接吸入导致的感染；气溶胶传播是指飞沫混合在空气中，形成气溶胶，吸入后导致感染；接触传播是指飞沫沉积在物品表面，接触污染手后，再接触口腔、鼻腔、眼睛等粘膜，导致感染。\n','2020-02-11','ck6hgxc9z003bs27c6gfo2nsh','央视新闻','全国','2020-02-08','http://m.weibo.cn/2656274875/4469720700817749','','新冠肺炎传播途径含气溶胶传播','2020-02-11'),('7日，国家邮政局召开部分快递企业专题电话会议指出，分阶段确定快递企业恢复生产目标，积极推进网购快递的生产恢复，以满足百姓网购快递需求。计划在本月中旬，快递业生产要恢复到正常产能的4成以上；到本月下旬，根据疫情变化和形势发展，继续提高产能比重。\n','2020-02-11','ck6hgxc9z003cs27c4pny0a7y','人民网','全国','2020-02-08','http://m.weibo.cn/2286908003/4469721326007093','','国家邮政局：快递2月中旬恢复到4成以上','2020-02-11'),('从湖北省新冠肺炎疫情防控指挥部了解到，今天省内企业自产N95口罩超过12万只，预计下周可实现N95口罩自产自足，供需矛盾大大缓解。 \n','2020-02-11','ck6hgxc