11'),('2020年2月7日12—24时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例11例。截至2月7日24时，重庆市累计报告新型冠状病毒感染的肺炎确诊病例426例；现有重型病例31例，危重型病例17例，死亡病例2例，出院病例31例。累计追踪到密切接触者14114人，已解除医学观察6640人，尚有7474人正在接受医学观察。\n','2020-02-11','ck6hgxcak0045s27c53zz4qbv','人民网','重庆市','2020-02-07','http://m.weibo.cn/2286908003/4469594460278164','','重庆新增11例累计426例','2020-02-11'),('2020年2月7日0时至24时，山西省报告新型冠状病毒感染的肺炎新增确诊病例8例。新增疑似病例29例，现有疑似病例58例。截至2月7日24时，山西省11个市累计报告新型冠状病毒感染的肺炎确诊病例104例。其余77名普通病例正在市级定点医院隔离治疗。目前累计追踪到密切接触者2895人，当日解除医学观察286人，共有1096人正在接受医学观察。\n','2020-02-11','ck6hgxcak0046s27c88gr6kk6','人民网','山西省','2020-02-07','http://m.weibo.cn/2286908003/4469593592863907','','山西新增8例，累计104例','2020-02-11'),('据南京市卫健委消息，今天下午，南京有2位患者经反复核酸检测均为阴性，经专家组评估，符合肺炎确诊病例解除隔离和出院标准。其中，1例患者出院，另1例患者已95岁，其家人因感染正隔离治疗，老人目前无人照顾，转出隔离病房后将留院进行康复治疗。\n','2020-02-11','ck6hgxcak0047s27ceqn47o8r','人民网','江苏省','2020-02-07','http://m.weibo.cn/2286908003/4469477196200527','','南京95岁确诊患者治愈','2020-02-11'),('2020年2月7日0时-24时，湖北省新增新型冠状病毒感染的肺炎病例2841例，全省新增死亡81例，新增出院298例。截至2020年2月7日24时，湖北省累计报告新型冠状病毒感染的肺炎病例24953例，其中：重症4188例、危重症1007例，均在定点医疗机构接受隔离治疗。累计追踪密切接触者114044人，尚在接受医学观察67802人。\n','2020-02-11','ck6hgxcal0048s27cf7m4e4jt','人民日报','湖北省','2020-02-07','http://m.weibo.cn/2803301701/4469576891182947','','湖北新增病例2841例，累计确诊24953例','2020-02-11'),('按照党中央、国务院总体部署，国家发展改革委紧急下达第二批中央预算内投资2亿元，专项补助承担重症感染患者救治任务的华中科技大学同济医学院附属同济医院、华中科技大学同济医学院附属协和医院、湖北省人民医院的重症治疗病区建设，重点用于购置无创呼吸机、心电监护仪、床旁血滤机（CRRT）、体外膜肺氧合仪（ECMO）等重要医疗设备，保障重症患者得到集中统一救治，努力提高治愈率、降低病死率。\n','2020-02-11','ck6hgxcal004as27c54yi96gj','人民网','全国','2020-02-07','http://m.weibo.cn/2286908003/4469465724977463','','发改委下达2亿补助湖北重症救治','2020-02-11'),('2020年2月7日13时至19时，辽宁省沈阳市新增1例新型冠状病毒感染的肺炎确诊病例,为普通型病例。沈阳市治愈出院1例。\n截至2020年2月7日19时，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例96例，治愈出院7例。96例确诊病例中，沈阳市25例、大连市14例、鞍山市3例、本溪市3例、丹东市7例、锦州市7例、营口市1例、阜新市7例、辽阳市2例、铁岭市3例、朝阳市6例、盘锦市11例、葫芦岛市7例。\n目前89名在治患者均在定点医疗机构隔离治疗，其中重型病例11例，危重型病例1例。 89名在治患者中，64例病例为输入性病例，25例病例为本地感染病例。\n目前累计追踪到密切接触者1850人，已解除医学观察1015人，现有835人正在接受医学观察。\n\n                   \n    \n                \n                  \n                    \n                     \n                  \n                \n      \n        ','2020-02-11','ck6hgxcal004bs27ccgak43tx','辽宁卫健委','辽宁省','2020-02-07','http://wsjk.ln.gov.cn/wst_zdzt/xxgzbd/yqtb/202002/t20200207_3736270.html','','辽宁新增确诊1例累计96例','2020-02-11'),('2月7日，教育部召开全国教育系统应对新型冠状病毒感染肺炎疫情防控工作视频会议。指出严格管控学校校门，未经学校批准学生一律不准返校，校外无关人员一律不准进校门，师生进入校门一律核验身份和检测体温，对发烧咳嗽者一律实行医学隔离观察，不服从管理者一律严肃处理。学生公寓封闭管理。\n','2020-02-11','ck6hgxcal004cs27c0z9xdhoc','人民日报','全国','2020-02-07','http://m.weibo.cn/2803301701/4469410393593075','','教育部：未经学校批准不准返校','2020-02-11'),('人社部等7日印发《关于做好新型冠状病毒感染肺炎疫情防控期间稳定劳动关系支持企业复工复产的意见》，对因依法被隔离导致不能提供正常劳动的职工，要指导企业按正常劳动支付其工资；隔离期结束后，对仍需停止工作进行治疗的职工，按医疗期有关规定支付工资。对在春节假期延长假期间因疫情防控不能休假的职工，指导企业应先安排补休，对不能安排补休的，依法支付加班工资。\n','2020-02-11','ck6hgxcal004ds27c0pyy1af9','人民日报','全国','2020-02-07','http://m.weibo.cn/2803301701/4469448381191260','','春节延长假期间上班先安排补休','2020-02-11'),('7日，深圳发布《关于建立健全社区联防联控机制的若干措施》，明确了“五个100%”、“十个一律”、“四个重点”等防控举措：社区小区100%实行围合封闭式管理；近14天有疫情重点地区旅居史的人员100%居家隔离等。','2020-02-11','ck6hgxcal004es27c56414yi5','人民日报','广东省','2020-02-07','http://m.weibo.cn/2803301701/4469427740938572','','深圳所有小区封闭管理，确诊病例楼14天硬隔离','2020-02-11'),('疫情当前，中国工程院院士钱七虎分两次向武汉捐款650万元。年过八旬的钱老，是我国著名防护工程专家，现任军委科技委顾问、陆军工程大学教授。去年，他就曾把获得2018年度国家最高科技奖的奖金800万元全部捐赠，资助贫困学生上学。\n','2020-02-11','ck6hgxcam004fs27c79oo02wc','人民网','全国','2020-02-07','http://m.weibo.cn/2286908003/4469411937241900','','钱七虎院士为武汉捐款650万','2020-02-11'),('确诊患者个人费用财政兜底，疫情防控人员享工伤待遇，餐饮、住宿等行业享税费优惠，免征货物捐赠关税，灵活调整住房按揭和信用卡还款安排，四大行定期存款到期自动延期，2月6日前购买的火车票可免费退…还有哪些政策帮助你我安然度过疫情？戳图了解！ \n','2020-02-11','ck6hgxcam004gs27c9pyq29x3','人民日报','全国','2020-02-07','http://m.weibo.cn/2803301701/4469411488466860','','12项疫情防控惠民政策','2020-02-11'),('2月7日0—12时，全省新型冠状病毒感染的肺炎新增确诊病例4例，新增治愈出院病例0例。其中：新增确诊病例中，毕节市4例。截至2月7日12时，全省累计报告新型冠状病毒感染的肺炎病例81例。','2020-02-11','ck6hgxcam004is27chbu73rg7','人民网','贵州省','2020-02-07','http://m.weibo.cn/2286908003/4469405213435428','','贵州新增确诊4例累计81例','2020-02-11'),('今天，91岁的王明光老人战胜新冠肺炎，从湖北宜昌市第三人民医院出院，他是目前年龄最大的治愈患者。据了解，老人1月23日入院治疗，确诊患病，体温39℃以上。\n','2020-02-11','ck6hgxcam004js27c84h1azzd','央视新闻','湖北省','2020-02-07','http://m.weibo.cn/2656274875/4469403883786422','','湖北91岁老兵患者出院','2020-02-11'),('7日下午，三亚中心医院又有2例新冠肺炎确诊病例患者经过综合诊治，符合国家卫生健康委新型冠状病毒感染的肺炎确诊病例解除隔离和出院标准，于当天出院。截至2月7日，海南省累计10例确诊病例痊愈出院。\n','2020-02-11','ck6hgxcam004ks27ch08iazcl','人民网','海南省','2020-02-07','http://m.weibo.cn/2286908003/4469396334635705','','三亚治愈新增2例 累计治愈10例','2020-02-11'),('7日10时许，91岁高龄的新冠肺炎患者王某从宜昌市第三人民医院出院，这是目前年龄最大的治愈患者。“能够治愈出院，非常开心”，老人表示，自己参加过解放战争，和打仗比起来，这个病没什么可怕的。据了解，老人1月19日出现发热、咳嗽、乏力等症状，23日入院治疗，两天后确诊患病。\n','2020-02-11','ck6hgxcam004ls27c647eg4hz','人民日报','湖北省','2020-02-07','http://m.weibo.cn/2803301701/4469389400757412','','全国年龄最大治愈患者出院：湖北91岁患者治愈出院','2020-02-11'),('2月7日16时30分，经过自治区新型冠状病毒感染的肺炎疫情专家诊疗组和医护人员的精心救治，日前被确诊为新冠肺炎的银川市永宁县患者谢某和兴庆区患者闫某救治情况良好，正式治愈出院。\n','2020-02-11','ck6hgxcam004ms27cadzn3ywt','人民网','宁夏回族自治区','2020-02-07','http://m.weibo.cn/2286908003/4469386960072294','','宁夏又有两例确诊患者出院','2020-02-11'),('据健康南京，南京市中医院新型冠状病毒感染肺炎防治工作小组组长、副院长徐辉同志，因突发疾病，抢救无效，于2020年2月7日凌晨不幸逝世，享年51岁。南京卫健委哀悼抗疫女医生徐辉，向徐辉同志家属表示诚挚慰问。南京市卫健委向徐辉同志表示深切哀悼 。\n','2020-02-11','ck6hgxcan004ns27c30pr2uii','人民网','江苏省','2020-02-07','http://m.weibo.cn/2286908003/4469379124938671','','南京抗疫女医生突发疾病逝世','2020-02-11'),('截至2月6日24时，本市累计疑似病例157例，确诊病例297例。 目前，本市死亡1例，出院33例，263例在定点医院进行隔离治疗，其中危重型15例。','2020-02-11','ck6hgxcan004os27c868e1lex','人民网','北京市','2020-02-07','http://m.weibo.cn/2286908003/4469371785690519','','北京首次公布疑似病例数量：累计157例','2020-02-11'),('截至2月7日12时，全省累计报告新型冠状病毒感染的肺炎确诊病例1034例。7日当天0-12时全省新增确诊病例16例。截至2月7日12时，在院的959例确诊病例中，轻型51例，普通型787例，重型85例，危重型36例。新增出院6例，累计出院74例。累计死亡1例。','2020-02-11','ck6hgxcan004ps27c9xerckjj','人民网','广东省','2020-02-07','http://m.weibo.cn/2286908003/4469366274006432','','广东新增16例，累计1034例','2020-02-11'),('2月7日0—12时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例4例，新增出院病例1例。截至2月7日12时，重庆市累计报告新型冠状病毒感染的肺炎确诊病例415例；现有重型病例29例，危重型病例16例，死亡病例2例，出院病例25例。累计追踪到密切接触者13222人，已解除医学观察5882人，尚有7340人正在接受医学观察。','2020-02-11','ck6hgxcan004qs27c6o8i7h29','人民网','重庆市','2020-02-07','http://m.weibo.cn/2286908003/4469365665918923','','重庆新增4例累计415例，新增出院病例1例','2020-02-11'),('今天，中央纪委国家监委网站发布消息：经中央批准，国家监察委员会决定派出调查组赴湖北省武汉市，就群众反映的涉及李文亮医生的有关问题作全面调查。李文亮医生在抗击疫情中感染新型冠状病毒肺炎，不幸逝世，引发网友刷屏关注。此前，在发布病情的微博里，他表示“等我病好了我就会上一线。”这种事不避难、义不逃责的担当，令人肃然起敬。 如今，国家监察委派出调查组作全面调查，回应了公众关切，也让人对还原事实真相抱有期待。','2020-02-11','ck6hgxcan004rs27cd8b653t6','人民日报','全国','2020-02-07','http://m.weibo.cn/2803301701/4469363668716791','','人民锐评：全面调查李文亮事件，让正义抵达人心','2020-02-11'),('上海卫健委新闻发言人郑锦：截至昨天24时，上海共发现确诊病例269例，报告聚集性的疫情有45起，其中家庭亲属聚集的有38起，单位同事有3起，混合的包括家庭亲属和单位同事都有聚集的有3起，同一航班有1起。转发提醒，疫情防控期间，不要组织和参加亲友之间的聚会聚餐！','2020-02-11','ck6hgxcan004ss27ch21z161v','央视新闻','上海市','2020-02-07','http://m.weibo.cn/2656274875/4469336980719335','','上海发现38起家庭聚集性疫情','2020-02-11'),('2020年2月6日18时至2月7日13时，辽宁省沈阳市新增1例输入性新型冠状病毒感染的肺炎确诊病例,为普通型病例。截至2020年2月7日13时，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例95例，治愈出院6例。目前累计追踪到密切接触者1782人，已解除医学观察1015人，现有767人正在接受医学观察。','2020-02-11','ck6hgxcan004ts27c5j7odh73','人民网','辽宁省','2020-02-07','http://m.weibo.cn/2286908003/4469350314408565','','辽宁新增1例，累计95例','2020-02-11'),('2月7日0时至12时，云南省报告新型冠状病毒感染肺炎新增病例1例（昆明市）。全省累计报告确诊病例136例，除治愈出院者外，现均在定点医院接受隔离治疗。现有危重3例，重症15例，治愈出院12例，疑似病例122例，密切接触者医学观察3105人。','2020-02-11','ck6hgxcan004us27c8m9l63ic','人民网','云南省','2020-02-07','http://m.weibo.cn/2286908003/4469350817733246','','云南新增1例，累计136例','2020-02-11'),('2020年2月7日0—12时，山东省报告新型冠状病毒感染肺炎新增确诊病例7例，累计确诊病例386例(含重症病例22例，危重症病例6例，出院36例，无死亡病例);新增疑似病例9例，现有疑似病例87例。截至目前，追踪到密切接触者12120人，已解除医学观察6584人，诊断为疑似或确诊198例，尚有5338人正在接受医学观察。\n','2020-02-11','ck6hgxcan004vs27c6do8f4ou','人民网','山东省','2020-02-07','http://m.weibo.cn/2286908003/4469358627316520','','山东新增7例，累计386例','2020-02-11'),('2020年2月7日0—12时，上海市排除新型冠状病毒感染的肺炎疑似病例23例，新增治愈出院5例；新增确诊病例8例，其中1例为外地来沪人员，7例为本市常住人口。截至2月7日12时，上海市已累计排除疑似病例796例，发现确诊病例277例。尚有211例疑似病例正在排查中。','2020-02-11','ck6hgxcan004ws27cffuy4672','人民网','上海市','2020-02-07','http://m.weibo.cn/2286908003/4469331218388438','','上海新增8例确诊 ，累计确诊新冠肺炎277例','2020-02-11'),('武汉市中心医院李文亮医生在抗击疫情中感染新型冠状病毒肺炎，经全力救治不幸逝世，国家卫健委表示深切哀悼，向李文亮医生的家属表示诚挚慰问。疫情发生以来，广大医务工作者不顾个人安危，舍小家，为大家，迎难而上，英勇奋战在抗疫最前线，为保护人民生命健康作出了重大贡献，我们表示崇高敬意。当前，抗击疫情正处于关键时期，防控形势依然严峻复杂，需要全社会更加关心关爱医务人员，团结一致，万众一心，共克时艰，坚决打赢疫情防控阻击战。','2020-02-11','ck6hgxcao004xs27cca29hkpy','央视新闻','全国','2020-02-07','http://m.weibo.cn/2656274875/4469324121534694','','国家卫健委向李文亮表示深痛哀悼','2020-02-11'),('今天，安徽有13名新型冠状病毒感染的肺炎患者治愈出院，其中，合肥2例，阜阳2例，蚌埠1例，芜湖1例，铜陵3例，安庆3例，黄山1例。截至目前，安徽累计治愈出院47例。\n','2020-02-11','ck6hgxcao004ys27c5z9efd2v','央视新闻','安徽省','2020-02-07','http://m.weibo.cn/2656274875/4469314612377545','','安徽13名患者治愈出院，累计治愈出院47例','2020-02-11'),('武汉大学中南医院急救中心的4名医护人员郭琴、赵智刚、李春芳、柏慧，在工作中不慎感染新型冠状病毒，经过治疗康复后主动返回各自岗位。2月6日，他们将自己的经历分享给患者，鼓励他们保持乐观心态战胜病情。\n','2020-02-11','ck6hgxcao004zs27ceh6r1jpg','人民网','湖北省','2020-02-07','http://m.weibo.cn/2286908003/4469305263579349','','武汉4名医护人员病愈后返岗上班','2020-02-11'),('财政部副部长余蔚平在新闻发布会上说，截至2月6日，财政部会同有关部门已经出台十余条财税支持措施。明确患者治疗费用，对确诊患者个人负担费用实行财政兜底，中央财政补助60％；对疑似患者，由就医地制定财政补助政策，中央财政视情给予适当补助。\n','2020-02-11','ck6hgxcao0050s27c7ctafmie','央视新闻','全国','2020-02-07','http://m.weibo.cn/2656274875/4469285835721740','','财政部：新冠肺炎患者中央财政补助60％','2020-02-11'),('2月6日0—24时，福建省报告新增新型冠状病毒感染的肺炎确诊病例9例。截至2月6日24时，福建省累计报告新型冠状病毒感染的肺炎确诊病例224例（危重症8例、重症11例，无死亡病例）。','2020-02-11','ck6hgxcao0051s27cgigs2pm5','人民网','福建省','2020-02-07','http://m.weibo.cn/2286908003/4469289648291462','','福建新增9例累计224例','2020-02-11'),('西藏自治区卫健委今天上午发布新型冠状病毒感染的肺炎疫情情况：截至2月6日24时，西藏自治区累计报告新型冠状病毒感染的肺炎确诊病例1例，重症病例0例，死亡病例0例，出院病例0例。\n','2020-02-11','ck6hgxcao0052s27c0m2v1ne9','人民日报','西藏自治区','2020-02-07','http://m.weibo.cn/2803301701/4469280491543936','','西藏连续8天无新增或疑似','2020-02-11'),('财政部副部长余蔚平：截至昨天下午17时，各级财政共安排疫情防控资金是667.4亿元，实际支出284.8亿元。目前看，#各地疫情防控经费有保障#，中央财政正将根据疫情发展的态势和防控的需要，继续做好经费的保障工作，管好用好资金。\n','2020-02-11','ck6hgxcao0053s27cfrzt027n','央视新闻','全国','2020-02-07','http://m.weibo.cn/2656274875/4469276256000775','','各级财政共安排疫情防控资金667.4亿元','2020-02-11'),('截至2月7日0时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增治愈出院病例387例（湖北省184例），累计治愈出院病例1540例。','2020-02-11','ck6hgxcao0054s27c4c0e7apz','央视新闻','全国','2020-02-07','http://m.weibo.cn/2656274875/4469273001245599','','全国累计治愈出院1540例','2020-02-11'),('2月6日0时至24时，北京市新增23例新型冠状病毒感染的肺炎病例。10例有湖北及其他省份接触史，14例为确诊病例的密切接触者,其中3例既有湖北及其他省份接触史又是确诊病例的密切接触者。2例无湖北接触史。均已送至定点医疗机构进行救治。截至2月6日24时,北京市累计确诊病例297例。@首都健康\n','2020-02-11','ck6hgxcao0055s27c4eldc6wz','人民网','北京市','2020-02-07','http://m.weibo.cn/2286908003/4469286217524960','','北京新增23例累计确诊297例','2020-02-11'),('#新冠肺炎最新动态#【#内蒙古新增4例累计50例#】截至2020年2月7日9时, 内蒙古自治区累计报告新型冠状病毒感染的肺炎确诊病例50例，其中：1.鄂尔多斯市11例 2.包头市9例 3.呼和浩特市7例4.呼伦贝尔市5例 5.巴彦淖尔市4例 7.乌兰察布市3例（化德县2例、四子王旗1例）8.乌海市海勃湾区2例9.锡林郭勒盟2例 10.通辽市2例 11.兴安盟乌兰浩特市1例；乌海市乌达区1例；包头市土默特右旗1例；呼伦贝尔市海拉尔区1例、牙克石市1例）。均在定点医院接受隔离治疗。鄂尔多斯市达拉特旗1例疑似病例排除。目前，尚在接受医学观察的密切接触者1289人。当日解除医学观察195人。（内蒙古卫健委）网页链接\n','2020-02-11','ck6hgxcao0056s27c5i939atz','人民网','内蒙古自治区','2020-02-07','http://m.weibo.cn/2286908003/4469267124868831','','内蒙古新增4例累计50例','2020-02-11'),('#新冠肺炎最新动态#【#海南新增11例累计111例#】2020年2月6日0-24时，海南省报告新型冠状病毒感染的肺炎新增确诊病例11例，新增重症病例1例，新增死亡病例1例，新增解除重症0例，新增出院病例3例；新增确诊病例中，海口市3例、三亚市2例、儋州市1例、文昌市2例、澄迈县2例、昌江县1例；新增重症病例中，临高县1例；新增死亡病例中，三亚市1例；新增出院病例中，海口市1例、三亚市1例、澄迈县1例。截至2月6日24时，海南省累计报告新型冠状病毒感染的肺炎确诊病例111例，重症病例15例，死亡病例2例，出院病例8例。确诊病例中，海口市19例、三亚市32例、儋州市11例、文昌市3例、琼海市6例、万宁市11例、东方市3例、澄迈县6例、临高县5例、陵水县4例、琼中县1例、定安县3例、昌江县4例、乐东县1例、保亭县2例。截至2月6日24时，追踪到密切接触者2570人，已解除医学观察1367人，尚有1203人正在接受居家或集中医学观察。（海南卫健委）网页链接\n','2020-02-11','ck6hgxcao0057s27cdgwye8b8','人民网','海南省','2020-02-07','http://m.weibo.cn/2286908003/4469266252453993','','海南新增11例累计111例','2020-02-11'),('【#广东累计确诊1018例#，#广东首次报告死亡病例#】截至2月6日24时，全省累计报告新型冠状病毒感染的肺炎确诊病例1018例。6日当天全省新增确诊病例74例。新增确诊病例中，广州市29例、深圳市20例、佛山市7例、东莞市6例、惠州市4例、中山市2例、汕头市2例、江门市2例、肇庆市1例、河源市1例。新增死亡病例1例，为肇庆市1例。另有疑似病例170例。有3522名密切接触者正在接受医学观察。\n','2020-02-11','ck6hgxcao0058s27c9iqp4hus','人民日报','广东省','2020-02-07','http://m.weibo.cn/2803301701/4469264318369619','','广东累计确诊1018例，首次报告死亡病例','2020-02-11'),('【#河南新增确诊病例63例#，#河南累计确诊914例#】2020年2月6日0-24时，河南省新增新型冠状病毒感染的肺炎确诊病例63例，新增出院病例14例，新增死亡病例1例。新增确诊病例中，郑州市10例、开封市2例（含兰考县1例）、洛阳市3例、平顶山市5例、安阳市3例、鹤壁市1例、焦作市1例、许昌市2例、南阳市7例（含邓州市1例）、商丘市7例（含永城市1例）、信阳市12例（含固始县3例）、周口市1例、驻马店市8例（含新蔡县1例）、济源示范区1例。截至2月6日24时，河南省累计报告新型冠状病毒感染的肺炎确诊病例914例，现有重症病例48例，现有危重病例27例，累计死亡病例3例，累计治愈病例68例。目前累计追踪到密切接触者19555人，2月6日已解除观察3356人，诊断为疑似66人，共有10138人正在接受医学观察。\n','2020-02-11','ck6hgxcao0059s27caecucxsp','人民日报','河南省','2020-02-07','http://m.weibo.cn/2803301701/4469251417128460','','河南新增确诊病例63例，累计914例','2020-02-11'),('#江西新增61例新冠肺炎#【#江西累计确诊病例661例#】2月6日0-24时，江西省报告新型冠状病毒感染的肺炎新增确诊病例61例，新增治愈出院病例8例。新增确诊病例中，南昌市13例、抚州市10例、新余市9例、宜春市8例、上饶市8例、赣州市7例、九江市3例、萍乡市1例、鹰潭市1例、吉安市1例。新增治愈出院病例中，南昌市4例、抚州市2例、九江市1例、宜春市1例。截至2月6日24时，江西省累计报告新型冠状病毒感染的肺炎确诊病例661例，其中重症病例58例，治愈出院病例45例。目前追踪到密切接触者16631人，解除医学观察5102人，尚有11529人正在接受医学观察。\n','2020-02-11','ck6hgxcap005as27cbkkofwmy','央视新闻','江西省','2020-02-07','http://m.weibo.cn/2656274875/4469260430681517','','江西新增61例，累计661例','2020-02-11'),('【#黑龙江新增确诊病例50例#，#黑龙江累计确诊277例#】2020年2月6日0-24时, 黑龙江省报告新型冠状病毒感染的肺炎新增确诊病例50例。新增重症病例5例。新增出院病例1例。新增疑似病例88例。截至2月6日24时,黑龙江省累计报告新型冠状病毒感染的肺炎确诊病例277例，其中：哈尔滨市94例、绥化市39例、双鸭山市36例、鸡西市29例、齐齐哈尔市27例、佳木斯市13例、大庆市13例、牡丹江市11例、七台河市10例、鹤岗市2例、大兴安岭地区2例、黑河市1例；现有重症病例28例。死亡病例3例目前追踪到密切接触者7144人, 已解除医学观察3273人，尚有3442人正在接受医学观察。\n','2020-02-11','ck6hgxcap005bs27c4titcpxn','人民日报','黑龙江省','2020-02-07','http://m.weibo.cn/2803301701/4469262208563929','','黑龙江新增确诊病例50例，累计277例','2020-02-11'),('【#湖南新增确诊61例#，#湖南累计确诊772例#】2020年2月6日0-24时，湖南省报告新型冠状病毒感染的肺炎新增确诊病例61例，新增重症病例2例，新增死亡病例0例，新增出院病例35例。其中:新增确诊病例中，长沙市11例、株洲市5例、湘潭市1例、邵阳市9例、岳阳市14例、常德市2例、张家界市2例、益阳市2例、郴州市4例、永州市6例、怀化市2例、娄底市2例、湘西自治州1例。新增重症病例中，株洲市1例、邵阳市1例。截至2月6日24时，湖南省累计报告新型冠状病毒感染的肺炎确诊病例772例，累计报告重症病例95例，现有重症病例57例，死亡病例0例，出院病例91例。目前追踪到密切接触者19031人，已解除医学观察9141人，尚有9890人正在接受医学观察。（王云娜）\n','2020-02-11','ck6hgxcap005cs27c4fcj209w','人民日报','湖南省','2020-02-07','http://m.weibo.cn/2803301701/4469256236006330','','湖南新增确诊61例，累计确诊772例','2020-02-11'),('#浙江新增52例新冠肺炎#【#浙江累计确诊病例超千例#】2月6日0-24时，浙江省报告新型冠状病毒感染的肺炎新增确诊病例52例，新增出院病例17例。其中：新增确诊病例中，杭州市5例、宁波市10例、温州市25例、嘉兴市5例、绍兴市1例、金华市1例、台州市5例；新增出院病例中，杭州市1例、宁波市3例、温州市8例、嘉兴市1例、金华市1例、舟山市1例、丽水市2例。截至2月6日24时，浙江省累计报告新型冠状病毒感染的肺炎确诊病例1006例，现有重症病例72例（其中危重21例），累计出院98例。目前，全省共追踪到密切接触者22270人，已解除医学观察7441人，尚有13333人正在接受医学观察。（总台央视记者高珧）\n','2020-02-11','ck6hgxcas005ds27cb8wqg2vj','央视新闻','浙江省','2020-02-07','http://m.weibo.cn/2656274875/4469257154949776','','浙江累计确诊病例超千例','2020-02-11'),('#新冠肺炎最新动态# 【#贵州新增6例累计77例#】2020年2月6日12—24时，贵州省新型冠状病毒感染的肺炎新增确诊病例6例,新增治愈出院病例0例。其中：新增确诊病例中，贵阳市3例，遵义市1例，安顺市1例，黔南州1例。截至2月6日24时，全省累计报告新型冠状病毒感染的肺炎病例77例。36例有武汉旅居史，4例有除武汉外湖北其他地区旅居史，6例有湖北以外地区旅居史。治愈出院6例，病情平稳60例，重症4例，危重症6例，死亡1例；男性38例，女性39例；年龄最大80岁，最小1个月（确诊时间）；贵阳市18例（1例已治愈出院），遵义市12例，六盘水9例，安顺市4例，毕节市13例，铜仁市6例（2例已治愈出院），黔东南州5例，黔南州7例（3例已治愈出院），黔西南州3例。现有疑似病例54例。目前累计追踪密切接触者1045人，已解除医学观察369人，尚在接受医学观察648人。（贵州卫健委）网页链接\n','2020-02-11','ck6hgxcas005es27cc4527bjl','人民网','贵州省','2020-02-07','http://m.weibo.cn/2286908003/4469254654579276','','贵州新增6例累计77例','2020-02-11'),('#黑龙江新增50例新冠肺炎#【#黑龙江累计确诊277例#】2020年2月6日0-24时，黑龙江省报告新型冠状病毒感染的肺炎新增确诊病例50例。新增重症病例5例。新增出院病例1例。新增疑似病例88例。\n截至2月6日24时,黑龙江省累计报告新型冠状病毒感染的肺炎确诊病例277例，其中：哈尔滨市94例、绥化市39例、双鸭山市36例、鸡西市29例、齐齐哈尔市27例、佳木斯市13例、大庆市13例、牡丹江11例、七台河10例、鹤岗市2例、大兴安岭地区2例、黑河市1例；现有重症病例28例。死亡病例3例为绥化市确诊病例2例、大庆市确诊病例1例。出院病例8例为黑龙江省传染病防治院治愈患者2例、哈尔滨市传染病医院治愈患者4例、双鸭山市人民医院治愈患者1例、佳木斯市传染病医院治愈患者1例。现有疑似病例210例。\n全省当日发热门诊诊疗人数1899人。目前追踪到密切接触者7144人,已解除医学观察3273人，尚有3442人正在接受医学观察。','2020-02-11','ck6hgxcat005fs27c8rkg8s7a','央视新闻','黑龙江省','2020-02-07','https://weibo.com/2656274875/It3uy9HhL?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1581036800096','','黑龙江新增50例，确诊277例','2020-02-11'),('#新冠肺炎最新动态#【#四川新增23例累计344例#】2月6日0-24时，我省新型冠状病毒肺炎新增确诊病例23例，新增治愈出院病例10例，无新增死亡病例。新增确诊病例中，成都市5例、甘孜州5例、广安市3例、达州市3例、泸州市1例、绵阳市1例、内江市1例、乐山市1例、南充市1例、宜宾市1例、巴中市1例。新增治愈出院病例中，成都市6例、达州市3例、遂宁市1例。截至2月6日24时，我省累计报告新型冠状病毒肺炎确诊病例344例，涉及21个市（州）、120个县（市、区）。\n344名确诊患者中，正在住院隔离治疗306人（其中危重19人），已治愈出院37人，死亡1人。\n当日解除医学观察1166人，现有7226人正在接受医学观察。@健康四川官微','2020-02-11','ck6hgxcat005gs27cc9kb24gf','人民网','四川省','2020-02-07','https://weibo.com/2286908003/It3uc2v1M?from=page_1002062286908003_profile&wvr=6&mod=weibotime&type=comment#_rnd1581035766904','','四川新增23例累计344例','2020-02-11'),('#新冠肺炎最新动态#【#广西新增4例累计172例#】2月6日0-24时，我区共新增新型冠状病毒感染的肺炎确诊病例4例，其中南宁市1例、桂林市1例、百色市1例、来宾市1例。目前全区累计报告确诊病例172例，累计出院病例17例。现有重症病例9例（南宁市2例、桂林市2例、防城港市4例、贵港市1例），危重病例6例（南宁市1例、桂林市1例、玉林市1例、河池市3例），无死亡病例。累计确诊病例中，南宁市31例、柳州市20例、桂林市28例、梧州市5例、北海市31例、防城港市15例、钦州市7例、贵港市7例、玉林市8例、百色市3例、贺州市4例、河池市11例、来宾市2例。目前累计追踪到密切接触者8008人，正在接受医学观察4099人。','2020-02-11','ck6hgxcat005hs27c0ttvcry8','人民网','广西壮族自治区','2020-02-07','https://weibo.com/2286908003/It3mZwsLu?from=page_1002062286908003_profile&wvr=6&mod=weibotime&type=comment#_rnd1581034550358','','广西新增4例累计172例','2020-02-11'),('#新冠肺炎最新动态# 【#上海新增12例累计269例#】上海市卫健委今早（2月7日）通报：2020年2月6日12—24时，上海市排除新型冠状病毒感染的肺炎疑似病例97例；新增确诊病例12例，其中3例为外地来沪人员，9例为本市常住人口。截至2月6日24时，上海市已累计排除疑似病例773例，发现确诊病例269例。确诊病例中，男性140例，女性129例；年龄最大88岁，最小7月龄；134例有湖北居住或旅行史，19例有湖北以外地区居住或旅行史，114例有相关病例接触史，2例正在流行病学调查中；外地来沪人员92例，本市常住人口177例。目前，225例病情平稳，8例病情危重，10例重症，25例治愈出院，1例死亡。尚有166例疑似病例正在排查中。@上海发布','2020-02-11','ck6hgxcat005is27c5atjb2xa','人民网','上海市','2020-02-06','https://weibo.com/2286908003/It3evhHTg?from=page_1002062286908003_profile&wvr=6&mod=weibotime&type=comment#_rnd1581033211141','','上海新增12例累计269例','2020-02-11'),('2020年2月6日12—24时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例11例，新增重型病例2例，重型病例转危重型病例5例，新增出院病例9例。新增确诊病例中，万州区3例、渝中区1例、江北区1例、綦江区1例、大足区1例、潼南区3例、忠县1例；新增重型病例中，忠县1例、奉节县1例；重型病例转危重型病例中，万州区2例、綦江区1例、云阳县1例、奉节县1例；新增出院病例中，大渡口区1例、渝北区2例、长寿区2例、开州区2例、城口县1例、云阳县1例。截至2月6日24时，重庆市累计报告新型冠状病毒感染的肺炎确诊病例411例；现有重型病例29例，危重型病例16例，死亡病例2例，出院病例24例。累计追踪到密切接触者13066人，已解除医学观察5627人，尚有7439人正在接受医学观察。具体情况如下：','2020-02-11','ck6hgxcat005js27c2641ac4m','重庆市卫健委','重庆市','2020-02-06','http://wsjkw.cq.gov.cn/yqxxyqtb/20200207/252409.html','','重庆新增确诊病例11例，累计 411 例','2020-02-11'),('【#湖北新增2447例#，#湖北累计确诊超过两万#】2020年2月6日0时-24时，湖北省新增新型冠状病毒感染的肺炎病例2447例，其中：武汉市1501例、孝感市255例、黄冈市90例、荆州市84例、随州市81例、黄石市69例、襄阳市51例、鄂州市48例、宜昌市47例、荆门市45例、咸宁市44例、十堰市42例、仙桃市42例、天门市25例、恩施州13例、潜江市10例。全省新增死亡69例，其中：武汉市64例、襄阳市1例、宜昌市1例、黄冈市3例。新增出院184例，其中：武汉市103例、黄石市6例、十堰市10例、襄阳市19例、宜昌市2例、荆州市4例、荆门市3例、鄂州市1例、孝感市16例、黄冈市6例、咸宁市3例、仙桃市11例。截至2020年2月6日24时，湖北省累计报告新型冠状病毒感染的肺炎病例22112例，其中：武汉市11618例、孝感市2141例、黄冈市1897例、随州市915例、荆州市885例、襄阳市838例、黄石市635例、宜昌市610例、荆门市553例、鄂州市471例、咸宁市443例、十堰市395例、仙桃市307例、天门市163例、恩施州157例、潜江市74例、神农架林区10例。已治愈出院817例。死亡618例，其中：武汉市478例、黄石市2例、襄阳市3例、宜昌市7例、荆州市10例、荆门市17例、鄂州市18例、孝感市25例、黄冈市32例、咸宁市1例、随州市9例、仙桃市5例、天门市10例、潜江市1例。目前仍在院治疗15804例，其中：重症3161例、危重症841例，均在定点医疗机构接受隔离治疗。累计追踪密切接触者101599人，尚在接受医学观察64057人。\n','2020-02-11','ck6hgxcat005ks27c30h06fes','人民日报','湖北省','2020-02-06','http://m.weibo.cn/2803301701/4469214977346455','','湖北新增2447例，累计确诊超过两万','2020-02-11'),('2月6日起，沈阳将在全市公共交通和出租车行业实施实名登记乘车。市民乘车时，使用微信扫描张贴在地铁车厢、公交车、出租车上的专用二维码，即可自动导入联系方式。如完成初次登记，再次乘车3秒搞定。老人、儿童及未携带手机者将由他人代为录入。 ​','2020-02-11','ck6hgxcat005ls27cdgn2e071','人民网','辽宁省','2020-02-06','http://m.weibo.cn/2286908003/4469099670819056','','沈阳实施实名登记乘车','2020-02-11'),('2020年2月6日14时至18时，辽宁省盘锦市新增3例新型冠状病毒感染的肺炎确诊病例,均为普通型病例。丹东市1例治愈出院。截至2020年2月6日18时，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例94例，治愈出院5例。\n\n                   \n    \n                \n                  \n                    \n                     \n                  \n                \n      \n        ','2020-02-11','ck6hgxcat005ms27cbqtp1xtr','辽宁卫健委','辽宁省','2020-02-06','http://wsjk.ln.gov.cn/wst_zdzt/xxgzbd/yqtb/202002/t20200206_3735571.html','','辽宁新增3例累计94例','2020-02-11'),('6日，文化和旅游部发布《关于延期公布2019年全国导游资格考试结果的通知》：为落实新型冠状病毒感染的肺炎疫情防控工作有关要求，经研究决定，延期公布2019年全国导游资格考试考试结果（原定于2020年2月21日）。具体公布时间另行通知。\n','2020-02-11','ck6hgxcat005ns27c54o68102','人民网','全国','2020-02-06','http://m.weibo.cn/2286908003/4469081350320436','','2019年导游资格考试结果延期公布 具体公布时间另行通知','2020-02-11'),('武汉市即日起将开展全民体温监测工作。每日每户每人监测一次并电话、微信报告，体温异常者由工作人员上门检查。发热或相关症状人员，由社区组织其及时到社区卫生服务中心诊断筛查，根据诊断情况分类集中收治或隔离医学观察。如遇不配合排查工作的市民，必要时可由公安机关依法采取强制措施。\n','2020-02-11','ck6hgxcat005os27cdgeh3a1w','人民网','湖北省','2020-02-06','http://m.weibo.cn/2286908003/4469083024427677','','武汉市全民体温监测 上门排查与自查自报相结合','2020-02-11'),('在湖北疫情防控发布会上，湖北副省长杨云彦表示，截至2月5日，全国共有107支医疗队，10596名医疗队员支援湖北省医疗救治工作。对此，湖北人民表示深深的感谢。 \n','2020-02-11','ck6hgxcau005ps27chwrkd39f','人民日报','全国','2020-02-06','http://m.weibo.cn/2803301701/4469081098537125','','全国1万多医疗队员支援湖北','2020-02-11'),('6日，文化和旅游部发布通知，为进一步做好文化和旅游系统疫情防控工作，支持旅行社积极应对当前经营困难，履行社会责任，文化和旅游部决定向旅行社暂退80%旅游服务质量保证金。自通知印发之日起两年内，接受暂退保证金的各旅行社应在2022年2月5日前将本次暂退的保证金如数交还。','2020-02-11','ck6hgxcau005qs27carfl7fk6','人民网','全国','2020-02-06','http://m.weibo.cn/2286908003/4469080188831135','','暂退旅行社80%旅游服务质量保证金 两年内交还','2020-02-11'),('历时11天，河南版“小汤山”医院今日完成验收移交。医院分为四大功能区，采用防渗膜全覆盖，雨污水全收集消毒；病患、医护、污物、后勤动线分离处理，最大程度做到“洁污分流、医患分流”。\n','2020-02-11','ck6hgxcau005rs27c2aqv0o5y','人民网','河南省','2020-02-06','http://m.weibo.cn/2286908003/4469068818270878','','河南版小汤山医院正式交付','2020-02-11'),('2月6日，记者从天津市新型冠状病毒感染的肺炎疫情防控工作指挥部获悉，指挥部发布《关于进一步加强疫情防控期间居民小区管理的通告》，自发布之日起，全市居民小区实施封闭式管理。\n','2020-02-11','ck6hgxcau005ss27c3zhd8w4r','人民日报','天津市','2020-02-06','http://m.weibo.cn/2803301701/4469068486852706','','天津全市小区封闭式管理','2020-02-11'),('近日，人力资源社会保障部办公厅印发通知，要求暂停各地人力资源服务机构疫情防控期间举办的现场招聘会、跨地区劳务协作、人力资源培训、供需对接会等聚集性活动。强化网络招聘等线上服务，针对高校毕业生、农民工等重点群体，通过短信、微信公众号、网络发布岗位供求信息，采取电子邮件、传真、视频等形式开展远程笔试面试和人力资源培训等非现场服务，特别是加大疫情防控物资生产等企业招用工帮助支持力度。\n','2020-02-11','ck6hgxcau005ts27c09bb7m4s','人民日报','全国','2020-02-06','http://m.weibo.cn/2803301701/4469066800421653','','暂停人力资源服务机构现场招聘','2020-02-11'),('6日下午，武汉儿童医院的医务人员准备了5份特殊的礼物，早早等在内科综合病房楼下。大家等待的是湖北省首批5名新型冠状病毒感染肺炎的康复患儿，他们中年龄最大的14岁，最小的仅2岁。经过武汉儿童医院的系统治疗治愈康复，正式出院。\n','2020-02-11','ck6hgxcau005us27ccff2gyw4','人民网','湖北省','2020-02-06','http://m.weibo.cn/2286908003/4469051923018013','','湖北首批5名儿童患者出院','2020-02-11'),('2月4日，由深航青年突击队承运的100箱共计10万只口罩抵达深圳。深圳海关特事特办，30分钟火速清关。\n','2020-02-11','ck6hgxcau005vs27c135v3tas','人民网','广东省','2020-02-06','http://m.weibo.cn/2286908003/4469037352052652','','深圳青年接力护送 10万只爱心口罩由泰国抵深','2020-02-11'),('2月5日22时至2月6日14时，辽宁省鞍山市新增2例本地感染新型冠状病毒感染的肺炎确诊病例,其中1例为重型病例，1例为普通型病例。截至2020年2月6日14时，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例91例，治愈出院4例。','2020-02-11','ck6hgxcau005ws27cg3p50paz','人民网','辽宁省','2020-02-06','http://m.weibo.cn/2286908003/4469025340136096','','辽宁新增2例累计91例','2020-02-11'),('6日下午，河南郑州，6.5吨污水处理药剂装车完毕，悬挂河南省“新型冠状病毒感染的肺炎疫情防控应急物资及人员运输车辆通行证”，紧急送往武汉火神山医院。据悉，武汉火神山医院污水处理药剂存量有限，急需补充。此次6.5吨药剂，可供火神山医院使用两个月。\n','2020-02-11','ck6hgxcau005xs27c5bkh517q','人民网','湖北省','2020-02-06','http://m.weibo.cn/2286908003/4469017224139453','','郑州6.5吨药剂急送火神山医院','2020-02-11'),('2月6日0—12时，全省新型冠状病毒感染的肺炎新增确诊病例2例，新增治愈出院病例0例。其中：新增确诊病例中，遵义市2例。截至2月6日12时，全省累计报告新型冠状病毒感染的肺炎病例71例。','2020-02-11','ck6hgxcav005ys27cc9d022qk','人民网','贵州省','2020-02-06','http://m.weibo.cn/2286908003/4469022193855089','','贵州新增2例累计71例','2020-02-11'),('北京市卫健委通报，北京市又有7例新型冠状病毒感染的肺炎患者，经过医护人员精心治疗后，符合出院标准，于2月5日从地坛医院、佑安医院出院。7名患者中，年龄最小的17岁，最大的61岁。\n','2020-02-11','ck6hgxcav005zs27c45sph1ec','人民网','北京市','2020-02-06','http://m.weibo.cn/2286908003/4469004711858688','','北京又有7位患者治愈出院','2020-02-11'),('截至2月6日12时，全省累计报告新型冠状病毒感染的肺炎确诊病例970例。6日当天0-12时全省新增确诊病例26例。新增确诊病例中，广州市15例、佛山市7例、深圳市2例、肇庆市1例、汕头市1例。另有疑似病例167例。有3530名密切接触者正在接受医学观察。','2020-02-11','ck6hgxcav0060s27cb79w6rf2','人民网','广东省','2020-02-06','http://m.weibo.cn/2286908003/4469005135802695','','广东新增26例累计970例','2020-02-11'),('2020年2月6日0—12时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例11例。万盛经开区为报告首例确诊病例。新增确诊病例中，万州区2例、渝中区1例、合川区4例、梁平区1例、垫江县1例、奉节县1例、万盛经开区1例。截至2月6日12时，重庆市累计报告新型冠状病毒感染的肺炎确诊病例400例；现有重型病例32例，危重型病例11例，死亡病例2例，出院病例15例。累计追踪到密切接触者11986人，已解除医学观察4794人，尚有7192人正在接受医学观察。（重庆卫健委）\n','2020-02-11','ck6hgxcav0061s27c0k4fhwxg','人民网','重庆市','2020-02-06','http://m.weibo.cn/2286908003/4469004741317375','','重庆新增11例累计400例','2020-02-11'),('2月5日0时至24时，北京市新增21例新型冠状病毒感染的肺炎病例，均已送至定点医疗机构进行救治。为帮助市民及时了解疾病线索，北京市疾病预防控制中心发布2月5日新发病例活动过的小区或场所。\n','2020-02-11','ck6hgxcav0062s27cciadej84','人民日报','北京市','2020-02-06','http://m.weibo.cn/2803301701/4469008575647672','','北京公布新发病例活动地点','2020-02-11'),('今天，国务院联防联控机制在国家卫健委西直门办公区新闻发布厅召开新闻发布会，介绍春运错峰返程疫情防控、交通运输服务保障等相关工作情况。','2020-02-11','ck6hgxcav0063s27cfocmc3ze','央视新闻','全国','2020-02-06','http://m.weibo.cn/2656274875/4468989767644296','','直播！国家卫健委介绍春运错峰返程疫情防控','2020-02-11'),('2020年2月6日0—12时，上海市排除新型冠状病毒感染的肺炎疑似病例12例，新增治愈出院10例；新增确诊病例3例，其中1例为外地来沪人员，2例为本市常住人口。截至2月6日12时，上海市已累计排除疑似病例676例，发现确诊病例257例。@上海发布\n','2020-02-11','ck6hgxcav0064s27c1bca2vwy','人民网','上海市','2020-02-06','http://m.weibo.cn/2286908003/4468973992927911','','上海新增4例累计257例','2020-02-11'),('6日，湖北省襄阳市传染病医院15名患者经过治疗达到临床治愈标准，集体出院。他们中年龄最大的72岁。目前15名患者均退烧三天以上，两次核算检测呈阴性，已达到临床治愈标准，符合出院条件。患者出院后，依然需要在家隔离观察两周。@湖北之声 \n','2020-02-11','ck6hgxcav0065s27c4wboce5k','人民网','湖北省','2020-02-06','http://m.weibo.cn/2286908003/4468973355919583','','襄阳15名患者治愈集体出院','2020-02-11'),('2月5日18时至2月6日12时，天津市新增新型冠状病毒肺炎确诊病例9例，累计确诊病例78例。@天津发布\n','2020-02-11','ck6hgxcav0066s27cdcr7a5ki','人民网','天津市','2020-02-06','http://m.weibo.cn/2286908003/4468968586795866','','天津新增确诊病例9例，累计78例','2020-02-11'),('国务院台湾事务办公室负责人2月6日就世界卫生组织涉台问题发表谈话，全文如下：连日来，在全国人民众志成城抗击新型冠状病毒感染的肺炎疫情的同时，台湾民进党当局和“台独”分裂势力伺机鼓噪所谓台湾参与世界卫生组织议题，企图利用疫情趁火打劫，拓展所谓台湾的“国际空间”。国务院台办特就此表明严正立场。台湾是中国的一部分，一个中国原则是国际社会普遍共识和公认的国际准则，不容挑战和践踏。世界卫生组织是仅限主权国家加入的联合国专门机构。根据联合国大会，世界卫生组织有关决议和世卫组织《组织法》，台湾作为中国一部分无权加入。任何有关中国台湾地区参与国际组织活动的问题都必须在一个中国原则下解决。','2020-02-11','ck6hgxcav0067s27chxcpcv7i','人民日报','全国','2020-02-06','http://m.weibo.cn/2803301701/4468958554088392','','国台办：以疫谋独绝不会得逞','2020-02-11'),('【#江西所有村组小区封闭管理#】2月6日，江西省新型冠状病毒感染的肺炎疫情防控应急指挥部发布《关于进一步强化疫情防控十条措施的公告》，要求所有村组（小区）一律实行封闭式管理，本村组（小区）居住人员凭有效证件进出，进行体温检测。\n','2020-02-11','ck6hgxcav0068s27c2fed1c6p','人民日报','江西省','2020-02-06','http://m.weibo.cn/2803301701/4468956917964727','','江西发布强化疫情防控十条措施','2020-02-11'),('2月6日，陕西收治的武汉9岁确诊患者小晗治愈出院，这也是陕西目前年龄最小的治愈患者。治疗期间，小晗十分配合治疗，体温已连续8天正常，2次核酸检测阴性，达到出院指征。@陕视新闻\n','2020-02-11','ck6hgxcav0069s27ccd9o6a8p','人民网','陕西省','2020-02-06','http://m.weibo.cn/2286908003/4468951633234836','','陕西9岁确诊女孩出院','2020-02-11'),('6日上午，在上海新冠病毒感染肺炎患者集中收治点上海公共卫生临床中心，又有10名患者治愈出院，至此，上海治愈患者累计已有25名。截至2月5日24时，上海市已累计发现确诊病例254例，治愈患者占比已近10%。（人民日报记者 巨云鹏） \n','2020-02-11','ck6hgxcaw006as27c0bzk469y','人民日报','上海市','2020-02-06','http://m.weibo.cn/2803301701/4468932024657201','','上海又有10人出院','2020-02-11'),('经上海市专家组评估，上海又有10例新型冠状病毒感染的肺炎患者痊愈出院，目前共有25例确诊病例出院。@上海发布 \n','2020-02-11','ck6hgxcaw006bs27cgmz992ml','人民网','上海市','2020-02-06','http://m.weibo.cn/2286908003/4468928258951668','','上海又有10位患者治愈，共有25例确诊病例出院','2020-02-11'),('2月5日0—24时，福建省报告新增新型冠状病毒感染的肺炎确诊病例10例。报告新增新型冠状病毒感染的肺炎疑似病例22例。截至2月5日24时，福建省累计报告新型冠状病毒感染的肺炎确诊病例215例。目前，确诊、疑似病例的密切接触者已解除医学观察1801人，尚有4159人正在接受医学观察。','2020-02-11','ck6hgxcaw006cs27cfsfl7anx','人民网','福建省','2020-02-06','http://m.weibo.cn/2286908003/4468927595754557','','福建新增10例，累计215例','2020-02-11'),('今天上午，湖北省中西医结合医院出院18人。住院天数最长18天，住院天数最短6天。通过中西医结合治疗，痊愈出院。','2020-02-11','ck6hgxcaw006ds27c10b61yfi','人民网','湖北省','2020-02-06','http://m.weibo.cn/2286908003/4468927197501601','','湖北又有18位患者治愈出院','2020-02-11'),('日本厚生劳动省今日确认，停靠在横滨港口的“钻石公主号”游轮上再确认10人感染新型冠状病毒，目前已确认游轮上有20人感染。游轮上的3700多人需要在客舱内隔离14天。','2020-02-11','ck6hgxcaw006es27cc7nz3y1c','央视新闻','','2020-02-06','http://m.weibo.cn/2656274875/4468925858865451','','日本邮轮3700人海上隔离，确认10人感染新型冠状病毒','2020-02-11'),('西藏自治区卫健委今天上午发布新型冠状病毒感染的肺炎疫情情况：截至2月5日24时，西藏自治区累计报告新型冠状病毒感染的肺炎确诊病例1例，重症病例0例，死亡病例0例，出院病例0例。据介绍，目前，这名患者生命体征平稳，追踪到的密切接触者正在接受医学观察。因此，西藏自治区已经连续7天没有新增确诊病例或疑似病例报告。\n','2020-02-11','ck6hgxcaw006fs27c3phr8nwv','人民日报','西藏自治区','2020-02-06','http://m.weibo.cn/2803301701/4468918368346117','','西藏连续7天无新增或疑似','2020-02-11'),('2月5日0时至24时，北京市新增21例新型冠状病毒感染的肺炎病例。8例有湖北及其他省份接触史，10例为确诊病例的密切接触者,其中1例既有湖北及其他省份接触史又是确诊病例的密切接触者。4例无湖北接触史。均已送至定点医疗机构进行救治。       截至2月5日24时,本市累计确诊病例274例。\n','2020-02-11','ck6hgxcay006gs27c572wdh9r','人民网','北京市','2020-02-06','http://m.weibo.cn/2286908003/4468918367932704','','北京新增21例，累计274例','2020-02-11'),('2月5日晚11点30开始，来自武汉市武昌区各社区的第一批轻症新型冠状病毒肺炎确诊病例，被陆续转送至位于洪山体育馆的武汉大学人民医院武昌方舱医院接受治疗。\n','2020-02-11','ck6hgxcaz006hs27c3828bz2u','人民网','湖北省','2020-02-06','http://m.weibo.cn/2286908003/4468916581968903','','武昌方舱医院开始收治轻症确诊患者','2020-02-11'),('截至2月6日10时，陕西新增8例新型冠状病毒感染的肺炎确诊病例。陕西累计报告新型冠状病毒感染的肺炎确诊病例173例（6例治愈出院），其中输入性病例101例，密切接触者65例，无明确接触史病例7例。全省现有疑似病例238例。全省新增密切接触者615人，累计7655人，均集中医学观察。新增解除密切接触者641人，累计解除密切接触者2393人。\n','2020-02-11','ck6hgxcaz006is27c0nx445nt','人民网','陕西省','2020-02-06','http://m.weibo.cn/2286908003/4468912395170853','','陕西新增8例累计173例，6例治愈出院','2020-02-11'),('2月5日0-24时，海南省报告新型冠状病毒感染的肺炎新增确诊病例11例，新增重症病例4例，新增死亡病例0例，新增解除重症1例，新增出院病例1例。 截至2月5日24时，海南省累计报告新型冠状病毒感染的肺炎确诊病例100例。截至2月5日24时，追踪到密切接触者2198人，已解除医学观察1183人，尚有1015人正在接受居家或集中医学观察。','2020-02-11','ck6hgxcaz006js27cd1dd6nb3','人民网','海南省','2020-02-06','http://m.weibo.cn/2286908003/4468906917662145','','海南新增11例，累计100例','2020-02-11'),('截至2020年2月6日9时，内蒙古自治区累计报告新型冠状病毒感染的肺炎确诊病例46例，目前，尚在