),('2020年2月5日12—24时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例13例，新增出院病例1例。截至2月5日24时，重庆市累计报告新型冠状病毒感染的肺炎确诊病例389例；现有重型病例32例，危重型病例11例，死亡病例2例，出院病例15例。累计追踪到密切接触者11700人，已解除医学观察4461人，尚有7239人正在接受医学观察。\n','2020-02-11','ck6hgxcb10074s27ch67geufl','人民网','重庆市','2020-02-05','http://m.weibo.cn/2286908003/4468865004309019','','重庆新增13例，累计389例','2020-02-11'),('2月5日12时至24时，云南省报告新型冠状病毒感染肺炎新增病例4例。全省累计报告确诊病例128例，除治愈出院者外，现均在定点医院接受隔离治疗。现有危重2例，重症13例，治愈出院5例，疑似病例149例，无死亡病例。密切接触者当日解除医学观察525人，正在观察3659人。','2020-02-11','ck6hgxcb40075s27c19a8bjji','人民网','云南省','2020-02-05','http://m.weibo.cn/2286908003/4468864597175712','','云南新增4例，累计128例','2020-02-11'),('2020年2月5日0时-24时，湖北省新增新型冠状病毒感染的肺炎病例2987例，全省新增死亡70例，新增出院113例。截至2020年2月5日24时，湖北省累计报告新型冠状病毒感染的肺炎病例19665例。目前仍在院治疗14314例，其中：重症2328例、危重症756例，均在定点医疗机构接受隔离治疗。累计追踪密切接触者90997人，尚在接受医学观察64127人。','2020-02-11','ck6hgxcb40076s27c5nfq4lu0','人民网','湖北省','2020-02-05','http://m.weibo.cn/2286908003/4468864102870502','','湖北新增2987例，累计19665例','2020-02-11'),('【#湖北新增确诊病例2987例#】2020年2月5日0时-24时，湖北省新增新型冠状病毒感染的肺炎病例2987例，其中：武汉市1766例、孝感市424例、黄冈市162例、随州市128例、荆州市88例、荆门市86例、宜昌市67例、黄石市57例、襄阳市52例、鄂州市41例、仙桃市40例、十堰市35例、咸宁市15例、天门市10例、潜江市10例、恩施州6例。全省新增死亡70例，其中：武汉市52例、宜昌市2例、荆州市1例、荆门市1例、孝感市7例、黄冈市4例、咸宁市1例、随州市1例、仙桃市1例。新增出院113例，其中：武汉市63例、黄石市7例、十堰市5例、襄阳市3例、荆州市9例、荆门市5例、鄂州市2例、孝感市3例、黄冈市10例、咸宁市1例、恩施州4例、天门市1例。截至2020年2月5日24时，湖北省累计报告新型冠状病毒感染的肺炎病例19665例，其中：武汉市10117例、孝感市1886例、黄冈市1807例、随州市834例、荆州市801例、襄阳市787例、黄石市566例、宜昌市563例、荆门市508例、鄂州市423例、咸宁市399例、十堰市353例、仙桃市265例、恩施州144例、天门市138例、潜江市64例、神农架林区10例。已治愈出院633例。死亡549例，其中：武汉市414例、黄石市2例、襄阳市2例、宜昌市6例、荆州市10例、荆门市17例、鄂州市18例、孝感市25例、黄冈市29例、咸宁市1例、随州市9例、仙桃市5例、天门市10例、潜江市1例。目前仍在院治疗14314例，其中：重症2328例、危重症756例，均在定点医疗机构接受隔离治疗。累计追踪密切接触者90997人，尚在接受医学观察64127人。\n','2020-02-11','ck6hgxcb50077s27c0tqm5bm3','央视新闻','湖北省','2020-02-05','http://m.weibo.cn/2656274875/4468853059339263','','湖北新增确诊病例2987例','2020-02-11'),('2月5日，河北省市场监管局公布第八批疫情防控期间市场监管领域违法典型案件。其中，衡水颖诺医疗器械商贸有限公司虚假宣传案引发关注。根据群众举报，衡水市冀州区市场监督管理局依法对衡水颖诺医疗器械商贸有限公司开展立案调查。经查，该店在销售防护口罩等防护产品时，其天猫店铺网页发布“医用三层一次性无纺布口罩”“外科口罩N95”等虚假宣传内容，且存在哄抬价格违法行为。衡水市冀州区市场监督管理局责令立即改正，并罚款180万元。当事人涉嫌销售假冒伪劣口罩问题已移交当地公安机关。河北市场监管部门提示，群众若发现市场监管领域违法违规问题，请拨打12315投诉举报，各级市场监管部门将从严从快查处。\n','2020-02-11','ck6hgxcb50078s27cg21u7n71','人民日报','河北省','2020-02-05','http://m.weibo.cn/2803301701/4468754018796013','','河北一企业销售假劣口罩被罚180万','2020-02-11'),('福建泉州晋江市发生一起新型冠状病毒感染的肺炎家族聚集性发病案例，当地从严从快落实疫情防控措施。目前已全面调查密切接触者并落实轨迹追溯，进行全程管控。晋江市公安机关对涉嫌危害公共安全罪的张某某立案侦查并采取强制措施。晋江同时对5名履职不力责任人进行问责处理。\n','2020-02-11','ck6hgxcb50079s27cbsygerrr','人民网','福建省','2020-02-05','http://m.weibo.cn/2286908003/4468744551725622','','晋江发生一起家族聚集性病例','2020-02-11'),('2月5日15时30分至22时，辽宁省沈阳市新增1例新型冠状病毒感染的肺炎确诊病例,属普通型病例。截至2020年2月5日22时，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例89例，重型病例7例，治愈出院4例。','2020-02-11','ck6hgxcb5007as27c95qw89px','人民网','辽宁省','2020-02-05','http://m.weibo.cn/2286908003/4468743558269521','','辽宁新增1例累计89例','2020-02-11'),('2月5日，甘肃临夏州两例新型冠状病毒感染的肺炎患者，符合出院标准，解除隔离出院。　\n','2020-02-11','ck6hgxcb5007bs27cblxd6eai','人民网','甘肃省','2020-02-05','http://m.weibo.cn/2286908003/4468740894271514','','甘肃两例确诊患者治愈出院','2020-02-11'),('中国国家铁路集团有限公司决定，自2020年2月6日0时起，此前在车站、12306网站等各渠道已购买的全国铁路火车票，旅客在开车前自愿改变行程需退票的，铁路部门均不收取退票手续费，购买铁路乘意险的一同办理。对无法在网上办理退票的旅客，铁路部门继续推出延长退票时限的服务措施。凡是于2月5日24时前使用现金购票或已于2月5日24时前换取纸质车票（含报销凭证）的旅客，如开车前无法到车站办理退票的，可延期至3月31日24时前办理退票；凡是火车票票面发站所在地车站进站通道关闭的，在进站通道恢复之日起30日内均可办理退票；退票须在购票地或出发地各车站办理，办理时继续免收退票费，铁路乘意险一同办理。\n','2020-02-11','ck6hgxcb5007cs27c8h6a89vm','人民网','全国','2020-02-05','http://m.weibo.cn/2286908003/4468716953923865','','2月6日前购票可免费退票','2020-02-11'),('5日下午，武汉江汉方舱医院正式交接给华中科技大学附属协和医院，这也标志着江汉方舱医院正式投入使用。方舱医院医疗队由国家医疗队和武汉医疗队组成，其中国家医疗队共9家，分别有广东、天津、浙江、海南、辽宁、河南、广西、吉大一院、广东疾控，武汉医疗队共6家，有协和医院、同济医院、武汉市第一医院、湖北省第三医院、武汉市第四医院、武汉市儿童医院。\n','2020-02-11','ck6hgxcb5007ds27cchla7aoy','人民网','湖北省','2020-02-05','http://m.weibo.cn/2286908003/4468704588872302','','15家医疗队齐聚 武汉江汉方舱医院正式投入使用','2020-02-11'),('按照湖北省新型冠状病毒感染肺炎疫情防控指挥部的工作部署，省发展改革委、省财政厅在1月31日紧急下达2亿元救治场所建设补助资金的基础上，2月5日再紧急下达2亿元资金，专项补助各地救治场所建设。省指挥部要求各地迅速将资金落实到具体项目，加快推进项目建设，抓实抓细各项工作，千方百计尽快提升救治能力。\n','2020-02-11','ck6hgxcb5007es27c4zp7egrb','人民日报','湖北省','2020-02-05','http://m.weibo.cn/2803301701/4468697442053173','','湖北再次紧急下达2亿补助救治场所','2020-02-11'),('2月5日，铜仁市首例新冠肺炎患者经过医护人员倾尽全力的救治，各项生理指标逐渐恢复正常，复查胸部CT片显示肺部炎症已逐渐吸收，4次复查咽/鼻拭子新型冠状病毒核酸检测均呈阴性，达到出院标准。这是贵州首例危重型新冠肺炎患者治愈出院。\n','2020-02-11','ck6hgxcb5007fs27c4ovf25d3','人民网','贵州省','2020-02-05','http://m.weibo.cn/2286908003/4468693662765335','','贵州首例危重型患者治愈出院','2020-02-11'),('2月5日，武汉“火眼”实验室正式启动试运行，新型冠状病毒核酸检测日通量可达万人。“火眼”实验室仅用5天时间，完成实验室主体施工，投入运行后将提供充足的检测能力和科学依据。\n','2020-02-11','ck6hgxcb5007gs27c00ma45z5','人民网','湖北省','2020-02-05','http://m.weibo.cn/2286908003/4468688646250877','','武汉火眼实验室今日试运行 核酸检测日通量可达万人','2020-02-11'),('5日，武汉儿童医院确诊两例新生儿新型冠状病毒肺炎病例。最小的确诊宝宝出生仅30小时，该新生儿母亲为新型冠状病毒肺炎确诊患者，目前该新生儿生命体征稳定。专家提示，可能存在母婴垂直感染传播途径，应引起重视。\n','2020-02-11','ck6hgxcb5007hs27cdmer5mcj','人民网','湖北省','2020-02-05','http://m.weibo.cn/2286908003/4468671793513457','','武汉出生30小时新生儿确诊新冠肺炎  专家：可能存在母婴垂直感染传播途径','2020-02-11'),('天津市卫健委副主任顾清5日透露，从疫情发展看，天津已出现多起聚集性疫情，而且以家庭聚集为主，呈本地扩散趋势。该市发生家庭聚集性疫情从一周前的4起，到目前发生了14起，涉及35例病例，占确诊病例数的50%。\n','2020-02-11','ck6hgxcb5007is27c68hh1768','人民日报','天津市','2020-02-05','http://m.weibo.cn/2803301701/4468670913287733','','天津已现14起聚集性疫情，天津聚集性疫情占确诊病例50%','2020-02-11'),('今天，武汉儿童医院确诊两例新生儿新型冠状病毒肺炎病例。最小的确诊宝宝出生仅30小时，该新生儿母亲为新型冠状病毒肺炎确诊患者，目前该新生儿生命体征稳定。专家提示，可能存在母婴垂直感染传播途径，应引起重视。','2020-02-11','ck6hgxcb6007js27cgwufge91','央视新闻','湖北省','2020-02-05','http://m.weibo.cn/2656274875/4468668508937270','','武汉出生30小时新生儿确诊，可能存在母婴垂直感染','2020-02-11'),('广州市公安局新闻办公室今天通报：2月4日，海珠区公安分局依法对余某以涉嫌妨害传染病防治罪立案侦查。余某在明知家人出入过疫情发生地、已被确诊感染新型冠状病毒肺炎，且本人检测新型冠状病毒核酸结果均呈阳性的情况下，却故意隐瞒不配合工作人员排查，导致其感染的新型冠状病毒存在继续传播的严重社会危险，其行为涉嫌妨害传染病防治罪。','2020-02-11','ck6hgxcb6007ks27c07vy3alu','人民日报','广东省','2020-02-05','http://m.weibo.cn/2803301701/4468656044011970','','广州一确诊患者隐瞒病情不核查被立案侦查','2020-02-11'),('2月5日0—12时，贵州全省新型冠状病毒感染的肺炎无新增确诊病例。截至5日12时，贵州全省累计报告新型冠状病毒感染的肺炎病例64例。2月5日0-12时贵州无新增病例，死亡1例，累计确诊64例\n','2020-02-11','ck6hgxcb6007ls27c5v2o27ai','人民网','贵州省','2020-02-05','http://m.weibo.cn/2286908003/4468665145157592','','贵州无新增病例死亡1例','2020-02-11'),('2月5日，鄂尔多斯市新型冠状病毒感染肺炎防控工作指挥部发布消息，经自治区和鄂尔多斯市专家组会诊，鄂尔多斯市第2例新冠肺炎治愈患者出院。经专家组与医院医务人员积极治疗，患者临床症状消失，2次核酸检测结果均为阴性。经自治区和鄂尔多斯市两级专家组确认，符合解除隔离出院标准条件，于2月5日下午出院。至此，鄂尔多斯市已有2例新冠肺炎患者治愈出院。','2020-02-11','ck6hgxcb6007ns27c3yic9560','人民网','内蒙古自治区','2020-02-05','http://m.weibo.cn/2286908003/4468642172929232','','鄂尔多斯市第2例确诊患者治愈出院','2020-02-11'),('2月5日0时至12时，云南省报告新型冠状病毒感染肺炎新增病例2例。全省累计报告确诊病例124例，除治愈出院者外，现均在定点医院接受隔离治疗。现有危重2例，重症13例，治愈出院5例，疑似病例138例，密切接触者医学观察3628人，无死亡病例。\n','2020-02-11','ck6hgxcb6007os27cbequbxjf','人民网','云南省','2020-02-05','http://m.weibo.cn/2286908003/4468632190921733','','云南新增2例，累计124例','2020-02-11'),('2月5日上午，华中科技大学附属协和医院的医护人员经过治疗后，临床症状得到有效控制，经专家组讨论，符合出院标准，协和医院第三批共有5名医护人员出院。截止目前，该院14名医务人员已出院。\n','2020-02-11','ck6hgxcb6007ps27c83vabxga','人民网','湖北省','2020-02-05','http://m.weibo.cn/2286908003/4468631939144402','','武汉协和医院14名感染医护出院','2020-02-11'),('2020年2月5日0—12时，山东省报告新型冠状病毒感染的肺炎新增确诊病例9例，累计确诊病例307例(含重症病例21例，危重症病例6例，出院13例，无死亡病例);新增疑似病例11例，现有疑似病例89例。截至目前，追踪到密切接触者10826人，已解除医学观察4422人，诊断为疑似或确诊144例，尚有6260人正在接受医学观察。\n','2020-02-11','ck6hgxcb6007qs27c4xls25m1','人民网','山东省','2020-02-05','http://m.weibo.cn/2286908003/4468625194897550','','山东新增9例，累计307例','2020-02-11'),('上海市教委发布通知：根据疫情发展情况，为确保学生安全，决定上海各级各类学校2月底前不开学。将密切跟踪疫情发展，及时作出研判。开学时间一经确定，将提前向社会公布，以留出时间方便师生家长作出合理安排。 \n','2020-02-11','ck6hgxcb6007rs27c4ihifj92','央视新闻','上海市','2020-02-05','http://m.weibo.cn/2656274875/4468622380114326','','上海开学日期延至3月','2020-02-11'),('2月4日0时至24时，北京市新增25例新型冠状病毒感染的肺炎病例，其中14例有湖北及其他省份接触史，10例为确诊病例的密切接触者,1例无湖北接触史。均已送至定点医疗机构进行救治。截至2月4日24时,北京市累计确诊病例253例。','2020-02-11','ck6hgxcb7007xs27chlaz16ip','人民日报','北京市','2020-02-05','http://m.weibo.cn/2803301701/4468598745993889','','北京新增25例确诊病例，累计确诊253例','2020-02-11'),('上海市卫健委今天（2月5日）通报：2020年2月5日0—12时，上海市排除新型冠状病毒感染的肺炎疑似病例6例；新增治愈出院3例；新增确诊病例10例，其中1例重症。新增确诊病例中，2例为外地来沪人员，8例为本市常住人口。截至2月5日12时，上海市已累计排除疑似病例591例，发现确诊病例243例。有237例疑似病例正在排查中。','2020-02-11','ck6hgxcb7007ys27c3vsb7h3s','人民网','上海市','2020-02-05','http://m.weibo.cn/2286908003/4468605154675128','','上海新增10例，累计243例','2020-02-11'),('2月4日0—24时，福建省报告新增新型冠状病毒感染的肺炎确诊病例11例。新增治愈出院病例6例。报告新增新型冠状病毒感染的肺炎疑似病例40例。截至2月4日24时，福建省累计报告新型冠状病毒感染的肺炎确诊病例205例。目前，确诊、疑似病例的密切接触者已解除医学观察1077人，尚有4193人正在接受医学观察。','2020-02-11','ck6hgxcb7007zs27chczv7ma2','人民网','福建省','2020-02-05','http://m.weibo.cn/2286908003/4468589068843300','','福建新增11例，累计确诊205例','2020-02-11'),('2月5日，3名在青海省第四人民医院救治的新冠肺炎患者，符合出院标准准备出院。3名患者中，年龄最小的7岁，最大的42岁，系一家人。马某某一家系湟中县上新庄镇上峡门村人，一家人长期居住武汉市从事餐饮服务。@人民网青海频道','2020-02-11','ck6hgxcb70080s27cbqrf0rf9','人民网','青海省','2020-02-05','http://m.weibo.cn/2286908003/4468559839043628','','好消息！青海3名新冠肺炎患者出院','2020-02-11'),('2月5日凌晨，本市一名新型冠状病毒肺炎确诊病例出现急性左心功能衰竭、急性冠脉综合征，经海河医院奋力抢救无效死亡，为本市首例死亡病例。@天津发布\n','2020-02-11','ck6hgxcb70081s27caj0m0aa4','人民网','天津市','2020-02-05','http://m.weibo.cn/2286908003/4468570790459858','','天津现首例死亡病例','2020-02-11'),('2月5日上午，西藏自治区卫健委通报新型冠状病毒感染的肺炎疫情情况：截至2月4日24时，西藏自治区累计报告新型冠状病毒感染的肺炎确诊病例1例，重症病例0例，死亡病例0例，出院病例0例。目前，患者生命体征平稳，追踪到的密切接触者正在接受医学观察。因此，西藏自治区已经连续6天没有新增病例或疑似病例报告。\n','2020-02-11','ck6hgxcb70082s27c8ch75okv','人民网','西藏自治区','2020-02-05','http://m.weibo.cn/2286908003/4468561298669471','','西藏连续6天无新增病例','2020-02-11'),('继2月3日福建首例患者治愈出院后，4日，福建又有6例新型冠状病毒感染的肺炎确诊患者治愈出院，包括福州2例，宁德1例，泉州3例。（刘晓宇）\n','2020-02-11','ck6hgxcb80083s27c1h230kfu','人民日报','福建省','2020-02-05','http://m.weibo.cn/2803301701/4468574045275911','','好消息！福建已有7例患者治愈出院','2020-02-11'),('截至2月5日10时，陕西新增23例新型冠状病毒感染的肺炎确诊病例（首次在孕妇中发现确诊病例），新增疑似病例41例。新增确诊病例中，西安市10例、咸阳市4例、渭南市3例、汉中市3例、安康市2例、商洛市1例。陕西累计报告新型冠状病毒感染的肺炎确诊病例165例（2例治愈出院），其中输入性病例100例，密切接触者58例，无明确接触史病例7例。（陕西卫健委）\n','2020-02-11','ck6hgxcb80084s27c0ykb23gw','人民网','陕西省','2020-02-05','http://m.weibo.cn/2286908003/4468553908450885','','陕西新增23例累计确诊165例','2020-02-11'),('2020年2月4日0-24时，浙江省报告新型冠状病毒感染的肺炎新增确诊病例66例，新增出院病例15例。其中：新增确诊病例中，杭州市9例、宁波市18例、温州市24例、嘉兴市4例、金华市4例、台州市7例；新增出院病例中，杭州市1例、宁波市3例、温州市11例。\n','2020-02-11','ck6hgxcb80085s27cb2nyem1d','人民日报','浙江省','2020-02-05','http://m.weibo.cn/2803301701/4468533385808235','','浙江新增确诊66例，累计确诊895例','2020-02-11'),('截至2020年2月5日9时，内蒙古自治区累计报告新型冠状病毒感染的肺炎确诊病例42例，均在定点医院接受隔离治疗。目前，追踪到的密切接触者1181人，尚在接受医学观察中。当日解除医学观察51人。（内蒙古卫健委）\n','2020-02-11','ck6hgxcb80086s27ca3ccch5i','人民网','内蒙古自治区','2020-02-05','http://m.weibo.cn/2286908003/4468541736689041','','内蒙古累计确诊42例','2020-02-11'),('2020年2月4日0-24时，宁夏报告无新增确诊病例；新增疑似病例6例。截至2月4日24时，宁夏累计报告确诊病例34例，其中银川市20例（兴庆区6例、金凤区8例、西夏区4例、永宁县2例）、石嘴山市1例（大武口区）、吴忠市7例（利通区4例、红寺堡区3例）、固原市2例（原州区2例）、中卫市3例（沙坡头区2例、中宁县1例）、宁东1例（宁东镇）；出院病例1例（西夏区）；现有重症病例5例；累计有疑似病例24例。目前累计追踪到密切接触者1262人，正在接受集中或居家隔离医学观察。@人民网宁夏频道 \n','2020-02-11','ck6hgxcb80087s27c6s25fdfu','人民网','宁夏回族自治区','2020-02-05','http://m.weibo.cn/2286908003/4468540109599294','','宁夏昨日无新增确诊病例','2020-02-11'),('2020年2月4日0-24时，新疆（含兵团）报告新型冠状病毒感染的肺炎新增确诊病例3例，新增死亡病例0例，新增出院病例0例。确诊病例中，乌鲁木齐市12例、伊犁州9例、昌吉州2例、吐鲁番市1例、阿克苏地区1例，兵团第六师五家渠市1例、兵团第七师1例、兵团第八师石河子市1例、兵团第九师4例；现有重症病例8例、危重症病例2例；累计死亡病例0例，累计出院病例0例。目前尚有1929人正在接受医学观察。\n','2020-02-11','ck6hgxcb80088s27c8o6w1ou7','人民网','新疆维吾尔自治区','2020-02-05','http://m.weibo.cn/2286908003/4468542030267164','','新疆新增3例累计32例','2020-02-11'),('【山东潍坊#患者隐瞒情况致68名医务人员被隔离#，警方立案】据@潍坊公安 通报：2月3日，潍坊市公安局奎文分局依法对故意隐瞒旅行史和接触史的新型冠状病毒感染的肺炎患者张某芳立案侦查。 \n','2020-02-11','ck6hgxcb80089s27cf0fkdg2d','人民网','山东省','2020-02-05','http://m.weibo.cn/2286908003/4468549445817141','','山东潍坊患者隐瞒情况致68名医务人员被隔离','2020-02-11'),('截至2月4日24时，广东省累计报告新型冠状病毒感染的肺炎确诊病例870例。4日当天全省新增确诊病例73例。在院的838例确诊病例中，危重型29例，重型69例，普通型740例。新增出院12例，累计出院32例。无死亡病例。（广东卫健委）网页链接\n','2020-02-11','ck6hgxcb8008as27c3cqp8fr3','人民网','广东省','2020-02-05','http://m.weibo.cn/2286908003/4468542608702553','','广东新增73例累计870例','2020-02-11'),('2020年2月4日0-24时，海南省报告新型冠状病毒感染的肺炎新增确诊病例11例，新增重症病例1例，新增死亡病例0例，新增解除重症0例，新增出院病例1例，新增订正病例1例。截至2月4日24时，海南省累计报告新型冠状病毒感染的肺炎确诊病例89例，重症病例11例，死亡病例1例，出院病例4例。\n','2020-02-11','ck6hgxcb8008bs27c7q910g6v','人民网','海南省','2020-02-05','http://m.weibo.cn/2286908003/4468547680117886','','海南新增11例累计89例','2020-02-11'),('截至2月4日24时，广东全省累计报告新型冠状病毒感染的肺炎确诊病例870例，4日当天全省新增确诊病例73例。累计报告确诊病例中，男性424例，女性446例，年龄介于10月龄-86岁之间。\n','2020-02-11','ck6hgxcb8008cs27cdkojdx37','央视新闻','广东省','2020-02-05','http://m.weibo.cn/2656274875/4468548736794032','','广东新增73例确诊病例','2020-02-11'),('【#江西新增确诊72例#，#江西累计确诊548例#】2020年2月4日0-24时，江