791025566','','河南新增89例累计确诊764例','2020-02-11'),('#新冠肺炎最新动态#【#青海新增2例累计17例#】2020年2月4日0-24时，青海省报告新型冠状病毒感染的肺炎新增确诊病例2例，新增重症病例0例，新增死亡病例0例，新增出院病例0例,其中：西宁市报告新增确诊病例2例，其他市州无报告病例。截至2月4日24时，青海省累计报告新型冠状病毒感染的肺炎确诊病例17例，其中：重症病例1例，死亡病例0例，出院病例0例。确诊病例中，西宁市14例，海北州3例。目前追踪到密切接触者331人，当日解除医学观察7人，尚有324人正在接受医学观察。','2020-02-11','ck6hgxcb9008is27cci8udxcr','人民网','青海省','2020-02-05','http://m.weibo.cn/2286908003/4468529564391873','','青海新增2例累计17例','2020-02-11'),('#新冠肺炎最新动态#【#江苏新增33例累计确诊341例# 】2020年2月4日0-24时，江苏省报告新型冠状病毒感染的肺炎新增确诊病例33例。其中，南京市3例、无锡市1例、徐州市6例、常州市5例、苏州市3例、南通市3例、连云港市3例、淮安市4例、镇江市1例、泰州市3例、宿迁市1例。新增重症病例3例，新增出院病例5例。新增确诊病例中，年龄最大的97岁，最小的20岁。男性15人，女性18人。所有病例均已在定点医院救治，病情稳定。截至2月4日24时，江苏省累计报告新型冠状病毒感染的肺炎确诊病例341例。其中，重症病例5例，出院病例13例。确诊病例中，南京市47例、无锡市26例、徐州市45例、常州市24例、苏州市55例、南通市25例、连云港市20例、淮安市26例、盐城市15例、扬州市15例、镇江市6例、泰州市26例、宿迁市11例；重症病例中，苏州市4例，南通市1例；出院病例中，南京市4例、无锡市1例、常州市2例、苏州市3例、连云港市1例、淮安市1例、泰州市1例。目前，江苏省追踪到密切接触者6476人，已解除医学观察895人，尚有5581人在接受医学观察。专家提醒：近期不要出门，更要避免集聚。尽量避免使用公共交通，开私家车要注意开窗通风。少去密闭、通风不良的公共场所，特别是不要去麻将馆等空间狭小、通风不好的场所。在外要注意减少公共部位的接触。出门戴口罩，回家先洗手。如果出现发热或咳嗽等症状，可及时拨打12320卫生热线咨询，必要时主动就医，并主动告知前2周的生活轨迹。同时注意不要盲目就医，更不要短期内到多家医疗机构就诊，避免不必要的交叉感染。@健康江苏微博\n','2020-02-11','ck6hgxcb9008js27cekju00vd','人民网','江苏省','2020-02-05','http://m.weibo.cn/2286908003/4468528894011196','','江苏新增33例累计确诊341例','2020-02-11'),('【#湖南新增确诊病例68例#，#湖南累计确诊661例#】2020年2月4日0-24时，湖南省报告新型冠状病毒感染的肺炎新增确诊病例68例，新增重症病例4例，新增死亡病例0例，新增出院病例13例。其中:新增确诊病例中，长沙市16 例、衡阳市4例、株洲市4例、湘潭市2例、邵阳市13例、岳阳市6例、常德市6例、益阳市5例、郴州市2例、永州市4例、娄底市5例、湘西自治州1例。新增重症病例中，长沙市1例、邵阳市2例、永州市1例。新增出院病例中，长沙市4例、衡阳市1例、株洲市1例、湘潭市1例、邵阳市1例、常德市3例、怀化市1例、娄底市1例。截至2月4日24时，湖南省累计报告新型冠状病毒感染的肺炎确诊病例661例，累计报告重症病例77例，现有重症病例57例，死亡病例0例，出院病例35例。其中:确诊病例中，长沙市164例、衡阳市39例、株洲市38例、湘潭市23例、邵阳市68例、岳阳市89例、常德市56例、张家界市3例、益阳市40 例、郴州市24例、永州市30例、怀化市35例、娄底市45例、湘西自治州7例。现有重症病例中，长沙市17例、衡阳市2例、株洲市2例、湘潭市3例、邵阳市10例、岳阳市4例、常德市3例、益阳市5例、永州市2例、怀化市6例、娄底市2例、湘西自治州1例。出院病例中，长沙市6例、衡阳市5例、株洲市2例、湘潭市4例、邵阳市2例、常德市3例、益阳市1例、郴州市1例、永州市5例、怀化市2例、娄底市3例、湘西自治州1例。目前追踪到密切接触者14840人，已解除医学观察4955人，尚有9885人正在接受医学观察。（王云娜）\n','2020-02-11','ck6hgxcb9008ks27c8ox7hhy0','人民日报','湖南省','2020-02-05','http://m.weibo.cn/2803301701/4468528453761858','','湖南新增确诊病例68例，累计确诊661例','2020-02-11'),('#新冠肺炎最新动态#【#安徽新增50例累计530例#】2020年2月4日0-24时，安徽省报告新增确诊病例50例，新增疑似病例63例，新增治愈出院6例。       新增确诊病例中，合肥12例、淮北3例、亳州10例、宿州1例、蚌埠5例、阜阳5例、淮南4例、六安4例、马鞍山2例、芜湖2例、池州1例、安庆1例，均病情平稳。       新增疑似病例中，合肥7例、淮北6例、亳州2例、宿州1例、蚌埠8例、阜阳14例、六安14例、芜湖2例、宣城1例、铜陵1例、安庆7例。       新增治愈出院病例中，阜阳3例、安庆3例。       截至2月4日24时，安徽省累计报告确诊病例530例，其中合肥93例、淮北14例、亳州58例、宿州24例、蚌埠48例、阜阳84例、淮南12例、滁州11例、六安34例、马鞍山30例、芜湖23例、宣城4例、铜陵19例、池州11例、安庆56例、黄山9例。累计治愈出院病例20例，其中合肥5例、亳州2例、阜阳3例、滁州2例、六安1例、芜湖1例、宣城1例、铜陵1例、池州1例、安庆3例。无死亡病例。累计医学观察密切接触者11604人。       截至2月4日24时，安徽省在院治疗确诊病例510例，其中危重病例5例。       2月5日即将治愈出院3例，其中淮南2例、芜湖1例。（安徽卫健委）网页链接\n','2020-02-11','ck6hgxcb9008ls27c3kzzb5a2','人民网','安徽省','2020-02-05','http://m.weibo.cn/2286908003/4468528096894201','','安徽新增50例累计530例','2020-02-11'),('#新冠肺炎最新动态#【#贵州新增6例累计64例#】2020年2月4日12—24时，全省新型冠状病毒感染的肺炎新增确诊病例6例。其中，外地来黔人员3例，本省常住人口3例。贵阳市2例、安顺市1例、毕节市2例、黔东南州1例。截至2月4日24时，全省累计报告新型冠状病毒感染的肺炎病例64例。其中，外地来黔返黔人员38例，本省常住人口26例；治愈出院5例，病情平稳51例，重症2例，危重症6例；男性33例，女性31例；年龄最大80岁，最小1个月；贵阳市12例（1例已治愈），遵义市9例，六盘水9例，安顺市3例，毕节市11例，铜仁市6例（1例已治愈），黔东南州5例，黔南州6例（3例已治愈），黔西南州3例。现有疑似病例33例。累计追踪密切接触者793人，已解除医学观察142人，尚在接受医学观察630人。（贵州卫健委）网页链接\n','2020-02-11','ck6hgxcb9008ms27c2m0q9yho','人民网','贵州省','2020-02-05','http://m.weibo.cn/2286908003/4468527064774197','','贵州新增6例累计64例','2020-02-11'),('#新冠肺炎最新动态#【#河南新增89例累计764例#】2020年2月4日0-24时，河南省新增新型冠状病毒感染的肺炎确诊病例89例,新增出院病例21例。新增确诊病例中，郑州市7例、开封市5例、洛阳市5例、平顶山市6例、安阳市2例、新乡市6例、焦作市3例、许昌市5例、漯河市1例、南阳市8例、商丘市1例、信阳市26例（含固始县1例）、周口市4例（含鹿邑县1例）、驻马店市10例。截至2月4日24时，全省累计报告新型冠状病毒感染的肺炎确诊病例764例，现有重症病例38例，现有危重病例19例，累计死亡病例2例，累计治愈病例41例。其中：确诊病例中，郑州市92例（含巩义市8例,巩义核增1例）、开封市17例（含兰考县4例）、洛阳市17例、平顶山市34例（含汝州市1例）、安阳市35例（含滑县1例）、鹤壁市10例、新乡市39例（含长垣市3例）、焦作市15例、濮阳市4例、许昌市24例、漯河市24例、三门峡市7例、南阳市107例（含邓州市15例）、商丘市61例（含永城市9例）、信阳市138例（含固始县12例）、周口市56例（含鹿邑县6例）、驻马店市82例（含新蔡县7例）、济源示范区2例。目前累计追踪到密切接触者16088人，2月4日已解除观察2285人，诊断为疑似52人，共有9695人正在接受医学观察。网页链接\n','2020-02-11','ck6hgxcb9008ns27c3ptj92jc','人民网','河南省','2020-02-05','http://m.weibo.cn/2286908003/4468526016478869','','河南新增89例累计764例','2020-02-11'),('#新冠肺炎最新动态#【#山东新增23例累计298例#】2020年2月4日12—24时，山东省报告新型冠状病毒感染的肺炎新增确诊病例23例，累计确诊病例298例(含重症病例21例，危重症病例4例，出院13例，无死亡病例);新增疑似病例38例，现有疑似病例94例。截至目前，追踪到密切接触者10264人，已解除医学观察4058人，诊断为疑似或确诊139例，尚有6067人正在接受医学观察。（山东卫健委）网页链接\n','2020-02-11','ck6hgxcb9008os27c9tiw8fmv','人民网','山东省','2020-02-05','http://m.weibo.cn/2286908003/4468525400003932','','山东新增23例累计298例','2020-02-11'),('#新冠肺炎最新动态#【#四川新增19例累计301例#】2月4日0-24时，四川省新增新型冠状病毒肺炎确诊病例19例，新增治愈出院病例9例。新增确诊病例中，成都市5例、达州市4例、巴中市3例、甘孜州2例、攀枝花市1例、泸州市1例、南充市1例、雅安市1例、凉山州1例。新增治愈出院病例中，成都市7例、绵阳市1例、眉山市1例。截至2月4日24时，四川省累计报告新型冠状病毒肺炎确诊病例301例，涉及21个市（州）。其中成都市92例、南充市28例、广安市24例、绵阳市17例、达州市17例、内江市15例、巴中市15例、德阳市12例、攀枝花市11例、泸州市10例、甘孜州10例、自贡市9例、宜宾市7例、凉山州7例、广元市6例、雅安市6例、遂宁市5例、眉山市5例、乐山市2例、资阳市2例、阿坝州1例。301名患者中，危重14人，死亡1人，治愈出院23人。当日解除医学观察824人，现有6393人正在接受医学观察。@健康四川官微\n','2020-02-11','ck6hgxcb9008ps27cbfz74s1r','人民网','四川省','2020-02-05','http://m.weibo.cn/2286908003/4468524745567582','','四川新增19例累计301例','2020-02-11'),('#新冠肺炎最新动态#【#广西新增11例累计150例#】2月4日0-24时，广西壮族自治区共新增新型冠状病毒感染的肺炎确诊病例11例，其中南宁市1例、柳州市2例、桂林市2例、北海市2例、防城港市2例、钦州市1例、河池市1例。目前全区累计报告确诊病例150例，累计出院病例10例。现有重症病例10例（南宁市2例、桂林市1例、防城港市5例、贵港市1例、河池市1例），危重病例4例（桂林市2例、玉林市1例、河池市1例），无死亡病例。累计确诊病例中，南宁市28例、柳州市17例、桂林市26例、梧州市5例、北海市29例、防城港市13例、钦州市4例、贵港市5例、玉林市8例、百色市2例、贺州市4例、河池市9例。目前累计追踪到密切接触者6469人，正在接受医学观察3972人。为控制新型冠状病毒感染的肺炎疫情传播蔓延，自治区要求全区机关事业单位返程上岗人员要带头做到：“六必须六不要”，即返岗必须主动报告、健康监测检查必须配合、通风消毒必须勤快、身体不适必须及时就医、个人防护必须加强、适度锻炼身体必须坚持；不要参加聚集活动、不要串门访客、不要造谣信谣传谣、不要盲目恐慌、不要盲目抢购药品和囤货、不要接触和食用野生动物。网页链接\n','2020-02-11','ck6hgxcb9008qs27cbfjxg2jj','人民网','广西壮族自治区','2020-02-05','http://m.weibo.cn/2286908003/4468518835412955','','广西新增11例累计150例','2020-02-11'),('2月4日0-24时，吉林省新增确诊病例12例，其中长春市10例，四平市1例，公主岭市1例。截至2月4日24时，全省累计报告确诊病例54例，长春市治愈出院1例，现在院隔离治疗确诊病例53例。其中长春市27例，四平市8例，吉林市5例，公主岭市4例，延边州3例，辽源市3例，松原市2例，通化市1例。在院治疗确诊病例中，48例为普通病例，3例为重症病例，2例为危重症病例。上述确诊病例的密切接触者1627人，正在隔离或居家医学观察1176人，已解除医学观察451人。　　2月4日0-24时，全省原有24例疑似病例转为确诊病例9例，排除疑似病例2例；新增疑似病例48例，其中3例转为确诊病例；现有疑似病例58例，已全部隔离治疗，目前正在进一步明确诊断。（吉林卫健委）网页链接\n','2020-02-11','ck6hgxcb9008rs27cgit82vhz','人民网','吉林省','2020-02-05','http://m.weibo.cn/2286908003/4468518428846466','','吉林新增12例累计54例','2020-02-11'),('#新冠肺炎最新动态#【#上海新增14例累计233例#】上海市卫健委今早（2月5日）通报：2020年2月4日12—24时，上海市排除新型冠状病毒感染的肺炎疑似病例58例；新增确诊病例14例，其中3例为外地来沪人员，11例为本市常住人口。截至2月4日24时，上海市已累计排除疑似病例585例，发现确诊病例233例。确诊病例中，男性118例，女性115例；年龄最大88岁，最小7月龄；126例有湖北居住或旅行史，11例有湖北以外地区居住或旅行史，95例有相关病例接触史,1例无湖北接触史；外地来沪人员84例，本市常住人口149例。目前，205例病情平稳，8例病情危重，7例重症，12例治愈出院，1例死亡。尚有194例疑似病例正在排查中。@上海发布\n','2020-02-11','ck6hgxcb9008ss27c4hkdedne','人民网','上海市','2020-02-04','http://m.weibo.cn/2286908003/4468513735323077','','上海新增14例累计233例','2020-02-11'),('2月4日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增治愈出院病例262例（湖北省125例），累计治愈出院病例892例。戳→网页链接 关注#最新疫情地图#！ \n','2020-02-11','ck6hgxcba008ts27c9vra4lqp','央视新闻','全国','2020-02-05','http://m.weibo.cn/2656274875/4468519443378257','','全国累计治愈出院共892例','2020-02-11'),('#新冠肺炎最新动态#【#河北新增9例累计135例#】2020年2月4日0—24时，河北省报告新型冠状病毒感染的肺炎新增确诊病例9例，其中保定市4例、承德市1例、张家口市1例、唐山市1例、廊坊市1例、秦皇岛市1例。新增治愈出院病例1例（石家庄市）。新增疑似病例58例，其中，石家庄市33例、沧州市6例、邢台市5例、秦皇岛市4例、邯郸市2例、衡水市2例、唐山市2例、张家口市2例、定州市2例。　　截至2月4日24时，河北省累计报告确诊病例135例，其中死亡1例，现有重症病例12例，累计治愈出院4例。确诊病例中，石家庄市21例、沧州市20例、保定市17例、邢台市16例、邯郸市14例、廊坊市13例、唐山市12例、张家口市10例、衡水市5例、承德市4例、秦皇岛市3例；死亡病例中，沧州市1例；重症病例中，石家庄市2例、张家口市2例、邢台市2例、承德市1例、唐山市1例、廊坊市1例、沧州市1例、邯郸市1例、保定市1例；出院病例中，保定市2例、廊坊市1例、石家庄市1例。现有疑似病例117例。　　目前累计追踪到密切接触者4728人，当日解除隔离医学观察260人，现有2866人正在接受隔离医学观察。（河北卫健委）网页链接\n','2020-02-11','ck6hgxcba008us27c6dwygkfx','人民网','河北省','2020-02-05','http://m.weibo.cn/2286908003/4468516679663266','','河北新增9例累计135例','2020-02-11'),('2020年2月4日12—24时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例22例，新增出院病例5例。新增确诊病例中，万州区5例、涪陵区1例、渝中区3例、九龙坡区4例、南岸区1例、綦江区2例、潼南区2例、垫江县2例、巫山县1例、两江新区1例。新增出院病例中，万州区1例、忠县1例、云阳县1例、奉节县1例、巫溪县1例。截至2月4日24时，重庆市累计报告新型冠状病毒感染的肺炎确诊病例366例；现有重型病例24例，危重型病例10例，死亡病例2例，出院病例14例。累计追踪到密切接触者10776人，已解除医学观察3543人，尚有7233人正在接受医学观察。（重庆卫健委）网页链接\n','2020-02-11','ck6hgxcba008vs27c2tjlhann','人民网','重庆市','2020-02-04','http://m.weibo.cn/2286908003/4468504214099772','','重庆新增22例累计366例','2020-02-11'),('2020年2月4日0时至24时，山西省报告新型冠状病毒感染的肺炎新增确诊病例7例。其中：太原市3例（迎泽区1例、尖草坪区2例），晋中市2例（平遥县2例），运城市1例（稷山县1例），朔州市1例（怀仁市1例）。截至2月4日24时，山西省11个市累计报告新型冠状病毒感染的肺炎确诊病例81例。其中：晋中市21例（平遥县21例），运城市17例（新绛县5例、河津市3例、芮城县3例、平陆县2例，万荣县1例、夏县1例、绛县1例、稷山县1例），大同市9例（平城区5例、云冈区2例、浑源县1例、天镇县1例），太原市9例（迎泽区4例、万柏林区2例、尖草坪区2例、小店区1例），晋城市7例（城区2例、泽州县2例、陵川县1例、阳城县1例、沁水县1例），吕梁市5例（离石区2例、孝义市2例、文水县1例），朔州市4例（应县3例、怀仁市1例），长治市3例（长子县2例、潞州区1例），忻州市3例（五台县2例、忻府区1例），阳泉市2例（城区2例），临汾市1例（乡宁县1例）。新增出院2例（晋中市平遥县2例），累计治愈出院4例。现有在院隔离治疗确诊病例77例，其中重症4例，危重症4例。新增疑似病例14例，现有疑似病例42例。4名危重症病例（长治市1例，晋城市1例，运城市1例，忻州市1例），4名重症病例（太原市2例，晋中市2例，）均已集中在太原市第四人民医院（省级定点医院）隔离治疗，经省级专家和医护团队精心监护救治，目前病情基本平稳。其余69名普通病例正在市级定点医院隔离治疗，目前病情平稳，部分病例病情好转。目前累计追踪到密切接触者2368人，当日解除医学观察187人，共有1511人正在接受医学观察。（山西卫健委）网页链接\n','2020-02-11','ck6hgxcba008ys27c2sdu6law','人民网','山西省','2020-02-04','http://m.weibo.cn/2286908003/4468500938837546','','山西新增7例累计81例','2020-02-11'),('#新冠肺炎最新动态# 【#云南新增3例累计122例#】2月4日12时至24时，云南省报告新型冠状病毒感染肺炎新增病例3例（昭通市、曲靖市、西双版纳州各1例）。全省累计报告确诊病例122例，除治愈出院者外，现均在定点医院接受隔离治疗。现有危重3例，重症13例，治愈出院5例，疑似病例172例，无死亡病例。密切接触者当日解除医学观察738人，正在观察3670人。确诊病例中，昆明市34例、西双版纳州14例、玉溪市12例、昭通市10例、曲靖市10例、保山市8例、大理州7例、丽江市7例、红河州5例、德宏州5例、楚雄州4例、普洱市4例、文山州1例、临沧市1例。（云南卫健委）网页链接\n','2020-02-11','ck6hgxcba008zs27c8xuo3phj','人民网','云南省','2020-02-04','http://m.weibo.cn/2286908003/4468501408683388','','云南新增3例累计122例','2020-02-11'),('#湖北新增确诊病例3156例# 【#湖北累计确诊16678例#】2020年2月4日0时-24时，湖北省新增新型冠状病毒感染的肺炎病例3156例，其中：武汉市1967例、黄石市104例、十堰市27例、襄阳市103例、宜昌市44例、荆州市100例、荆门市22例、鄂州市50例、孝感市342例、黄冈市223例、咸宁市36例、随州市65例、恩施州15例、仙桃市37例、天门市11例、潜江市10例。全省新增死亡65例，其中：武汉市49例、襄阳市1例、宜昌市1例、荆州市2例、荆门市2例、孝感市1例、黄冈市6例、随州市2例、仙桃市1例。新增出院125例，其中：武汉市65例、黄石市8例、十堰市3例、襄阳市6例、宜昌市7例、荆州市3例、荆门市10例、鄂州市2例、孝感市2例、黄冈市11例、咸宁市1例、随州市6例、恩施州1例。截至2020年2月4日24时，湖北省累计报告新型冠状病毒感染的肺炎病例16678例，其中：武汉市8351例、黄石市509例、十堰市318例、襄阳市735例、宜昌市496例、荆州市713例、荆门市422例、鄂州市382例、孝感市1462例、黄冈市1645例、咸宁市384例、随州市706例、恩施州138例、仙桃市225例、天门市128例、潜江市54例、神农架林区10例。已治愈出院520例，死亡479例，其中：武汉市362例、黄石市2例、襄阳市2例、宜昌市4例、荆州市9例、荆门市16例、鄂州市18例、孝感市18例、黄冈市25例、随州市8例、仙桃市4例、天门市10例、潜江市1例。目前仍在院治疗12627例，其中：重症1809例、危重症711例，均在定点医疗机构接受隔离治疗。累计追踪密切接触者81039人，尚在接受医学观察66764人。（总台央视记者 李炜）\n','2020-02-11','ck6hgxcba0091s27c5bkuh8ql','央视新闻','湖北省','2020-02-04','http://m.weibo.cn/2656274875/4468490490595228','','湖北新增确诊病例3156例','2020-02-11'),('截至2月4日20时，甘肃新增2例新型冠状病毒感染的肺炎确诊病例。新增确诊病例均在兰州市。甘肃累计报告新型冠状病毒感染的肺炎确诊病例57例，出院4例，53例在定点医院进行隔离治疗。目前，累计追踪到密切接触者1784人，已解除医学观察475人，其余1309人正在接受医学观察。','2020-02-11','ck6hgxcba0092s27c8yej07oy','人民网','甘肃省','2020-02-04','http://m.weibo.cn/2286908003/4468386215842614','','甘肃新增2例，累计57例','2020-02-11'),('2020年2月4日15时至21时30分，辽宁省新增4例新型冠状病毒感染的肺炎确诊病例。截至2020年2月4日21时30分，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例81例，79名在治患者中，60例病例为输入性病例，19例病例为本地感染病例。目前累计追踪到密切接触者1436人，已解除医学观察326人，现有1109人正在接受医学观察，正在追踪1人。\n','2020-02-11','ck6hgxcbb0093s27c094z9d6h','人民网','辽宁省','2020-02-04','http://m.weibo.cn/2286908003/4468363297900276','','辽宁新增4例，累计81例','2020-02-11'),('2月2日，朝阳区分局对王某某涉嫌以危险方法危害公共安全罪立案侦查。经查，王某某系武汉某医药公司职工，1月19日回长探亲后，未向社区报备，不主动居家隔离，在其出现发热咳嗽等症状3次就医时，故意隐瞒在重点疫区工作生活经历和返长行程事实，欺骗就诊医生，且多次主动与他人密切接触、就餐，现已导致5人直接感染、多人封闭隔离观察，造成严重后果。','2020-02-11','ck6hgxcbb0094s27c06z8e3we','人民网','吉林省','2020-02-04','http://m.weibo.cn/2286908003/4468327218494255','','长春一确诊男子瞒报致5人感染被立案侦查','2020-02-11'),('4日，中央应对新型冠状病毒感染肺炎疫情工作领导小组召开会议，提出：①征用一批酒店场馆等收治轻症患者或观察密切接触者，将部分三级综合医院转为定点收治医院，调集一批应急方舱医院、再增加2000名医护人员支援湖北。②调派高水平医护团队整建制接管重症救治医院或病区。③调派检测力量，提高检测能力。④要压实地方责任，推动医用防护服、口罩等企业加快复工和扩大产能。','2020-02-11','ck6hgxcbb0095s27c5o1n7dnf','人民网','全国','2020-02-04','http://m.weibo.cn/2286908003/4468341857154008','','中央明确：再增加2000名医护支援湖北','2020-02-11'),('2月4日下午，三亚中心医院（海南省第三人民医院）又有1例新冠肺炎确诊病例患者经过综合诊治，符合国家卫生健康委新型冠状病毒感染的肺炎确诊病例解除隔离和出院标准，于当天出院。','2020-02-11','ck6hgxcbb0096s27cgtlthm6d','人民网','海南省','2020-02-04','http://m.weibo.cn/2286908003/4468324324777589','','三亚新增出院病例1例，累计治愈5例','2020-02-11'),('2月4日下午，南京第二批两位新型冠状病毒感染的肺炎患者治愈出院，这也是南京治愈出院的第三例和第四例确诊患者。这两位患者均收治在南京市公共卫生医疗中心。在这里他们经过抗病毒治疗及其他对症治疗，心理疏导，精心护理，病情好转，无发烧，无身体不适，经反复连续核酸检测均为阴性，经专家组评估，符合国家卫生健康委新型冠状病毒感染的肺炎确诊病例解除隔离和出院标准。\n','2020-02-11','ck6hgxcbg0097s27c9saa81at','人民网','江苏省','2020-02-04','http://m.weibo.cn/2286908003/4468332038697747','','南京2例确诊患者治愈出院','2020-02-11'),('从天津市疾控中心获悉，截至2月4日18时，天津市新增新型冠状病毒肺炎确诊病例1例，累计确诊病例67例。截至目前，天津市累计报告新型冠状病毒肺炎确诊病例67例，其中男性37例，女性30例；危重型4例，重型17例，普通型44例，治愈出院2例。\n','2020-02-11','ck6hgxcbg0098s27chd7mdiit','人民网','天津市','2020-02-04','http://m.weibo.cn/2286908003/4468346382693395','','天津新增1例，累计67例','2020-02-11'),('2月4日，上海市卫生健康委党组副书记郑锦介绍7个月大婴儿感染新冠肺炎过程：女婴的外公外婆1月20日从武汉来沪，1月21日、1月24日家庭聚会，1月25日社区卫生中心接到两人申报后核实，1月26日将两人纳入重点地区来沪人员管理。当时女婴与外公外婆住在一起。2月2日爷爷被确诊，女婴父母外公外婆被密切观察。当天多人出现症状，2月3日经诊断，女婴及母亲、外公为确诊病例，父亲、奶奶、外婆核酸阴性，继续落实隔离观察。目前，女婴及其母亲、外公都在定点医院接受治疗，病情平稳。\n','2020-02-11','ck6hgxcbg0099s27cak0d8qy1','人民网','上海市','2020-02-04','http://m.weibo.cn/2286908003/4468316611599246','','上海7个月大婴儿确诊','2020-02-11'),('随着疫情发展，12306推出多项新举措，包括首次在全国范围内免收退票费，延长退票时限至3月25日，购票人需提供手机号等。考虑目前旅客日发送量不足200万人次，春运返程运输中，12306还在进行新的系统调整，将考虑推出“隔号售票”，实现旅客分隔而座，降低疫情传播风险。\n','2020-02-11','ck6hgxcbg009as27cfbkdb3kn','人民网','全国','2020-02-04','http://m.weibo.cn/2286908003/4468310475086913','','应对疫情，12306考虑推出隔号售票','2020-02-11'),('2月4日，天津市第二例新型冠状病毒感染的肺炎确诊患者出院 。患者为男性，因间断发热就医，被确认为新型冠状病毒感染的肺炎确诊病例后，进入天津海河医院进行救治。经全力救治，患者病情持续改善，临床症状得到有效控制，肺部影像学较前明显吸收，2次核酸检测阴性，经专家组评估，达到出院标准。\n','2020-02-11','ck6hgxcbg009bs27c0pj9aq45','人民网','天津市','2020-02-04','http://m.weibo.cn/2286908003/4468309443407640','','天津第二例新冠肺炎确诊患者出院','2020-02-11'),('今天下午，北京市召开疫情防控新闻发布会。北京市发改委、北京市人力社保局、北京市金融局、北京市卫健委等有关单位将发布最新信息，并答记者问。看直播，关注！（总台央视记者王丰） \n','2020-02-11','ck6hgxcbg009cs27c46s909ai','央视新闻','北京市','2020-02-04','http://m.weibo.cn/2656274875/4468275381724420','','正直播！北京市疫情防控工作新闻发布会','2020-02-11'),('科技部生物中心副主任孙燕荣：在药物研发方面，提高治愈率，降低死亡率是应急攻关的重中之重。新药研发是一个非常漫长的过程，突如其来的疫情让我们没有办法按照新药研发的传统规律来开展工作，科技部第一时间组织相关专家进行攻关，已经取得了一定成绩，发现了磷酸氯喹、法匹拉韦以及中成药中一批具有抗病毒活性的上市药物。 （人民日报的微博视频）\n','2020-02-11','ck6hgxcbg009ds27c7p6zbjir','人民日报','全国','2020-02-04','http://m.weibo.cn/2803301701/4468276812060095','','专家通报：疫情药物研发最新情况','2020-02-11'),('截至2月4日12时，全省累计报告新型冠状病毒感染的肺炎确诊病例813例。4日0-12时全省新增确诊病例16例。新增确诊病例中，广州市8例、湛江市3例、佛山市3例、深圳市2例。另有疑似病例199例。有2999名密切接触者正在接受医学观察。@人民网','2020-02-11','ck6hgxcbg009es27c89l8gy0q','人民网','广东省','2020-02-04','http://m.weibo.cn/2286908003/4468296047129077','','广东新增 16 例累计 813 例','2020-02-11'),('在重症病房救治28天后，57岁的危重型新冠肺炎患者李婆婆，又“活了过来”。2月4日，家人将已确认符合出院标准的她从武汉大学人民医院重症医学科接出，出院回家隔离恢复。@人民日报\n','2020-02-11','ck6hgxcbg009fs27cdiyc55h8','人民网','湖北省','2020-02-04','http://m.weibo.cn/2286908003/4468295455327121','','好消息！武汉 2 例危重患者出院','2020-02-11'),('近日，华中科技大学附属协和医院西院妇产科为一名感染新型冠状病毒肺炎的孕妇顺利娩下7斤2两的男宝宝。此例感染新型冠状病毒肺炎的产妇经阴道分娩的成功经验，对全国其他医院开展疑似或感染新型冠状病毒肺炎孕妇的治疗具有借鉴意义。（湖北之声）\n','2020-02-11','ck6hgxcbg009gs27c8ysth4n8','人民日报','湖北省','2020-02-04','http://m.weibo.cn/2803301701/4468285502786565','','好消息！感染新冠病毒孕妇成功分娩','2020-02-11'),('继2月1日哈尔滨首批两例治愈患者出院后，4日下午16时许，黑龙江省传染病防治院两名新型冠状病毒感染的肺炎确诊患者经过治疗后，经过两次核酸检测和专家会诊，确认为治愈，可以解除隔离，出院居家休养。\n','2020-02-11','ck6hgxcbh009hs27ca4hr4tr0','人民网','黑龙江省','2020-02-04','http://m.weibo.cn/2286908003/4468280922141063','','好消息！黑龙江新增出院病例 2 例','2020-02-11'),('3日0时至24时，北京市新增16例新型冠状病毒感染的肺炎病例，其中6例有湖北及其他省份接触史，10例为确诊病例的密切接触者。均已送至定点医疗机构进行救治。截至3日24时，北京市累计确诊病例228例。（总台央视记者张伟泽）\n','2020-02-11','ck6hgxcbh009is27cav4p03fk','央视新闻','北京市','2020-02-04','http://m.weibo.cn/2656274875/4468280234366868','','北京新增 16 例累计确诊 228 例','2020-02-11'),('【直播：人民战 “疫”特别直播 #你守护大家我守护你#】《人民战“疫”》特别直播节目今天重点关注火神山医院收治首批患者，平凡英雄支援一线，河南小汤山基本成型，各地全力保障防控期间市民菜篮子和办公场所防疫工作指南。敬请关注↓↓#万众一心抗击疫情# 人民网的微博直播 . \n','2020-02-11','ck6hgxcbh009qs27c9iva55h7','人民网','全国','2020-02-04','http://m.weibo.cn/2286908003/4468274919834711','','人民战 “疫”特别直播 ：你守护大家我守护你','2020-02-11'),('#卫健委发布会#【#确诊病例绝大多数是轻症#】国家卫健委医政医管局副局长焦雅辉：首先我想强调一点，此次新型冠状病毒感染的肺炎的患者绝大多数是轻症。大家不要因今天发布会主要谈的重症患者救治，就认为我们患者当中都是重症，产生恐慌或恐惧，这一点是想跟大家传递的一个信号。 央视新闻的微博视频\n','2020-02-11','ck6hgxcbh009ss27cdt94gbk7','央视新闻','全国','2020-02-04','http://m.weibo.cn/2656274875/4468264660590606','','卫健委发布会：确诊病例绝大多数是轻症','2020-02-11'),('#新冠肺炎最新动态#【国家卫健委：#死亡病例以高龄老人为主#】 国家卫健委医政医管局副局长焦雅辉：死亡病例以高龄为主，男性占2/3，女性占1/3，80%以上都是60岁以上的老年人，且多数有一种以上的心脑血管、糖尿病等基础疾病。她表示：这些有基础疾病的老年人只要感染了肺炎，它就是一种高危因素，它的病死率本身也是很高，并不是说因为感染了新型冠状病毒肺炎病死率才会高。 人民网的微博视频\n','2020-02-11','ck6hgxcbh009ts27c5wqsgcui','人民网','全国','2020-02-04','http://m.weibo.cn/2286908003/4468272201848670','','国家卫健委：死亡病例以高龄老人为主','2020-02-11'),('#新冠肺炎最新动态#【#全国确诊病例病死率2.1%#】2月4日，国家卫生健康委发布会上，国家卫健委医政医管局副局长焦雅辉表示，截至到3日晚24时，全国确诊病例的病死率是2.1%。湖北省3.1%，武汉市4.9%，湖北省死亡病例占全国97%。除湖北省外，其他省病死率0.16%。 人民网的微博视频 \n','2020-02-11','ck6hgxcbi009us27cahuwe0vd','人民网','全国','2020-02-04','http://m.weibo.cn/2286908003/4468268209785404','','全国确诊病例病死率 2.1%','2020-02-11'),('#新冠肺炎最新动态#【#山东新增5例累计275例#】2020年2月4日0—12时，山东省报告新型冠状病毒感染的肺炎新增确诊病例5例，累计确诊病例275例(含重症病例20例，危重症病例3例，出院9例，无死亡病例);新增疑似病例12例，现有疑似病例73例。截至目前，追踪到密切接触者9152人，已解除医学观察2927人，诊断为疑似或确诊128例，尚有6097人正在接受医学观察。（山东卫健委）网页链接\n','2020-02-11','ck6hgxcbi009vs27cb98wesof','人民网','山东省','2020-02-04','http://m.weibo.cn/2286908003/4468264514299666','','山东新增 5 例累计 275 例','2020-02-11'),('#新冠肺炎最新动态#【#辽宁新增3例累计77例#】2020年2月3日19时至2月4日15时，辽宁省新增3例新型冠状病毒感染的肺炎确诊病例，其中大连市1例，阜新市2例，均属普通型病例。截至2020年2月4日15时，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例77例，重型病例6例，大连市治愈出院1例。77例确诊病例中，沈阳市15例、大连市13例、鞍山市1例，本溪市3例、丹东市6例、锦州市7例、营口市1例、阜新市7例，辽阳市2例、铁岭市3例、朝阳市6例、盘锦市8例、葫芦岛市5例。目前76名在治患者均在定点医疗机构隔离治疗，病情平稳。76名在治患者中，59例病例为输入性病例，17例病例为本地感染病例。目前累计追踪到密切接触者1391人，已解除医学观察326人，现有1064人正在接受医学观察，正在追踪1人。（辽宁卫健委）网页链接\n','2020-02-11','ck6hgxcbi009ws27c6d0t0zup','人民网','辽宁省','2020-02-04','http://m.weibo.cn/2286908003/4468264959196072','','辽宁新增 3 例累计 77 例','2020-02-11'),('#新冠肺炎最新动态#【#云南新增2例累计119例#】2月4日0时至12时，云南省报告新型冠状病毒感染肺炎新增病例2例（曲靖市1例、楚雄州1例）。全省累计报告确诊病例119例，除治愈出院者外，现均在定点医院接受隔离治疗。现有危重3例，重症13例，治愈出院5例，疑似病例160例，密切接触者医学观察3788人，无死亡病例。确诊病例中，昆明市34例、西双版纳州13例、玉溪市12例、昭通市9例、曲靖市9例、保山市8例、大理州7例、丽江市7例、红河州5例、德宏州5例、普洱市4例、楚雄州4例、文山州1例、临沧市1例。（云南卫健委）网页链接\n','2020-02-11','ck6hgxcbi009xs27c0wbi0tab','人民网','云南省','2020-02-04','http://m.weibo.cn/2286908003/4468261535881668','','云南新增 2 例累计 119 例','2020-02-11'),('#万众一心抗击疫情#【直播：国家卫健委2月4日新闻发布会】2月4日下午，国家卫健委召开新闻发布会，介绍新型冠状病毒感染的肺炎疫情防控工作有关情况，敬请关注。#民民直播#  人民网的微博直播 . \n','2020-02-11','ck6hgxcbi009ys27c20tb50ow','人民网','全国','2020-02-04','http://m.weibo.cn/2286908003/4468259955188674','','直播：国家卫健委 2 月 4 日新闻发布会','2020-02-11'),('【#湖北省红十字会3名领导被问责#】针对反映湖北省红十字会在捐赠款物接收分配中的有关问题，湖北省纪委监委迅速开展调查核实工作。经调查，省红十字会有关领导和干部在疫情防控期间接收和分配捐赠款物工作中存在不担当不作为、违反“三重一大”规定、信息公开错误等失职失责问题，经湖北省纪委监委研究并报省委批准，决定免去张钦省红十字会党组成员、专职副会长职务，并给予其党内严重警告、政务记大过处分；给予省红十字会党组成员陈波党内严重警告、政务记大过处分；给予省红十字会党组书记、常务副会长高勤党内警告处分。省红十字会其他责任人员按照干部管理权限由有关党组织依纪依规处理。（湖北省纪律检查委员会）网页链接\n','2020-02-11','ck6hgxcbi009zs27can6khct8','人民网','湖北省','2020-02-04','http://m.weibo.cn/2286908003/4468256037742888','','湖北省红十字会 3 名领导被问责','2020-02-11'),('#共同战疫#【正直播！#上海疫情防控发布会#】今天下午，上海市政府举行疫情防控工作新闻发布会，邀请市卫生健康委、市医保局、市药监局、宝山区负责人出席并介绍情况。看直播，关注！（总台央视记者魏然）\n','2020-02-11','ck6hgxcbi00a0s27c2cf1g4u3','央视新闻','上海市','2020-02-04','http://m.weibo.cn/2656274875/4468245543326839','','正直播！上海疫情防控发布会','2020-02-11'),('#新冠肺炎最新动态#【急寻同乘人员！#四川一确诊病例21日四次乘车#并待候车室超两小时】2月4日，四川省广元市卫生健康委发布2020年2月3日新增确诊病例交通行程信息，请同乘人员注意。确诊病例：侯某某，于2020年1月21日从武汉站乘动车（D627次10号车厢）于14:05时到重庆北站，在候车室（人流量极大）停留2小时后，16：29从重庆乘坐动车（D753次03车厢）于18：22到达阆中，在阆中站台候车22分钟后，乘坐高铁（G2851次2号车厢）于18:58时到达苍溪火车站，出站后19:03乘坐5路公交车（车牌号川H22543）于19:21至苍溪县汽车站，再转电动三轮车回到苍溪县陵江镇龙江世纪小区家中。@人民日报\n','2020-02-11','ck6hgxcbi00a1s27cbnp2aofx','人民网','四川省','2020-02-04','http://m.weibo.cn/2286908003/4468240488720439','','急寻同乘人员！四川一确诊病例 21 日四次乘车','2020-02-11'),('【#福建170人因疫情防控不力被处理#】福建省纪委监委通报，疫情发生以来严肃依规依纪依法追责问责疫情防控工作不力问题，共查处100起、处理170人，其中给予党纪政务处分12人。通报指出，疫情防控哪怕一节脱链、一棒失手，都可能对人民群众的生命安全和身体健康造成不可挽回的重大损失。（福建省纪委监委网站）网页链接\n','2020-02-11','ck6hgxcbi00a2s27c3ggt5yfn','人民网','福建省','2020-02-04','http://m.weibo.cn/2286908003/4468236022078181','','福建 170 人因疫情防控不力被处理','2020-02-11'),('【#西藏连续5天无新增病例#】截至2020年2月3日24时，西藏自治区累计报告新型冠状病毒感染的肺炎确诊病例1例，重症病例0例，死亡病例0例，出院病例0例。目前，患者生命体征平稳，追踪到的密切接触者正在接受医学观察。据了解，这是西藏自治区连续第5天没有新增确诊病例或疑似病例的报告。（邓建胜）\n','2020-02-11','ck6hgxcbi00a3s27c2bth23au','人民日报','西藏自治区','2020-02-04','http://m.weibo.cn/2803301701/4468225427438314','','西藏连续 5 天无新增病例','2020-02-11'),('#万众一心抗击疫情#【#民航局要求确保国际航班不断航#】受新型冠状病毒疫情影响，国际航空市场需求锐减，部分国家对我国公民出入境实施了限制措施。目前已有46家外国航空公司宣布暂停往来中国大陆的航班。为满足特殊时期旅客出入境和物资国际运输需求，民航局要求国内各航空公司在考虑市场需求取消部分航班的同时，除对方国家实施航行限制措施外，要确保通航国家不断航。@新华视点\n','2020-02-11','ck6hgxcbi00a4s27cdzho9a45','人民网','全国','2020-02-04','http://m.weibo.cn/2286908003/4468219676738403','','民航局要求确保国际航班不断航','2020-02-11'),('2月3日，广东中山首批一家3口确诊病例治愈出院，系一对夫妻加上一位11个月大的婴儿。此次治愈出院的3人中，患者温某，男性，36岁，2020年1月10-12日到武汉市出差，17日发病，21日来中山，住石岐区，23日收入定点医疗机构隔离治疗。患者冯某，女，42岁，住石岐区，是之前确诊病例温某的妻子。另有患者温某（11个月）是前述温某和冯某的小孩。','2020-02-11','ck6hgxcbi00a5s27c7ur6ajgs','人民网','山东省','2020-02-04','http://m.weibo.cn/2286908003/4468207354295406','','好消息！广东中山11月大婴儿及其父母治愈出院','2020-02-11'),('2月3日0—24时，福建省报告新增新型冠状病毒感染的肺炎确诊病例15例。其中福州市6例（仓山区2例、晋安区2例、闽清县1例、福清市1例）；厦门市1例（思明区1例）；泉州市4例（惠安县1例、晋江市2例、南安市1例）；莆田市3例（城厢区3例）；龙岩市1例（永定区1例）。新增治愈出院病例1例。截至2月3日24时，福建省累计报告新型冠状病毒感染的肺炎确诊病例194例（危重症7例、重症15例，无死亡病例）累计治愈出院病例1例。现有报告新型冠状病毒感染的肺炎疑似病例共87例。','2020-02-11','ck6hgxcbi00a6s27c3j966o8x','人民网','福建省','2020-02-04','http://m.weibo.cn/2286908003/4468203608678153','','福建新增15例，累计194例','2020-02-11'),('当地时间2月3日，世界银行表示，对感染新型冠状病毒的所有人感到同情。世界银行认为，中国政府方面有充足的政策空间来应对这一疫情，并且为市场注入了相当大规模的流动性，这些举措能够缓和疫情给中国经济增长带来的损失。国际货币基金组织IMF总裁克里斯塔利娜·格奥尔基耶娃2月3日表示，对新型冠状病毒感染的肺炎疫情表示诚挚慰问，我们支持最近一段时间以来中国政府在应对这一疫情方面采取的措施，包括财政、货币和金融领域。中国经济继续展现出极强的韧性，我们对此充满信心。','2020-02-11','ck6hgxcbi00a7s27c5vma3o23','人民日报','','2020-02-04','http://m.weibo.cn/2803301701/4468196902095482','','世界银行和IMF发声：对中国经济充满信心','2020-02-11'),('截至2020年2月4日9时，内蒙古自治区累计报告新型冠状病毒感染的肺炎确诊病例35例，其中：呼和浩特市4例(新城区2例、玉泉区1例、赛罕区1例)，包头市6例（昆都仑区3例、土右旗3例），呼伦贝尔市3例（满洲里市1例已痊愈出院、牙克石市1例、莫力达瓦旗1例），兴安盟乌兰浩特市1例，通辽市经济开发区1例，赤峰市2例（松山区1例、林西县1例），锡林郭勒盟2例（锡林浩特市1例，二连浩特市1例），乌兰察布市3例（四子王旗1例，化德县2例），鄂尔多斯市9例（东胜区1例、鄂托克前旗1例、达拉特旗7例），巴彦淖尔市3例（五原县2例、临河区1例），乌海市海勃湾区1例。','2020-02-11','ck6hgxcbj00a8s27c7ccueh9s','人民网','内蒙古自治区','2020-02-04','http://m.weibo.cn/2286908003/4468192527099534','','内蒙古累计确诊35例','2020-02-11'),('今天，据香港媒体报道：香港一名39岁的新型冠状病毒男性感染者死亡。该患者系香港出现新型冠状病毒肺炎疫情以来的首例死亡病例。据香港卫生部门消息，截至昨天中午12时，香港共确诊15例病例，仍有159人住院接受进一步检查。','2020-02-11','ck6hgxcbj00a9s27c15tmatzf','人民网','香港','2020-02-04','http://m.weibo.cn/2286908003/4468194464764798','','香港出现首例死亡病例：39岁男性患者死亡','2020-02-11'),('截至2月4日10时，陕西新增14例新型冠状病毒感染的肺炎确诊病例，新增重症患者1例，新增疑似病例53例。新增确诊病例中，西安市5例、宝鸡市2例、咸阳市2例、汉中市1例、商洛市3例、杨凌示范区1例。陕西累计报告新型冠状病毒感染的肺炎确诊病例142例（1例治愈出院），其中输入性病例94例，密切接触者42例，无明确接触史病例6例。','2020-02-11','ck6hgxcbj00aas27ce26yemxw','人民网','陕西省','2020-02-04','http://m.weibo.cn/2286908003/