例425例，累计治愈出院病例632例，现有疑似病例23214例。目前累计追踪到密切接触者221015人，当日解除医学观察12755人，现有171329人正在接受医学观察。累计收到港澳台地区通报确诊病例33例：香港特别行政区15例，澳门特别行政区8例，台湾地区10例。','2020-02-11','ck6hgxcbl00azs27c2bmz864m','人民网','全国','2020-02-03','http://m.weibo.cn/2286908003/4468153403207573','','全国新增3235例，累计确诊20438例','2020-02-11'),('2月3日12时至24时，云南省报告新型冠状病毒感染肺炎新增病例3例（曲靖市2例、昆明市1例）。全省累计报告确诊病例117例，现有危重3例，重症7例，治愈出院5例，疑似病例225例，无死亡病例。密切接触者当日解除医学观察345人，正在观察3936人。','2020-02-11','ck6hgxcbl00b0s27c57k89ltz','人民网','云南省','2020-02-03','http://m.weibo.cn/2286908003/4468148525319080','','云南新增3例累计117例','2020-02-11'),('2020年2月3日12—24时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例25例，新增出院病例1例。彭水县为报告首例确诊病例。截至2月3日24时，重庆市累计报告新型冠状病毒感染的肺炎确诊病例337例；现有重型病例23例，危重型病例6例，死亡病例2例，出院病例9例。累计追踪到密切接触者9733人，已解除医学观察2988人，尚有6745人正在接受医学观察。','2020-02-11','ck6hgxcbl00b1s27c1gco7yt3','人民日报','重庆市','2020-02-03','http://m.weibo.cn/2803301701/4468144905357426','','重庆新增确诊25例，累计确诊337例','2020-02-11'),('2月3日晚间，四川雅安市应对新型冠状病毒感染肺炎疫情应急指挥部办公室发布通告称，一69岁确诊患者治疗中多次隐瞒自己途径武汉汉口返回雅安事实，致治疗中30多名医护密切接触。经雅安市应对新冠肺炎应急指挥部研究决定，责成市县公安、卫生健康、监委等部门负责，按照《中华人民共和国刑法》《中华人民共和国传染病防治法》《中华人民共和国治安管理处罚法》《最高人民法院、最高人民检察院关于办理妨害预防、控制突发传染病疫情等灾害的刑事案件具体应用法律若干问题的解释》等相关法律法规、司法解释和省、市指挥部通告要求，对侯某进行专项调查，查实后依法依规从严惩处；责成天全县对该事件过程中干部是否尽责、精准排查是否到位等情况进行倒查，对失职人员严肃问责。','2020-02-11','ck6hgxcbl00b2s27cayxbbge6','人民网','四川省','2020-02-03','http://m.weibo.cn/2286908003/4468025111600415','','四川雅安一69岁男子隐瞒行程致30多名医护人员密切接触','2020-02-11'),('国家卫生健康委专家组成员蒋荣猛表示，到目前为止，我们还没有发现有宠物感染冠状病毒再传给人的，也没发现病人感染了冠状病毒以后，让家中的猫和狗发病的。病毒有种属屏障，不是随便可以跨越。 ','2020-02-11','ck6hgxcbl00b3s27c8h3uf0pr','央视新闻','全国','2020-02-03','http://m.weibo.cn/2656274875/4468030367126478','','没有发现宠物与人互相传染新型冠状病毒','2020-02-11'),('3日晚，武汉市新型冠状病毒感染的肺炎疫情防控指挥部视频调度会透露，武汉市将在洪山体育馆、武汉客厅、武汉国际会展中心建设“方舱医院”，用于收治新型冠状病毒感染的肺炎轻症患者。据悉，位于武汉国际会展中心的“方舱医院”将设有1000张床位。','2020-02-11','ck6hgxcbl00b4s27c121f935u','人民日报','湖北省','2020-02-03','http://m.weibo.cn/2803301701/4468049672987327','','武汉将建3个方舱医院收治轻症患者','2020-02-11'),('2月4日，杭州市人民政府发布关于实施“防控疫情，人人有责” 十项措施的通告。措施包括：全市所有村庄、小区、单位实行封闭式管理，人员进出一律测温，并出具有效证件；近14天有疫情重点地区旅居史的市外返回人员，须在1小时内报告；非涉及居民生活必需的公共场所一律关闭；除特殊需要外，倡导每户家庭每两天指派1名家庭成员外出采购生活物资；严禁各单位在2月9日之前通知疫情重点地区人员返杭，除经批准同意的企业外，一律不得开（复）工。','2020-02-11','ck6hgxcbl00b5s27chmuv9fe1','人民日报','浙江省','2020-02-03','http://m.weibo.cn/2803301701/4468071944729093','','杭州所有村庄小区单位封闭式管理','2020-02-11'),('2020年2月3日0时至24时，山西省报告新型冠状病毒感染的肺炎新增确诊病例8例。其中：晋中市4例（平遥县4例），运城市3例（新绛县2例，河津市1例），晋城市1例（沁水县1例）。新增疑似病例21例。截至2月3日24时，山西省11个市累计报告新型冠状病毒感染的肺炎确诊病例74例。累计治愈出院2例，现有在院隔离治疗确诊病例72例，其中重症5例。现有疑似病例62例。\n','2020-02-11','ck6hgxcbl00b6s27caapd6mur','人民网','山西省','2020-02-03','http://m.weibo.cn/2286908003/4468138823586651','','山西新增8例累计确诊74例','2020-02-11'),('2020年2月3日0时-24时，湖北省新增新型冠状病毒感染的肺炎病例2345例。全省新增死亡64例 。新增出院101例。截至2020年2月3日24时，湖北省累计报告新型冠状病毒感染的肺炎病例13522例，已治愈出院396例，死亡414例。\n','2020-02-11','ck6hgxcbl00b7s27c5sr13lg4','央视新闻','湖北省','2020-02-03','http://m.weibo.cn/2656274875/4468135316891085','','湖北新增2345例累计确诊13522例','2020-02-11'),('#新冠肺炎最新动态# 【急求扩散！#急寻星梦邮轮世界梦号所有人员#】2月3日，广东省疾控中心传防所通报，根据最新调查，最新接报的数名新型冠状病毒感染者曾乘坐编号“WD05200119”的“星梦游轮-世界梦号”游轮。该游轮1月19日22:00由南沙码头（广州市南沙区龙穴大道南广州港南沙集装箱三期码头）出发，途径越南芽庄和岘港，1月24日8:30返回南沙码头。请该趟邮轮所有人员（含工作人员、同乘旅客等）第一时间联系居住城市的疾控中心进行报备，并配合疾控人员后续工作。急求扩散！急寻曾搭乘这趟“星梦游轮-世界梦号”游轮的乘客！\n','2020-02-11','ck6hgxcbl00b8s27c4ys323sm','人民网','广东省','2020-02-03','http://m.weibo.cn/2286908003/4468012696035994','','急寻星梦邮轮世界梦号所有人员','2020-02-11'),('【专家：#没有发现宠物传染新型冠状病毒#】北京地坛医院感染二科主任医师蒋荣猛表示：感染人的病毒并不意味着能感染其他动物。目前为止没有发现宠物感染冠状病毒传播给人，也没有发现病人传染给猫和狗发病的情况。 人民日报的微博视频 \n','2020-02-11','ck6hgxcbl00b9s27ca73t372z','人民日报','全国','2020-02-03','http://m.weibo.cn/2803301701/4468006199043880','','专家：没有发现宠物传染新型冠状病毒','2020-02-11'),('#万众一心抗击疫情#【#武汉雷神山医院总体完成80%#】截至3日中午12时，武汉雷神山医院总体完成80%。隔离病房区完成总体工作量的75%。其中，基础施工全部完成，箱板房完成吊装1903间，地板胶施工完成至1000间，卫生间贴砖完成200间，房间内安装及装修同步施工；医技楼钢结构安装完成90%；液氯加药间、垃圾处理站、液氧站、正负压站房、垃圾暂存间等设备基础完成，污水处理站安装完成。@人民网湖北频道 人民网的秒拍视频\n','2020-02-11','ck6hgxcbl00bas27c2t06dqo7','人民网','湖北省','2020-02-03','http://m.weibo.cn/2286908003/4468003154838873','','武汉雷神山医院总体完成 80%','2020-02-11'),('【#钟南山释疑疫情防控#】钟南山：①部分病人粪便检测核酸阳性，应高度关注；②火神山医院的作用是，缓解现有定点医院的压力；③确诊人数或仍将持续升高，但不会太长；④没必要每次出门都换口罩，脱口罩时，手不触碰里面，就可以继续用……更多戳图↓↓ \n','2020-02-11','ck6hgxcbl00bbs27cgqxe443f','央视新闻','全国','2020-02-03','http://m.weibo.cn/2656274875/4467990806206788','','钟南山释疑疫情防控','2020-02-11'),('#共同战疫#【直播！#湖北疫情防控发布会#】今晚，湖北省召开第十三场疫情防控例行发布会，通报防控工作新进展。国家卫生健康委专家组成员出席并围绕疫情防控与治疗等问题回应社会关切。关注！（总台央视记者王伟超） 央视新闻的微博直播 . \n','2020-02-11','ck6hgxcbl00bcs27ccw5v532m','央视新闻','湖北省','2020-02-03','http://m.weibo.cn/2656274875/4467988214079119','','直播！湖北疫情防控发布会','2020-02-11'),('#新冠肺炎最新动态# 【#天津新增4例累计60例#】截至2月3日18时，天津市新增4例新型冠状病毒感染的肺炎确诊病例，累计确诊病例60例 。@天津健康 \n','2020-02-11','ck6hgxcbm00bds27c615x1xxu','人民网','天津市','2020-02-03','http://m.weibo.cn/2286908003/4467994472726888','','天津新增 4 例累计 60 例','2020-02-11'),('【#新型冠状病毒在适宜环境可存活5天#】国家卫生健康委专家组成员蒋荣猛表示，病毒从人体出来后会很快沉降，不会在空气中飘移。从这个意义讲，空气中不会有病毒。但病毒可能落在物体上，人可以通过手来接触到病毒。病毒在光滑的物体表面能存活数小时，温度湿度合适的环境能存活1天，有发现可达到5天。 \n','2020-02-11','ck6hgxcbm00bes27c8wls2hw4','央视新闻','全国','2020-02-03','http://m.weibo.cn/2656274875/4467999341952261','','新型冠状病毒在适宜环境可存活 5 天','2020-02-11'),('【#一女子聚餐后去祈福25人感染#：包括丈夫女儿和同车者】3日，#宁波通报三起聚集性疫情#。其中，患者胡某1月17日晚上参加有武汉人参与的聚餐，19日乘车往返一寺院参加祈福活动，当天自感畏寒、发热，未及时就诊。随后，该女子及其丈夫、女儿均确诊为新型冠状病毒感染的肺炎确诊病例。截至2月2日24时，参加该次祈福活动的人员和部分病例的密切接触者中，已有25人确诊为新型冠状病毒感染的肺炎。','2020-02-11','ck6hgxcbm00bfs27ccuza57db','人民日报','浙江省','2020-02-03','http://m.weibo.cn/2803301701/4467964520981997','','宁波通报 3 起聚集性疫情','2020-02-11'),('天津市新型冠状病毒感染的肺炎疫情防控工作指挥部决定，进一步提升天津“小汤山”海河医院的接诊能力，加快天津市海滨人民医院、天津医科大学总医院空港医院、天津市津南医院（新址）作为天津市新型冠状病毒感染的肺炎救治定点医院的建设，4家医院累计床位将达到2130张。（人民日报记者朱虹）\n','2020-02-11','ck6hgxcbm00bgs27c91rmaj8a','人民日报','天津市','2020-02-03','http://m.weibo.cn/2803301701/4467948141570263','','天津再备3座小汤山','2020-02-11'),('2月3日北京市新型冠状病毒感染的肺炎疫情防控工作新闻发布会上，北京市疾控中心副主任贺雄针对复兴医院出现的聚集性疫情介绍说，聚集性疫情是指14天内在小范围发现2例及以上的病例，且存在因密切接触导致的人际传播的可能性，或因共同暴露而感染的可能性。目前，全市共报告聚集性病例41起，涉及病例124人，占确诊病例50%以上。','2020-02-11','ck6hgxcbm00bks27c21n49o99','人民日报','北京市','2020-02-03','http://m.weibo.cn/2803301701/4467931134263502','','北京共报告聚集性病例41起，涉及确诊病例124人','2020-02-11'),('2月3日北京市新型冠状病毒感染的肺炎疫情防控工作新闻发布会上，西城区副区长缪剑虹说，复兴医院心内科重症监护室出现聚集性病例，确诊9例，其中医护人员5例，住院患者4例，目前已经转到定点医院治疗，以轻症为主。初步调查，与个别医务人员受感染有关，具体原因进行流调和排查中。\n','2020-02-11','ck6hgxcbm00bls27c8svz2esn','人民日报','北京市','2020-02-03','http://m.weibo.cn/2803301701/4467923999936567','','北京复兴医院现9人感染聚集性病例','2020-02-11'),('北京市又有3例新型冠状病毒感染的肺炎患者，经过医护人员精心治疗后，符合出院标准，已于2日17时从佑安医院出院。3名患者中，年龄最小的38岁，最大年龄68岁，平均住院天数9.3天。\n','2020-02-11','ck6hgxcbp00bms27cg12q545l','人民网','北京市','2020-02-03','http://m.weibo.cn/2286908003/4467923277902688','','北京3名患者出院','2020-02-11'),('2月2日12时至24时，北京市新增24例新型冠状病毒感染的肺炎病例。截至2月2日24时，北京市累计确诊病例212例（核减3例）。截至2月2日24时，北京市死亡1例，出院12例，199例在定点医院进行隔离治疗，其中危重型11例。\n','2020-02-11','ck6hgxcbp00bns27c32o9d7p7','人民网','北京市','2020-02-03','http://m.weibo.cn/2286908003/4467921260223857','','北京新增24例，累计212例','2020-02-11'),('截至2月3日12时，广东省累计报告新型冠状病毒感染的肺炎确诊病例725例。3日0-12时全省新增确诊病例42例。有2680名密切接触者正在接受医学观察。截至2月3日12时，在院的711确诊病例中,危重22例，重症58例，普通型631例。累计出院14例。无死亡病例。\n','2020-02-11','ck6hgxcbp00bos27cb5ve72g1','人民网','广东省','2020-02-03','http://m.weibo.cn/2286908003/4467918437532029','','广东新增42例，累计725例','2020-02-11'),('2020年2月3日0—12时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例12例，新增出院病例1例。截至2月3日12时，重庆市累计报告新型冠状病毒感染的肺炎确诊病例312例。累计追踪到密切接触者8718人，已解除医学观察2192人，尚有6526人正在接受医学观察。','2020-02-11','ck6hgxcbp00bps27c0k9pa0ln','人民网','重庆市','2020-02-03','http://m.weibo.cn/2286908003/4467915196075079','','重庆新增12例，累计确诊312例','2020-02-11'),('2月3日下午15时35分，经过自治区专家诊疗组和医护人员14天精心诊治和护理，宁夏首例确诊的新型冠状病毒感染的肺炎患者治愈出院。这也是新型冠状病毒感染的肺炎疫情出现以来，宁夏首个治愈患者。','2020-02-11','ck6hgxcbp00bqs27chadsfqfk','人民日报','宁夏回族自治区','2020-02-03','http://m.weibo.cn/2803301701/4467914256345310','','宁夏首例确诊患者治愈出院','2020-02-11'),('据山东省卫健委通报，2020年2月3日0—12时，山东省报告新型冠状病毒感染的肺炎新增确诊病例13例，累计确诊病例259例；新增疑似病例13例，现有疑似病例55例。截至目前，追踪到密切接触者8209人，已解除医学观察1733人，诊断为疑似或确诊111例，尚有6365人正在接受医学观察。\n','2020-02-11','ck6hgxcbp00brs27cdy20cqac','人民日报','山东省','2020-02-03','http://m.weibo.cn/2803301701/4467900997751855','','山东新增13例累计259例','2020-02-11'),('2月2日12时至24时，云南省报告新型冠状病毒感染肺炎新增病例4例。全省累计报告确诊病例109例，除治愈出院者外，现均在定点医院接受隔离治疗。密切接触者当日解除医学观察523人，正在观察3592人。','2020-02-11','ck6hgxcbp00bss27c0gfiam7v','人民网','云南省','2020-02-03','http://m.weibo.cn/2286908003/4467881599135005','','云南新增4例，累计109例','2020-02-11'),('2020年2月3日0—12时，上海市排除新型冠状病毒感染的肺炎疑似病例39例；新增确诊病例10例，其中1例7月龄，有来自湖北的确诊病例接触史。截至2月3日12时，上海市已累计排除疑似病例488例，发现确诊病例203例。','2020-02-11','ck6hgxcbp00bts27cblxkeyg6','央视新闻','上海市','2020-02-03','http://m.weibo.cn/2656274875/4467880730754571','','上海7个月婴儿被感染','2020-02-11'),('#新冠肺炎最新动态#【#天津新增2例累计56例#】截至2月3日10时，天津市新增2例新型冠状病毒感染的肺炎确诊病例，累计确诊病例56例 。@天津健康 \n','2020-02-11','ck6hgxcbq00bus27c8i859soc','人民网','天津市','2020-02-03','http://m.weibo.cn/2286908003/4467872862047035','','天津新增2例累计56例','2020-02-11'),('“从当前我省发现的疫情来看，聚集性疫情持续出现，截至目前，共发生12起。”海南省疾控中心专家组副组长陈言提醒公众，聚集性疫情主要以家庭成员为主，尤其是年龄大者多见。同时，海南出现低年龄组人群发病现象，最小年龄是3个月。','2020-02-11','ck6hgxcbq00bvs27ch15o02i1','人民日报','海南省','2020-02-03','http://m.weibo.cn/2803301701/4467859809992503','','海南发生12起聚集性疫情，最小感染者仅3个月','2020-02-11'),('2月2日0—24时，福建省报告新增新型冠状病毒感染的肺炎确诊病例20例。其中：福州市3例；厦门市1例；漳州市1例；泉州市2例；莆田市7例；南平市3例；宁德市3例。累计确诊179例。','2020-02-11','ck6hgxcbq00bws27c6kih20z7','人民网','福建省','2020-02-03','http://m.weibo.cn/2286908003/4467839081896969','','福建新增20例累计179例','2020-02-11'),('【好消息！#安徽首例确诊患者出院#】据@安徽日报 ，2月3日，经安徽医科大学附属巢湖医院医务人员精心诊治和护理，安徽首例确诊的新型冠状病毒感染的肺炎患者现已治愈出院。\n','2020-02-11','ck6hgxcbq00bys27c91k0419r','人民日报','安徽省','2020-02-03','http://m.weibo.cn/2803301701/4467854247970018','','安徽首例确诊患者出院','2020-02-11'),('#新冠肺炎最新动态#【好消息！#西藏已连续4天无新增病例#】截至2月2日24时，西藏自治区累计报告新型冠状病毒感染的肺炎确诊病例1例，重症病例0例，死亡病例0例，出院病例0例。目前，患者生命体征平稳，追踪到的密切接触者正在接受医学观察。因此，自1月29日确诊1例输入型新型冠状病毒感染的肺炎病例至2月2日，西藏自治区已经连续4天没有新增确诊病例或疑似病例报告。网页链接\n','2020-02-11','ck6hgxcbq00bzs27c51j7838x','人民网','西藏自治区','2020-02-03','http://m.weibo.cn/2286908003/4467855737237641','','西藏已连续4天无新增病例','2020-02-11'),('日前，广州市疾控中心在疫情监测中，在一名确诊患者家中门把手上发现了新型冠状病毒的核酸，这是广州首次在外环境中发现，提示市民应更注意手卫生。专家提醒，日常家居细节中，有许多可能造成病毒间接传播的途径：如手机屏幕、电脑键盘、水龙头等等，都需要日常清洁。\n','2020-02-11','ck6hgxcbs00c1s27cb0yx65z7','人民日报','广东省','2020-02-03','http://m.weibo.cn/2803301701/4467840704401415','','确诊病例门把手测出病毒核酸','2020-02-11'),('经中央军委批准，根据中部战区命令，驻鄂部队抗击疫情运力支援队2日正式抽组成立，开始承担武汉市民生活物资配送供应任务！致敬！一起战疫！尽快好起来！','2020-02-11','ck6hgxcbs00c3s27c5gtwg0u1','央视新闻','湖北省','2020-02-03','http://m.weibo.cn/2656274875/4467837189658480','','解放军承担武汉市民物资配送供应任务','2020-02-11'),('工业化信息化部总工程师田玉龙在新闻发布会上表示：2月1日，新型冠状病毒核酸检测试剂日产量已经达到了77.3万人份，是疑似患病者的40倍，已经基本满足要求。目前产能恢复值达到了百分之六七十，后期主要工作就是恢复产能。 \n','2020-02-11','ck6hgxcbs00c4s27c9m9f0ure','人民日报','全国','2020-02-03','http://m.weibo.cn/2803301701/4467833549373586','','核酸检测试剂产量是疑似患者40倍','2020-02-11'),('至2020年2月3日9时, 内蒙古自治区累计报告新型冠状病毒感染的肺炎确诊病例34例，其中：呼和浩特市4例(新城区2例、玉泉区1例、赛罕区1例)，包头市6例（昆都仑区3例、土右旗3例），呼伦贝尔市2例（满洲里市1例已痊愈出院、牙克石市1例），兴安盟乌兰浩特市1例，通辽市经济开发区1例，赤峰市2例（松山区1例、林西县1例），锡林郭勒盟2例（锡林浩特市1例，二连浩特市1例），乌兰察布市3例（四子王旗1例，化德县2例），鄂尔多斯市9例（东胜区1例、鄂托克前旗1例、达拉特旗7例），巴彦淖尔市3例（五原县2例、临河区1例），乌海市海勃湾区1例。　　疑似病例3例（呼伦贝尔市莫力达瓦旗1例、鄂尔多斯市达拉特旗1例、海勃湾区1例）。均在定点医院接受隔离治疗。排除疑似病例2例（呼和浩特市托克托县1例、呼伦贝尔市陈巴尔虎旗1例）。目前，追踪到的密切接触者1129人，尚在接受医学观察中。当日解除医学观察30人。\n','2020-02-11','ck6hgxcbt00c5s27c5sbn46ub','人民网','内蒙古自治区','2020-02-03','http://m.weibo.cn/2286908003/4467833168081585','','内蒙古累计确诊34例','2020-02-11'),('截至2月3日10时，陕西新增12例新型冠状病毒感染的肺炎确诊病例，新增疑似病例36例。新增确诊病例中，西安市8例、宝鸡市1例、铜川市1例、渭南市1例、安康市1例。陕西累计报告新型冠状病毒感染的肺炎确诊病例128例，其中输入性病例87例，密切接触者37例，无明确接触史病例4例。累计确诊病例中，西安市55例、宝鸡市8例、咸阳市9例、铜川市7例、渭南市6例、延安市7例、榆林市1例、汉中市15例、安康市17例、商洛市2例、韩城市1例。全省现有疑似病例205例。全省新增密切接触者1024人，累计5418人，均集中医学观察。新增解除密切接触者118人，累计解除密切接触者906人。\n','2020-02-11','ck6hgxcbt00c6s27c03hxh1t4','人民网','陕西省','2020-02-03','http://m.weibo.cn/2286908003/4467827265866286','','陕西新增12例累计128例','2020-02-11'),('2月3日，宁夏应对新型冠状病毒感染肺炎疫情工作指挥部发布最新全区新型冠状病毒感染的肺炎疫情通报。2月2日0时至24时，全区报告新增确诊病例3例，新增疑似病例4例。截至2月2日24时，全区累计报告确诊病例31例，其中银川市19例（兴庆区5例、金凤区8例、西夏区4例、永宁县2例）、吴忠市7例（利通区4例、红寺堡区3例）、固原市2例（原州区2例）、中卫市2例（沙坡头区2例）、宁东1例（宁东镇）；现有重症病例4例；共有疑似病例12例。目前累计追踪到密切接触者992人，正在接受集中或居家隔离医学观察。','2020-02-11','ck6hgxcbt00c7s27c6m9icwto','人民网','宁夏回族自治区','2020-02-03','http://m.weibo.cn/2286908003/4467825605382426','','宁夏新增3例累计31','2020-02-11'),('2020年2月2日0-24时，海南省报告新型冠状病毒感染的肺炎新增确诊病例7例，新增重症病例1例，新增死亡病例0例，1例重症病例转轻症病例，新增出院病例3例；新增确诊病例中，海口市2例、儋州市1例、琼海市1例、文昌市1例、昌江县2例；新增重症病例中，万宁市1例。截至2月2日24时，海南省累计报告新型冠状病毒感染的肺炎确诊病例7