出院6例，无死亡病例）；新增疑似病例28例，现有疑似病例62例。截至目前，追踪到密切接触者7825人，已解除医学观察1425人，诊断为疑似或确诊101例，尚有6299人正在接受医学观察。\n','2020-02-11','ck6hgxcbt00cfs27c7mbx1kwj','人民网','山东省','2020-02-03','http://m.weibo.cn/2286908003/4467804743028777','','山东新增16例累计确诊246例','2020-02-11'),('2月2日，四川省新型冠状病毒感染的肺炎病例确认专家组确认四川省新增新型冠状病毒感染的肺炎病例23例。截至2月2日24时，四川省累计报告新型冠状病毒感染的肺炎确诊病例254例，涉及21个市（州）。其中成都市77例、南充市26例、广安市21例、绵阳市17例、内江市12例、巴中市12例、达州市11例、攀枝花市10例、德阳市10例、自贡市9例、泸州市7例、宜宾市7例、甘孜州6例、凉山州6例、广元市5例、遂宁市5例、雅安市5例、眉山市3例、乐山市2例、资阳市2例、阿坝州1例。254名患者中，危重9人,死亡1人，治愈出院12人。正在接受医学观察6001人，当日解除医学观察288人。','2020-02-11','ck6hgxcbt00cgs27ccbvr7z8e','人民网','四川省','2020-02-03','http://m.weibo.cn/2286908003/4467802893277225','','四川新增23例累计254例','2020-02-11'),('2020年2月2日0-24时，江苏省报告新型冠状病毒感染的肺炎新增确诊病例35例。其中，南京市5例、无锡市4例、徐州市6例、苏州市6例、南通市2例、连云港市1例、淮安市5例、扬州市1例、泰州市4例、宿迁市1例。新增重症病例1例，新增出院病例1例。新增确诊病例中，14例有武汉旅居史，4例有湖北旅居史，11例有湖北以外地区旅居史，6例为此前确诊病例的密切接触者。年龄最大的72岁，最小的23岁。女性15人，男性20人。所有病例均已在定点医院救治，病情稳定。已追踪到密切接触者592人，均在接受隔离医学观察。截至2月2日24时，江苏省累计报告新型冠状病毒感染的肺炎确诊病例271例，其中，重症病例2例，出院病例7例。确诊病例中，南京市40例、无锡市23例、徐州市36例、常州市15例、苏州市44例、南通市19例、连云港市14例、淮安市18例、盐城市15例、扬州市14例、镇江市3例、泰州市21例、宿迁市9例；重症病例中，苏州市2例；出院病例中，南京市2例、苏州市3例、连云港市1例、淮安市1例。目前，江苏省追踪到密切接触者4584人，已解除医学观察280人，尚有4304人在接受医学观察。\n','2020-02-11','ck6hgxcbt00chs27c8ort2taz','人民日报','江苏省','2020-02-03','http://m.weibo.cn/2803301701/4467802330830290','','江苏新增35例，累计确诊271例','2020-02-11'),('2月2日0-24时，全省新增确诊病例8例，其中长春市4例，四平市3例，吉林市1例。截至2月2日24时，全省累计报告确诊病例31例，长春市治愈出院1例，现在院隔离治疗确诊病例30例。其中长春市16例，吉林市4例，四平市4例，延边州2例，松原市2例，通化市1例，公主岭市1例。在院治疗确诊病例有25例为普通病例，4例为重症病例,1例危重症病例。上述确诊病例的密切接触者1181人，正在隔离或居家医学观察1110人，已解除医学观察71人。　　病例1，女，1972年出生。系1月30日吉林省通报的确诊病例的妹妹。住址为长春市朝阳区崇智路694号。　　病例2，女，1940年出生。系1月30日吉林省通报的确诊病例的母亲。住址为长春市朝阳区崇智路694号。　　病例3，男，1996年出生。系病例1的儿子。住址为长春市朝阳区崇智路694号。　　病例4，男，1977年出生。系辽宁省盘锦市确诊病例的密切接触者。1月20日曾到居然之家太阳城店参加吉林省店长年会。1月21日乘C1007次列车（16车06F）自长春市到达敦化市。1月22日自行驾车返回长春市。住址为长春市绿园区西城国际公馆。　　病例5，女，1986年出生。曾去广东旅游，1月23日结束旅游乘CZ3749次航班（56A）自珠海市到达长春龙嘉机场，乘自家车返回吉林市。住址为吉林市丰满区中海紫御江城。　　病例6，男，1990年出生。1月18日由包头市乘Z352次列车（3车56号）至呼和浩特市，由呼和浩特市乘DR6562次航班（10F）至沈阳市，转乘T261次列车（16车36号）返回四平市。住址为四平市铁西区宏泰第一城二期。　　病例7，男，1938年出生（危重症病例），1月30日发病。其女儿为武汉返吉人员，目前没有发病。住址为四平市铁西区人防办小区。　　病例8，男，1987年出生。系1月27日吉林省通报的四平市确诊病例的密切接触者。住址为四平市铁西区和谐家园。　　2月2日0-24时，全省原有14例疑似病例转为确诊病例8例，排除1例，新增12例，现有疑似病例17例，已全部隔离治疗，目前正在进一步明确诊断。\n','2020-02-11','ck6hgxcbt00cis27c3szr6n5t','人民网','吉林省','2020-02-03','http://m.weibo.cn/2286908003/4467801119469321','','吉林新增8例累计31例','2020-02-11'),('2月2日0-24时，河南省新增新型冠状病毒感染的肺炎确诊病例73例,新增出院病例10例。新增确诊病例中，郑州市7例、平顶山市5例（含汝州市1例）、安阳市4例、新乡市4例、焦作市1例、许昌市2例、漯河市4例、南阳市8例（含邓州市1例）、商丘市6例（含永城市1例）、信阳市11例、周口市7例（含鹿邑县1例）、驻马店市12例、济源示范区2例。截至2月2日24时，全省累计报告新型冠状病毒感染的肺炎确诊病例566例，现有重症病例30例，现有危重病例14例，累计死亡病例2例，累计治愈病例14例。其中：确诊病例中，郑州市72例（含巩义市7例）、开封市11例（含兰考县4例）、洛阳市7例、平顶山市19例（含汝州市1例）、安阳市29例（含滑县1例）、鹤壁市8例、新乡市27例（含长垣市2例）、焦作市8例、濮阳市3例、许昌市15例、漯河市20例、三门峡市7例、南阳市84例（含邓州市15例）、商丘市50例（含永城市9例）、信阳市99例（含固始县9例）、周口市47例（含鹿邑县5例）、驻马店市58例（含新蔡县5例）、济源示范区2例。目前累计追踪到密切接触者12797人，2月2日已解除观察1424人，诊断为疑似26人，共有8250人正在接受医学观察。','2020-02-11','ck6hgxcbu00cjs27c8e1wcxi4','人民网','河南省','2020-02-03','http://m.weibo.cn/2286908003/4467801052214356','','河南新增73例确诊病例','2020-02-11'),('2020年2月2日0—24时，贵州省新型冠状病毒感染的肺炎新增8例确诊病例。其中，外地来黔人员5例、本省常住人口3例。贵阳市1例，遵义市3例，六盘水市1例，铜仁市3例。       截至2月2日24时，全省累计报告新型冠状病毒感染的肺炎病例46例。其中，外地来黔人员28例，本省常住人口18例；治愈出院2例，病情平稳34例，重症6例，危重症4例；男性26例，女性20例；年龄最大80岁，最小10岁；贵阳市7例（1例已治愈），遵义市8例，六盘水市9例，安顺市2例，毕节市4例，铜仁市6例（1例已治愈），黔东南4例，黔南州5例，黔西南州1例。现有疑似病例46例。       累计追踪密切接触者567人，13人转为确诊病例，3人转为疑似病例，已解除医学观察50人，尚在接受医学观察501人。','2020-02-11','ck6hgxcbu00cks27c93f97rto','人民网','贵州省','2020-02-03','http://m.weibo.cn/2286908003/4467800397670172','','贵州新增8例累计确诊46例','2020-02-11'),('2020年2月2日0-24时，天津报告新型冠状病毒感染的肺炎新增确诊病例7例，新增出院病例1例，累计报告确诊病例48例。\n','2020-02-11','ck6hgxcbu00cls27c0vqp4h1k','人民网','天津市','2020-02-03','http://m.weibo.cn/2286908003/4467800170960310','','天津新增7例累计48例','2020-02-11'),('2020年2月2日0-24时，安徽省报告新增确诊病例68例，新增疑似病例75例，新增治愈出院2例。       新增确诊病例中，合肥16例、淮北2例、亳州9例、宿州7例、蚌埠11例、阜阳6例、淮南1例、滁州2例、六安7例、马鞍山1例、铜陵2例、安庆4例，均病情平稳。       新增疑似病例中，合肥6例、淮北8例、亳州4例、宿州3例、蚌埠6例、阜阳11例、淮南1例、滁州4例、六安17例、芜湖3例、铜陵1例、池州2例、安庆9例。新增治愈出院病例中，芜湖1例、宣城1例。       截至2月2日24时，安徽省累计报告确诊病例408例，累计治愈出院病例7例，无死亡病例。确诊病例中，合肥75例、淮北8例、亳州39例、宿州21例、蚌埠37例、阜阳65例、淮南7例、滁州8例、六安20例、马鞍山28例、芜湖16例、宣城4例、铜陵18例、池州6例、安庆47例、黄山9例。       截至2月2日24时，安徽省在院治疗确诊病例401例，其中危重病例4例。       2月3日即将治愈出院7例，其中合肥3例、滁州2例、池州1例、铜陵1例。       累计医学观察密切接触者8975人。\n','2020-02-11','ck6hgxcbu00cms27cbevqcuz7','人民网','安徽省','2020-02-03','http://m.weibo.cn/2286908003/4467799684112401','','安徽新增68例累计确诊408例','2020-02-11'),('2月2日0-24时，广西共新增新型冠状病毒感染的肺炎确诊病例16例，其中南宁6例、柳州2例、桂林1例、北海3例、防城港1例、贵港1例、玉林1例、贺州1例。       目前广西累计报告确诊病例127例，累计出院病例2例。现有重症病例5例（桂林2例、防城港3例），危重病例3例（桂林2例、贵港1例），无死亡病例。       累计确诊病例中，南宁市22例、柳州市14例、桂林市24例、梧州市5例、北海市26例、防城港市9例、钦州市2例、贵港市5例、玉林市8例、百色市2例、贺州市4例、河池市6例；累计出院病例中：梧州1例、防城港1例。       目前累计追踪到密切接触者5054人，正在接受医学观察3632人。\n','2020-02-11','ck6hgxcbu00cns27cht953ihq','人民网','广西壮族自治区','2020-02-03','http://m.weibo.cn/2286908003/4467794835515237','','广西新增16例累计确诊127例','2020-02-11'),('2020年2月2日0—24时，河北省报告新型冠状病毒感染的肺炎新增确诊病例9例，其中，邢台市4例、石家庄市3例、廊坊市1例、秦皇岛市1例。新增疑似病例50例，其中，石家庄市15例、秦皇岛市9例、邢台市8例、张家口市4例、唐山市4例、邯郸市3例、承德市3例、沧州市3例、衡水市1例。　　截至2月2日24时，河北省累计报告确诊病例113例，其中死亡1例，现有重症病例12例，治愈出院3例。确诊病例中，沧州市19例、石家庄市16例、邢台市14例、保定市13例、廊坊市12例、唐山市11例、邯郸市11例、张家口市9例、衡水市4例、承德市2例、秦皇岛市2例；死亡病例中，沧州市1例；重症病例中，石家庄市2例、邢台市2例、唐山市2例、张家口市2例、承德市1例、廊坊市1例、沧州市1例、邯郸市1例；出院病例中，保定市2例、廊坊市1例。现有疑似病例108例。　　目前累计追踪到密切接触者3796人，当日解除隔离医学观察501人，现有2797人正在接受隔离医学观察。','2020-02-11','ck6hgxcbu00cos27chqz2g2b2','人民网','河北省','2020-02-03','http://m.weibo.cn/2286908003/4467792302938588','','河北新增9例累计确诊113例','2020-02-11'),('2月2日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例2829例（湖北省2103例），新增重症病例186例（湖北省139例），新增死亡病例57例（湖北省56例，重庆市1例），新增治愈出院病例147例（湖北省80例），新增疑似病例5173例（湖北省3260例）。　　截至2月2日24时，国家卫生健康委收到31个省（自治区、直辖市）和新疆生产建设兵团累计报告确诊病例17205例（北京市核减3例，江西省核减1例），现有重症病例2296例，累计死亡病例361例，累计治愈出院病例475例，共有疑似病例21558例。　　目前累计追踪到密切接触者189583人，当日解除医学观察10055人，共有152700人正在接受医学观察。　　累计收到港澳台地区通报确诊病例33例：香港特别行政区15例，澳门特别行政区8例，台湾地区10例。\n','2020-02-11','ck6hgxcbu00cps27c9ooq5eu5','人民网','全国','2020-02-02','http://m.weibo.cn/2286908003/4467790314822516','','全国确诊新增2829例，累计17205例','2020-02-11'),('上海市卫健委2月3日通报：2020年2月2日12—24时，上海市排除新型冠状病毒感染的肺炎疑似病例60例；新增确诊病例11例，其中外地来沪人员2例，本市常住人口9例。       具体情况截至2月2日24时，上海市已累计排除疑似病例449例，发现确诊病例193例。确诊病例中，男性101例，女性92例；年龄最大88岁，最小7岁；113例有湖北居住或旅行史，8例有湖北以外地区居住或旅行史，70例有相关确诊病例接触史，2例无湖北接触史；外地来沪人员76例，本市常住人员117例。具体情况如下，目前，170例病情平稳，7例病情危重，5例重症，10例治愈出院，1例死亡。尚有173例疑似病例正在排查中。\n','2020-02-11','ck6hgxcbu00cqs27c6f3xd1xo','人民网','上海市','2020-02-02','http://m.weibo.cn/2286908003/4467789148811467','','上海新增11例累计确诊193例','2020-02-11'),('钟南山：目前确诊病例病死率大概是2.3%、2.4%，因为患者集中，武汉病死率要高于外地。但不应该因为病死率低，就放松警惕。总的来说，与H7N9、MERS、H5N1相比，病死率相对低，但比普通的流感要高。','2020-02-11','ck6hgxcbu00crs27cbs9x738r','央视新闻','全国','2020-02-02','http://m.weibo.cn/2656274875/4467787793720033','','钟南山谈疫情死亡率','2020-02-11'),('江西九江市首批2例新型冠状病毒感染的肺炎患者治愈出院，感染病学博士沈国俊介绍，两位患者转入时为均为重症，医院按照国家诊疗指南进行治疗。目前，两位患者2次病毒核酸检测均呈阴性，且肺部医学影像明显好转，病灶较前吸收，符合国家卫生健康委新型冠状病毒感染的肺炎确诊病例解除隔离和出院标准。','2020-02-11','ck6hgxcbu00css27c7p0p8c1u','九江发布','江西省','2020-02-02','https://m.weibo.cn/detail/4467540925636413','','江西九江市首批2例新型冠状病毒感染的患者治愈出院','2020-02-11'),('德国《世界报》当地时间2月2日报道，首批从武汉撤出的德国侨民中，2人确诊感染新型冠状病毒，目前已被送往法兰克福大学医院隔离。2月1日，130名德国侨民从武汉返回法兰克福，在法兰克福附近的军营接受隔离、检测和询问。据了解，德国此前确诊8例新型肺炎患者，其中7人来自于巴伐利亚州同一家企业，另一人为患者家属。\n','2020-02-11','ck6hgxcbv00cts27c6pwqeofg','人民网','','2020-02-02','http://m.weibo.cn/2286908003/4467643526074190','','德国确诊病例增至10例','2020-02-11'),('2日下午，武汉金银潭医院有37名确诊新型冠状病毒肺炎患者出院，是迄今为止该院出院人数最多的一天。医务人员将治愈出院患者们送出大门，嘱咐他们回家后要居家隔离两周，医务人员会随时回访。本次出院年纪最大患者已88岁，是该院出院年龄最大患者。一定要健康！','2020-02-11','ck6hgxcbv00cus27c541rcl0r','人民日报','湖北省','2020-02-02','http://m.weibo.cn/2803301701/4467581769048139','','武汉市金银潭医院一天37人出院','2020-02-11'),('钟南山2日表示：“目前全国的疫情仍处于上升期，但我们判断疫情应不会产生全国性爆发，而可能只为局部爆发。”钟南山说，面对此次2019-nCoV肺炎疫情，最原始最有效的方法仍是“早发现、早隔离”。“我们政府和相关部门采取了多项全国性的举措：延长假期、交通管制、公共场所体温检测排查、积极宣讲少聚集、个人防护知识等，而国民公共安全意识的提高也保证了相关举措的顺利实施。”钟南山说：“这些举措有效阻断传染源，大大减少二代、三代传染，我们判断此次疫情有望在未来10天至两周左右出现高峰，但我们仍需加强防控，不可放松警惕。”\n','2020-02-11','ck6hgxcbv00cvs27c3bky6btm','人民日报','全国','2020-02-02','http://m.weibo.cn/2803301701/4467621451970226','','钟南山称疫情未来10天至两周或现高峰','2020-02-11'),('【好消息！#武汉市金银潭医院今天37人出院#】2日下午2时，武汉市金银潭医院有37名确诊新型冠状病毒肺炎患者出院，是迄今为止该院出院人数最多的一天。本次出院年纪最大的患者已88岁，也是该院出院年龄最大的患者。医务人员将治愈出院的患者们送出医院大门，并嘱咐他们回家后需要居家隔离两周，医务人员将会随时对他们的健康状况进行回访。（人民日报客户端）网页链接\n','2020-02-11','ck6hgxcbv00cws27cak742ldz','人民网','湖北省','2020-02-02','http://m.weibo.cn/2286908003/4467583149418870','','武汉市金银潭医院今天37人出院','2020-02-11'),('2月2日，中央应对疫情工作领导小组会议指出，保障湖北省特别是武汉市疫情防控物资需要是重中之重。国家已集中人力物力支持。会议确定，要加快湖北医院和床位建设，组织更多呼吸、重症等高水平医护人员支援湖北。抓紧弥补湖北医用口罩防护服缺口。国务院联防联控机制各单位要帮助解决重点医用防控物资生产运输遇到的问题。所有紧缺物资实行国家统一调度。湖北省要做好医疗防控物资管理、优化使用。\n','2020-02-11','ck6hgxcbv00cxs27c4itz33vo','人民日报','湖北省','2020-02-02','http://m.weibo.cn/2803301701/4467603688992599','','保障湖北防控物资需要是重中之重','2020-02-11'),('据甘肃省卫健委消息，2月2日，经省市级专家会诊，定西市陇西县1例输入性新型冠状病毒感染的肺炎患者，符合出院标准，解除隔离出院，属甘肃省首例新型冠状病毒感染的肺炎出院患者。\n','2020-02-11','ck6hgxcbv00cys27c65bmdkvm','人民网','甘肃省','2020-02-02','http://m.weibo.cn/2286908003/4467592175279785','','甘肃首例康复患者出院','2020-02-11'),('2月2日0时至12时，云南省报告新型冠状病毒感染肺炎新增病例6例，其中楚雄州为首次报告确诊病例。全省累计报告确诊病例105例，除治愈出院者外，现均在定点医院接受隔离治疗。现有危重3例，重症7例，治愈出院3例，疑似病例235例，密切接触者医学观察3423人，无死亡病例。\n','2020-02-11','ck6hgxcbv00czs27ca595g8oh','人民日报','云南省','2020-02-02','http://m.weibo.cn/2803301701/4467588350713087','','云南新增确诊6例，累计105例','2020-02-11'),('截至2月1日24时，深圳市累计报告新型冠状病毒感染的肺炎确诊病例196例。其中，出现了3例社区传播病例。这3个病例是目前深圳首次监测到的社区传播病例，具体情况还在进行进一步的研判分析中。深圳市疾控中心提醒：3例社区传播病例属于散发，目前深圳新型冠状病毒感染的肺炎病例仍以输入性病例为主。','2020-02-11','ck6hgxcbv00d0s27cb1ig7el1','人民日报','广东省','2020-02-02','http://m.weibo.cn/2803301701/4467577956497023','','深圳首次出现3例社区传播病例，其中一名为外卖骑手','2020-02-11'),('截至2月2日12时，全省累计报告新型冠状病毒感染的肺炎确诊病例632例。2日0-12时全省新增确诊病例28例。新增确诊病例中，深圳市11例、珠海市6例、广州市4例、佛山市4例、汕头市1例、梅州市1例、潮州市1例。有2504名密切接触者正在接受医学观察。累计报告确诊病例中，深圳市207例、广州市179例、珠海市47例、佛山市43例、东莞市27例、惠州市23例、中山市21例、汕头市15例、湛江市14例、阳江市10例、肇庆市7例、梅州市7例、清远市6例、揭阳市6例、韶关市5例、汕尾市4例、潮州市4例、茂名市3例、江门市3例、河源市1例。男性307例，女性325例，年龄介于10月龄-86岁之间。截至2月2日12时，在院的620例确诊病例中，危重18例，重症55例，普通型547例。累计出院12例。无死亡病例。\n','2020-02-11','ck6hgxcbv00d2s27cgi4ggwsf','人民日报','广东省','2020-02-02','http://m.weibo.cn/2803301701/4467559422714095','','广东新增确诊28例累计632例','2020-02-11'),('国务院办公厅发布关于组织做好疫情防控重点物资生产企业复工复产和调度安排工作的紧急通知。通知称，医用防护服、N95口罩、医用护目镜、负压救护车、相关药品等重点医疗应急防控物资由国务院应对新型冠状病毒感染肺炎疫情联防联控机制物资保障组统一管理、统一调拨，地方各级人民政府不得以任何名义截留、调用。国务院办公厅关于组织做好疫情防控重点物资生产企业复工复产和调度安排工作的紧急通知\n','2020-02-11','ck6hgxcbw00d3s27c497e80oc','人民日报','全国','2020-02-02','http://m.weibo.cn/2803301701/4467568749994426','','地方不得以任何名义截留调用医疗物资','2020-02-11'),('好消息！今天下午4点40分，天津首例康复新冠肺炎患者从天津海河医院出院！ \n','2020-02-11','ck6hgxcbw00d4s27c5zyldr18','人民日报','天津市','2020-02-02','http://m.weibo.cn/2803301701/4467567278501070','','天津首例康复患者出院','2020-02-11'),('国务院应对新型冠状病毒感染的肺炎疫情联防联控机制要求：各地要在原有心理援助热线的基础上设立应对疫情心理援助热线，每条热线至少开通2个坐席，结合本地公众需求提供24小时免费心理服务。地方政府应当对热线主办机构给予适当经费补助。\n','2020-02-11','ck6hgxcbw00d5s27c7gqj0v96','人民日报','全国','2020-02-02','http://m.weibo.cn/2803301701/4467564547579656','','各地设立24小时心理援助热线','2020-02-11'),('【好消息！#海南又一例确诊患者治愈# 累计治愈2例】 2月2日，海南三亚中心医院一位新型冠状病毒感染的肺炎确诊患者经2次核酸检测均为阴性，符合出院条件。这也是海南省治愈的第2例新型冠状病毒感染的肺炎确诊患者。据了解，这名男性患者今年71岁。由于还有其它较严重基础病，从感染科出院后，目前已转入神经外科继续进行治疗。（人民网海南频道）好消息！海南又一新型冠状病毒感染的肺炎患者治愈 累计治愈2例\n','2020-02-11','ck6hgxcbw00d6s27c1xdzda18','人民网','海南省','2020-02-02','http://m.weibo.cn/2286908003/4467563125631493','','海南又一例确诊患者治愈','2020-02-11'),('【#北京新确诊8例累计191例#】2月1日24时至2日12时，北京新增8例新型冠状病毒感染的肺炎病例，4例有湖北及其他省份接触史，4例为确诊病例的密切接触者。均已送至定点医疗机构进行救治。截至2月2日12时，#北京累计确诊病例191例#，其中死亡1例，出院9例，181例在定点医院进行隔离治疗。东城区3例、西城区22例、朝阳区35例、海淀区41例、丰台区16例、石景山区5例、门头沟区2例、房山区2例、通州区13例、顺义区6例、昌平区12例、大兴区22例、怀柔区1例、外地来京人员11例。平谷区、密云区、延庆区尚未有病例。\n','2020-02-11','ck6hgxcbw00d8s27c5n781wz6','人民日报','北京市','2020-02-02','http://m.weibo.cn/2803301701/4467554632711769','','北京新确诊8例累计191例','2020-02-11'),('【卫健委回应病毒通过粪-口传播】针对近日在确诊患者粪便中检测到新型冠状病毒，中国疾控中心传染病处研究员冯录召2日在国家卫健委发布会上回应，这说明病毒可以在消化道存在，但是否通过粪-口传播，还是通过含有病毒的飞沫形成气溶胶的方式再传播，需要我们进一步证实。新型冠状病毒传播主要途径还是以近距离飞沫传播、间接接触传播为主。但这些现象也提示我们勤洗手的重要性。\n','2020-02-11','ck6hgxcbw00d9s27cbfhgazar','人民日报','全国','2020-02-02','http://m.weibo.cn/2803301701/4467554120914381','','粪-口传播还没得到证实','2020-02-11'),('2020年2月2日0—12时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例13例，新增出院病例4例。新增确诊病例中，万州区5例、长寿区1例、合川区1例、荣昌区1例、梁平区1例、垫江县1例、忠县3例；新增出院病例中，永川区1例、云阳县1例、巫山县2例。截至2月2日12时，重庆市累计报告新型冠状病毒感染的肺炎确诊病例275例，重型病例26例，危重型病例6例，死亡病例1例，出院病例7例。确诊病例中，万州区44例、黔江区2例、涪陵区1例、渝中区9例、大渡口区6例、江北区13例、沙坪坝区2例、九龙坡区11例、南岸区4例、渝北区12例、巴南区1例、长寿区11例、江津区3例、合川区9例、永川区3例、綦江区4例、大足区4例、璧山区8例、铜梁区4例、潼南区2例、荣昌区3例、开州区16例、梁平区3例、武隆区1例、城口县1例、丰都县5例、垫江县12例、忠县15例、云阳县18例、奉节县8例、巫山县6例、巫溪县11例、石柱县10例、秀山县1例、两江新区12例；重型病例中，万州区3例、大渡口区2例、江北区1例、渝北区1例、长寿区3例、江津区3例、綦江区1例、璧山区2例、开州区1例、梁平区1例、丰都县1例、垫江县1例、忠县3例、云阳县1例、奉节县2例；危重型病例中，万州区1例、江北区1例、九龙坡区1例、铜梁区1例、开州区1例、忠县1例；死亡病例为九龙坡区1例；出院病例中，永川区1例、丰都县1例、云阳县1例、巫山县3例、秀山县1例。累计追踪到密切接触者7556人，已解除医学观察1780人，尚有5776人正在接受医学观察。\n','2020-02-11','ck6hgxcbw00das27c1bacbryo','人民网','重庆市','2020-02-02','http://m.weibo.cn/2286908003/4467550051674156','','重庆新增13例累计确诊275例，新增出院病例4例','2020-02-11'),('2020年2月1日22时至2月2日13时，辽宁省新增5例新型冠状病毒感染的肺炎确诊病例，其中沈阳市1例，大连市1例，阜新市1例，辽阳市1例，盘锦市1例，均属普通型病例。截至2020年2月2日13时，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例69例，其中重型病例5例，大连市治愈出院1例。确诊病例中，沈阳市17例（铁岭市转入1例，鞍山市转入1例，盘锦市转入2例）、大连市11例、本溪市3例、丹东市6例、锦州市7例、营口市1例、阜新市3例，辽阳市2例、铁岭市2例、朝阳市6例、盘锦市6例、葫芦岛市5例。目前68名在治患者均在定点医疗机构隔离治疗，病情平稳。68名在治患者中，56例病例为输入性病例，7例病例为武汉输入病例家属，4例为现有确诊病例的密切接触者，1例正在对其感染情况进行流行病学调查。目前累计追踪到密切接触者1152人，已解除医学观察216人，现有908人正在接受医学观察，正在追踪28人。\n','2020-02-11','ck6hgxcbw00dbs27ce2g245ra','央视新闻','辽宁省','2020-02-02','http://m.weibo.cn/2656274875/4467543391820360','','辽宁确诊病例增至69例','2020-02-11'),('2月2日上午，湖北省新型冠状病毒感染肺炎疫情防控指挥部召开会议强调，当前，全省防控形势依然极为严峻，要做实做细基层基础工作，坚决按照“四集中”要求，对所有疑似患者集中隔离。要对所有疑似病例，先隔离再检测、再诊疗，严防交叉感染。各地都要加快设置定点医院，建立隔离病区、隔离病房。征用酒店、招待所、闲置厂房等，抓紧建立备用隔离场所，并配备必要的生活、消毒、医疗设施。\n','2020-02-11','ck6hgxcbw00dcs27caog21so1','人民日报','湖北省','2020-02-02','http://m.weibo.cn/2803301701/4467540426093495','','湖北省集中隔离所有疑似病例','2020-02-11'),('2月2日下午，山东省卫生健康委员会通报山东省新型冠状病毒感染的肺炎疫情情况。2020年2月2日0—12时，山东省报告新型冠状病毒感染的肺炎新增确诊病例5例，现有疑似病例67例，累计确诊病例230例（含重症病例15例，危重症病例1例，出院6例，无死亡病例）。截至目前，追踪到密切接触者7535人，已解除医学观察1232人，诊断为疑似或确诊91例，尚有6212人正在接受医学观察。\n','2020-02-11','ck6hgxcbw00dds27c10ilaorh','央视新闻','山东省','2020-02-02','http://m.weibo.cn/2656274875/4467541864405082','','山东新增5例确诊病例','2020-02-11'),('2月2日，四川首例新冠肺炎危重患者陈某在四川大学华西医院广安医院（广安市人民医院）出院。四川大学华西广安医院重症医学科副主任医师、陈某主诊医生王健介绍，患者已经连续3天没有发烧，两次间隔24小时核酸检测为阴性，已经完全脱离呼吸机，不用高流量鼻塞吸氧，呼吸状态恢复正常，已经可以判断临床治愈。','2020-02-11','ck6hgxcbx00des27cecd5bls0','人民日报','四川省','2020-02-02','http://m.weibo.cn/2803301701/4467530775651688','','四川首例危重患者治愈出院','2020-02-11'),('今天，武汉火神山医院正式交付。军队抽组1400名医护人员于2月3日起，承担武汉火神山新型冠状病毒感染肺炎专科医院医疗救治任务。','2020-02-11','ck6hgxcbx00dfs27c6odb98ld','央视新闻','湖北省','2020-02-02','http://m.weibo.cn/2656274875/4467508931107457','','武汉火神山医院正式交付','2020-02-11'),('上海市卫健委今天（2月2日）通报：2020年2月2日0—12时，上海市排除新型冠状病毒感染的肺炎疑似病例15例；新增确诊病例5例，其中重症1例。确诊病例均为本市常住人口。具体情况如下，截至2月2日12时，上海市已累计排除疑似病例389例，发现确诊病例182例。确诊病例中，男性93例，女性89例；年龄最大88岁，最小7岁；110例有湖北居住或旅行史，5例有湖北以外地区居住或旅行史，64例有相关确诊病例接触史，3例无湖北接触史；外地来沪人员74例，本市常住人员108例。具体情况如下↓目前，160例病情平稳，7例病情危重，4例重症，10例治愈出院，1例死亡。尚有220例疑似病例正在排查中。\n','2020-02-11','ck6hgxcbx00dgs27cfd75fikd','央视新闻','上海市','2020-02-02','http://m.weibo.cn/2656274875/4467513947993262','','上海新增5例累计确诊182例','2020-02-11'),('截至2月2日11时，天津新增3例新型冠状病毒感染的肺炎确诊病例，确诊病例增至48例。第46例患者，女，71岁，居住于宁河区，该患者是第32例确诊病例的亲戚，系密切接触者。无武汉旅居史。患者于1月23日与第32例在饭店一起就餐，后又到第32例家中串门。第32例确诊后，患者于1月31日下午被送至宁河区医院进行筛查，2月1日被诊断为疑似新型冠状病毒感染的肺炎并报告。2月2日，转至海河医院治疗，经市专家组确诊为天津第46例病例，为普通型。目前生命体征平稳。宁河区疾控中心已开展流行病学调查，对4名密切接触者实施隔离医学观察，继续对密切接触者进行追踪排查。第47例患者，男，59岁，现居住于河东区，为天津动车客车段员工。患者曾与第6例确诊病例和第2例确诊病例有过接触。1月23日晚出现发热，24日凌晨被送至市第三中心医院发热门诊隔离治疗，核酸检测阴性，25日晚回到家中继续居家医学隔离观察，之后持续发热，28日再次前往第三中心医院发热门诊就诊并在隔离病房隔离治疗，核酸检测仍为阴性。因高度怀疑，2月2日再次核酸检测为阳性。经市专家组确诊为天津第47例病例，为重型。目前，患者已转至海河医院治疗。河东区疾控中心正在对其隔离医学观察的亲属（1人）继续居家医学观察，并对其居所进行终末消毒。第48例患者，女，26岁，现居住于宝坻区，为宝坻区正心大药房售货员。1月23日15时至18时患者曾去过百货大楼鞋区（第45例确诊病例工作区）、服装区和珠宝区（第38例确诊病例工作区）购物。患者1月29日出现发烧、头晕、干咳等症状，自服退烧药缓解，后去宝坻区中医医院发热门诊就诊，取药后返回。2月1日因症状未缓解前往宝坻区人民医院发热门诊就诊，被诊断为疑似新型冠状病毒感染的肺炎并报告。2月2日经市专家组确诊为天津第48例病例，为普通型。目前，宝坻区疾控中心正在对其密切接触者进行排查。截至目前，天津累计发现新型冠状病毒感染的肺炎病例48例，其中男性29例，女性19例；其中危重型3例，重型15例，普通型30例，无死亡病例。\n','2020-02-11','ck6hgxcc000dhs27cdqvuek0h','央视新闻','天津市','2020-02-02','http://m.weibo.cn/2656274875/4467506913419976','','天津新增3例确诊病例','2020-02-11'),('1日晚10时许，武汉雷神山医院隔离病区首个完整病房样板正式完成。该类病房面积 16.5平方米（3米×5.5米），分为卫生间、缓冲区和病房区三大区域，将作为专科医院，用于集中收治新型冠状病毒感染的肺炎患者。','2020-02-11','ck6hgxcc000dis27c8nhe23tf','人民网','湖北省','2020-02-02','http://m.weibo.cn/2286908003/4467493894898193','','雷神山医院病房样板间来啦','2020-02-11'),('2日上午，衡阳市新型冠状病毒感染的肺炎首批3名确诊重症患者走出医院，康复归家。三名重症患者经过精心诊治和护理，病情好转，无发烧，无身体不适，经反复连续核酸检测均为阴性，经专家组评估，符合国家卫生健康委新型冠状病毒感染的肺炎确诊病例解除隔离和出院标准。\n','2020-02-11','ck6hgxcc000djs27cfibuh5pg','人民网','湖南省','2020-02-02','http://m.weibo.cn/2286908003/4467493047740260','','衡阳首批3名患者出院','2020-02-11'),('记者2月2日从澳门特区政府卫生局获悉，澳门新增第8例新型冠状病毒感染确诊病例，患者为64岁女性，澳门居民，无业。据介绍，该患者1月27日因出现发烧和咳嗽等症状，曾到仁伯爵综合医院急诊就诊，但觉病情无好转，30日和31日到镜湖医院就诊，期间反覆发烧；2月1日因右腹痛到镜湖医院求诊，入院后经CT检查考虑有肺部炎症表现，下午由消防救护车送到仁伯爵综合医院特别急症室，经检测，对新型冠状病毒呈阳性，已被列为澳门第8个确诊个案，患者已被安排至隔离病房治疗。患者曾于1月10日至1月17日因带状疱疹在珠海中西医结合医院住院治疗， 1月22日曾在中山三乡市场购买活家禽并于1月22-23日期间在中山三乡居住。目前，患者情况一般，否认曾到湖北地区及接触新型肺炎确诊患者，疾病防控团队正展开追踪调查其流行病学史和密切接触者。','2020-02-11','ck6hgxcc000dks27c7brdhnfm','央视新闻','澳门','2020-02-02','http://m.weibo.cn/2656274875/4467491788964266','','澳门新增第8例确诊病例','2020-02-11'),('2月1日12时至24时，云南省报告新型冠状病毒感染肺炎新增病例6例（玉溪市4例、昆明市1例、大理州1例）。全省累计报告确诊病例99例，除治愈出院2人外，现均在定点医院接受隔离治疗。现有危重3例、重症6例，疑似病例261例，密切接触者医学观察3279人，无死亡病例。确诊病例中，昆明市31例、西双版纳州12例、玉溪市11例、保山市8例、大理州7例（出院1例）、昭通市6例、丽江市6例、曲靖市5例、红河州5例（出院1例）、普洱市4例、德宏州3例、临沧市1例。新增确诊患者情况：第94例：70岁女性，湖北武汉人，1月21日乘高铁从武汉到昆明，换乘动车到达大理，22日至24日自驾车在大理、丽江旅游，25日返回大理，1月26日在大理医疗机构收治入院隔离治疗。第95例：53岁女性，湖北武汉人，1月19日从武汉到玉溪探亲，其玉溪亲戚及同行者已确诊，2月1日在玉溪收治入院隔离治疗。第96例：72岁男性，云南玉溪人，住玉溪红塔区，为第91例患者丈夫、第95例患者亲戚，1月19日武汉亲戚（已确诊）来家探亲，1月31日在玉溪医疗机构收治入院隔离治疗。第97例：45岁女性，湖北武汉人，1月22日从武汉乘高铁到昆明，1月23至25日在昆明旅游，1月26日经排查在定点安置酒店医学观察，2月1日在昆明市医疗机构收治入院隔离治疗。第98例：62岁女性，湖北武汉人，为第95例患者同行者，1月19日从武汉到玉溪探亲，其玉溪亲戚及同行者已确诊，1月31日在玉溪医疗机构收治入院隔离治疗。第99例：37岁女性，湖北武汉人，为第95例患者同行者，1月19日从武汉到玉溪探亲，其玉溪亲戚及同行者已确诊，1月31日在玉溪医疗机构收治入院隔离治疗。\n','2020-02-11','ck6hgxcc000dls27chvg00elh','央视新闻','云南省','2020-02-02','http://m.weibo.cn/2656274875/4467490765501047','','云南新增6例确诊病例','2020-02-11'),('1月30日10时至31日17时，徐州市新增新型冠状病毒病原学检测阳性19例，其中睢宁县10人为同一待确认病例密切接触者，出现一人传染多人现象。因宿迁市宿城区耿车镇等乡镇与睢宁县接壤，人员相互流动较为频繁，传染危险性增加。','2020-02-11','ck6hgxcc000dms27cbeac196x','央视新闻','江苏省','2020-02-02','http://m.weibo.cn/2656274875/4467488152562884','','江苏出现1名患者感染10人案例','2020-02-11'),('2020年2月1日10时至2日10时，内蒙古自治区报告新型冠状病毒感染的肺炎新增确诊病例4例，新增疑似病例5例为呼和浩特市2例、包头市土右旗1例、呼伦贝尔市陈巴尔虎旗病例1例、鄂尔多斯市达拉特旗病例1例。截至2020年2月2日10时, 内蒙古自治区累计报告新型冠状病毒感染的肺炎确诊病例27例，其中：呼和浩特市新城区2例，包头市5例（昆都仑区3例、土右旗2例），呼伦贝尔市2例（满洲里市1例已痊愈出院、牙克石市1例），兴安盟乌兰浩特市1例，通辽市经济开发区1例，赤峰市2例（松山区1例、林西县1例），锡林郭勒盟2例（锡林浩特市1例，二连浩特市1例），乌兰察布市2例（四子王旗1例，化德县1例），鄂尔多斯市6例（东胜区1例、鄂托克前旗1例、达拉特旗4例），巴彦淖尔市3例（五原县2例、临河区1例），乌海市海勃湾区1例。　　确诊病例中，危重病例2例（牙克石市1例、锡林浩特市1例）；重症病例为包头市昆都仑区2例。　　疑似病例7例（呼和浩特市玉泉区1例、托克托县1例；包头市土右旗1例、呼伦贝尔市陈巴尔虎旗1例、鄂尔多斯市达拉特旗3例）。均在定点医院接受隔离治疗。目前，追踪到的密切接触者1110人，尚在接受医学观察中。当日解除医学观察2人。\n','2020-02-11','ck6hgxcc000dns27cefk1987n','人民网','内蒙古自治区','2020-02-02','http://m.weibo.cn/2286908003/4467465654617559','','内蒙古新增4例累计确诊27例','2020-02-11'),('最早收治新型冠状病毒感染的肺炎患者的金银潭医院的口罩和防护服十分紧张。现急需爱心捐助下列防护物资：医用外科口罩，N95口罩，一次性医用口罩，医用防护服，一次性手术衣，防护面罩，防冲击眼罩，一次性圆帽。\n','2020-02-11','ck6hgxcc000dos27cg1y89gvv','人民日报','湖北省','2020-02-02','http://m.weibo.cn/2803301701/4467470687393173','','武汉金银潭医院接受社会捐赠公告','2020-02-11'),('2月2日，根据《新型冠状病毒感染的肺炎诊疗方案（试行第四版）》规定，2名疑似病例患者马某、张某，病例样本经青海省疾病预防控制中心实验室复核检测，呈新型冠状病毒核酸阳性。结合患者临床表现、流行病学史，经省级医疗救治专家组会诊研判，确认为新型冠状病毒感染的肺炎确诊病例。截至2月2日11时，青海省累计报告新型冠状病毒感染的肺炎确诊病例11例，均为武汉输入性新型冠状病毒感染的肺炎确诊病例，均在定点医疗机构接受治疗。目前除1例患者属重症病例外，其他10例患者病情稳定，密切接触者已开展追踪调查和医学观察。\n','2020-02-11','ck6hgxcc100dps27c1fm81268','央视新闻','青海省','2020-02-02','http://m.weibo.cn/2656274875/4467484604556801','','青海省新增2例确诊病例','2020-02-11'),('2月1日0-24时，福建省报告新增新型冠状病毒感染的肺炎确诊病例15例。其中：福州市5例（晋安区3例、福清市2例）；厦门市1例（集美区1例）；漳州市1例（芗城区1例）；泉州市5例（晋江市5例）；三明市1例（将乐县1例）；莆田市2例（城厢区2例）。报告新增新型冠状病毒感染的肺炎疑似病例39例。其中：福州市6例（仓山区1例、晋安区1例、罗源县1例、福清市3例）；厦门市8例（湖里区2例、集美区2例、同安区1例、翔安区2例、漳州市龙海市1例）；漳州市2例（芗城区1例、诏安县1例）；泉州市4例（永春县1例、晋江市3例）；三明市3例（梅列区1例、大田县1例、沙县1例）；莆田市10例（城厢区5例、荔城区1例、湄洲岛北岸2例、仙游县2例）；南平市3例（延平区2例、武夷山市1例）；龙岩市1例（新罗区1例）；宁德市2例（周宁县2例）。截至2月1日24时，福建省累计报告新型冠状病毒感染的肺炎确诊病例159例（危重症5例、重症7例，无死亡病例）。现有报告新型冠状病毒感染的肺炎疑似病例共99例。目前，确诊、疑似病例的密切接触者已解除医学观察265人，尚有3613人正在接受医学观察。','2020-02-11','ck6hgxcc100dqs27chefn6yc2','人民网','福建省','2020-02-02','http://m.weibo.cn/2286908003/4467480564765736','','福建新增15例累计159例','2020-02-11'),('2月2日，菲律宾卫生部长杜克在记者会上宣布，菲律宾确诊第二例新型冠状病毒感染肺炎病例。该病例为一名44岁的中国男性公民，是菲律宾首例确诊患者的同伴，他于1月25日和首例患者一起到马尼拉圣拉扎罗医院就诊，其后他病情恶化，于2月1日死亡。','2020-02-11','ck6hgxcc100drs27c5f4i8pt5','央视新闻','','2020-02-02','http://m.weibo.cn/2656274875/4467478631680795','','中国之外首次出现死亡病例','2020-02-11'),('截至2月2日10时，陕西新增15例新型冠状病毒感染的肺炎确诊病例，新增重症患者1例，新增疑似病例77例。新增确诊病例中，西安市8例、宝鸡市1例、咸阳市1例、铜川市1例、汉中市2例、安康市2例。陕西累计报告新型冠状病毒感染的肺炎确诊病例116例，其中输入性病例82例，密切接触者31例，无明确接触史病例3例。累计确诊病例中，西安市47例、宝鸡市7例、咸阳市9例、铜川市6例、渭南市5例、延安市7例、榆林市1例、汉中市15例、安康市16例、商洛市2例、韩城市1例。全省现有疑似病例201例。全省新增密切接触者830人，累计4394人，均集中医学观察。新增解除密切接触者264人，累计解除密切接触者809人。\n','2020-02-11','ck6hgxcc100dss27c25w4amxr','人民网','陕西省','2020-02-02','http://m.weibo.cn/2286908003/4467476525817859','','陕西新增15例累计116例','2020-02-11'),('2月1日12时至24时，北京市新增15例新型冠状病毒感染的肺炎病例，11例有湖北及其他省份接触史，4例为确诊病例的密切接触者，其中2例既有湖北及其他省份接触史又是确诊病例的密切接触者。2例否认湖北接触史，正在进一步核实。均已送至定点医疗机构进行救治。截至2月1日24时，北京市累计确诊病例183例，其中死亡1例，出院9例，173例在定点医院进行隔离治疗。东城区3例、西城区17例、朝阳区35例、海淀区41例、丰台区16例、石景山区4例、门头沟区1例、房山区2例、通州区13例、顺义区6例、昌平区12例、大兴区21例、怀柔区1例、外地来京人员11例。平谷区、密云区、延庆区尚未有病例。\n','2020-02-11','ck6hgxcc100dts27c7bx84ioe','人民日报','北京市','2020-02-02','http://m.weibo.cn/2803301701/4467472964959734','','北京新增15例含10月婴儿','2020-02-11'),('2020年2月1日0-24时，湖南省报告新型冠状病毒感染的肺炎新增确诊病例74例，新增重症病例2例，新增死亡病例0例，新增出院病例5例。截至2月1日24时，湖南省累计报告新型冠状病毒感染的肺炎确诊病例463例，累计报告重症病例56例，死亡病例0例，出院病例8例。目前追踪到密切接触者9599人，已解除医学观察1353人，尚有8246人正在接受医学观察。\n','2020-02-11','ck6hgxcc100dus27cfy2805c6','人民网','湖南省','2020-02-02','http://m.weibo.cn/2286908003/4467451112558429','','湖南新增确诊74例，累计463例','2020-02-11'),('2月1日0时至24时，宁夏回族自治区报告新增新型冠状病毒感染的肺炎确诊病例2例，新增疑似病例7例。截至2月1日24时，全区累计报告确诊病例28例，其中银川市16例（兴庆区5例、金凤区6例、西夏区3例、永宁县2例）、吴忠市7例（利通区4例、红寺堡区3例）、固原市2例（原州区2例）、中卫市2例（沙坡头区2例）、宁东1例（宁东镇）；现有重症病例4例；共有疑似病例8例。目前累计追踪到密切接触者884人，正在接受集中或居家隔离医学观察。\n','2020-02-11','ck6hgxcc100dvs27c4l983re6','人民网','宁夏回族自治区','2020-02-02','http://m.weibo.cn/2286908003/4467450357733629','','宁夏新增确诊2例，累计28例','2020-02-11'),('2020年2月1日0-24时，浙江省报告新型冠状病毒感染的肺炎新增确诊病例62例，新增出院病例8例。其中：新增确诊病例中，杭州市12例、宁波市11例、温州市24例、嘉兴市1例、绍兴市3例、台州市5例、丽水市6例；新增出院病例中，杭州市2例、温州市2例、绍兴市1例、台州市3例。截至2月1日24时，浙江省累计报告新型冠状病毒感染的肺炎确诊病例661例，现有重症病例52例（其中危重12例），累计出院23例。目前，全省共追踪到密切接触者11961人，已解除医学观察1008人，尚有10397人正在接受医学观察。\n','2020-02-11','ck6hgxcc100dws27cho7jcy2r','人民网','浙江省','2020-02-02','http://m.weibo.cn/2286908003/4467447971360307','','浙江新增确诊62例，累计661例','2020-02-11'),('2020年2月1日0-24时，江西省报告新型冠状病毒感染的肺炎新增确诊病例47例，新增治愈出院病例1例（新余市1例）。截至2月1日24时，江西省累计报告新型冠状病毒感染的肺炎确诊病例333例，其中重症病例32例，治愈出院病例10例。目前追踪到密切接触者9254人，解除医学观察825人，尚有8429人正在接受医学观察。\n','2020-02-11','ck6hgxcc100dxs27c31r9g4j9','人民网','江西省','2020-02-02','http://m.weibo.cn/2286908003/4467446251935270','','江西新增确诊47例，累计333例','2020-02-11'),('2020年2月1日0-24时，安徽省报告新增确诊病例43例，新增疑似病例82例，新增危重病例1例，新增治愈出院2例。截至2月1日24时，安徽省在院治疗确诊病例335例。2月2日即将治愈出院2例（芜湖、宣城各1例）。累计医学观察密切接触者7481人。\n','2020-02-11','ck6hgxcc100dys27ca0qa5z9w','人民网','安徽省','2020-02-02','http://m.weibo.cn/2286908003/4467446008352154','','安徽新增43例，累计340例','2020-02-11'),('2月1日0-24时，黑龙江省报告新型冠状病毒感染的肺炎新增确诊病例15例。黑河市为报告首例确诊病例。新增重症病例1例。新增出院病例2例。新增疑似病例79例。截至2月1日24时，黑龙江省累计报告新型冠状病毒感染的肺炎确诊病例95例，出院病例2例为哈尔滨市传染病医院治愈患者。累计报告疑似病例172例。全省当日发热门诊诊疗人数2520人。目前追踪到密切接触者2931人, 已解除医学观察1008人,尚有1807人正在接受医学观察。','2020-02-11','ck6hgxcc100dzs27cct00933r','人民网','黑龙江省','2020-02-02','http://m.weibo.cn/2286908003/4467445450680613','','黑龙江新增15例，累计95例','2020-02-11'),('截至2月1日24时，广东累计报告新型冠状病毒感染的肺炎确诊病例604例。1日当天广东新增确诊病例84例，新增确诊病例中，广州市38例、深圳市26例、东莞市6例、珠海市3例、中山市3例、惠州市3例、肇庆市1例、湛江市1例、韶关市1例、梅州市1例、佛山市1例。有2418名密切接触者正在接受医学观察。截至2月1日24时，604例确诊病例中，危重20例,重症50例，普通病例522例，累计出院12例，无死亡病例。\n','2020-02-11','ck6hgxcc100e0s27c1ii11b1j','人民网','广东省','2020-02-02','http://m.weibo.cn/2286908003/4467444116380676','','广东新增确诊84例，累计604例','2020-02-11'),('2020年2月1日0-24时，江苏省报告新型冠状病毒感染的肺炎新增确诊病例34例。其中，南京市7例、无锡市6例、徐州市7例、常州市1例、苏州市4例、南通市5例、淮安市1例、盐城市2例、镇江市1例。新增出院病例1例。所有病例均已在定点医院救治，病情稳定。已追踪到密切接触者744人，均在接受隔离医学观察。截至2月1日24时，江苏省累计报告新型冠状病毒感染的肺炎确诊病例236例，其中，重症病例1例，出院病例6例。目前，江苏省追踪到密切接触者3992人，已解除医学观察216人，尚有3776人在接受医学观察。','2020-02-11','ck6hgxcc400e1s27ce1br2ia7','央视新闻','江苏省','2020-02-02','http://m.weibo.cn/2656274875/4467442728700426','','江苏新增34例，累计236例','2020-02-11'),('四川省新型冠状病毒感染的肺炎病例确认专家组确认四川新增新型冠状病毒感染的肺炎病例24例。截至2月1日24时，四川累计报告新型冠状病毒感染的肺炎确诊病例231例，涉及21个市（州）。231名患者中，危重5人,死亡1人，治愈出院3人。正在接受医学观察5038人，已解除医学观察334人。\n','2020-02-11','ck6hgxcc400e2s27c6mqj3orv','人民网','四川省','2020-02-02','http://m.weibo.cn/2286908003/4467439796701281','','四川新增24例累，计231例','2020-02-11'),('2020年2月1日0-24时，全省新型冠状病毒感染的肺炎新增9例确诊病例。其中，外地来黔人员7例、本省常住人口2例。贵阳市2例、遵义市1例、安顺市2例、毕节市1例、黔东南州2例、黔南州1例。截至2月1日24时，全省累计报告新型冠状病毒感染的肺炎病例38例。其中，外地来黔人员23例，本省常住人口15例；治愈出院2例，病情平稳28例，重症6例，危重症2例；男性22例，女性16例；年龄最大80岁，最小10岁；贵阳市6例（1例已治愈），遵义市5例，六盘水8例，安顺市2例，毕节市4例，铜仁市3例（1例已治愈），黔东南州4例，黔南州5例，黔西南州1例。现有疑似病例65例。累计追踪密切接触者567人，12人转为确诊病例，3人转为疑似病例，已解除医学观察50人，尚在接受医学观察502人。\n','2020-02-11','ck6hgxcc400e3s27cd04pa9ti','人民网','贵州省','2020-02-02','http://m.weibo.cn/2286908003/4467439498668883','','贵州新增9例，确诊38例','2020-02-11'),('截至2月2日6时，天津新增4例新型冠状病毒感染的肺炎确诊病例，确诊病例增至45例。截至目前，天津累计报告新型冠状病毒感染的肺炎确诊病例45例，其中男性28例，女性17例；危重型3例，重型14例，普通型28例；疑似病例为124例。累计排查密切接触者301人，其中已确诊12人，已解除医学观察13人，尚有276人正在接受医学观察。','2020-02-11','ck6hgxcc500e4s27c2n1kdr8m','人民网','天津市','2020-02-02','http://m.weibo.cn/2286908003/4467455680188813','','天津新增4例，累计45例','2020-02-11'),('2月1日0-24时，吉林新增确诊病例6例，均为长春市报告，其中2例为东丰县转诊病例。截至2月1日24时，吉林累计报告确诊病例23例，长春市治愈出院1例，现在院隔离治疗确诊病例22例。其中长春市12例，吉林市3例，延边州2例，松原市2例，通化市1例，四平市1例，公主岭市1例。在院治疗确诊病例有18例为普通病例，4例为重症病例。2月1日0-24时，全省原有疑似病例转为确诊病例6例，新增疑似病例10例，现有疑似病例14例，已全部隔离治疗，目前正在进一步明确诊断。\n','2020-02-11','ck6hgxcc500e5s27cb5w4a1rl','人民网','吉林省','2020-02-02','http://m.weibo.cn/2286908003/4467452752188554','','吉林新增6例，累计23例','2020-02-11'),('2月1日0-24时，兵团报告新型冠状病毒感染的肺炎新增确诊病例3例，新增重症病例0例，新增危重症病例0例，新增死亡病例0例，新增出院病例0例。其中：新增确诊病例中，兵团第九师3例。截至2月1日24时，新疆（含兵团）累计报告新型冠状病毒感染的肺炎确诊病例21例，现有重症病例4例、危重症病例1例，累计死亡病例0例，累计出院病例0例。其中：确诊病例中，乌鲁木齐市8例、伊犁州5例、吐鲁番市1例、阿克苏地区1例，兵团第七师1例、兵团第八师石河子市1例、兵团第九师4例；现有重症病例中，乌鲁木齐市2例、伊犁州2例；现有危重症病例中，乌鲁木齐市1例。目前尚有1151人正在接受医学观察。\n','2020-02-11','ck6hgxcc500e6s27c4w4m5siz','人民网','新疆维吾尔自治区','2020-02-02','http://m.weibo.cn/2286908003/4467438344863570','','新疆新增3例，累计21例','2020-02-11'),('2月1日0-24时，海南省报告新型冠状病毒感染的肺炎新增确诊病例6例，新增重症病例1例，新增死亡病例0例，新增出院病例0例。截至2月1日24时，海南省累计报告新型冠状病毒感染的肺炎确诊病例63例，重症病例10例，死亡病例1例，出院病例1例。截至2月1日24时，追踪到密切接触者1643人，已解除医学观察616人，尚有1027人正在接受居家或集中医学观察。\n','2020-02-11','ck6hgxcc500e7s27c1fjdczal','央视新闻','海南省','2020-02-02','http://m.weibo.cn/2656274875/4467456460684277','','海南新增6例，累计63例','2020-02-11'),('2月2日，河北省首批新型冠状病毒感染的肺炎患者经过省、市级医疗救治专家组的科学指导和定点收治医院的精心治疗，已符合治愈标准，正式出院3例。保定患者为母子二人，母亲30岁，儿子9岁，长居武汉，原籍保定安国市，于2020年1月19日由武汉回到保定安国。根据患者流行病学史和临床表现，1月24日收入保定市人民医院进行救治，1月25日，该母子同时被确诊为新型冠状病毒感染的肺炎病例，目前母子二人临床症状消失，各项化验指标恢复正常。廊坊患者，男，48岁，某物业公司工作，因发热、咳嗽于1月24日到医院就诊，1月25日收入廊坊市第三人民医院救治。1月26日经专家组会诊确诊为新型冠状病毒感染的肺炎病例。经治疗，临床症状消失，各项化验指标恢复正常。\n','2020-02-11','ck6hgxcc500eas27cek1l00ma','人民网','河北省','2020-02-02','http://m.weibo.cn/2286908003/4467462524896471','','好消息！河北首批3名患者治愈出院','2020-02-11'),('据新华社，临床发现，部分新型冠状病毒感染者首发症状仅为腹泻，专家在感染者大便和肛拭子中已发现病毒核酸，确诊患者粪便中检出病毒RNA阳性。专家提醒，应注意消化系统传播新型冠状病毒风险，做好相关防护。研究团队提醒，轻症患者居家隔离时，应格外重视手卫生，同时尽可能避免与家庭成员共用卫生间。如无单独卫生间，每次使用后，可通过乙醚、75%乙醇、含氯消毒剂、过氧乙酸和氯仿等脂溶剂，做好居家隔离消毒。武汉大学人民医院临床学科在诊疗过程中还发现，部分患者存在胸部影像与临床症状相背离的现象。不必为了解病情进展频繁复査胸部CT，以临床症状为导向复查胸部CT即可。\n','2020-02-11','ck6hgxcc500ecs27cc3blby8s','人民日报','全国','2020-02-02','http://m.weibo.cn/2803301701/4467448784522553','','专家提醒注意消化系统传播风险','2020-02-11'),('当地时间2月2日上午，韩国通报3例新型冠状病毒感染的肺炎确诊病例。至此，韩国自1月20日确诊首例新型冠状病毒感染的肺炎以来，累计确诊病例已达15例。\n','2020-02-11','ck6hgxcc500eds27chist2x2d','人民网','','2020-02-02','http://m.weibo.cn/2286908003/4467446293046079','','韩国累计确诊病例增至15例','2020-02-11'),('邱海波表示，目前尚无二次感染病例。现在已有对新型冠状病毒感染病人的监测，这些病人感染两三周后就可产生抗体，尤其是痊愈病人。一般抗体会持续半年或更长，所以半年内再感染可能性非常小，除非病毒又变异了，但目前还无证据。  \n','2020-02-11','ck6hgxcc600ejs27c4ri1fg5a','人民日报','全国','2020-02-02','http://m.weibo.cn/2803301701/4467455478690170','','国家卫健委专家组成员邱海波：目前没有新型冠状病毒变异证据','2020-02-11'),('2020年2月1日12—24时，山东省报告新型冠状病毒感染的肺炎新增确诊病例19例，累计确诊病例225例（含重症病例15例，危重症病例1例，出院5例，无死亡病例）；新增疑似病例33例，现有疑似病例81例。截至目前，追踪到密切接触者7277人，已解除医学观察997人，诊断为疑似或确诊86例，尚有6194人正在接受医学观察。\n','2020-02-11','ck6hgxcc600eos27cac822lwu','人民日报','山东省','2020-02-02','http://m.weibo.cn/2803301701/4467441885228766','','山东新增病例19例，累计病例225例','2020-02-11'),('截至2月1日24时，湖北黄冈市新型冠状病毒感染的肺炎病例过千例，为武汉外全国第二个破千的城市。湖北省累计报告新型冠状病毒感染的肺炎病例9074例（其中：武汉市4109例、黄石市252例、十堰市212例、襄阳市441例、宜昌市353例、荆州市333例、荆门市329例、鄂州市278例、孝感市749例、黄冈市1002例、咸宁市246例、随州市384例、恩施州105例、仙桃市140例、天门市99例、潜江市35例、神农架林区7例），已治愈出院215例，死亡294例（其中：武汉市224例、黄石市2例、宜昌市1例、荆州市4例、荆门市7例、鄂州市13例、孝感市14例、黄冈市15例、随州3例、仙桃市3例、天门市7例、潜江市1例）。目前湖北全省仍在院治疗8565例（其中：重症1118例、危重症444例），均在定点医疗机构接受隔离治疗。累计追踪密切接触者48571人，尚在接受医学观察43121人。\n','2020-02-11','ck6hgxcc600eqs27caozf5x4i','央视新闻','湖北省','2020-02-02','http://m.weibo.cn/2656274875/4467444242513457','','黄冈累计确诊病例过千','2020-02-11'),('浙江温州决定自2020年2月1日24时起至2月8日24时，在全市范围实行村（居）民出行管控措施。全市每户家庭每两天可指派1名家庭成员出门采购生活物资，其他人员除生病就医、疫情防控工作需要和在保障公共事业运行、群众生活及其他涉及重要国计民生的相关企业上班外，原则上不要外出。\n','2020-02-11','ck6hgxcc600ess27caob258qj','人民网','浙江省','2020-02-02','http://m.weibo.cn/2286908003/4467436520630657','','温州实施出行管控：每家每两天可指派1人出门采购','2020-02-11'),('2020年2月1日0-24时，河南省新增新型冠状病毒感染的肺炎确诊病例71例,新增出院病例1例。新增确诊病例中，郑州市9例、开封市3例、洛阳市2例、焦作市5例、平顶山市3例、鹤壁市2例、许昌市1例、漯河市2例、南阳市9例、商丘市7例、信阳市18例、周口市2例、驻马店市6例、永城市1例、邓州市1例。截至2月1日24时，全省累计报告新型冠状病毒感染的肺炎确诊病例493例，现有重症病例32例，现有危重病例12例，累计死亡病例2例，累计治愈病例4例，现有疑似病例754例。其中：确诊病例中，郑州市65例、开封市11例、洛阳市7例、平顶山市14例、安阳市24例、鹤壁市8例、新乡市21例、焦作市7例、濮阳市3例、许昌市13例、漯河市16例、三门峡市7例、南阳市62例、商丘市36例、信阳市88例、周口市40例、驻马店市46例、滑县1例、长垣市2例、永城市8例、邓州市14例。目前累计追踪到密切接触者11012人，2月1日已解除观察1263人，诊断为疑似17人，共有7162人正在接受医学观察。\n','2020-02-11','ck6hgxcc600ets27c4dxubm92','人民日报','河南省','2020-02-02','http://m.weibo.cn/2803301701/4467437187425854','','河南新增71例，累计确诊493例','2020-02-11'),('昨晚，山东威海市乳山市1例新型冠状病毒感染的肺炎确诊病例痊愈出院。患者女，39岁，是威海首例确诊患者的妻子。经治疗，该患者病情持续改善，呼吸道症状好转，肺部影像学显示病灶明显吸收，体温正常，各项化验指标均正常。两次核酸检测均为阴性，已符合出院标准。\n','2020-02-11','ck6hgxcc600eus27cele42024','央视新闻','山东省','2020-02-02','http://m.weibo.cn/2656274875/4467435149271096','','好消息！山东第4例确诊患者治愈出院','2020-02-11'),('2月1日0-24时，广西共新增新型冠状病毒感染的肺炎确诊病例11例，其中桂林2例、钦州1例、贵港4例、玉林2例、贺州2例。目前全区累计报告确诊病例111例，累计出院病例2例。现有重症病例6例（桂林2例、防城港3例、贵港1例），危重病例2例（桂林2例），无死亡病例，无医务人员感染病例。累计确诊病例中，南宁市16例、柳州市12例、桂林市23例、梧州市5例、北海市23例、防城港市8例、钦州市2例、贵港市4例、玉林市7例、百色市2例、贺州市3例、河池市6例；累计出院病例中：梧州市1例、防城港市1例。目前累计追踪到密切接触者4223人，正在接受医学观察3119人。\n','2020-02-11','ck6hgxcc700evs27c810t7fnd','央视新闻','广西壮族自治区','2020-02-02','http://m.weibo.cn/2656274875/4467431848132661','','广西新增11例累计111例','2020-02-11'),('2月1日12—24时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例15例，新增重型病例6例。新增确诊病例中，渝中区2例、江北区1例、九龙坡区2例、南岸区1例、渝北区1例、铜梁区2例、奉节县3例、巫溪县1例、两江新区2例；新增重型病例中，江津区1例、开州区1例、梁平区1例、忠县2例、奉节县1例。截至2月1日24时，重庆市累计报告新型冠状病毒感染的肺炎确诊病例262例，重型病例26例，危重型病例6例，死亡病例1例，出院病例3例。确诊病例中，万州区39例、黔江区2例、涪陵区1例、渝中区9例、大渡口区6例、江北区13例、沙坪坝区2例、九龙坡区11例、南岸区4例、渝北区12例、巴南区1例、长寿区10例、江津区3例、合川区8例、永川区3例、綦江区4例、大足区4例、璧山区8例、铜梁区4例、潼南区2例、荣昌区2例、开州区16例、梁平区2例、武隆区1例、城口县1例、丰都县5例、垫江县11例、忠县12例、云阳县18例、奉节县8例、巫山县6例、巫溪县11例、石柱县10例、秀山县1例、两江新区12例；重型病例中，万州区3例、大渡口区2例、江北区1例、渝北区1例、长寿区3例、江津区3例、綦江区1例、璧山区2例、开州区1例、梁平区1例、丰都县1例、垫江县1例、忠县3例、云阳县1例、奉节县2例；危重型病例中，万州区1例、江北区1例、九龙坡区1例、铜梁区1例、开州区1例、忠县1例；死亡病例为九龙坡区1例；出院病例中，丰都县1例、巫山县1例、秀山县1例。累计追踪到密切接触者7327人，已解除医学观察1581人，尚有5746人正在接受医学观察。\n','2020-02-11','ck6hgxcc700ews27c0c78dv0n','人民网','重庆市','2020-02-01','http://m.weibo.cn/2286908003/4467415872578051','','重庆新增15例累计262例','2020-02-11'),('截至2月1日24时，国家卫生健康委收到31个省（自治区、直辖市）和新疆生产建设兵团累计报告确诊病例14380例，现有重症病例2110例，累计死亡病例304例，累计治愈出院病例328例，共有疑似病例19544例。 \n','2020-02-11','ck6hgxcc700exs27c2aur8lsm','央视新闻','全国','2020-02-01','http://m.weibo.cn/2656274875/4467427825461189','','31个省区市累计治愈出院328例','2020-02-11'),('截至2月1日22时，天津市新增3例新型冠状病毒感染的肺炎确诊病例，确诊病例增至41例。第39例，男，52岁，居住于天津市东丽区，无武汉旅行史。1月20日至26日回浙江温州母亲家过年，于26日同家人自驾返津。患者自诉在温州曾与一名确诊新型冠状病毒感染者一同进餐。1月27日出现发热，自行对症治疗，1月31日就诊于医科大学总医院空港医院，2月1日经市专家组确诊为天津市第39例病例，为普通型。目前患者已转至海河医院，生命体征平稳。第40例，女，46岁，居住于天津市东丽区，无武汉旅行史。该病例系第39例确诊病例家属，1月20日至26日一同回浙江温州过年，26日自驾返津，自诉在温州曾与一名确诊新型冠状病毒感染者一同进餐。1月31日因咳嗽、咽部不适就诊于天津医科大学总医院空港医院， 2月1日经市专家组确诊为天津市第40例病例，为普通型。目前患者已转至海河医院，生命体征平稳。第41例，女，21岁，居住于天津市东丽区，无武汉旅行史。该病例系第39、40例确诊病例的家属，1月20日至26日回浙江温州过年，26日自驾返津，自诉在温州曾与一名确诊新型冠状病毒感染者一同进餐。1月31日因发热就诊于天津医科大学总医院空港医院， 2月1日经市专家组确诊为天津市第41例病例，为普通型。目前患者已转至海河医院，生命体征平稳。流行病学调查显示，以上3例病例为一家三口发病，有聚集性。1月26日至31日，三人自述一直居家，未接触其他人。截至目前，天津市累计发现新型冠状病毒感染的肺炎病例41例，其中男性27例，女性14例；危重型3例，重型13例，普通型25例；无死亡病例。\n','2020-02-11','ck6hgxcc700eys27c63ujcwjm','央视新闻','天津市','2020-02-02','http://m.weibo.cn/2656274875/4467430640428064','','天津新增3例累计41例','2020-02-11'),('2020年2月1日0—24时，河北省报告新型冠状病毒感染的肺炎新增确诊病例8例，其中，唐山市3例、保定市2例、石家庄市1例、张家口市1例、邯郸市1例。新增疑似病例60例，其中，石家庄市23例、邢台市21例、秦皇岛市8例、张家口市3例、唐山市3例、邯郸市1例，定州市1例。截至2月1日24时，河北省累计报告确诊病例104例，其中死亡1例，现有重症病例9例，治愈出院3例。确诊病例中，沧州市19例、石家庄市13例、保定市13例、唐山市11例、廊坊市11例、邯郸市11例、邢台市10例、张家口市9例、衡水市4例、承德市2例、秦皇岛1例；死亡病例中，沧州市1例；重症病例中，石家庄市2例、邢台市2例、承德市1例、张家口市1例、廊坊市1例、沧州市1例、邯郸市1例；出院病例中，保定市2例、廊坊市1例。现有疑似病例104例。目前累计追踪到密切接触者3132人，当日解除隔离医学观察176人，现有2540人正在接受隔离医学观察。\n','2020-02-11','ck6hgxcc700ezs27c2afi8b4n','央视新闻','河北省','2020-02-01','http://m.weibo.cn/2656274875/4467428770078922','','河北新增8例累计104例','2020-02-11'),('2月1日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例2590例（湖北省1921例），新增重症病例315例（湖北省268例），新增死亡病例45例（湖北省45例），新增治愈出院病例85例（湖北省49例），新增疑似病例4562例（湖北省2606例）。截至2月1日24时，国家卫生健康委收到31个省（自治区、直辖市）和新疆生产建设兵团累计报告确诊病例14380例，现有重症病例2110例，累计死亡病例304例，累计治愈出院病例328例，共有疑似病例19544例。目前累计追踪到密切接触者163844人，当日解除医学观察8044人，共有137594人正在接受医学观察。累计收到港澳台地区通报确诊病例31例：香港特别行政区14例，澳门特别行政区7例，台湾地区10例。\n','2020-02-11','ck6hgxcc700f0s27c5jjk01dw','人民网','全国','2020-02-01','http://m.weibo.cn/2286908003/4467427083263906','','全国新增2590例，全国累计确诊14380例','2020-02-11'),('德国巴伐利亚州卫生部1日下午通报了新型冠状病毒感染肺炎的最新情况，一名33岁家住慕尼黑的男子被确诊为第8名患者。与此前7例一样，该名患者同样与巴伐利亚州的全球汽车天窗制造商伟博思通公司有关，系该公司员工，也是该公司的第7名患者，另一患者为其中一人的孩子。伟博思通公司于本周三至周五对公司员工进行了病毒感染检测，截至周六下午，共有2人检测结果为阳性，分别为周五下午确诊的第7名和周六确诊的第8名患者。\n','2020-02-11','ck6hgxcc700f1s27cg1w5852f','人民日报','','2020-02-01','http://m.weibo.cn/2803301701/4467418338138478','','德国再增1例确诊，累计确诊8例','2020-02-11'),('美国马萨诸塞州公共卫生厅2月1日证实，一名20多岁的波士顿男子被证实感染新型冠状病毒，美国疾病控制与预防中心1月31日晚将检测结果呈阳性通知了马萨诸塞州和波士顿市卫生部门。目前，全美已经有8例新型冠状病毒确诊病例,另有36个州的约120名疑似患者正在等待检查结果。据悉，这名男子近日从中国武汉返回马萨诸塞不久，就开始寻求治疗，并一直处于被隔离状态。马萨诸塞州公共卫生专员莫妮卡·巴雷尔博士说:“我们很高兴，这个年轻人正在康复。他就医很及时，马萨诸塞州也一直在为这种新型冠状病毒的可能病例做准备。新型冠状病毒对公众的风险在马萨诸塞州仍然很低。”\n','2020-02-11','ck6hgxcc700f2s27c60fr8iu0','人民日报','','2020-02-01','http://m.weibo.cn/2803301701/4467419994879818','','美国发现第8名感染病人','2020-02-11'),('2020年2月1日12—24时，上海市排除新型冠状病毒感染的肺炎疑似病例32例；新增确诊病例8例，其中1例病情危重。确诊病例中，外地来沪人员1例，上海市常住人口7例。具体情况如下：截至2月1日24时，上海市已累计排除疑似病例374例，发现确诊病例177例。确诊病例中，男性89例，女性88例；年龄最大88岁，最小7岁；109例有湖北居住或旅行史，4例有湖北以外地区居住或旅行史，62例有相关确诊病例接触史，2例无湖北接触史；外地来沪人员74例，上海市常住人员103例。具体情况如下：目前，155例病情平稳，7例病情危重，4例重症，10例治愈出院，1例死亡。尚有168例疑似病例正在排查中。','2020-02-11','ck6hgxcc800f3s27ccad36wpi','央视新闻','上海市','2020-02-01','http://m.weibo.cn/2656274875/4467423908970507','','上海新增8例累计177例','2020-02-11'),('驻欧盟使团发言人就欧盟对华运送12吨疫情防控急需物资发表谈话：维护全球和地区公共卫生安全是国际社会的共同责任。当前，中国防控新型冠状病毒感染肺炎疫情正处于关键阶段，欧盟协调协助成员国向中国运送12吨疫情防控急需物资，体现了欧盟机构、成员国政府和人民对中国政府和人民抗击疫情的大力支持，中方对此表示衷心感谢。\n','2020-02-11','ck6hgxcc800f4s27chjxtbu6l','人民日报','','2020-02-01','http://m.weibo.cn/2803301701/4467413829285064','','欧盟对华运送12吨急需物资','2020-02-11'),('据重庆市公安局最新消息，重庆1日晚发布的“关于新型冠状病毒感染肺炎疫情防控期间对主城区道路实施临时交通管制的通告”，系重庆公安机关紧急情况交通处置预案。根据目前情况，暂不执行。\n','2020-02-11','ck6hgxcc800f5s27c5m668vy1','央视新闻','重庆市','2020-02-01','http://m.weibo.cn/2656274875/4467321000950560','','重庆暂不执行交通管制','2020-02-11'),('2020年2月1日0时-24时，湖北省新增新型冠状病毒感染的肺炎病例1921例（其中：武汉市894例、黄石市43例、十堰市35例、襄阳市94例、宜昌市77例、荆州市46例、荆门市78例、鄂州市51例、孝感市121例、黄冈市276例、咸宁市40例、随州市80例、恩施州18例、仙桃市43例、天门市17例、潜江市8例、神农架林区0例）。全省新增死亡45例  （其中：武汉市32例、荆门市2例、鄂州市4例、孝感市2例、黄冈市1例、随州市2例、仙桃市2例）。新增出院49例（其中：武汉市32例、黄石1例、荆门2例、黄冈市10例、随州市3例、恩施州1例）。截至2020年2月1日24时，湖北省累计报告新型冠状病毒感染的肺炎病例9074例（其中：武汉市4109例、黄石市252例、十堰市212例、襄阳市441例、宜昌市353例、荆州市333例、荆门市329例、鄂州市278例、孝感市749例、黄冈市1002例、咸宁市246例、随州市384例、恩施州105例、仙桃市140例、天门市99例、潜江市35例、神农架林区7例），已治愈出院215例，死亡294例(其中：武汉市224例、黄石市2例、宜昌市1例、荆州市4例、荆门市7例、鄂州市13例、孝感市14例、黄冈市15例、随州3例、仙桃市3例、天门市7例、潜江市1例)。目前仍在院治疗8565例（其中：重症1118例、危重症444例），均在定点医疗机构接受隔离治疗。累计追踪密切接触者48571人，尚在接受医学观察43121人。\n','2020-02-11','ck6hgxccb00f6s27c8lntfi6r','人民网','湖北省','2020-02-01','http://m.weibo.cn/2286908003/4467407114412512','','湖北新增1921例，#湖北累计确诊9704例','2020-02-11'),('2月1日0时至24时，山西省报告新型冠状病毒感染的肺炎新增确诊病例9例。其中：太原市2例（迎泽区1例、万柏林区1例），大同市2例（云冈区1例、天镇县1例），晋中市2例（平遥县2例），忻州市2例（五台县2例），晋城市1例（泽州县1例）。新增重症病例1例（忻州市忻府区1例），新增疑似病例26例。截至2月1日24时，山西省11个市累计报告新型冠状病毒感染的肺炎确诊病例56例（含重症病例3例、危重症病例1例、出院病例1例，无死亡病例)。其中：晋中市13例（平遥县13例），运城市10例（芮城县3例、新绛县3例、河津市2例、万荣县1例、夏县1例），大同市8例（平城区4例、云冈区2例、浑源县1例、天镇县1例），太原市6例（迎泽区3例、小店区1例、万柏林区2例），吕梁市5例（离石区2例、孝义市2例、文水县1例），朔州市3例（应县3例），长治市3例（潞州区1例、长子县2例），晋城市3例（城区1例、陵川县1例、泽州县1例），忻州市3例（忻府区1例、五台县2例），阳泉市1例（城区1例），临汾市1例（乡宁县1例）。治愈出院病例1例（太原市小店区），现有疑似病例64例。1名危重症病例（晋中市平遥县，太原市第四人民医院重症监护隔离治疗）和3名重症病例（吕梁市离石区1例，山西省汾阳医院重症监护隔离治疗；晋中市平遥县1例，太原市第四人民医院重症监护隔离治疗；忻州市忻府区1例，忻州市人民医院重症监护隔离治疗）目前病情基本平稳。省级专家继续驻守医院，进一步指导和参与救治。其余51名普通病例经定点医院医护团队严密监护，中西医结合治疗，目前病情平稳。目前累计追踪到密切接触者1634人，当日解除医学观察95人，共有1307人正在接受医学观察。\n','2020-02-11','ck6hgxccb00f7s27chuocdhus','央视新闻','山西省','2020-02-01','http://m.weibo.cn/2656274875/4467410528767225','','山西新增9例累计56例','2020-02-11'),('2020年2月1日0时-24时，湖北省新增新型冠状病毒感染的肺炎病例1921例（其中：武汉市894例、黄石市43例、十堰市35例、襄阳市94例、宜昌市77例、荆州市46例、荆门市78例、鄂州市51例、孝感市121例、黄冈市276例、咸宁市40例、随州市80例、恩施州18例、仙桃市43例、天门市17例、潜江市8例、神农架林区0例）。全省新增死亡45例  （其中：武汉市32例、荆门市2例、鄂州市4例、孝感市2例、黄冈市1例、随州市2例、仙桃市2例）。新增出院49例（其中：武汉市32例、黄石1例、荆门2例、黄冈市10例、随州市3例、恩施州1例）。截至2020年2月1日24时，湖北省累计报告新型冠状病毒感染的肺炎病例9074例（其中：武汉市4109例、黄石市252例、十堰市212例、襄阳市441例、宜昌市353例、荆州市333例、荆门市329例、鄂州市278例、孝感市749例、黄冈市1002例、咸宁市246例、随州市384例、恩施州105例、仙桃市140例、天门市99例、潜江市35例、神农架林区7例），已治愈出院215例，死亡294例(其中：武汉市224例、黄石市2例、宜昌市1例、荆州市4例、荆门市7例、鄂州市13例、孝感市14例、黄冈市15例、随州3例、仙桃市3例、天门市7例、潜江市1例)。目前仍在院治疗8565例（其中：重症1118例、危重症444例），均在定点医疗机构接受隔离治疗。累计追踪密切接触者48571人，尚在接受医学观察43121人。\n','2020-02-11','ck6hgxccb00f8s27c9zrt2ahz','央视新闻','湖北省','2020-02-01','http://m.weibo.cn/2656274875/4467402274730865','','湖北新增1921例累计9074例','2020-02-11'),('2月1日0时至12时，云南省报告新型冠状病毒感染肺炎新增病例2例。全省累计报告确诊病例93例，除治愈出院2人外，现均在定点医院接受隔离治疗。现有危重3例、重症6例，无死亡病例。现有疑似病例208例，密切接触者医学观察2642人。确诊病例中，昆明市30例、西双版纳州12例、保山市8例，玉溪市7例、昭通市6例、大理州6例、丽江市6例、曲靖市5例、红河州5例、普洱市4例、德宏州3例、临沧市1例。       新增确诊患者情况：       第92例：63岁男性，湖北武汉人，1月15日自驾车从武汉到贵州、云南旅游，1月19日至1月24日先后到罗平、弥勒、元阳、建水、隆阳、瑞丽等地，1月25日到达腾冲，1月31日在腾冲医疗机构收治入院隔离治疗。       第93例：24岁男性，红河建水人，住建水县李浩寨乡，1月21日乘机从武汉至昆明，1月22日乘动车从昆明至建水，当日乘客运班车回到李浩寨家中，1月29日在建水县医疗机构收治入院隔离治疗。\n','2020-02-11','ck6hgxccb00f9s27cajqr0ayx','人民网','云南省','2020-02-01','http://m.weibo.cn/2286908003/4467303099438949','','云南新增2例累计确诊93例','2020-02-11'),('截至2月1日22时，天津市新增3例新型冠状病毒感染的肺炎确诊病例，确诊病例增至41例 。\n','2020-02-11','ck6hgxccc00fas27ccvqsa65f','人民网','天津市','2020-02-01','http://m.weibo.cn/2286908003/4467301023367961','','天津新增3例累计确诊41例','2020-02-11'),('截至2月1日20时，甘肃新增5例新型冠状病毒感染的肺炎确诊病例。新增确诊病例中，兰州市3例、定西市1例、甘南州1例。甘肃累计报告新型冠状病毒感染的肺炎确诊病例40例，其中兰州市23例、白银市1例、临夏州2例、定西市3例、张掖市2例、陇南市3例、金昌市1例、天水市3例、平凉市1例、甘南州1例；累计重症病例6例，危重病例1例。重症病例转普通型病例4例，现有重症病例2例、危重病例1例。       新增疑似病例10例，其中兰州市4例、天水市3例，平凉市1例，陇南市1例，临夏州1例。目前，累计追踪到密切接触者1125人，已解除医学观察79人，其余1046人均正在接受医学观察。\n','2020-02-11','ck6hgxccc00fbs27c793948xg','人民网','甘肃省','2020-02-01','http://m.weibo.cn/2286908003/4467299283257507','','甘肃新增5例累计确诊40例','2020-02-11'),('2月1日，中国红十字会党组书记、常务副会长梁惠玲率领总会工作组赶赴湖北武汉，指导、督促湖北省红十字会、武汉市红十字会做好新型冠状病毒感染的肺炎疫情防控工作，确保捐赠款物使用规范高效、公开透明，主动接受社会监督，为奋战在疫情防控第一线的医护人员提供有力支援，助力打赢疫情防控阻击战。\n','2020-02-11','ck6hgxccc00fcs27c6ifz68n0','人民日报','湖北省','2020-02-01','http://m.weibo.cn/2803301701/4467286260291484','','中国红十字总会派工作组赴武汉','2020-02-11'),('湖北省黄冈市市长说，前期我们认知准备都不足，一些干部重视不够作风不实，导致防控工作存在短板和弱项。①医疗救治能力仍然不足②农村的疫情防控也很薄弱。我们诚恳接受、感谢新闻媒体和社会各方面对我们的监督和批评。\n','2020-02-11','ck6hgxccc00fds27c9v6u5rea','人民网','湖北省','2020-02-01','http://m.weibo.cn/2286908003/4467270207732489','','黄冈处理处分党员干部337人','2020-02-11'),('湖北省人民政府办公厅发布通知：经国务院批准，为加强新型冠状病毒感染肺炎疫情防控工作，有效减少人员聚集，阻断疫情传播，切实保障人民群众生命安全和身体健康，现将延长2020年春节假期的具体安排通知如下。一、延长2020年春节假期至2月13日（包含春节期间来湖北探亲访友休假的外地人员），2月14日起正常上班。二、省内大专院校、中小学、中职学校、技工学校、幼儿园推迟开学，具体时间由教育部门另行通知。三、因疫情防控不能休假的职工，应根据《中华人民共和国劳动法》规定安排补休，未休假期的工资报酬应按照有关政策保障落实。\n','2020-02-11','ck6hgxccc00fes27c72ho5nxy','人民网','湖北省','2020-02-01','http://m.weibo.cn/2286908003/4467268748313842','','湖北延长春节假期2月14日上班','2020-02-11'),('2月1日下午，西藏自治区人民政府召开新型冠状病毒感染的肺炎疫情防治工作新闻发布会。会议通报，截至2020年2月1日12时，西藏自治区累计确诊新型冠状病毒感染的肺炎1例，没有危重症和死亡病例；密切接触者正在接受医学隔离观察。\n','2020-02-11','ck6hgxccc00ffs27cb43g865m','人民网','西藏自治区','2020-02-01','http://m.weibo.cn/2286908003/4467261408432874','','西藏无新增病例累计确诊1例','2020-02-11'),('2020年2月1日0—12时，山东省报告新型冠状病毒感染的肺炎新增确诊病例4例，现有疑似病例77例，累计确诊病例206例(含重症病例12例，危重症病例1例，出院3例，无死亡病例)。目前，累计追踪到密切接触者6389人，已解除医学观察915人，诊断为疑似或确诊74例，尚有5400人正在接受医学观察。\n','2020-02-11','ck6hgxccc00fgs27cgcw03va1','人民网','山东省','2020-02-01','http://m.weibo.cn/2286908003/4467249324684801','','山东新增确诊4例，累计确诊206例','2020-02-11'),('截至2月1日12时，武汉火神山医院项目场地基础施工全部完成，医疗配套工程全面展开。','2020-02-11','ck6hgxccc00fhs27c46rta6q3','人民网','湖北省','2020-02-01','http://m.weibo.cn/2286908003/4467234321334139','','武汉火神山医院基础施工完成，箱式病房安装进度达98%','2020-02-11'),('2月1日，交通运输部下发明电，要求各地切实保障疫情防控应急物资运输车辆顺畅通行，并公布了全国应急物资运输电话。各省份的应急运输电话将保持24小时通畅，及时解决应急运输车辆在通行中遇到的问题。\n','2020-02-11','ck6hgxccc00fis27cfyhl1opg','人民日报','全国','2020-02-01','http://m.weibo.cn/2803301701/4467245503703022','','交通运输部公布全国应急物资运输电话','2020-02-11'),('截至2月1日18时天津市新增1例新型冠状病毒感染的肺炎确诊病例，确诊病例增至38例。第38例患者，男，32岁，居住于天津市宁河区，无武汉旅行史，其与天津市第32例确诊病例为亲戚关系，系密切接触者。1月31日，该患者被转入宁河区集中隔离医学观察点。宁河区疾控中心组织对密切接触者进行筛查时，采取核酸检测，经市、区两级检验和复检，结果均为阳性。2月1日转至市海河医院，经市专家组确诊为天津市第38例病例，为普通型病例。目前患者生命体征平稳。目前，该患者亲属密切接触者已被隔离医学观察，其他密切接触者正在排查中。宁河区疾控中心已对其居住地进行了终末消毒。截至目前，天津市累计发现新型冠状病毒感染的肺炎病例38例，其中男性26例，女性12例；重型15例、普通型23例，无危重及死亡病例。\n','2020-02-11','ck6hgxccc00fjs27c7t64hfiu','人民网','天津市','2020-02-01','http://m.weibo.cn/2286908003/4467244962279853','','天津新增1例累计确诊38例','2020-02-11'),('国务院关税税则委员会发布通知：对按照防控新型冠状病毒感染的肺炎疫情进口物资免税政策进口且原产于美国的物资，不实施对美加征关税措施，即恢复我对美232措施所中止的关税减让义务、不加征我为反制美301措施所加征的关税；已加征税款予以退还。 \n','2020-02-11','ck6hgxccc00fks27ch17s7ci3','央视新闻','全国','2020-02-01','http://m.weibo.cn/2656274875/4467241888563462','','防控疫情进口物资不对美国加征关税','2020-02-11'),('2月1日下午3点50分，合肥市第一人民集团医院南区合肥市滨湖医院首例新型冠状病毒感染的肺炎治愈患者出院，这也是合肥市第二例新冠肺炎治愈患者出院。\n患者为37岁男性，浙江人，有武汉接触史，1月22日上午因头痛伴少许咳嗽在庐江县医院就诊。1月23日，该患者新型冠状病毒核酸PCR检测结果阳性，经安徽省疾控再次确认后，于1月23日，转入合肥市滨湖医院进一步治疗。\n入院后，合肥市滨湖医院根据国家诊疗指南，对患者进行抗病毒等治疗。入院后连续3天体温正常，1月27日，胸部CT提示两肺多发磨玻璃样病变较前好转。1月27日、1月28日，间隔24小时两次咽拭子新型冠状病毒核酸PCR检测均阴性。1月31日，复查胸部CT，该患者肺部磨玻璃影较1月27日胸部CT明显吸收好转。\n患者目前无发热、无咳嗽，无胸闷、无呼吸困难症状。经安徽省专家组评估，符合国家卫健委新型冠状病毒感染的肺炎诊疗方案','2020-02-11','ck6hgxccc00fls27cgepx79na','安徽发布','安徽省','2020-02-01','https://m.weibo.cn/detail/4467207222039564','','合肥市又一位新冠肺炎治愈患者出院','2020-02-11'),('继1月29日四川首例新型冠状病毒肺炎感染者治愈出院后，1月31日四川又有两名患者治愈出院。患者邓某28岁女性，因发热、咳嗽2天收入成都市公共卫生临床医疗中心。入院后患者反复发热，间断咳嗽，胸部CT提示双肺多发感染病灶，经省、市专家组讨论并结合流行病学史、实验室检查诊断为“新型冠状病毒感染肺炎重症”。给予吸氧、抗病毒、祛痰、中医中药、对症支持治疗等，体温降至正常，咳嗽明显好转。患者刘某36岁女性，因发热、咳嗽7天收入成都市公共卫生临床医疗中心。入院后经省、市专家组讨论并结合流行病学史、实验室检查诊断为“新型冠状病毒肺炎 重型”。给予吸氧、抗病毒、化痰、监测生命体征等对症治疗后，患者咳嗽减轻，体温降至正常。入院后，医院根据国家诊疗指南，对患者进行抗病毒等治疗。经省、市专家组讨论，结合疾控中心间隔1天的两次新型冠状病毒核酸检测结果均阴性，达到国家卫健委颁布的新型冠状病毒感染肺炎诊疗方案的出院标准，准予出院。','2020-02-11','ck6hgxccc00fms27cfjqrffpp','人民日报','四川省','2020-02-01','http://m.weibo.cn/2803301701/4467229967622183','','四川已有3名患者出院','2020-02-11'),('2月1日，哈尔滨市卫生健康委员会发布消息，哈尔滨市两名新型冠状病毒感染的肺炎确诊患者经过积极科学治疗后，经两次核酸检测和省市专家联合会诊，确认痊愈。可以解除隔离出院。由居住地疾控和社区对患者进行健康管理。1. 姜xx， 49岁男性。2020年1月13日在武汉时出现发热、咳嗽、咳黄痰，咽痛症状，经治疗后体温正常，仍有咳嗽等症状。于1月20日在汉口乘火车，1月22日到达哈尔滨市就医，通过流行病学史、血常规及CT表现，符合新型冠状病毒感染的肺炎疑似病例，予以隔离治疗。经核酸检测阳性，确诊为哈尔滨市第一例新型冠状病毒感染的肺炎病例，1月23日17:40经120转送至哈尔滨市传染病院隔离病房。入院后按照新型冠状病毒治疗指南给予患者相应治疗，包括对症治疗、干扰素雾化吸入、抗病毒治疗并联合中药等综合治疗。经复查患者肺CT明显好转，且超过三天以上无发热，患者2次核酸检测阴性，经省市专家联合会诊，经确认治愈，可以解除隔离出院。2、姜xx，29岁男性。1月22日乘高铁从武汉至哈尔滨，同行者中有人发热，从车站来到哈尔滨市传染病院，进入留观病区。肺CT检查符合新型冠状病毒感染的肺炎的影像学改变，列为疑似病例。经核酸检测阳性，确诊为新型冠状病毒感染的肺炎。按照治疗指南给予患者相应治疗，并联合中药治疗，经复查患者肺CT基本恢复正常，且超过三天以上无发热，患者2次核酸检测阴性，经市新型冠状病毒感染的肺炎专家组会诊，认为已经治愈，可以解除隔离出院。','2020-02-11','ck6hgxccd00fns27c914g5r6m','人民网','黑龙江省','2020-02-01','http://m.weibo.cn/2286908003/4467220518707681','','黑龙江两名确诊患者治愈出院','2020-02-11'),('在今天举行的北京市新型冠状病毒感染的肺炎疫情防控工作新闻发布会上，北京市政府副秘书长陈蓓表示：再次重申，任何社区、村和物业，在对返京人员体温检测合格后，无权自行阻止其进入社区。','2020-02-11','ck6hgxccd00fos27cgg14agkt','央视新闻','北京市','2020-02-01','http://m.weibo.cn/2656274875/4467212964085290','','社区、村、物业#无权阻止无症状返京人员进社区','2020-02-11'),('记者今天从北京市教委了解到，当前北京各大专院校、中小学、幼儿园推迟开学时间。那么，企业职工家庭谁来看护未成年子女？特殊时期的工资待遇怎么发放？为此，北京市人力社保局联合北京市教委发布了《关于因防控疫情推迟开学企业职工看护未成年子女期间工资待遇问题的通知》，通知明确：每户家庭可有一名职工在家看护未成年子女，视为政府实施隔离措施或采取其他紧急措施导致不能提供正常劳动的情形，期间的工资待遇由职工所属企业按出勤照发。       通知同时指出，职工看护未成年子女期间，企业不得解除劳动合同；劳动合同到期的，顺延至政府隔离措施或采取其他紧急措施结束。鼓励在家看护职工采用电话、网络等灵活办公方式提供劳动；鼓励职工之间调班轮休，发扬互助友爱精神，保证工作和生产正常运转。\n','2020-02-11','ck6hgxccd00fps27c23rs1igk','人民网','北京市','2020-02-01','http://m.weibo.cn/2286908003/4467211135693849','','北京市规定：延期开学期间每户家庭可有一名职工在家看护未成年子女 工资待遇照发','2020-02-11'),('截至2月1日12时，本市累计确诊病例168例。东城区3例、西城区17例、朝阳区28例、海淀区39例、丰台区16例、石景山区3例、门头沟区1例、房山区2例、通州区13例、顺义区2例、昌平区12例、大兴区20例、怀柔区1例、外地来京人员11例。平谷区、密云区、延庆区尚未有病例。本市今日又有4名新型冠状病毒感染的肺炎患者，经过治疗后符合出院标准，已出院。其中地坛医院1例，佑安医院3例。4名患者中，年龄最小的18岁，最大的42岁，平均住院天数10.25天。截至2月1日16时，本市死亡1例，出院9例，在定点医院进行隔离治疗158例，其中危重型7例。\n','2020-02-11','ck6hgxccd00fqs27c84625vt7','人民网','北京市','2020-02-01','http://m.weibo.cn/2286908003/4467200024604002','','北京累计确诊168例，新增治愈出院4例','2020-02-11'),('截至2月1日12时，广东省累计报告新型冠状病毒感染的肺炎确诊病例535例。1日0-12时全省新增确诊病例15例，新增出院1例。新增确诊病例中，广州市13例、佛山市1例、梅州市1例。累计报告确诊病例中，深圳市170例、广州市150例、佛山市39例、珠海市38例、东莞市21例、惠州市20例、中山市18例、汕头市14例、湛江市13例、阳江市10例、肇庆市6例、清远市6例、梅州市6例、揭阳市6例、韶关市4例、汕尾市4例、茂名市3例、江门市3例、潮州市3例、河源市1例。男性261例，女性274例，年龄介于10月龄-86岁之间。截至2月1日12时，535例确诊病例中，危重18例,重症50例，普通病例456例，出院11例，无死亡病例。\n','2020-02-11','ck6hgxccd00frs27c6aty7wkq','人民日报','广东省','2020-02-01','http://m.weibo.cn/2803301701/4467199076760825','','广东新增确诊15例，广东累计确诊535例','2020-02-11'),('1月31日23时30分至2月1日14时30分，辽宁新增3例输入性新型冠状病毒感染的肺炎确诊病例。其中大连市2例，阜新市1例。       截至2020年2月1日14时30分，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例63例，其中重型病例6例，大连市治愈出院1例。确诊病例中，沈阳市13例（1例为铁岭市转至沈阳市就诊）、大连市10例、鞍山市1例、本溪市3例、丹东市5例、锦州市7例、营口市1例、阜新市2例，辽阳市1例、铁岭市2例、朝阳市6例、盘锦市7例、葫芦岛市5例。       目前62名在治患者均在定点医疗机构隔离治疗，病情平稳。62名在治患者中，51例病例为输入性病例，6例病例为武汉输入病例家属，4例为现有确诊病例的密切接触者，1例正在对其感染情况进行流行病调查。       目前累计追踪到密切接触者898人，已解除医学观察110人，现有788人正在接受医学观察，其余正在追踪中。\n','2020-02-11','ck6hgxccd00fss27c3caf675y','人民网','辽宁省','2020-02-01','http://m.weibo.cn/2286908003/4467168382678067','','辽宁新增3例累计确诊63例','2020-02-11'),('2020年2月1日0-12时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例9例，新增出院病例2例。截至2月1日12时，重庆市累计报告新型冠状病毒感染的肺炎确诊病例247例，重型病例20例，危重型病例6例，死亡病例1例，出院病例3例。累计追踪到密切接触者6026人，已解除医学观察1188人，尚有4838人正在接受医学观察。\n','2020-02-11','ck6hgxccd00fts27c5wxeh7f7','人民网','重庆市','2020-02-01','http://m.weibo.cn/2286908003/4467184711546635','','重庆新增9例累计确诊247例','2020-02-11'),('北医三院产科专家：目前，没有足够数据证明新型冠状病毒感染母胎传播的风险问题。如孕妇确诊，医生会综合病人的孕周、疾病严重程度等具体情况，必要时要跟产科、传染病、重症ICU、新生儿科等在内的医生共同讨论，决定是否继续妊娠。保证孕妇的安全，是最重要的。\n','2020-02-11','ck6hgxccd00fus27cbpxu2g1s','央视新闻','全国','2020-02-01','http://m.weibo.cn/2656274875/4467186167140795','','没有足够数据证明疫情母胎传播风险','2020-02-11'),('经湖北黄冈市新型冠状病毒感染的肺炎疫情防控工作指挥部研究，决定从今天起，在黄冈市区范围内实行居民出行管控措施。即日起，严格控制市区居民出行。#每个家庭每2天可派1人上街采购#，其他人员除生病就医、疫情防控工作需要、在商超和药店上班外，不得外出。措施解除时间另行通知。\n','2020-02-11','ck6hgxccd00fvs27cajwihrlv','人民网','湖北省','2020-02-01','http://m.weibo.cn/2286908003/4467178789580490','','湖北黄冈实行市区人口出行管控措施','2020-02-11'),('湖北省民政厅决定，自2020年2月3日起，全省各婚姻登记机关暂停办理所有婚姻登记业务，具体恢复时间视疫情防控情况另行通知。请各婚姻登记机关提前发布公告，并做好解释工作。特此公告。\n','2020-02-11','ck6hgxccd00fws27ceu3gb8lc','人民网','湖北省','2020-02-01','http://m.weibo.cn/2286908003/4467182802907988','','2月3日起，湖北暂停办理所有婚姻登记业务','2020-02-11'),('2月1日，经过长沙县第一人民医院医护人员9天的精心救治，新型冠状病毒感染的肺炎确诊患者，4岁女童蒋某，救治情况良好，符合出院标准，于当日12时58分治愈出院。这也是长沙县首例新型冠状病毒感染的肺炎确诊患者治愈出院。','2020-02-11','ck6hgxccd00fxs27cbre9drel','人民日报','湖南省','2020-02-01','http://m.weibo.cn/2803301701/4467163957613361','','湖南4岁最小患者出院','2020-02-11'),('2020年2月1日0—12时，上海市排除新型冠状病毒感染的肺炎疑似病例46例；新增治愈出院1例；新增确诊病例16例，其中外地来沪人员5例，本市常住人口11例。具体情况如下图。截至2月1日12时，上海市已累计排除疑似病例342例，发现确诊病例169例。确诊病例中，男性82例，女性87例；年龄最大88岁，最小7岁；105例有湖北居住或旅行史，3例有湖北以外省市居住或旅行史，59例有相关确诊病例接触史，2例无湖北接触史；外地来沪人员73例，本市常住人员96例。具体情况如下图。目前，149例病情平稳，6例病情危重，3例重症，10例治愈出院，1例死亡。尚有166例疑似病例正在排查中。\n','2020-02-11','ck6hgxccd00fys27c3wo4dj6a','人民网','上海市','2020-02-01','http://m.weibo.cn/2286908003/4467156559582561','','上海新增病例16例，新增治愈出院1例','2020-02-11'),('今天下午14:00，上海市政府举行疫情防控工作新闻发布会，通报上海最新防控举措。看直播，关注！\n','2020-02-11','ck6hgxccd00fzs27ch7h6grmw','央视新闻','上海市','2020-02-01','http://m.weibo.cn/2656274875/4467157780320253','','直播！#上海疫情防控发布会#','2020-02-11'),('截至2月1日10时，天津市新增3例新型冠状病毒感染的肺炎确诊病例，确诊病例增至37例。\n','2020-02-11','ck6hgxccd00g0s27caxfue30f','人民网','天津市','2020-02-01','http://m.weibo.cn/2286908003/4467148561089777','','天津新增3例累计确诊37例','2020-02-11'),('海南省新型冠状病毒感染肺炎疫情防控工作指挥部决定：海南省各级各类学校（含高校、中职学校、中小学、幼儿园等）于2月24日前不得开学。为有效应对“返工潮”对海南防疫工作的影响，海南省企业可灵活安排工作。从岛外返琼人员一律实行14天隔离观察，有症状的一律集中观察。\n','2020-02-11','ck6hgxcce00g1s27c5c580o7x','央视新闻','海南省','2020-02-01','http://m.weibo.cn/2656274875/4467136301294623','','海南2月24日前不得开学','2020-02-11'),('1月31日14时至24时，北京市新增17例新型冠状病毒感染的肺炎病例。均已送至定点医疗机构进行救治。截至1月31日24时，北京市累计确诊病例156例，其中死亡1例，出院5例，150例在定点医院进行隔离治疗。东城区3例、西城区17例、朝阳区27例、海淀区35例、丰台区12例、石景山区3例、门头沟区1例、通州区13例、顺义区2例、大兴区19例、昌平区12例、怀柔区1例，外地来京人员11例。房山区、平谷区、密云区、延庆区尚未有病例。','2020-02-11','ck6hgxcce00g2s27c3elx3wu6','人民网','北京市','2020-02-01','http://m.weibo.cn/2286908003/4467126578249465','','北京新增17例累计确诊156例','2020-02-11'),('1月31日，河北省新增确诊病例14例。截至1月31日24时，河北省累计报告确诊病例96例，其中死亡1例，现有重症病例8例，无治愈出院病例。现有疑似病例88例。目前累计追踪到密切接触者2354人，当日解除隔离医学观察52人，现有2045人正在接受隔离医学观察。\n','2020-02-11','ck6hgxcce00g3s27c783rbvao','央视新闻','河北省','2020-02-01','http://m.weibo.cn/2656274875/4467125919652362','','河北新增14例累计确诊96例','2020-02-11'),('1月31日12时至24时，云南省报告新型冠状病毒感染肺炎新增病例8例。全省累计报告确诊病例91例，除治愈出院1人外，现均在定点医院接受隔离治疗。现有危重3例、重症5例，无死亡病例。现有疑似病例228例，密切接触者医学观察2642人。\n','2020-02-11','ck6hgxcce00g4s27cakgd2poz','人民网','云南省','2020-02-01','http://m.weibo.cn/2286908003/4467125530061449','','云南新增8例，累计确诊91例','2020-02-11'),('1月31日14时至24时，北京市新增17例新型冠状病毒感染的肺炎病例。均已送至定点医疗机构进行救治。截至1月31日24时，北京市累计确诊病例156例，其中死亡1例，出院5例，150例在定点医院进行隔离治疗。\n','2020-02-11','ck6hgxcce00g5s27cd41024lv','央视新闻','北京市','2020-02-01','http://m.weibo.cn/2656274875/4467124950636407','','北京新增17例，累计确诊156例','2020-02-11'),('截至1月31日，日本国内新型冠状病毒感染者总数为17人。东京奥组委当天发表声明说，计划于7月24日开幕的2020年东京奥运会“不会因疫情而取消”，东京奥组委将会与国际奥委会等相关组织密切合作，采取必要的应对措施。东京奥组委：2020年东京奥运会“不会因疫情取消” \n','2020-02-11','ck6hgxcce00g6s27c9l447awi','央视新闻','','2020-02-01','http://m.weibo.cn/2656274875/4467120673316074','','东京奥运会不会因疫情取消','2020-02-11'),('1月31日0—24时，福建省报告新增新型冠状病毒感染的肺炎确诊病例24例（重症2例）。报告新增新型冠状病毒感染的肺炎疑似病例52例。截至1月31日24时，福建省累计报告新型冠状病毒感染的肺炎确诊病例144例（危重症3例、重症8例，无死亡病例）。目前，确诊、疑似病例的密切接触者已解除医学观察193人，尚有3048人正在接受医学观察。','2020-02-11','ck6hgxcce00g7s27c5z85bl43','人民日报','福建省','2020-02-01','http://m.weibo.cn/2803301701/4467116050603919','','福建新增24例，累计确诊144例','2020-02-11'),('2020年1月31日10时至2月1日10时，内蒙古自治区报告新型冠状病毒感染的肺炎新增确诊病例3例，新增疑似病例5例，新增出院病例1例，新增重症1例，重症转为普通病例1例。截至2020年2月1日10时, 内蒙古自治区累计报告新型冠状病毒感染的肺炎确诊病例23例（包括出院病例1例），疑似病例5例。目前，追踪到的密切接触者634人，尚在接受医学观察中。当日解除医学观察53人。','2020-02-11','ck6hgxcce00g8s27c3wde6pbe','人民网','内蒙古自治区','2020-02-01','http://m.weibo.cn/2286908003/4467111365229687','','内蒙古新增3例，累计确诊23例','2020-02-11'),('2020年1月31日0-24时，青海省报告新型冠状病毒感染的