接受医学观察2700例。\n','2020-02-11','ck6hgxccg00gts27cdyg31tcz','人民日报','广西壮族自治区','2020-02-01','http://m.weibo.cn/2803301701/4467071868004778','','广西新增病例13例，累计100例','2020-02-11'),('截至1月31日22时，天津无新增病例，天津累计确诊32例，无新增确诊病例。\n','2020-02-11','ck6hgxccg00gus27c5nsva0st','人民网','天津市','2020-02-01','http://m.weibo.cn/2286908003/4467069707530779','','天津无新增病例','2020-02-11'),('1月31日，河北省新增确诊病例14例。新增疑似病例47例。截至1月31日24时，河北省累计报告确诊病例96例，其中死亡1例，现有重症病例8例，无治愈出院病例。目前累计追踪到密切接触者2354人，当日解除隔离医学观察52人，现有2045人正在接受隔离医学观察。\n','2020-02-11','ck6hgxccg00gvs27c4pqffols','人民网','河北省','2020-02-01','http://m.weibo.cn/2286908003/4467067640236588','','河北新增确诊病例14例','2020-02-11'),('1月31日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例2102例，新增重症病例268例，新增死亡病例46例，新增治愈出院病例72例，新增疑似病例5019例。截至1月31日24时，国家卫生健康委收到31个省（自治区、直辖市）和新疆生产建设兵团累计报告确诊病例11791例，现有重症病例1795例，累计死亡病例259例，累计治愈出院病例243例，共有疑似病例17988例。目前累计追踪到密切接触者136987人，当日解除医学观察6509人，共有118478人正在接受医学观察。累计收到港澳台地区通报确诊病例30例：香港特别行政区13例，澳门特别行政区7例，台湾地区10例。\n','2020-02-11','ck6hgxccg00gws27cgb8y51yd','人民网','全国','2020-02-01','http://m.weibo.cn/2286908003/4467067467680627','','全国新增2102例，累计11791例','2020-02-11'),('2020年1月31日12—24时，上海市排除新型冠状病毒感染的肺炎疑似病例51例，新增确诊病例18例，其中外地来沪人员6例，本市常住人口12例。截至1月31日24时，上海市已累计排除疑似病例296例，发现确诊病例153例。目前，134例病情平稳，6例病情危重，3例重症，9例治愈出院，1例死亡。尚有167例疑似病例正在排查中。\n','2020-02-11','ck6hgxccg00gxs27ca6gw5d3l','人民日报','上海市','2020-01-31','http://m.weibo.cn/2803301701/4467064582166606','','上海新增病例18例，累计153例','2020-02-11'),('天津市新型冠状病毒感染的肺炎疫情防控工作指挥部发布延迟企业复工和学校开学的通知：本市区域内除涉及保障城乡运行必需（供水、供电、油气、通讯、公共交通、环保、市政环卫等行业）、疫情防控必需（医疗器械、药品、防护用品生产运输和销售等行业）、群众生活必需（超市卖场、食品生产、物流配送等行业）和其他涉及重要国计民生的相关企业之外，其他类企业暂不复工。本市各级各类学校延期开学。复工、开学具体时间将提前通知，给企业、学校留出准备时间。\n','2020-02-11','ck6hgxccg00gys27cdyp02f8o','人民日报','天津市','2020-01-31','http://m.weibo.cn/2803301701/4467062858703126','','天津延期复工开学','2020-02-11'),('2020年1月31日0时至24时，山西省报告新型冠状病毒感染的肺炎新增确诊病例8例。其中：晋城市、忻州市为首次报告确诊病例。治愈出院病例1例，现有疑似病例75例。1名危重症病例和2名重症病例，目前病情基本平稳。其余43名普通病例经定点医院医护团队严密监护，中西医结合治疗，目前病情平稳。目前累计追踪到密切接触者1333人，当日解除医学观察41人，共有1101人正在接受医学观察。\n','2020-02-11','ck6hgxccg00gzs27chcnu57ni','人民网','山西省','2020-01-31','http://m.weibo.cn/2286908003/4467057439683536','','山西新增确诊病例8例','2020-02-11'),('当地时间31日晚，在西班牙戈梅拉岛（LA GOMERA）确诊一名新型冠状病毒感染的肺炎病例。该患者为德国国籍，目前他在岛上的医院接受隔离和治疗。戈梅拉岛是西班牙加那利群岛中的一个岛屿，是德国人与英国人的度假圣地，该岛距离首都马德里约2000公里远。','2020-02-11','ck6hgxccg00h0s27c5i9m1kwi','央视新闻','','2020-01-31','http://m.weibo.cn/2656274875/4467053542613002','','西班牙确诊首例病例','2020-02-11'),('德国巴伐利亚州卫生部31日宣布，当日再确诊两名新型冠状病毒感染的肺炎患者，累计确诊已达7例。据介绍，这两名新确诊患者均与前5名患者有密切接触，其中31日下午确诊的第6名患者为30日确诊的第5例确诊男子的孩子，这既是德国首例儿童确诊患者，也是德国第一起家庭成员间感染的病例。\n','2020-02-11','ck6hgxcch00h1s27cft0scc1l','人民日报','','2020-01-31','http://m.weibo.cn/2803301701/4467052859116854','','德国确诊增至7例，出现德国首例儿童确诊患者','2020-02-11'),('2020年1月31日12—24时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例27例，新增重型病例2例，新增危重型病例2例，新增死亡病例1例。死亡病例为九龙坡区1例；出院病例为巫山县1例。累计追踪到密切接触者5868人，已解除医学观察1079人，尚有4789人正在接受医学观察。','2020-02-11','ck6hgxcch00h2s27cgoiu6n0v','央视新闻','重庆市','2020-01-31','http://m.weibo.cn/2656274875/4467051328078495','','重庆新增27例，新增死亡1例子，累计确诊238例','2020-02-11'),('2020年1月31日0时-24时，湖北省新增新型冠状病毒感染的肺炎病例1347例。全省新增死亡45例。新增出院50例。截至2020年1月31日24时，湖北省累计报告新型冠状病毒感染的肺炎病例7153例，已治愈出院166例，死亡249例。目前仍在院治疗6738例，均在定点医疗机构接受隔离治疗。累计追踪密切接触者41075人，尚在接受医学观察36838人。\n','2020-02-11','ck6hgxcch00h3s27cf3bm15zl','人民日报','湖北省','2020-01-31','http://m.weibo.cn/2803301701/4467041535010042','','湖北新增病例·1347例，累计7153例','2020-02-11'),('31日10时30分至23时30分，辽宁省新增12例新型冠状病毒感染的肺炎确诊病例，其中沈阳市2例,大连市1例,鞍山市1例，锦州市2例，阜新市1例，朝阳市1例，盘锦市3例，葫芦岛市1例，均属普通型病例。目前累计追踪到密切接触者804人，已解除医学观察95人，现有709人正在接受医学观察，其余正在追踪中。','2020-02-11','ck6hgxcch00h4s27ccqnzda7g','央视新闻','辽宁省','2020-01-31','http://m.weibo.cn/2656274875/4466940620072408','','辽宁新增12例，累计确诊60例','2020-02-11'),('武汉市副市长徐洪兰：近期捐赠武汉市蔬菜总量累计达8500吨，蔬菜存量将达3.44万吨，可保障武汉市场一周左右的供应。武汉市当前蔬菜的供应还是充足的，请广大市民放心！\n','2020-02-11','ck6hgxcch00h5s27cgl4z3dj8','人民网','湖北省','2020-01-31','http://m.weibo.cn/2286908003/4466919656525262','','武汉蔬菜存量达3.44万吨','2020-02-11'),('武汉市政府党组成员李强：截至31日12点，武汉共收到社会捐款25.86亿元，目前首批非定向社会捐助款已经使用8.4191亿元。截至30日，红十字会共接收27笔社会捐赠的国内防疫急需物资，大类有口罩9316箱，防护服74122套，护目镜80456个，还有其他的药品和医疗器械，捐赠物资是由指挥部根据各医疗机构的统一需求统一调拨。累计接受社会捐赠资金六亿零八百零八万，目前已拨付一亿五千八百五十九万元，交由统筹部使用，已经拨付给受捐单位。下一步将加强信息统一发布，加快捐赠物资的流转，同时专款专物将依法依规依程序公布，同时欢迎社会各界监督。\n','2020-02-11','ck6hgxcch00h6s27celh1cu9m','人民网','湖北省','2020-01-31','http://m.weibo.cn/2286908003/4466915378703586','','武汉已收到社会捐款25.86亿元','2020-02-11'),('武汉市委副书记、市长周先旺：截至30日24时，武汉累计确诊病人2639人，治愈出院103例，死亡159人。目前武汉地区共有6万余名医务工作者参与救治；共有42支医疗队支援武汉，医护人员4599人。我要向所有奋战在武汉疫情防控第一线的医务人员表示衷心的感谢和崇高的敬意。 ','2020-02-11','ck6hgxcch00h7s27cgcemfkcb','央视新闻','湖北省','2020-01-31','http://m.weibo.cn/2656274875/4466908311292157','','6万余名医务工作者奋战武汉','2020-02-11'),('31日，俄副总理、新型冠状病毒疫情防控指挥部负责人戈利科娃通报，俄罗斯发现2例新型冠状病毒感染的肺炎确诊病例。两人都是中国公民，目前分别位于俄后贝加尔边疆区和秋明州。 \n','2020-02-11','ck6hgxcch00h8s27cc9dx3bk2','人民日报','','2020-01-31','http://m.weibo.cn/2803301701/4466902111855603','','俄罗斯确诊2例新型肺炎病例','2020-02-11'),('今天下午5点左右，武汉市金银潭医院共有20名新型冠状病毒肺炎患者集体出院，其中，最大年龄64岁，最小年龄15岁。这是疫情发生以来同时出院人数最多一次。截至目前，武汉市金银潭医院累计出院确诊患者72例。 \n','2020-02-11','ck6hgxcch00h9s27c3wdo14be','人民日报','湖北省','2020-01-31','http://m.weibo.cn/2803301701/4466896252155552','','武汉金银潭医院20名患者集体出院','2020-02-11'),('工信部消息称，截至30日24时，共协调能进入重症监护病室的医用防护服厂家发货10.18万件，已运抵湖北8.63万件；协调医用护目镜厂家发货12万件，已运抵湖北8.99万件；协调全自动红外测温仪厂家发货57台，已运抵湖北52台；协调免洗手消毒液5.63吨，已运抵湖北5吨；协调84消毒液3.2万箱已全部运抵湖北。\n','2020-02-11','ck6hgxcci00hfs27cbx8e0ih9','人民网','湖北省','2020-01-31','http://m.weibo.cn/2286908003/4466888156940638','','工信部：共协调医用防护服厂家发货10.18万件','2020-02-11'),('北京市政府发布关于新型冠状病毒感染的肺炎疫情防控期间本市企业灵活安排工作的通知，明确提出：在2020年2月9日24时前，本市行政区域内疫情防控必需（药品、防护用品以及医疗器械生产、运输、销售等行业）、保障城市运行必需（供水、供电、油气、通讯、市政、市内公共交通等行业）、群众生活必需（超市卖场、食品生产和供应、物流配送、物业等行业）、重点项目建设施工以及其他涉及重要国计民生的相关企业应当安排职工正常到单位上班。对确因工作需要于2020年2月9日24时前正常到单位上班的职工，各企业应当对其加强体温检测和健康防护，及时报告相关信息，做到防护工作全员覆盖。\n','2020-02-11','ck6hgxcci00hgs27caa3aetri','人民日报','北京市','2020-01-31','http://m.weibo.cn/2803301701/4466888027314009','','北京除必需行业企业2月10日上班','2020-02-11'),('今天，中央应对新型冠状病毒感染肺炎疫情工作领导小组召开小组会议指出，春节假期即将结束，有序做好返程人员疫情防控极为重要。①同意湖北省将春节假期适当延长，目前人在湖北、工作在外地的人员同样延长假期，暂不返回工作地，以利于疫情防控。②新增病例增长快地区，履行法定程序后可推迟开工开业开课。③疫情防控急需的医疗物资、群众基本生活保障行业，要抓紧组织复工。④高等学校要错峰安排返校。\n','2020-02-11','ck6hgxcci00hhs27c84q763mr','央视新闻','湖北省','2020-01-31','http://m.weibo.cn/2656274875/4466874543112332','','湖北将适当延长春节假期','2020-02-11'),('1月31日，雷神山医院医护宿舍主体结构已基本完工，医护宿舍区内部正紧张建设中，建设者们争分夺秒，与时间赛跑！预计在2月5日能够全部完工交付！\n','2020-02-11','ck6hgxcci00his27cegefdust','人民网','湖北省','2020-01-31','http://m.weibo.cn/2286908003/4466870662475178','','雷神山医院2月5日全部完工交付','2020-02-11'),('31日，继向泰国和马来西亚派出两架民航包机后，民航局紧急协调第三架民航包机，前往日本接回滞留的湖北籍旅客。该航班由春秋航空执飞，计划31日晚从上海出发，2月1日凌晨从东京羽田机场起飞，5时50分抵达武汉天河机场。目前在日本东京及周边地区约有350名湖北籍人员愿乘包机尽快返回武汉。\n','2020-02-11','ck6hgxcci00hjs27cht9wfz90','人民网','','2020-01-31','http://m.weibo.cn/2286908003/4466867567591693','','民航局派包机赴日本接湖北籍滞留同胞','2020-02-11'),('记者从天津市疾控中心获悉，截至1月31日18时天津市新型冠状病毒感染的肺炎共确诊32例，无新增确诊病例。\n','2020-02-11','ck6hgxcci00hks27c7609dbyf','人民日报','天津市','2020-01-31','http://m.weibo.cn/2803301701/4466862819288806','','31日截至18时天津无新增病例','2020-02-11'),('英格兰公共卫生部门表示，英国确诊两例新型冠状病毒感染肺炎。\n','2020-02-11','ck6hgxcci00hls27c3u2l1ixq','人民日报','','2020-01-31','http://m.weibo.cn/2803301701/4466850282364480','','英国确诊2例新型冠状病毒感染肺炎','2020-02-11'),('泰国《泰叻》新闻网站报道，1月31日泰国确认首个本地病例，为曼谷的一位出租车司机，该病例并未去过中国，但可能承载过中国游客，目前已送医院治疗。截至31日，泰国共确诊19例新型冠状病毒感染的肺炎病例。','2020-02-11','ck6hgxcci00hms27cdc8z5kcy','人民日报','','2020-01-31','http://m.weibo.cn/2803301701/4466860181840215','','泰国出现首个本地病例，累计确诊19例','2020-02-11'),('日本新增1例病例，累计确诊增至15例。日本厚生劳动省31日确认，目前日本已确诊15例新型冠状病毒感染的肺炎病例。最新确认的一例为生活在千叶县的20多岁女性导游，主要服务对象为中国旅行团。 \n','2020-02-11','ck6hgxccn00hns27c7gbu9kxh','人民日报','','2020-01-31','http://m.weibo.cn/2803301701/4466858806030862','','日本新增1例病例','2020-02-11'),('2020年1月31日0—12时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例5例。　　新增确诊病例中，万州区1例、渝中区1例、长寿区1例、巫溪县1例、石柱县1例。累计追踪到密切接触者5181人，已解除医学观察822人，尚有4359人正在接受医学观察。\n','2020-02-11','ck6hgxccn00hps27cam3a2yn1','人民日报','重庆市','2020-01-31','http://m.weibo.cn/2803301701/4466848076495557','','重庆新增5例，累计确诊病例211例','2020-02-11'),('1月31日13时30分，云南红河州首例确诊的新型冠状病毒感染肺炎患者车女士治愈出院。患者车女士，1月16日自武汉返回蒙自后出现发热、头痛、胸闷等症状，1月24日前往蒙自市人民医院确诊为新型冠状病毒感染肺炎患者。1月25日转入红河州第一人民医院隔离治疗。1月28日，专家组对患者进行新型冠状病毒核酸检测，呈现阴性，1月30日，第二次核酸检测也呈现阴性。经过多方检查，决定让车女士出院。\n','2020-02-11','ck6hgxccn00hqs27c2u5h5zyj','人民日报','云南省','2020-01-31','http://m.weibo.cn/2803301701/4466834659563008','','云南红河首例确诊患者治愈出院','2020-02-11'),('截至1月31日12时，广东累计报告新型冠状病毒感染的肺炎确诊病例436例。31日0-12时全省新增确诊病例43例，新增出院1例。男性218例，女性218例，年龄介于10月龄-86岁之间。　　截至1月31日12时，全省累计出院10例，在院治疗426例，其中：危重14例，重症41例，普通病例371例，无死亡病例。\n','2020-02-11','ck6hgxccn00hrs27cey7s1rf5','人民日报','广东省','2020-01-31','http://m.weibo.cn/2803301701/4466836776905332','','广东新增确诊病例43例，累计436例','2020-02-11'),('1月30日24时至31日14时，北京市新增7例新型冠状病毒感染的肺炎病例，其中6例有湖北及其他省份接触史，5例为确诊病例的密切接触者，4例既有湖北及其他省份接触史又是确诊病例的密切接触者。均已送至市级定点医疗机构进行救治。','2020-02-11','ck6hgxcco00hus27cf5x45wn2','人民网','北京市','2020-01-31','http://m.weibo.cn/2286908003/4466833493042547','','北京新增7例确诊病例','2020-02-11'),('1月31日，内蒙古自治区新型冠状病毒感染肺炎防控工作指挥部发布消息，满洲里市1名新型冠状病毒感染的肺炎男患者于1月31日痊愈出院，为内蒙古首例治愈出院的新型冠状病毒感染的肺炎患者。　　\n','2020-02-11','ck6hgxcco00hvs27cb2sm7ajf','人民日报','内蒙古自治区','2020-01-31','http://m.weibo.cn/2803301701/4466829773125488','','内蒙古首例确诊患者治愈出院','2020-02-11'),('据云南省委省政府应对新冠疫情工作领导小组指挥部，截至1月31日12时，全省累计报告新型冠状病毒感染肺炎确诊病例83例。全省报告疑似病例204例。密切接触者医学观察2480人，第一批隔离观察的16位密切接触者已解除隔离。1名确诊病例治愈出院。','2020-02-11','ck6hgxcco00hws27cgkg1fr5x','人民网','云南省','2020-01-31','https://m.weibo.cn/detail/4466818405824999','','云南1例确诊病例治愈出院','2020-02-11'),('1月30日，全国新增确诊病例1982例，累计报告确诊病例9692例。国家卫生健康委定于1月31日下午15时召开新闻发布会，介绍新型冠状病毒感染的肺炎疫情防控工作中重点人群和社区组织的健康防护情况。\n','2020-02-11','ck6hgxcco00hxs27cbe8d4n6h','人民日报','全国','2020-01-31','http://m.weibo.cn/2803301701/4466810978360883','','卫健委新闻发布会','2020-02-11'),('韩联社快讯，韩国新确诊4例新型冠状病毒感染肺炎患者，患者总数达11名。\n','2020-02-11','ck6hgxcco00hys27c3i96gn2p','人民日报','','2020-01-31','http://m.weibo.cn/2803301701/4466795492635758','','韩国新增4例','2020-02-11'),('市卫健委今天（31日）通报：2020年1月31日0—12时，上海市排除新型冠状病毒感染的肺炎疑似病例20例；新增治愈出院4例；新增确诊病例7例，其中外地来沪人员4例，本市常住人口3例。','2020-02-11','ck6hgxcco00hzs27ceefjasgt','上海发布','上海市','2020-01-31','https://m.weibo.cn/2539961154/4466786235429874','','上海新增7例新型冠状病毒感染的肺炎确诊病例','2020-02-11'),('2020年1月31日0时至10时30分，辽宁省新增3例新型冠状病毒感染的肺炎确诊病例，其中锦州市1例,铁岭市1例,盘锦市1例,均属普通型病例。','2020-02-11','ck6hgxcco00i0s27ce7vpcoee','人民网','辽宁省','2020-01-31','https://m.weibo.cn/detail/4466772323364663','','辽宁新增3例，累计确诊48例','2020-02-11'),('陕西新增24例，累计87例，截至1月31日10时，陕西新增24例新型冠状病毒感染的肺炎确诊病例，新增疑似病例47例。\n','2020-02-11','ck6hgxcco00i1s27c8w8oeddo','人民日报','陕西省','2020-01-31','http://m.weibo.cn/2803301701/4466744540699394','','陕西新增24例','2020-02-11'),('北京新增11例，据@首都健康 ，1月30日20时至24时，本市新增11例新型冠状病毒感染的肺炎病例，7例有湖北及其他省份接触史，5例为确诊病例的密切接触者，其中1例既有湖北接触史又是确诊病例的密切接触者。均已送至市级定点医疗机构进行救治。\n','2020-02-11','ck6hgxcco00i2s27c2oz296yn','人民日报','北京市','2020-01-31','http://m.weibo.cn/2803301701/4466769508479860','','北京新增11例','2020-02-11'),('福建新增19例累计确诊120例，1月30日0—24时，福建省报告新增新型冠状病毒感染的肺炎确诊病例19例。','2020-02-11','ck6hgxcco00i3s27c8ot87deq','央视新闻','福建省','2020-01-31','http://m.weibo.cn/2656274875/4466764769146051','','福建新增19例累计确诊120例','2020-02-11'),('上海4例确诊病例痊愈出院，经上海市专家组评估，上海又有4例新型冠状病毒感染的肺炎患者痊愈出院，目前共有9例出院。','2020-02-11','ck6hgxcco00i4s27c5513g04s','人民日报','上海市','2020-01-31','http://m.weibo.cn/2803301701/4466744082576630','','上海4例确诊病例痊愈出院','2020-02-11'),('1月30日12时至24时，云南省报告新型冠状病毒感染的肺炎新增病例4例。全省累计报告确诊病例80例，现有危重3例、重症5例，无死亡病例。','2020-02-11','ck6hgxcco00i5s27c4mgp98c9','云南发布','云南省','2020-01-31','https://m.weibo.cn/status/4466765306571887?','','新增确诊4例！云南累计报告确诊病例80例','2020-02-11'),('1月30日，民政部办公厅印发《关于切实做好殡葬服务、婚姻登记等服务机构新型冠状病毒感染肺炎疫情防控工作的紧急通知》，通知要求：①劝导群众从简从快办理丧事活动，避免人员聚集扎堆；②对已宣布或承诺今年２月２日开放婚姻登记的地方，建议取消，并向社会公告；③正常工作日提倡预约服务，避免扎堆登记，疫情期间原则上暂停婚姻家庭辅导服务和结婚颁证服务，不举办集体颁证仪式，并积极引导群众不要举办人群聚集的结婚宴席。','2020-02-11','ck6hgxccp00ias27ceco7acnv','人民日报','全国','2020-01-31','http://m.weibo.cn/2803301701/4466731139308159','','民政部建议取消２月２日婚姻登记','2020-02-11'),('2020年1月30日0-24时，湖南省报告新型冠状病毒感染的肺炎新增确诊病例55例，新增重症病例10例（其中6例为既往确诊病例），新增死亡病例0例，新增出院病例2例。截至1月30日24时，湖南省累计报告新型冠状病毒感染的肺炎确诊病例332例，累计报告重症病例48例，现有重症病例34例，死亡病例0例，出院病例2例。目前追踪到密切接触者5990人，已解除医学观察388人，尚有5602人正在接受医学观察。','2020-02-11','ck6hgxccp00ibs27chih9ekd0','人民日报','湖南省','2020-01-31','http://m.weibo.cn/2803301701/4466729880982972','','湖南新增确诊55例，累计332例','2020-02-11'),('国家邮政局近日要求，严禁收寄野生动物；个人寄往疫情重点地区的医疗用品、用具和药品等，要在系统中录入交寄物品内件属性，并进行妥善包装，确保邮件快件寄递安全。','2020-02-11','ck6hgxccp00ics27ccd167bj0','人民日报','全国','2020-01-31','http://m.weibo.cn/2803301701/4466728975557072','','邮政局发布规范：严禁收寄野生动物','2020-02-11'),('2020年1月30日0-24时，新疆报告新型冠状病毒感染的肺炎新增确诊病例3例，新增重症病例0例，新增死亡病例0例，新增出院病例0例。其中：阿克苏地区为报告首例确诊病例；其他2个州市新增确诊病例中，乌鲁木齐市1例、伊犁州1例。截至1月30日24时，新疆（含兵团）累计报告新型冠状病毒感染的肺炎确诊病例17例，现有重症病例3例、危重症病例1例，累计死亡病例0例，累计出院病例0例。\n','2020-02-11','ck6hgxccp00ids27cc8oo54sk','央视新闻','新疆维吾尔自治区','2020-01-31','http://m.weibo.cn/2656274875/4466727729660027','','新疆新增确诊3例，累计17例','2020-02-11'),('中国疾病预防控制中心流行病学首席专家吴尊友在接受央视采访时表示：新型冠状病毒肺炎不像想象的那么严重。我们衡量这种疾病的一个重要指标就是病死率。对全国7000多确诊病人的病例分析，我们看到小于30岁的人基本没有死亡，那么40至59岁的人病死率也只有0.2%，那么死亡主要发生在高龄因素（人群），所以大家不要过分担心。','2020-02-11','ck6hgxccp00ies27c4chi8wbc','人民日报','全国','2020-01-31','http://m.weibo.cn/2803301701/4466726898641560','','新型肺炎死亡主要在高龄人群','2020-02-11'),('2020年1月30日12—24时，山东省报告新型冠状病毒感染的肺炎新增确诊病例20例，新增重症病例2例，新增危重症病例1例（青岛市黄岛区），新增出院病例1例（德州市）。其中：新增确诊病例中，烟台市5例（海阳市3例，芝罘区、福山区各1例）、威海市5例（乳山市3例，环翠区2例）、临沂市4例（兰山区2例，沂水县、临沭县各1例）、济南市2例（市中区、槐荫区各1例）、聊城市2例（东昌府区、莘县各1例）、潍坊市1例（奎文区）、德州市1例（宁津县）。截至1月30日24时，山东省累计报告新型冠状病毒感染的肺炎确诊病例178例（含重症病例10例、危重症病例1例、出院病例2例，无死亡病例）\n','2020-02-11','ck6hgxccp00ifs27c0w9f359a','人民日报','山东省','2020-01-31','http://m.weibo.cn/2803301701/4466716345829911','','山东新增确诊20例，累计178例 ','2020-02-11'),('2020年1月30日0-24时，浙江省报告新型冠状病毒感染的肺炎新增确诊病例109例，新增出院病例5例。其中：新增确诊病例中，杭州市16例、宁波市5例、温州市55例、湖州市1例、绍兴市4例、金华市7例、衢州市2例、舟山市1例、台州市17例、丽水市1例；新增出院病例中，温州市4例、舟山市1例。截至1月30日24时，浙江省累计报告新型冠状病毒感染的肺炎确诊病例537例，现有重症病例50例（其中危重10例），累计出院9例。其中：确诊病例中，杭州市85例、宁波市46例、温州市227例、湖州市6例、嘉兴市16例、绍兴市23例、金华市27例、衢州市12例、舟山市7例、台州市81例、丽水市7例；重症病例中，杭州市11例、宁波市1例、温州市14例、嘉兴市5例、绍兴市5例、金华市5例、衢州市1例、台州市6例、丽水市2例；出院病例中，温州市7例、丽水市1例、舟山市1例。目前，全省共追踪到密切接触者9297人，已解除医学观察422人，尚有8801人正在接受医学观察。 ','2020-02-11','ck6hgxccp00igs27ccq6v0431','央视新闻','浙江省','2020-01-31','http://m.weibo.cn/2656274875/4466722129879703','','浙江新增确诊109例，累计537例','2020-02-11'),('记者从黑龙江省卫健委获悉，2020年1月30日0-24时, 黑龙江省报告新型冠状病毒感染的肺炎新增确诊病例16例。新增重症病例3例。新增死亡病例1例为绥化市确诊病例。新增疑似病例74例。截至1月30日24时,黑龙江省累计报告新型冠状病毒感染的肺炎确诊病例59例，其中：哈尔滨市18例、齐齐哈尔市3例、牡丹江市2例、佳木斯市8例、大庆市7例、鸡西市2例、双鸭山市1例、七台河市3例、鹤岗市1例、绥化市12例、大兴安岭地区2例；累计重症病例7例。死亡病例2例为绥化市确诊病例。累计报告疑似病例128例。全省当日发热门诊诊疗人数2824人。目前追踪到密切接触者1869人, 已解除医学观察462人,尚有1389人正在接受医学观察。','2020-02-11','ck6hgxccp00ihs27ch4cjabah','人民日报','黑龙江省','2020-01-31','http://m.weibo.cn/2803301701/4466721823793802','','黑龙江新增确诊16例，累计59例','2020-02-11'),('1月30日0-24时，吉林全省无新增确诊病例。首例长春市输入性病例，已解除隔离出院。截至1月30日24时，吉林省累计报告确诊病例14例，治愈出院1例，现在院隔离治疗确诊病例13例。其中长春市3例，吉林市3例，松原市2例，四平市1例，公主岭市1例，通化市1例，延边州2例。上述确诊病例的密切接触者675人，均在接受医学观察。全省13例在院确诊病例中，11例为普通轻型病例，2例为重症病例。其中，1例为松原市老年男性病例，已于1月28日转入吉林大学中日联谊医院治疗，目前病情基本平稳。另1例为1月28日长春市传染病医院收治病例，男，50岁，因指氧饱和度偏低诊断为重型病例，目前给予无创机械通气、对症治疗，病情尚平稳。今日全省新增疑似病例3例，排除3例，现有疑似病例10例，已全部实施隔离医学观察，目前正在进行流行病学调查和实验室检测。\n','2020-02-11','ck6hgxccp00iis27cd7dp53ce','央视新闻','吉林省','2020-01-31','http://m.weibo.cn/2656274875/4466721471490183','','吉林新增0例确诊病例','2020-02-11'),('截至1月30日24时，广东累计报告新型冠状病毒感染的肺炎确诊病例393例。30日当天，全省新增确诊病例82例，新增出院3例。新增确诊病例中，广州市27例、深圳市24例、珠海市8例、佛山市7例、汕尾市2例、东莞市9例、中山市2例、湛江市2例、肇庆市1例。有1950名密切接触者正在接受医学观察。累计确诊病例中，广州市106例、深圳市110例、珠海市26例、汕头市12例、佛山市32例、韶关市4例、河源市1例、梅州市5例、惠州市17例、汕尾市3例、东莞市16例、中山市18例、江门市1例、阳江市10例、湛江市11例、茂名市3例、肇庆市6例、清远市6例、揭阳市6例。男性198例，女性195例，年龄介于11月龄-85岁之间。','2020-02-11','ck6hgxccp00ijs27cfesy78np','央视新闻','广东省','2020-01-31','http://m.weibo.cn/2656274875/4466720658223585','','广东新增确诊82例，累计393例','2020-02-11'),('2020年1月30日0-24时, 全省报告新增确诊病例16例。新增疑似病例74例。截至1月30日24时，全省累计报告确诊病例59例。累计报告疑似病例128例，累计排除疑似病例119例。全省30日当日发热门诊诊疗人数2824人。累计追踪到密切接触者1869人，已解除医学观察462人，尚有1389人正接受医学观察。已确诊59例病例中，死亡2例。其他：轻症3例，普通47例（含剖宫产术后1例），重症2例，危重症5例。与昨日相比，已确诊病例中10例好转，44例稳定，3例加重。5例危重症与昨日相比，1例好转，1例稳定，3例加重（哈尔滨、大庆和绥化各1例）。','2020-02-11','ck6hgxccq00iks27cbd927dbz','央视新闻','黑龙江省','2020-01-31','http://m.weibo.cn/2656274875/4466718275855733','','黑龙江新增确诊16例，累计59例','2020-02-11'),('2020年1月30日0-24时，河南省新增新型冠状病毒感染的肺炎确诊病例74例，新增危重1例、治愈1例。新增确诊病例中，郑州市4例、开封市2例、洛阳市1例、平顶山市2例、安阳市4例、新乡市4例、濮阳市2例、许昌市5例、漯河市2例、三门峡市1例、南阳市10例、商丘市9例、信阳市7例、周口市11例、驻马店市5例、长垣市1例、永城市4例。截至1月30日24时，全省累计报告新型冠状病毒感染的肺炎确诊病例352例，重症37例、危重5例、死亡2例、治愈3例。其中：确诊病例中，郑州市50例、开封市6例、洛阳市3例、平顶山市10例、安阳市20例、鹤壁市6例、新乡市15例、焦作市2例、濮阳市3例、许昌市8例、漯河市13例、三门峡市6例、南阳市61例、商丘市27例、信阳市49例、周口市36例、驻马店市30例、滑县1例、长垣市2例、永城市4例。目前累计追踪到密切接触者7512人，当日解除医学观察804人，诊断为疑似4人，共有6215人正在接受医学观察。','2020-02-11','ck6hgxccq00ils27c8p8f0smh','央视新闻','河南省','2020-01-31','http://m.weibo.cn/2656274875/4466717231557959','','河南新增确诊74例，累计352例','2020-02-11'),('贵州省卫生健康委员会通报：2020年1月30日0—24时，全省新型冠状病毒感染的肺炎新增3例确诊病例。其中，外地来黔、返黔人员1例，本省常住人口2例。截至1月30日24时，全省累计报告新型冠状病毒感染的肺炎病例15例。其中，外地来黔、返黔人员9例，本省常住人口6例；治愈出院1例，病情平稳10例，重症4例；男性10例，女性5例；年龄最大75岁，最小17岁；贵阳市1例（已治愈），遵义市1例，六盘水4例，毕节市1例，铜仁市2例，黔东南州1例，黔南州4例，黔西南州1例。现有疑似病例61例。累计追踪密切接触者389人，其中1人转为确诊病例，5人转为疑似病例，已解除医学观察21人，尚在接受医学观察362人。','2020-02-11','ck6hgxccq00ins27cha3289ra','央视新闻','贵州省','2020-01-31','http://m.weibo.cn/2656274875/4466715763059594','','贵州新增确诊3例，累计15例','2020-02-11'),('2020年1月30日0-24时，江苏省报告新型冠状病毒感染的肺炎新增确诊病例39例，新增重症病例1例，新增出院病例1例。截至1月30日24时，江苏省累计报告新型冠状病毒感染的肺炎确诊病例168例，其中，重症病例2例，出院病例2例。目前，江苏省追踪到密切接触者2644人，已解除医学观察137人，尚有2507人正在接受医学观察。\n','2020-02-11','ck6hgxccq00ios27c6njgd4lr','人民日报','江苏省','2020-01-31','http://m.weibo.cn/2803301701/4466715461507403','','江苏新增确诊39例，累计168例','2020-02-11'),('2020年1月30日0-24时，江西省报告新型冠状病毒感染的肺炎新增确诊病例78例，新增出院病例4例。截至1月30日24时，江西省累计报告新型冠状病毒感染的肺炎确诊病例240例，其中重症病例33例，出院病例7例。目前追踪到密切接触者6842人，解除医学观察275人，尚有6567人正在接受医学观察。','2020-02-11','ck6hgxccq00ips27cgj80cwq7','央视新闻','江西省','2020-01-31','http://m.weibo.cn/2656274875/4466715276089840','','江西新增确诊78例，累计240例','2020-02-11'),('2020年1月30日0-24时,安徽省新型冠状病毒感染的肺炎新增确诊病例37例，新增重症病例3例，新增出院病例1例（六安），新增疑似病例70例。所有病例均在定点医院接受治疗，除重症病例外，病情平稳。截至1月30日24时,全省累计报告新型冠状病毒感染的肺炎确诊病例237例，重症病例3例，出院病例3例，无死亡病例，累计医学观察密切接触者4997人。','2020-02-11','ck6hgxccq00iqs27chagmdx13','人民日报','安徽省','2020-01-31','http://m.weibo.cn/2803301701/4466714051414715','','安徽新增确诊37例，累计237例','2020-02-11'),('根据安徽省卫健委消息：2020年1月30日0-24时，安徽省新型冠状病毒感染的肺炎新增确诊病例37例，新增重症病例3例，新增疑似病例70例，所有病例均在定点医院接受治疗，除重症病例外，病情平稳。截至1月30日24时，全省累计报告新型冠状病毒感染的肺炎确诊病例237例，重症病例3例，出院病例3例，无死亡病例。累计医学观察密切接触者4997人。温馨提示：当前疫情防控正处于关键期，尽管天气晴好，仍建议您减少外出。做好居家防护，适当通风换气。注意个人卫生，适当锻炼，规律作息，理性面对疫情信息，保持平和心态。','2020-02-11','ck6hgxccq00irs27c40un1niv','央视新闻','安徽省','2020-01-31','http://m.weibo.cn/2656274875/4466713262876563','','安徽新增确诊37例，累计237例','2020-02-11'),('1月30日，四川省新型冠状病毒感染的肺炎病例确认专家组确认四川省新增新型冠状病毒感染的肺炎病例36例。截至1月30日24时，四川省累计报告新型冠状病毒感染的肺炎确诊病例177例（广元市1例无症状核酸检测阳性病例，暂不纳入确诊病例统计），涉及21个市（州）。177名患者中，危重4人,死亡1人，治愈出院1人。正在接受医学观察4214人，已解除医学观察345人。','2020-02-11','ck6hgxccq00iss27ceuc1dplx','央视新闻','四川省','2020-01-31','http://m.weibo.cn/2656274875/4466712638669143','','四川新增确诊36例，累计177例','2020-02-11'),('1月30日0-24时，广西共新增新型冠状病毒感染的肺炎确诊病例9例。目前全区累计报告确诊病例87例，累计出院病例2例。现有重症病例5例，危重病例2例，无死亡病例，无医务人员感染病例。目前累计追踪到密切接触者1913例，尚在接受医学观察1564例。\n','2020-02-11','ck6hgxccq00its27cfcm32w2s','央视新闻','广西壮族自治区','2020-01-31','http://m.weibo.cn/2656274875/4466711782934268','','广西新增确诊9例，累计87例','2020-02-11'),('人民日报记者张腾扬：记者从河北省卫健委了解到，2020年1月30日0—24时，河北省报告新型冠状病毒感染的肺炎新增确诊病例17例，新增疑似病例51例。截至1月30日24时，河北省累计报告确诊病例82例，其中死亡1例，现有重症病例7例，无治愈出院病例。现有疑似病例78例。目前累计追踪到密切接触者1899人，当日解除隔离医学观察109人，现有1698人正在接受隔离医学观察。\n','2020-02-11','ck6hgxccq00ius27c5z0j2eth','人民日报','河北省','2020-01-31','http://m.weibo.cn/2803301701/4466709416644008','','河北新增确诊17例，累计82例','2020-02-11'),('2020年1月30日9时至24时，辽宁省新增4例新型冠状病毒感染的肺炎确诊病例，其中沈阳市1例，大连市2例,，朝阳市1例，均属普通型病例。截至2020年1月30日24时，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例45例，其中重型病例8例，大连市治愈出院1例。确诊病例中，沈阳市10例、大连市7例、本溪市3例、丹东市5例、锦州市4例、营口市1例、辽阳市1例、铁岭市2例、朝阳市5例、盘锦市3例、葫芦岛市4例。目前44名在治患者均在定点医疗机构隔离治疗，病情平稳。44名在治患者中，39例病例为输入性病例，3例病例为武汉输入病例家属，2例为现有确诊病例的密切接触者。目前累计追踪到密切接触者744人，已解除医学观察73人，现有671人正在接受医学观察，其余正在追踪中。（总台央视记者李承泽）\n','2020-02-11','ck6hgxccq00ivs27cb0n7hze2','央视新闻','辽宁省','2020-01-31','http://m.weibo.cn/2656274875/4466707416231383','','辽宁新增确诊病例4例，累计45例','2020-02-11'),('昨天，国家税务总局发布消息：根据疫情防控需要，在全国范围内将2月份纳税申报期限从2月17日延长至2月24日；对湖北等疫情严重地区可视情况再适当延长。此外，按照“尽可能网上办”的原则，各级税务部门要积极拓展“非接触式”办税缴费服务，提高涉税事项网上办理覆盖面。\n','2020-02-11','ck6hgxccr00iws27c89vshhiz','央视新闻','全国','2020-01-31','http://m.weibo.cn/2656274875/4466706774728840','','国家税务总局：延长2月份纳税申报期限','2020-02-11'),('1月30日8时至20时，北京市新增7例新型冠状病毒感染的肺炎病例，其中2例有湖北及其他省份接触史，5例为确诊病例的密切接触者，均已送至市级定点医疗机构进行救治。目前，北京市累计确诊病例121例，其中死亡1例，出院5例，115例在市级定点医院进行隔离治疗。\n','2020-02-11','ck6hgxccr00ixs27cgnqybp3j','央视新闻','北京市','2020-01-30','http://m.weibo.cn/2656274875/4466699090350141','','北京新增7例病例，累计确诊121例','2020-02-11'),('2020年1月30日12—24时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例24例，新增重型病例2例，重型病例转普通型病例2例。荣昌区为报告首例确诊病例。截至1月30日24时，重庆市累计报告新型冠状病毒感染的肺炎确诊病例206例，重型病例18例，危重型病例4例，出院病例1例。累计追踪到密切接触者4125人，已解除医学观察707人，尚有3418人正在接受医学观察。专家认为，现在疫情进入比较严峻复杂的时期，疫情防控正处于关键期。随着网格化主动搜索力度加大，潜伏期感染者逐渐发病，近期输入性病例将继续呈上升趋势。随着疫情进展，与输入的已发病患者及潜伏期感染者密切接触的二代病例可能会逐渐增多。重庆市卫生健康委提示：在疫情存续期间，请务必做好个人防护，尽量减少探亲访友，尽量避免去人群聚集场所，如必须外出，请正确佩戴口罩。勤洗手，打喷嚏或咳嗽时用纸巾或手肘捂住口鼻。','2020-02-11','ck6hgxccr00iys27chic1d1wd','央视新闻','重庆市','2020-01-30','http://m.weibo.cn/2656274875/4466691067407996','','重庆新增24例，累计确诊206例','2020-02-11'),('2020年1月30日12—24时，上海市排除新型冠状病毒感染的肺炎疑似病例52例；新增确诊病例16例，其中外地来沪人员7例，本市常住人口9例。截至1月30日24时，上海市已累计排除疑似病例225例，发现确诊病例128例。目前，117例病情平稳，5例病情危重，5例治愈出院，1例死亡。尚有164例疑似病例正在排查中。\n','2020-02-11','ck6hgxccr00izs27c3ow06cgf','人民日报','上海市','2020-01-30','http://m.weibo.cn/2803301701/4466704098560323','','上海新增16例，累计128例','2020-02-11'),('人民日报记者张腾扬消息：1月30日，河北省发布《关于延迟企业复工复业的通知》（以下简称“《通知》”）要求，河北省行政区域内企业复工复业时间不早于2020年2月9日24时,涉及保障公共事业运行必需(供水、供气、供电、供暖、通信、公共交通、市政环卫等行业)、疫情防控必需(医疗器械、药品、防护用品、消杀用品生产运输和销售等行业)、群众生活必需(超市卖场、农贸市场、食品生产和物流供应等行业)及其他涉及重要国计民生的相关企业除外。\n','2020-02-11','ck6hgxccr00j1s27ces12fvud','人民日报','河北省','2020-01-30','http://m.weibo.cn/2803301701/4466697387377664','','河北企业复工不早于2月9日','2020-02-11'),('30日晚，澳大利亚昆士兰卫生部门宣布确诊第二例新冠病毒感染肺炎病例。患者为中国籍42岁女游客，目前病情稳定，正在接受隔离治疗。她与昆士兰确诊的第一例病患同属一个9人旅行团。他们从武汉飞抵澳大利亚，结束在墨尔本的活动后，于1月27日乘坐虎航TT556航班从墨尔本抵达黄金海岸。目前，旅行团其他成员被隔离在黄金海岸接受医学观察。虎航表示当天航班共搭载172名乘客，卫生部门仍在搜寻同一航班的其他乘客，要求他们去接受病毒检测。截至目前，澳大利亚累计确诊9例新型冠状病毒感染肺炎病例。','2020-02-11','ck6hgxccr00j3s27caiod21nh','央视新闻','','2020-01-30','http://m.weibo.cn/2656274875/4466688655040648','','澳大利亚累计确诊9例病例','2020-02-11'),('当地时间30日晚，意大利总理孔特在罗马向媒体表示，该国首次确诊两例新型冠状病毒感染肺炎病例。据意媒报道，被感染者是两名中国游客，此前已被意大利国家传染病研究所医院隔离收治，目前“状况良好”，其曾经留宿的酒店房间已被封锁，调查人员也向该国卫生部提交了初步报告。孔特表示，意大利相关部门正在对两名游客入境后的行踪进行仔细确认。他还强调，收治病人的是意大利专业机构，呼吁该国公众无需恐慌。','2020-02-11','ck6hgxccr00j4s27c8kp5h3qz','央视新闻','','2020-01-30','http://m.weibo.cn/2656274875/4466688004802625','','意大利首次确诊两例病例','2020-02-11'),('当地时间30日晚间，德国巴伐利亚州卫生部宣布，确诊第五例新型冠状病毒肺炎患者。该患者与前4名患者均来自巴伐利亚州的德国全球性汽车天窗制造商伟博思通（WEBASTO）公司总部。据称，目前5人状况良好。目前，与确诊5例患者密切接触者共有110人，已被要求在家中进行自我隔离。巴伐利亚州卫生部呼吁，当地所有医院都要做好接收新型冠状病毒肺炎患者的准备。','2020-02-11','ck6hgxccr00j5s27c0mcrb5e3','人民日报','','2020-01-30','http://m.weibo.cn/2803301701/4466682930012294','','德国确诊第五例新型冠状病毒肺炎患者','2020-02-11'),('意大利当地时间1月30日晚，意大利总理朱塞佩•孔特和卫生部长罗伯托•斯佩兰萨在罗马向媒体表示，意大利首次确诊两例新型冠状病毒感染肺炎病例。据意媒报道，被感染者是两名中国游客，此前已被意大利国家传染病研究所医院隔离收治，目前“状况良好”，其曾经留宿的酒店房间已被封锁，调查人员也向该国卫生部提交了初步报告。孔特表示，意大利相关部门正在对两名游客入境后的行踪进行仔细确认。他还强调，收治病人的是意大利专业机构，呼吁该国公众无需恐慌。同时，孔特还宣布意大利往返中国的航班已全部关闭。据意大利《共和报》及安莎社报道，两名患者为一对夫妻，来自中国武汉，分别为66岁和67岁，两人于1月23日抵达意大利米兰马尔彭萨机场，自那出发前往意大利各省游览。（人民日报记者韩硕）\n','2020-02-11','ck6hgxccr00j6s27c7wc07os3','人民日报','','2020-01-30','http://m.weibo.cn/2803301701/4466682401543509','','意大利首次确诊2例新型肺炎，往返意大利航空全部关闭','2020-02-11'),('2020年1月30日0时-24时，湖北省新增新型冠状病毒感染的肺炎病例1220例。新增出院26例（其中：武汉市21例、孝感市2例、黄冈市1例、神农架林区2例）。 截至2020年1月30日24时，湖北省累计报告新型冠状病毒感染的肺炎病例5806例，已治愈出院116例，死亡204例。目前仍在院治疗5486例（其中：重症804例、危重症290例），均在定点医疗机构接受隔离治疗。累计追踪密切接触者35144人，尚在接受医学观察32340人。\n','2020-02-11','ck6hgxccr00j7s27cbjx2a6bn','人民日报','湖北省','2020-01-30','http://m.weibo.cn/2803301701/4466681239648020','','湖北新增1220例，累计5806例','2020-02-11'),('世界卫生组织总干事谭德塞宣布：①主要基于中国感染者数量增加、多个国家都出现疫情两个事实，宣布将新型冠状病毒疫情列为国际关注的突发公共卫生事件；②没有必要采取限制国际人员流动的措施；③#世卫组织不推荐限制旅行#的措施。\n','2020-02-11','ck6hgxccs00j8s27c0sw39htw','人民日报','','2020-01-30','http://m.weibo.cn/2803301701/4466644677626659','','世卫组织称没必要限制国际人员流动','2020-02-11'),('世卫组织30日发布新型冠状病毒感染肺炎疫情为国际关注的突发公共卫生事件，强调不建议实施旅行和贸易限制，并再次高度肯定中方的防控举措。 \n','2020-02-11','ck6hgxccs00j9s27chm9ihirc','央视新闻','','2020-01-30','http://m.weibo.cn/2656274875/4466643377490651','','世卫组织宣布疫情为国际关注的突发公共卫生事件','2020-02-11'),('美东时间30日中午，美国疾病控制与预防中心（CDC）确认，伊利诺伊州新出现一例新型冠状病毒感染病例，为美国首例人传人感染。该最新确诊的病例为此前伊利诺伊州确诊患者（美国第二例）的丈夫，年龄为60多岁。该男性患者有“一些基本的健康状况”，但目前整体状况良好。截至目前，美国境内共发现新型冠状病毒确诊病例6例，其中华盛顿州1例，伊利诺伊州2例，加州2例，亚利桑那州1例。','2020-02-11','ck6hgxccs00jas27c27g71po0','人民日报','','2020-01-30','http://m.weibo.cn/2803301701/4466620867443542','','美国出现首例人传人病例，累计确诊6例','2020-02-11'),('1月30日8时至20时，北京新增7例新型冠状病毒感染的肺炎病例，其中2例有湖北及其他省份接触史，5例为确诊病例的密切接触者，均已送至市级定点医疗机构进行救治。截至1月30日20时，北京累计确诊病例121例，其中死亡1例，出院5例，115例在市级定点医院进行隔离治疗。东城区2例、西城区12例、朝阳区21例、海淀区24例、丰台区11例、石景山区2例、门头沟区1例、通州区10例、顺义区2例、大兴区15例、昌平区9例、怀柔区1例，外地来京人员11例。房山区、平谷区、密云区、延庆区尚未有病例。\n','2020-02-11','ck6hgxccs00jbs27cbr426oyh','人民日报','北京市','2020-01-30','http://m.weibo.cn/2803301701/4466592022824562','','北京新增7例，累计确诊121例','2020-02-11'),('交通管制在传染源和健康人间建立起屏障，阻断了病毒的传播。疫情数据可能令人担心，但试想一下，如果没有采取措施，全国可能会有好几个“武汉”，确诊人数或许不是今天报告的7700多例，而是好几万例，甚至更多。','2020-02-11','ck6hgxccs00jcs27c15gg61ww','央视新闻','全国','2020-01-30','http://m.weibo.cn/2656274875/4466584615287616','','交通管制的效果将在未来几天显现','2020-02-11'),('湖北省副省长曹广晶：医护工作者是抗击肺炎的中坚力量，如果他们得不到保护，战胜困难就难以实现。目前没有解决好尖锐的供需矛盾，我们诚恳接受社会各界，尤其是医护人员的批评。我们一定更加努力，尽快组织更多的医用物资，更加高效地把防护物资送到医护人员手中。 ','2020-02-11','ck6hgxccs00jds27c3etj17zo','央视新闻','湖北省','2020-01-30','http://m.weibo.cn/2656274875/4466576978229169','','湖北副省长表示接受批评','2020-02-11'),('截至30日12时，湖北省红十字会、省慈善总会、省青少年发展基金会累计接收捐赠物资615.43万件，包括医用防护服2.66万套，N95口罩47.9万个，医用一次性口罩172.87万个，护目镜3.93万个等。定向捐赠的已直接送达，非定向捐赠的已由各级疫情防控指挥部统筹分配。\n','2020-02-11','ck6hgxccs00jes27cc4z5htuk','央视新闻','湖北省','2020-01-30','http://m.weibo.cn/2656274875/4466563019272047','','湖北累计收到捐赠物资615.43万件','2020-02-11'),('当前一是新型冠状病毒肺炎高峰期，再是湖北地区常见的流感高发期，还是呼吸道疾病的高发期，出现了定点医院出现了一床难求的情况，我们采取了三条措施：一是抓紧现有医院的改造扩增病床；二是加强分级分类排查；三是千方百计的保证医务物资的供用。 \n','2020-02-11','ck6hgxccs00jfs27c0xlbcdgs','人民日报','湖北省','2020-01-30','http://m.weibo.cn/2803301701/4466561479925742','','湖北省委书记回应一床难求：采取三条措施','2020-02-11'),('湖北省召开新型冠状病毒感染的肺炎疫情防控工作新闻发布会。今天0点到中午12点，湖北省新增确诊病例317人。','2020-02-11','ck6hgxccs00jgs27ce78f3380','人民日报','湖北省','2020-01-30','https://weibo.com/2803301701/IrV02lIvs?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment','','湖北省新增317例累计确诊4903例','2020-02-11'),('湖北省召开新型冠状病毒感染的肺炎疫情防控工作新闻发布会。@人民日报 全程直播，一起关注！ \n','2020-02-11','ck6hgxccs00jis27c5aoifzfj','人民日报','湖北省','2020-01-30','http://m.weibo.cn/2803301701/4466539665175974','','直播：湖北疫情防控工作发布会','2020-02-11'),('国务院办公厅发布关于组织做好疫情防控重点物资生产企业复工复产和调度安排工作的紧急通知，要求各省(区、市)人民政府要切实履行主体责任，迅速组织本地区生产应对疫情使用的医用防护服、N95口罩、医用护目镜、负压救护车、相关药品等企业复工复产。','2020-02-11','ck6hgxcct00jjs27chp5y5kuv','人民日报','全国','2020-01-30','http://m.weibo.cn/2803301701/4466529254719912','','国办紧急通知：迅速组织疫情防控物资企业复工复产','2020-02-11'),('广州市首2例新型冠状病毒感染儿童30日下午从广东省人民医院感染科治愈出院。广东省人民医院收治的两例新型冠状病毒感染儿童，均于1月25日晚就诊于省医院儿科发热门诊。其中一例为13岁男童，其1月19日前往湖北黄冈探亲，其间与在武汉读大学的哥哥同住一间房，1月24日返回广州后出现流涕、干咳。另一例为2岁11个月的女童，1月24日陪父母返湖北黄冈，逗留1小时后与爷爷奶奶一同返回广州，随后出现发热、干咳，体温高达40°C。两例患儿入院后，医院给予针对性治疗，经过专家多次会诊讨论及修订治疗方案。在医护人员精心护理、治疗下，患儿体温正常3天，病情明显改善，连续2次核酸检测均转为阴性，经专家会诊，达到出院标准，给予出院。广州市首两例新型冠状病毒感染儿童治愈出院\n','2020-02-11','ck6hgxcct00jks27c9mqxe540','人民日报','广东省','2020-01-30','http://m.weibo.cn/2803301701/4466520220377390','','广州首两例感染儿童出院','2020-02-11'),('1月30日，根据《新型冠状病毒感染的肺炎诊疗方案（试行第四版）》规定，2名疑似病例患者苟某、郑某，病例样本经省疾病预防控制中心实验室复核检测，呈新型冠状病毒核酸阳性。结合患者临床表现、流行病学史，经省级医疗救治专家组会诊研判，确认为新型冠状病毒感染的肺炎确诊病例。\n截至1月30日18时，我省累计报告新型冠状病毒感染的肺炎确诊病例8例，均为武汉输入性新型冠状病毒感染的肺炎确诊病例。目前除1例患者属重症病例外，其他7例患者病情稳定，密切接触者已开展追踪调查和医学观察。','2020-02-11','ck6hgxcct00jls27cg0kchtjm','青海省卫健委','青海省','2020-01-30','https://wsjkw.qinghai.gov.cn/zhxw/xwzx/2020/01/30/1580377969996.html','','青海新增2例累计8例','2020-02-11'),('截至今天14时，天津新增1例新型冠状病毒感染的肺炎确诊病例，确诊病例增至30例。第30例患者，女，64岁，居住地为天津市红桥区。患者1月19日与家人自驾到湖北孝感旅游，23日与家人自驾返津，28日出现呼吸道症状，去红桥医院就诊。29日出现发热，到天津市人民医院就诊。经专家组确诊为天津市第30例病例，为普通型病例。目前已转至海河医院治疗。根据流行病学调查，该患者主要密切接触者有4例，目前均已被采取居家隔离医学观察。红桥区疾控中心已对其住所进行终末消毒，并对其他密切接触者进行追踪排查。截至目前，天津累计发现新型冠状病毒感染的肺炎病例30例，其中男性23例，女性7例；重型13例，普通型17例；无危重及死亡病例。（总台央视记者王烁）\n','2020-02-11','ck6hgxcct00jms27cgpqm4eaw','央视新闻','天津市','2020-01-30','http://m.weibo.cn/2656274875/4466496304750519','','天津新增1例累计30例','2020-02-11'),('环球网消息，据印度快报，印度出现首例新冠病毒感染肺炎确诊病例。印度快报称，该病例是一名在武汉读书的喀拉拉邦学生。 ','2020-02-11','ck6hgxcct00jns27c7zcifw07','人民日报','','2020-01-30','http://m.weibo.cn/2803301701/4466479296606315','','印度出现首例确诊病例','2020-02-11'),('为做好疫情防控工作，北京地铁公司自1月31日首班车起，将启动北京地铁全线网进站测温工作。下一步，为应对返京客流高峰，北京地铁将在全网使用非配合式热成像体温测试系统进行测温工作。','2020-02-11','ck6hgxcct00jos27c1t763klp','央视新闻','北京市','2020-01-30','http://m.weibo.cn/2656274875/4466473378462624','','北京地铁明起全线网测温进站','2020-02-11'),('截至1月30日12时，广东省累计报告新型冠状病毒感染的肺炎确诊病例354例。30日0-12时全省新增确诊病例43例，新增出院2例。新增确诊病例中，广州市15例、深圳市12例、珠海市8例、东莞市4例、中山市2例、湛江市2例。有1514名密切接触者正在接受医学观察。','2020-02-11','ck6hgxcct00jps27caz3e3hfb','人民日报','广东省','2020-01-30','http://m.weibo.cn/2803301701/4466470308702235','','广东新增43例新型肺炎','2020-02-11'),('截止今天中午12点全省累计报告新型冠状病毒感染的肺炎确诊病例354例，0到12点全省新增确诊病例43例，新增出院两例，新增确诊病例中广州15例，深圳12例，珠海8例，东莞4例，中山2例，湛江2例，有1514名密切接触者，正在接受医学观察。累计报告确诊病例轴广州94例，深圳98例，珠海26例，汕头12例，佛山25例，韶关4例，河源1例，梅州1例，湛江11例，茂名3例，肇庆5例，清远6例，男性176例，女性178例。年龄11月龄到85岁中间。无死亡病例。累计出院是8例。','2020-02-11','ck6hgxcct00jqs27c79gvey8s','央视新闻','广东省','2020-01-30','http://m.weibo.cn/2656274875/4466468324691745','','广东新增43例累计确诊354例','2020-02-11'),('30日，湖北省教育厅发布通知要求“推迟开学不停学”。各中小学可通过在线直播、网络点播、在线答疑等形式组织教学；各高校可调整春季学期教学计划、利用慕课等开展网络课程、科学组织毕业设计(论文)等方式保障教学，利用视频电话进行论文预答辩。','2020-02-11','ck6hgxcct00jrs27cdn2xdnfv','人民日报','湖北省','2020-01-30','http://m.weibo.cn/2803301701/4466467066016520','','湖北疫情期间开展网络教学','2020-02-11'),('2020年1月30日0—12时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例17例。新增确诊病例中，渝中区3例、江北区2例、渝北区1例、大足区2例、开州区1例、梁平区1例、垫江县3例、忠县1例、云阳县1例、巫溪县2例。截至1月30日12时，重庆市累计报告新型冠状病毒感染的肺炎确诊病例182例，重型病例18例，危重型病例4例，出院病例1例。','2020-02-11','ck6hgxcct00jss27cfn5d4mqu','央视新闻','重庆市','2020-01-30','http://m.weibo.cn/2656274875/4466462498754176','','重庆新增17例累计确诊182例','2020-02-11'),('今天下午，广东省人民政府举行新闻发布会，通报广东省新型冠状病毒感染的肺炎疫情防控工作有关情况，重点介绍广州市防疫防控及保障工作情况，广东省卫生健康委、广州市政府及有关单位将现场通报相关情况。','2020-02-11','ck6hgxcct00jts27c36z805o3','央视新闻','广东省','2020-01-30','http://m.weibo.cn/2656274875/4466462243036843','','广东通报疫情防控相关情况','2020-02-11'),('2020年1月30日0—12时，山东省报告新型冠状病毒感染的肺炎新增确诊病例13例，其中：德州市4例（乐陵市2例，德城区、宁津县各1例）、青岛市3例（黄岛区、市北区、即墨区各1例）、淄博市2例（博山区）、滨州市2例（邹平市）、枣庄市1例（滕州市）、日照市1例（岚山区）。','2020-02-11','ck6hgxccu00jus27c0qkfgvwf','央视新闻','山东省','2020-01-30','http://m.weibo.cn/2656274875/4466449744043809','','山东新增13例累计158例','2020-02-11'),('1月29日0-24时，浙江新增确诊132例，累计确诊428例。浙江省政府新闻办举行新闻发布会，省卫健委及相关地方、部门负责同志和专家将出席，介绍疫情防控工作情况并回答记者提问。','2020-02-11','ck6hgxccu00jvs27c5ke9078m','人民日报','浙江省','2020-01-30','http://m.weibo.cn/2803301701/4466447457285482','','浙江疫情防控新闻发布会','2020-02-11'),('1月29日0-24时，全国新增确诊1737例，累计确诊7711例。国家卫生健康委召开新闻发布会，介绍新型冠状病毒感染的肺炎疫情防控中的运输保障情况。','2020-02-11','ck6hgxccu00jws27c2fe9byhk','人民日报','全国','2020-01-30','http://m.weibo.cn/2803301701/4466447969760056','','卫健委疫情预防新闻发布会','2020-02-11'),('据新京报，30日下午13时50分左右，北京大学第一医院呼吸和危重症医学科主任王广发从地坛医院出院。王广发作为国家卫健委专家组成员赴武汉考察时染病，为国内首位确诊感染新型冠状病毒的专家组成员。 ','2020-02-11','ck6hgxccu00jxs27cb13ehgpf','人民日报','北京市','2020-01-30','http://m.weibo.cn/2803301701/4466443866949088','','染病专家组成员治愈出院','2020-02-11'),('交通运输部今天表示，各地交通运输部门要按照地方决策部署，依法依规开展通道管控和体温检测工作。不得采取封闭高速公路、阻断国省干线公路等措施，保障春运期间公路基本通行顺畅；不得简单采取堆填、挖断等硬隔离方式，阻碍农村公路交通。','2020-02-11','ck6hgxccu00jys27c6u019gph','央视新闻','全国','2020-01-30','http://m.weibo.cn/2656274875/4466440742159532','','疫情防控不得封闭高速公路','2020-02-11'),('2020年1月30日0—12时，上海市排除疑似病例28例；新增新型冠状病毒感染的肺炎确诊病例11例，其中外地来沪人员3例，上海市常住人口8例。截至1月30日12时，上海市累计发现确诊病例112例，其中，男性60例，女性52例；年龄最大88岁，最小7岁；78例有湖北居住或旅行史，1例有广东旅行史并曾食用野生动物，31例有相关确诊病例接触史，2例无湖北接触史；外地来沪人员51例，上海市常住人员61例。目前，102例病情平稳，4例病情危重，5例治愈出院，1例死亡。已累计排除173例疑似病例，尚有199例疑似病例正在排查中。','2020-02-11','ck6hgxccu00jzs27c0e61fj19','央视新闻','上海市','2020-01-30','http://m.weibo.cn/2656274875/4466434375978799','','上海新增11例累计112例','2020-02-11'),('今天，载有210人的日本政府第二架包机从湖北武汉抵达羽田机场，其中有9人出现咳嗽和发烧等症状。另有原定乘飞机回国的2人在事前检查中，被检出有发烧咳嗽症状没有登机。','2020-02-11','ck6hgxccu00k0s27ce3xh3cd0','央视新闻','全国','2020-01-30','http://m.weibo.cn/2656274875/4466430613395438','','日本第二批包机返日人员中9人发烧','2020-02-11'),('江西高安市管控好重点区域，迅速启动市、乡、村、组四级联防联控机制，按照“网格化、责任人”的工作要求，动员全市力量加入到疫情防控战斗中。','2020-02-11','ck6hgxccu00k1s27c3guygsfc','央视新闻','江西省','2020-01-30','http://m.weibo.cn/2656274875/4466425508502617','','直播！江西疫情防控工作如何？记者实地探访','2020-02-11'),('近日，针对“宠物是否会传播新型冠状病毒”的问题，世界卫生组织 回应：目前没有证据显示狗猫等宠物会感染新型冠状病毒。与宠物接触后，用肥皂和水洗手可以显著减少其他常见细菌在宠物和人类之间的传播，如大肠杆菌和沙门氏菌。 ','2020-02-11','ck6hgxccu00k2s27cf0g1abg0','人民日报','全国','2020-01-30','http://m.weibo.cn/2803301701/4466419724879647','','世卫组织称无证据显示宠物会感染','2020-02-11'),('30日上午，湖南省长沙市和郴州市各有一例新型冠状病毒感染的肺炎确诊患者救治情况良好，符合出院标准，治愈出院。据了解，长沙首例患者是57岁女性，武汉市青山区人，来长沙市探亲，因出现发热、咳嗽等症状，1月16日至医院就诊后被收至定点医院隔离治疗。1月21日，国家卫生健康委确认长沙市首例输入性新型冠状病毒感染的肺炎确诊病例。郴州首例患者邓某某，女，23岁，湖南宜章人，1月7日-9日在武汉逗留，1月9日返回株洲，1月16日返回郴州市，2020年1月21日21:00从宜章县县人民医院转入第二人民医院。据专家介绍，经过抗病毒、对症支持治疗后，体温恢复正常3天以上，呼吸道症状好转明显，连续两次呼吸道病原核酸检测阴性（采样间隔时间间隔24小时）。达到国家卫生健康委《新型冠状病毒感染的肺炎诊疗方案（试行第四版）》可解除隔离出院标准。','2020-02-11','ck6hgxccu00k3s27c5pp3efgj','人民日报','湖南省','2020-01-30','http://m.weibo.cn/2803301701/4466402502840353','','湖南两例确诊患者治愈出院','2020-02-11'),('从天津市疾控中心获悉，截至1月30日9时，天津市新增1例新型冠状病毒感染的肺炎确诊病例，确诊病例增至29例。第29例患者，男，36岁，住天津市和平区，职业为市场销售，工作单位位于和平区。患者1月18日至1月22日去武汉出差，1月22日下午由武汉去往湖北枣阳，1月26日由枣阳自驾返津。该患者于1月29日出现发热，由120救护车送至第九八三医院和平分院，经市专家组确诊为天津市第29例病例，为普通型病例。目前已转至海河医院治疗。疾控部门对其住所开展终末消毒，对其近期活动的密切接触者正在进行追踪排査。其家属已进行居家隔离医学观察。截至目前，天津累计发现新型冠状病毒感染的肺炎病例29例，其中男性23例，女性6例；重型13例，普通型16例;无危重及死亡病例。','2020-02-11','ck6hgxccu00k4s27c18icbgqd','央视新闻','天津市','2020-01-30','http://m.weibo.cn/2656274875/4466404227118903','','天津新增1例累计29例','2020-02-11'),('今天上午，北京市召开了新型冠状病毒感染的肺炎疫情防控工作新闻发布会。会后，北京市卫健委主任雷海潮介绍，目前小汤山医院已经启动修缮。当前，新型冠状病毒感染肺炎疫情防控形势严峻。各地版的“小汤山”医院都在紧锣密鼓的开工当中，北京小汤山康复医院此次修缮，是为了提供更好的就诊条件。这里将视疫情变化启用作为补充。','2020-02-11','ck6hgxccu00k5s27cdyg73i52','人民日报','北京市','2020-01-30','http://m.weibo.cn/2803301701/4466411038836152','','北京小汤山医院启动修缮','2020-02-11'),('疫情暴发以来，全国各地的医疗机构纷纷都派出医疗组前往武汉驰援，前线医护人员的工作压力巨大。28日，总台记者专门前往武汉同济医院，在午饭时间帮助医院一起给奋战在一线的护士们送午餐。','2020-02-11','ck6hgxccu00k6s27c8ex955wc','央视新闻','湖北省','2020-01-30','http://m.weibo.cn/2656274875/4466409406851666','','武汉日记：护士小姐姐顾得上吃饭吗','2020-02-11'),('抗击新型冠状病毒肺炎肺炎，武汉电视台新闻综合频道全天候直播。武汉加油，中国加油！','2020-02-11','ck6hgxccv00k7s27c35y1hvwu','人民日报','湖北省','2020-01-30','http://m.weibo.cn/2803301701/4466400774602516','','24小时不间断直播！抗击肺炎，武汉在行动！','2020-02-11'),('今天，湖南首例确诊新型冠状病毒的肺炎重症病例出院。患者罗某兰，女57岁，武汉青山区人，为湖南首例确诊为新型冠状病毒的肺炎重症病例。患者于16日下午4点左右到长沙市第一医院急诊科就诊。','2020-02-11','ck6hgxccv00k8s27c672ogsyg','央视新闻','湖南省','2020-01-30','http://m.weibo.cn/2656274875/4466399399040139','','好消息！湖南首例确诊重症病例出院','2020-02-11'),('2020年1月29日16时至30日9时，辽宁省新增2例输入性新型冠状病毒感染的肺炎确诊病例，其中本溪市1例，属重型病例；盘锦市1例，属普通型病例。截至2020年1月30日9时，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例41例，其中重型病例9例，大连市治愈出院1例。确诊病例中，沈阳市9例、大连市5例、本溪市3例、丹东市5例、锦州市4例、营口市1例、辽阳市1例、铁岭市2例、朝阳市4例、盘锦市3例、葫芦岛市4例。目前40名在治患者均在定点医疗机构隔离治疗，病情平稳。其中，36例病例发病前有武汉居住史或旅行史，3例病例为武汉输入病例家属，1例为现有确诊病例的密切接触者。目前累计追踪到密切接触者650人，已解除医学观察73人，现有577人正在接受医学观察，其余正在追踪中。','2020-02-11','ck6hgxccv00k9s27c0d4f1wta','央视新闻','辽宁省','2020-01-30','http://m.weibo.cn/2656274875/4466400829454111','','辽宁新增2例累计41例','2020-02-11'),('今日11时，广州首例新型冠状病毒感染的肺炎患者成功治愈出院。患者是一名55岁女性，今天是她发病第19天，其自1月22日入院后已无发热。根据国家诊疗标准要求，出院标准为体温正常三天，肺炎症状消失，连续两天两次检测核酸全部阴性。','2020-02-11','ck6hgxccy00kas27ca1n8705n','央视新闻','广东省','2020-01-30','http://m.weibo.cn/2656274875/4466396941884058','','好消息！广州首例确诊患者出院','2020-02-11'),('财政部、国家卫生健康委近日下发通知，对于直接接触待排查病例或确诊病例，诊断、治疗、护理、医院感染控制、病例标本采集和病原检测等工作相关人员，中央财政按照每人每天300元予以补助；对于参加疫情防控的其他医务人员和防疫工作者，中央财政按照每人每天200元予以补助。','2020-02-11','ck6hgxccy00kbs27c0wwg6mef','人民日报','全国','2020-01-30','http://m.weibo.cn/2803301701/4466393628199898','','一线医护人员每天补助300元','2020-02-11'),('1月30日上午8:15，江西新增1例治愈患者。该患者为男性，26岁，新余人，武汉某大学学生，1月18日返余，1月19日发热、头晕入院治疗，后被确诊为新型冠状病毒感染肺炎。在新余市人民医院医护人员的精心救治下，已符合出院标准，于30日上午出院。这是新余市第2例出院的新型冠状病毒感染的肺炎患者，也是江西省第四例出院患者。','2020-02-11','ck6hgxccy00kcs27ca9lpg2sh','人民日报','江西省','2020-01-30','http://m.weibo.cn/2803301701/4466393133119347','','江西已有4例患者出院','2020-02-11'),('2020年1月29日0-24时，宁夏全区报告新型冠状病毒感染的肺炎新增确诊病例5例，其中，蔡某为28日疑似病例29日转为确诊病例；全区无新增疑似病例报告。截至1月29日24时，宁夏全区累计报告新型冠状病毒感染的肺炎确诊病例17例，其中银川市9例（兴庆区3例、金凤区2例、西夏区2例、永宁县2例）、吴忠市5例（利通区4例、红寺堡区1例）、固原市1例（原州区）、中卫市1例（沙坡头区）、宁东管委会1例（宁东镇）；累计疑似病例1例（中卫市）。','2020-02-11','ck6hgxccy00kds27chk393pcn','央视新闻','宁夏回族自治区','2020-01-30','http://m.weibo.cn/2656274875/4466390184968919','','宁夏新增5例，累计17例','2020-02-11'),('1月29日20时至30日8时，北京市新增3例新型冠状病毒感染的肺炎病例。截至30日8时，北京市累计确诊病例114例，其中出院4例，死亡1例，在治109例确诊病例均在市级定点医院进行隔离治疗。','2020-02-11','ck6hgxccy00kes27c6huh0u69','央视新闻','北京市','2020-01-30','http://m.weibo.cn/2656274875/4466387042752153','','北京新增3例累计114例','2020-02-11'),('今天上午，北京市就疫情防控情况再次召开发布会。如何全力阻断传染源输入，确保防控无盲区、善待疫情高发区来京人员？北京市委组织部、卫健委、民政局相关负责人回应社会关切。','2020-02-11','ck6hgxccy00kfs27c3w7tci0m','央视新闻','北京市','2020-01-30','http://m.weibo.cn/2656274875/4466383049770339','','共同战疫：北京市召开发布会通报疫情防控进展','2020-02-11'),('1月29日，广东省人民医院引进双胞胎机器人“平平”和“安安”，它们天生不怕病毒并能迅速准确完成物资配送。 据了解，该医院还将引进第三台机器人，用于新型冠状病毒肺炎重点防控部门。','2020-02-11','ck6hgxccz00kgs27c06qc34xi','人民日报','广东省','2020-01-30','http://m.weibo.cn/2803301701/4466377815185924','','广东医院用机器人给病人送药，不怕病毒自己开门','2020-02-11'),('1月29日，河南新增72例新型肺炎，截至29日24时，河南省已累计报告确诊病例278例。日前，河南省内多家医疗机构发布公开征集信，向社会求助医疗保障物资。期盼每个人都能为这场看不见硝烟的战役尽自己的一份绵薄之力，共解医疗机构的燃眉之急！ ','2020-02-11','ck6hgxccz00khs27ca8jhf14z','人民日报','河南省','2020-01-30','http://m.weibo.cn/2803301701/4466376582878763','','河南多地急需医护物资','2020-02-11'),('截至1月30日10时，陕西新增7例新型冠状病毒感染的肺炎确诊病例，新增重症患者1例。新增确诊病例中，西安市4例、渭南市1例、榆林市1例、韩城市1例。陕西累计报告新型冠状病毒感染的肺炎确诊病例63例，其中西安市22例、宝鸡市4例、咸阳市5例、铜川市5例、渭南市4例、延安市3例、榆林市1例、汉中市6例、安康市10例、商洛市2例、韩城市1例。','2020-02-11','ck6hgxccz00kis27caglgao9y','央视新闻','陕西省','2020-01-30','http://m.weibo.cn/2656274875/4466374241562371','','陕西新增7例累计63例','2020-02-11'),('2020年1月29日10时至30日10时，内蒙古自治区报告新型冠状病毒感染的肺炎新增确诊病例2例；确诊病例中新增重症病例2例、新增危重病例1例；新增疑似病例1例。均在定点医院接受隔离治疗。目前追踪到密切接触者490人，正在接受医学观察。','2020-02-11','ck6hgxccz00kjs27cbkcy9wdn','央视新闻','内蒙古自治区','2020-01-30','http://m.weibo.cn/2656274875/4466374824693577','','内蒙古新增2例累计18例','2020-02-11'),('2020年1月29日0-24时，江苏省报告新型冠状病毒感染的肺炎新增确诊病例30例。截至1月29日24时，江苏省累计报告新型冠状病毒感染的肺炎确诊病例129例，其中，重症病例1例，出院病例1例。确诊病例中，南京市19例、无锡市10例、徐州市15例、常州市10例、苏州市24例、南通市9例、连云港市6例、淮安市7例、盐城市6例、扬州市8例、镇江市2例、泰州市9例、宿迁市4例；重症病例中，镇江市1例；出院病例中，苏州市1例。','2020-02-11','ck6hgxccz00kks27cblbfbbfv','央视新闻','江苏省','2020-01-30','http://m.weibo.cn/2656274875/4466353090326947','','江苏新增30例累计129例','2020-02-11'),('2020年1月29日0-24时,安徽省新型冠状病毒感染的肺炎新增确诊病例48例。截至1月29日24时,全省累计报告新型冠状病毒感染的肺炎确诊病例200例，累计出院病例2例，无死亡病例。累计医学观察密切接触者3638人。','2020-02-11','ck6hgxccz00kls27c837rgaai','央视新闻','安徽省','2020-01-30','http://m.weibo.cn/2656274875/4466351341457067','','安徽新增48例，累计200例','2020-02-11'),('2020年1月29日0-24时，甘肃省报告新型冠状病毒感染的肺炎新增确诊病例2例。其中：天水市清水县新增确诊病例1例，定西市通渭县新增确诊病例1例。截至2020年1月29日24时，甘肃省累计报告新型冠状病毒感染的肺炎确诊病例26例。目前，追踪到密切接触者556人，已解除隔离10人，其余均正在接受医学观察。','2020-02-11','ck6hgxccz00kms27cbd62a5ad','央视新闻','甘肃省','2020-01-30','http://m.weibo.cn/2656274875/4466359460717078','','甘肃新增2例，累计26例','2020-02-11'),('2020年1月29日0-24时，新疆报告新型冠状病毒感染的肺炎新增确诊病例1例，新增重症病例0例，新增死亡病例0例，新增出院病例0例。其中：新增确诊病例中，乌鲁木齐市1例。截至1月29日24时，新疆（含兵团）累计报告新型冠状病毒感染的肺炎确诊病例14例，现有重症病例3例、危重症病例1例，累计死亡病例0例，累计出院病例0例。目前累计追踪到密切接触者510人，已解除医学观察18人，现有492人正在接受医学观察。','2020-02-11','ck6hgxccz00kns27c26f1aq23','央视新闻','新疆维吾尔自治区','2020-01-30','http://m.weibo.cn/2656274875/4466356017759534','','新疆新增1例，累计14例','2020-02-11'),('1月29日12时至24时，云南省报告新增新型冠状病毒感染肺炎确诊病例15例。全省累计报告确诊病例70例，现有危重1例、重症6例，无死亡病例。报告疑似病例191例。密切接触者医学观察1857人。\n','2020-02-11','ck6hgxccz00kos27c3xsl8s92','央视新闻','云南省','2020-01-30','http://m.weibo.cn/2656274875/4466369086816072','','云南新增15例，累计70例','2020-02-11'),('海南省卫健委通报：2020年1月29日0-24时，海南省新型冠状病毒感染的肺炎新增确诊病例3例，新增重症病例1例，新增死亡病例0例，新增出院病例1例，3例重症病例转轻症病例。截至1月29日24时，海南省累计报告新型冠状病毒感染的肺炎确诊病例46例，重症病例7例，死亡病例1例，出院病例1例。截至1月29日24时，追踪到密切接触者1119人，已解除医学观察102人，尚有1017人正在接受居家或集中医学观察。','2020-02-11','ck6hgxccz00kps27c131j6l4p','央视新闻','海南省','2020-01-30','http://m.weibo.cn/2656274875/4466361080649368','','海南新增3例，累计46例','2020-02-11'),('2020年1月29日0-24时,黑龙江省报告新型冠状病毒感染的肺炎新增确诊病例6例。新增重症病例2例。鹤岗市、大兴安岭地区为报告首例确诊病例。新增疑似病例48例。截至1月29日24时，黑龙江省累计报告新型冠状病毒感染的肺炎确诊病例43例，累计报告疑似病例105例。全省当日发热门诊诊疗人数3118人。目前追踪到密切接触者1470人， 已解除医学观察273人,尚有1106人正在接受医学观察。','2020-02-11','ck6hgxcd000kqs27cf7is4joi','央视新闻','黑龙江省','2020-01-30','http://m.weibo.cn/2656274875/4466360308271042','','黑龙江新增6例，累计43例','2020-02-11'),('从天津市疾控中心获悉，截至1月30日6时，天津新增1例新型冠状病毒感染的肺炎确诊病例。截至目前，天津新型冠状病毒感染的肺炎累计确诊28例，其中男性22例，女性6例；重型13例，普通型15例，无危重及死亡病例。疑似病例97例。累计排查密切接触者210人，其中已确诊7人，已解除医学观察2人，尚有201人正在接受医学观察。截至1月30日早6时，天津动车客车段封控区域内未出现新的发热病例。此前出现的10例发热病例中，红区2例，确诊1例（第22例），排除1例。黄区8例，其中6例已排除，2例首次检测阴性。','2020-02-11','ck6hgxcd000krs27cgrq5hoi5','央视新闻','天津市','2020-01-30','http://m.weibo.cn/2656274875/4466372195456642','','天津新增1例，累计28例','2020-02-11'),('1月29日12时—1月29日24时，福建省报告新增新型冠状病毒感染的肺炎确诊病例17例，均为输入性病例。截至1月29日24时，福建省累计报告新型冠状病毒感染的肺炎确诊病例101例（危重症3例、重症12例，无死亡病例）。目前，确诊、疑似病例的密切接触者已解除医学观察109人，尚有1932人正在接受医学观察。\n','2020-02-11','ck6hgxcd000kss27cc54hgn1s','央视新闻','福建省','2020-01-30','http://m.weibo.cn/2656274875/4466370425511107','','福建新增17例，累计101例','2020-02-11'),('今天上午，江西新余市一名新型冠状病毒感染的肺炎患者治愈出院。该患者为男性，26岁，新余人，在新余市人民医院医护人员的精心救治下，已符合出院标准。这是江西省第4例治愈出院的新型冠状病毒感染的肺炎确诊患者。期待更多好消息！','2020-02-11','ck6hgxcd000kts27c2r2hbon0','央视新闻','江西省','2020-01-30','http://m.weibo.cn/2656274875/4466369657959638','','江西第4例患者治愈出院','2020-02-11'),('今天，吉林长春收治的首例输入性病例，即将出院。这名女性患者1月19日从武汉返乡，当时因肺炎收入长春市传染病院治疗，入院时患者感染了包括新型冠状病毒在内的多种呼吸道病原体，肺部影像学显示炎症较重，被专家组诊断为重症病例。经医护人员的精心照护，患者已无发热情况。省卫生健康委和长春市卫生健康委共同组织专家组对患者进行会诊，专家组一致认为，患者已达到解除隔离和出院标准。\n','2020-02-11','ck6hgxcd000kvs27cbte35u04','央视新闻','吉林省','2020-01-30','http://m.weibo.cn/2656274875/4466368172808834','','吉林首例确诊患者出院','2020-02-11'),('2020年1月29日0-24时，湖南省报告新型冠状病毒感染的肺炎新增确诊病例56例，新增重症病例0例，新增死亡病例0例，新增出院病例0例。截至1月29日24时,湖南省累计报告新型冠状病毒感染的肺炎确诊病例277例,累计报告重症病例38例,现有重症病例29例,死亡病例0例,出院病例0例。目前追踪到密切接触者4434人,已解除医学观察137人,尚有4297人正在接受医学观察。','2020-02-11','ck6hgxcd000kws27chvh67v1v','央视新闻','湖南省','2020-01-30','http://m.weibo.cn/2656274875/4466365715269319','','湖南新增56例，累计277例','2020-02-11'),('2020年1月29日0-24时，16市（县）报告新型冠状病毒感染的肺炎新增确诊病例72例，新增重症病例4例、死亡1例、治愈1例。截至1月29日24时，全省累计报告新型冠状病毒感染的肺炎确诊病例278例，重症37例、危重4例、死亡2例、治愈2例。目前追踪到密切接触者5288人，已解除医学观察499人，诊断为疑似29人，尚有4760人正在接受医学观察。','2020-02-11','ck6hgxcd000kxs27c0t6p9ss6','央视新闻','河南省','2020-01-30','http://m.weibo.cn/2656274875/4466353341766027','','河南新增72例，累计278例','2020-02-11'),('2020年1月29日12—24时，山东省报告新型冠状病毒感染的肺炎新增确诊病例15例，新增出院病例1例。截至1月29日24时，山东省累计报告新型冠状病毒感染的肺炎确诊病例145例，出院病例1例。目前累计追踪到密切接触者3960人，其中已解除医学观察61人、诊断为疑似或确诊32例，尚有3867人正在接受医学观察。\n','2020-02-11','ck6hgxcd100kys27c8gij471s','央视新闻','山东省','2020-01-30','http://m.weibo.cn/2656274875/4466352788131193','','山东新增15例，累计145例','2020-02-11'),('2020年1月29日0-24时，青海省报告新型冠状病毒感染的肺炎新增确诊病例0例，新增疑似病例1例。新增重症病例0例，新增死亡病例0例，新增出院病例0例。截至