,'http://m.weibo.cn/2803301701/4466354012889497','','注意！感染者向他人吐口水或追刑','2020-02-11'),('2020年1月29日0—24时，贵州省新型冠状病毒感染的肺炎新增3例确诊病例，均为1月28日报告的疑似病例。截至29日24时，全省累计报告新型冠状病毒感染的肺炎病例12例（重症3例）:贵阳市1例（已治愈），遵义市1例，六盘水市1例，毕节市1例，铜仁市2 例，黔东南州1例，黔南州4例，黔西南州1例。现有疑似病例6例（遵义市新增3例，六盘水市新增3例）。目前，累计追踪密切接触者353例，其中1例转为确诊病例，4例转为疑似病例，已解除医学观察21例，尚在接受医学观察327例。\n','2020-02-11','ck6hgxcd200les27c4in4d4w5','央视新闻','贵州省','2020-01-30','http://m.weibo.cn/2656274875/4466352288737677','','贵州新增3例，累计12例','2020-02-11'),('1月29日，按照《新型冠状病毒感染的肺炎诊疗方案》规定，根据病例临床表现，结合流行病学史和实验室检测结果，四川省新型冠状病毒感染的肺炎病例确认专家组确认四川省新增新型冠状病毒感染的肺炎病例34例。截至1月29日24时，四川省累计报告新型冠状病毒感染的肺炎确诊病例142例，涉及19个市（州）。其中成都市59例、绵阳市9例、南充市9例、广安市9例、自贡市7例、达州市6例、泸州市5例、宜宾市5例、甘孜州5例、遂宁市4例、内江市4例、巴中市4例、德阳市3例、广元市3例、乐山市2例、雅安市2例、眉山市2例、资阳市2例、凉山州2例。142名患者中，危重2人,死亡1人，治愈出院1人。正在接受医学观察2931人，已解除医学观察103人。','2020-02-11','ck6hgxcd200ljs27c0htx4egj','央视新闻','四川省','2020-01-30','http://m.weibo.cn/2656274875/4466349956829852','','四川新增34例，累计142例','2020-02-11'),('1月29日0-24时，广西共新增新型冠状病毒感染的肺炎确诊病例20例，其中南宁8例、北海2例、河池2例、柳州4例、桂林2例、钦州1例、贺州1例。目前广西累计报告确诊病例78例，累计出院病例2例。现有重症病例5例。危重病例2例，无死亡病例，无医务人员感染病例。其中：累计确诊病例中，南宁15例、柳州10例、桂林18例、梧州4例、北海15例、防城港5例、玉林2例、百色2例、河池5例、钦州1例、贺州1例；现有重症病例中，防城港1例，桂林3例，柳州1例；危重病例2例（桂林2例），累计出院病例中：梧州1例、防城港1例。','2020-02-11','ck6hgxcd200lks27c9tug1tph','央视新闻','广西壮族自治区','2020-01-30','http://m.weibo.cn/2656274875/4466344889869809','','广西新增20例，累计78例','2020-02-11'),('2020年1月29日0—24时，河北省报告新型冠状病毒感染的肺炎新增确诊病例17例，其中，张家口市5例、沧州市4例、邯郸市2例、邢台市2例、石家庄市1例、保定市1例、承德市1例、衡水市1例。新增疑似病例38例，其中，石家庄市13例、邢台市7例、秦皇岛市7例、唐山市4例、张家口市3例、邯郸市2例、廊坊市1例、辛集市1例。截至1月29日24时，河北省累计报告确诊病例65例，其中死亡1例，现有重症病例8例，无治愈出院病例。确诊病例中，沧州市12例、石家庄市11例、廊坊市9例、保定市7例、张家口市6例、邯郸市6例、邢台市5例、衡水市4例、唐山市3例、承德市2例；死亡病例中，沧州市1例；重症病例中，沧州市3例、石家庄市2例、廊坊市1例、衡水市1例、张家口市1例。现有疑似病例68例。目前累计追踪到密切接触者1581人，当日解除医学观察49人，现有1495人正在接受医学观察。','2020-02-11','ck6hgxcd200lls27ccqfr1rq1','央视新闻','河北省','2020-01-30','http://m.weibo.cn/2656274875/4466343405863704','','河北新增17例，累计65例','2020-02-11'),('1月29日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例1737例（西藏首例确诊病例），新增重症病例131例，新增死亡病例38例（湖北37例、四川1例），新增治愈出院病例21例，新增疑似病例4148例。\n截至1月29日24时，国家卫生健康委收到31个省（自治区、直辖市）和新疆生产建设兵团累计报告确诊病例7711例，现有重症病例1370例，累计死亡病例170例，累计治愈出院病例124例，共有疑似病例12167例。\n目前累计追踪到密切接触者88693人，当日解除医学观察2364人，共有81947人正在接受医学观察。累计收到港澳台地区通报确诊病例25例：香港特别行政区10例、澳门特别行政区7例、台湾地区8例。','2020-02-11','ck6hgxcd200lms27c78j94ztf','央视新闻','全国','2020-01-29','http://m.weibo.cn/2656274875/4466338090893957','','全国31省区市新增确诊1737例，累计7711例','2020-02-11'),('2020年1月29日12—24时，上海市新增新型冠状病毒感染的肺炎确诊病例5例。其中，外地来沪人员1例，本市常住人口4例。截至1月29日24时，上海市累计发现确诊病例101例，其中，男性54例，女性47例；年龄最大88岁，最小7岁；76例有湖北居住或旅行史，1例有广东旅行史并曾食用野生动物，22例有相关确诊病例接触史，2例无湖北接触史；外地来沪人员48例，本市常住人员53例。目前，91例病情平稳，4例病情危重，5例治愈出院，1例死亡。已累计排除145例疑似病例，尚有180例疑似病例正在排查中。','2020-02-11','ck6hgxcd200lns27ccbi85jwq','央视新闻','上海市','2020-01-29','http://m.weibo.cn/2656274875/4466341593505520','','上海新增5例，累计101例','2020-02-11'),('29日0时至24时，山西省报告新型冠状病毒感染的肺炎新增确诊病例8例。截至1月29日24时，山西省9个市累计报告新型冠状病毒感染的肺炎确诊病例35例。已治愈出院1例（太原市小店区）。现有在院隔离治疗病例34例，其中危重1例（晋中市平遥县）、重症1例（吕梁市离石区）、普通32例。','2020-02-11','ck6hgxcd200lps27c0ec0976t','人民日报','山西省','2020-01-29','http://m.weibo.cn/2803301701/4466313504333442','','山西新增确诊8例，治愈出院1例','2020-02-11'),('2020年1月29日0—24时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例18例，新增重型病例4例，重型病例转普通型病例1例，新增出院病例1例。武隆区为报告首例确诊病例。新增确诊病例中，万州区7例、渝中区1例、江北区1例、南岸区1例、渝北区1例、江津区1例、合川区1例、大足区1例、开州区2例、武隆区1例、云阳县1例；新增重型病例中，万州区1例、长寿区1例、永川区1例、綦江区1例；重型病例转普通型病例为九龙坡区１例；新增出院病例为巫山县１例。截至1月29日24时，重庆市累计报告新型冠状病毒感染的肺炎确诊病例165例，重型病例18例，危重型病例4例，出院病例1例。\n','2020-02-11','ck6hgxcd300lqs27c4zld4ivc','人民日报','重庆市','2020-01-29','http://m.weibo.cn/2803301701/4466324828738497','','重庆新增18例，累计165例','2020-02-11'),('2020年1月29日0时-24时，湖北省新增新型冠状病毒感染的肺炎病例1032例（其中：武汉市356例、黄石市27例、十堰市31例、襄阳市32例、宜昌市54例、荆州市50例、荆门市49例、鄂州39例、孝感市125例、黄冈市172例、咸宁市18例、随州市27例、恩施州15例、仙桃市23例、天门市10例、潜江2例、神农架林区2例）。全省新增死亡37例（其中：武汉市25例、荆州市1例、鄂州市1例、孝感市3例、黄冈市7例）。新增出院10例（其中：武汉市7例、黄冈市3例）。截至2020年1月29日24时，湖北省累计报告新型冠状病毒感染的肺炎病例4586例，已治愈出院90例，死亡162例。累计追踪密切接触者28780人，尚在接受医学观察26632人。\n','2020-02-11','ck6hgxcd300lrs27c736yg239','人民日报','湖北省','2020-01-29','http://m.weibo.cn/2803301701/4466316826466262','','湖北新增确诊病例1032例，累计4586例','2020-02-11'),('江西省卫健委通报，1月29日0-24时，江西报告新型冠状病毒感染的肺炎新增确诊病例53例。新增确诊病例中南昌市21例、九江市15例、赣州市5例、抚州市4例、萍乡市3例、鹰潭市2例、上饶市2例、吉安市1例。截至29日24时，江西累计确诊病例162例。','2020-02-11','ck6hgxcd300lts27cfx1g9flt','人民日报','江西省','2020-01-29','http://m.weibo.cn/2803301701/4466279089622346','','江西确诊病例新增53例，累计162例','2020-02-11'),('1月29日，重庆市教委印发通知指出，为加强新型冠状病毒感染肺炎疫情防控工作，根据市新型冠病毒感染的肺炎疫情防控工作领导小组统一安排，全市各级各类学校（高校、中小学、中职学校、幼儿园、托儿所等）2月17日（正月二十四）24时前不得开学。\n','2020-02-11','ck6hgxcd300lus27c9vqw6ld5','人民日报','重庆市','2020-01-29','http://m.weibo.cn/2803301701/4466219124488221','','重庆2月17日前不得开学','2020-02-11'),('据法媒报道，在29日举行的记者会上，法国卫生部长布赞宣布，法国当天确诊第五例新型冠状病毒感染病例。该患者是昨天在巴黎确诊的80岁中国男性游客的女儿，目前她正在重症监护中。（人民日报记者刘玲玲） \n','2020-02-11','ck6hgxcd300lvs27cews78zhc','人民日报','','2020-01-29','http://m.weibo.cn/2803301701/4466277525750547','','法国确诊第五例新冠病毒感染病例','2020-02-11'),('芬兰北部拉普兰地区的一名中国游客在表现出症状后被送往医院接受检查，被证实患有新型冠状病毒。这位游客是32岁的女性，身体相对健康，五天前离开武汉。症状首次出现时，她在伊瓦洛寻求医疗救助。 在转移到罗瓦涅米的拉普兰中心医院后，医生对她采集了样本。 随后在赫尔辛基进行的测试证实了感染新型冠状病毒。\n','2020-02-11','ck6hgxcd300lws27c68ry5v3u','央视新闻','','2020-01-29','http://m.weibo.cn/2656274875/4466257102983338','','芬兰确诊首例病例','2020-02-11'),('#疫情联防联控实时播报#【#北京新增9例累计111例#】 1月29日12时至20时，北京市新增9例新型冠状病毒感染的肺炎病例，其中7例有湖北及其他省份接触史，2例为确诊病例的密切接触者，均已送至市级定点医疗机构进行救治。  \n','2020-02-11','ck6hgxcd300lxs27c4t9x8bq8','央视新闻','北京市','2020-01-29','http://m.weibo.cn/2656274875/4466208855990515','','北京新增9例累计111例','2020-02-11'),('【好消息！#武汉首例高龄重症病人康复出院#】1月29号，一位78岁高龄的新型冠状病毒感染的肺炎重症患者，经过医护人员的治疗，从同济医院隔离病房康复出院，这是目前武汉市首个高龄重症患者治愈的病例。据介绍，本月初，卢先生在打兵乓球时不慎接触到被感染的球友，出现发热、乏力等症状，1月9号到同济医院接受隔离治疗。此前卢先生患有二十多年的高血压和糖尿病，入院后病情逐渐加重，1月18号出现危重症状。经过同济医院医护团队的全力救治，4天后，卢先生的病情得到缓解。','2020-02-11','ck6hgxcd300lys27chdhyh2g9','人民日报','湖北省','2020-01-29','http://m.weibo.cn/2803301701/4466225533077150','','武汉首例高龄重症病人康复出院','2020-02-11'),('#疫情联防联控实时播报#【好消息！#澳门新增0例确诊病例#】今天17时，澳门特区政府新型冠状病毒感染应变协调中心透露，在过去24小时内，澳门没有新增新型冠状病毒感染确诊病例。此前7名已经确诊的病人都没有发热，属于轻症。截至29日15时，澳门累计疑似个案共114例（包括累计确诊的7例），已排除101例，仍待排除6例。待排除的6例中有4人是澳门居民，经评估为中风险人士，现已排除感染的可能性；另外2人，分别报称澳门大学的研究员及其女儿，于16日从湖北来澳后在家中自我隔离，其后出现低烧，经消防局送到仁伯爵综合医院后正等待检查结果。（总台央视记者肖中仁 戴峰）\n','2020-02-11','ck6hgxcd300lzs27c2i553ken','央视新闻','澳门','2020-01-29','http://m.weibo.cn/2656274875/4466209803858902','','澳门新增0例确诊病例','2020-02-11'),('#疫情联防联控实时播报#【#加拿大确诊第2例感染者#】当地时间29日，加拿大安大略省卫生厅宣布，现在已经确诊了加拿大第二例新型冠状病毒感染者，也就是第一例感染者的妻子。目前，两人都处于隔离状态接受治疗。他们是22日乘飞机到多伦多之后就诊的，但是在飞机上就出现了轻微症状。另外，第三例初诊确认感染者目前在温哥华，也处于隔离治疗中（总台央视记者张森）\n','2020-02-11','ck6hgxcd300m1s27cc1eehtaz','央视新闻','','2020-01-29','http://m.weibo.cn/2656274875/4466207455921842','','加拿大确诊第2例感染者','2020-02-11'),('#岩松帮你问#【#此次疫情是否比SARS更重#】李兰娟：SARS时检测的能力和水平，同现在是不能相比的。现在我们有了非常好的检测设备和试剂，一发现病源后，很快就研制成功检测试剂。现在国家联网联控，各个社区、街道、医院，设备、条件都有了明显改进，所以感染的人基本都能发现和隔离。这个数据比较真实，能把感染的人都发现出来，SARS时水平还不够，不能比较。 央视新闻的微博视频\n','2020-02-11','ck6hgxcd300m2s27c0mkjawwg','央视新闻','全国','2020-01-29','http://m.weibo.cn/2656274875/4466197083176793','','此次疫情是否比SARS更重','2020-02-11'),('【#四川出现首例死亡病例#】#四川累计确诊108例#1月29日，四川省医疗救治专家组就当前全省新型冠状病毒感染的肺炎危重、重症、第一例痊愈病例、第一例解除隔离的危重病例和第一例死亡病例进行了讨论分析。从病例情况分析看，高龄危重、重症患者一般都伴有其他基础性疾病，如高血压、糖尿病、冠心病等，加之新型冠状病毒肺炎的存在，治疗面临不少挑战。\n','2020-02-11','ck6hgxcd300m3s27cehmq2god','人民日报','四川省','2020-01-29','http://m.weibo.cn/2803301701/4466191186242379','','四川出现首例死亡病例','2020-02-11'),('据大连市卫生健康委，大连市首例新型冠状病毒感染的肺炎病例入院后，经大连市级专家组科学制定方案，医护人员精心诊治和护理，连续5天体温正常，两次新型冠状病毒核酸检测阴性，经大连市专家组会诊，符合国家卫生健康委最新的新型冠状病毒感染的肺炎确诊病例解除隔离和出院标准，已于今日出院。同时，这也是辽宁省首例出院的确诊患者。','2020-02-11','ck6hgxcd400m5s27c6mg3eb89','央视新闻','辽宁省','2020-01-29','http://m.weibo.cn/2656274875/4466189583511108','','好消息！辽宁首例患者出院','2020-02-11'),('28日0-24时，31个省（区、市）报告新增确诊病例1459例，累计确诊病例5974例。过去几十天里，武汉金银潭医院救治情况如何？今晚《新闻1+1》连线中国工程院院士、国家卫健委高级别专家组成员李兰娟、武汉金银潭医院院长张定宇','2020-02-11','ck6hgxcd400m6s27c946p35km','央视新闻','全国','2020-01-29','http://m.weibo.cn/2656274875/4466186114794256','','《新闻1+1》连线专家问疫情','2020-02-11'),('1月29日召开的中央应对新型冠状病毒感染肺炎疫情工作领导小组会议指出，当前疫情防控正在全面推进，防控力度持续加大，但疫情仍处于扩散阶段，局部地区有迅速上升趋势，形势复杂严峻。中央应对疫情工作领导小组会议强调，各地要提高分散接诊、集中收治能力，将重症病例集中到综合力量最强的医院，或派出重症医学专家赴定点医院全天候值守。加快疫苗研制进度，对研究表明有一定效果的药物抓紧审批投入临床使用。中央应对疫情工作领导小组会议指出，各地要迅速组织医用防护服、口罩、医用护目镜、负压救护车、相关药品等生产企业复工复产，研究实施税收、金融等支持政策。指导物流企业包括电商平台做好投放等工作。中央应对疫情工作领导小组会议指出，要切实做好节后人员返程疫情防控工作。进行错峰疏导，指导有关单位允许来自疫情高发地区人员、非紧迫工作岗位人员适当延期返程，对高风险人群延长居家留观时间或实行居家网上办公。湖北等疫情相对严重省市可依法经国务院批准，采取适当推迟开工开业开课等必要措施。','2020-02-11','ck6hgxcd400m7s27cernv0zlz','人民日报','全国','2020-01-29','http://m.weibo.cn/2803301701/4466185204915172','','中央应对疫情工作领导小组会议：疫情仍处于扩散阶段，形势复杂严峻','2020-02-11'),('湖北省省长王晓东：湖北省的疫情防控处于一个关键期，经过省疫情防控指挥部研究决定，全省各类企业复工的时间不早于2月13日24时，各类学校延期开学，具体的开学时间要视疫情防控的情况确定。 ','2020-02-11','ck6hgxcd400m8s27c7odg79ol','央视新闻','湖北省','2020-01-29','http://m.weibo.cn/2656274875/4466181291810579','','湖北企业复工不早于2月13日','2020-02-11'),('今晚，湖北省召开新型冠状病毒感染肺炎疫情防控工作新闻发布会，通报全省疫情和防控工作最新进展情况。\n','2020-02-11','ck6hgxcd400m9s27c6g9fao0s','央视新闻','湖北省','2020-01-29','http://m.weibo.cn/2656274875/4466176795187551','','直播！湖北疫情防控发布会','2020-02-11'),('今天下午15点，由钟南山院士担任组长的广东省新型冠状病毒感染的肺炎重症病例会诊专家组对广东5例危重症患者进行了第一次远程会诊。参与今天远程会诊的有共5家医院的10名专家，整个专家组成员100余名。从今天开始，这样的远程会诊每天都会进行。','2020-02-11','ck6hgxcd400mas27cf7gt3xeg','央视新闻','全国','2020-01-29','http://m.weibo.cn/2656274875/4466175607848341','','钟南山参与危重患者远程会诊','2020-02-11'),('29日，中央应对新型冠状病毒感染肺炎疫情工作领导小组举行会议，部署有针对性加强防控工作。会议指出，要进行错峰疏导，指导有关单位允许来自疫情高发地区人员、非紧迫工作岗位人员适当延期返程，对高风险人群延长居家留观时间。湖北等疫情相对严重省市可依法经国务院批准，采取适当推迟开工开业开课等必要措施。','2020-02-11','ck6hgxcd400mbs27c3wwdduip','央视新闻','全国','2020-01-29','http://m.weibo.cn/2656274875/4466171275377551','','中央明确：允许疫情高发区人员适当延期返程','2020-02-11'),('29日上午，西藏自治区应对新型冠状病毒感染的肺炎疫情工作领导小组召开会议，决定自即日起，全区启动重大突发公共卫生事件Ⅰ级响应。\n','2020-02-11','ck6hgxcd400mcs27c0jj3dem5','人民日报','西藏自治区','2020-01-29','http://m.weibo.cn/2803301701/4466167794617744','','最新！西藏启动一级响应','2020-02-11'),('曾光接受人民日报专访时表示：我们现在不是防新型冠状病毒肺炎，是防新型冠状病毒感染，可能有些病人不到肺炎的程度，但是他是传染源。所以现在诊断标准出了4版，是因为病毒变化快，我们在适应，跟它赛跑。\n','2020-02-11','ck6hgxcd400mds27c2g2j5bh8','人民日报','全国','2020-01-29','http://m.weibo.cn/2803301701/4466161091829323','','现在不是防肺炎而是防感染','2020-02-11'),('1月29日，武汉市肺科医院4名新型冠状病毒感染的肺炎患者在经过治疗后康复出院，其中包括一位在重症监护室住了13天的急危重症患者，和泰国首例新型冠状病毒感染的肺炎患者。经专家组评估后，4名患者符合出院标准，于下午3时陆续出院。','2020-02-11','ck6hgxcd400mes27cgxhhgy9x','人民日报','湖北省','2020-01-29','http://m.weibo.cn/2803301701/4466160206450949','','好消息！4名新冠肺炎患者康复出院，一曾住重症监护室13天的患者出院','2020-02-11'),('中国疾控中心流行病学首席科学家曾光接受@人民日报专访时表示：疾病有潜伏期，从1月23号推算的话，大概到正月十五，应该能看到明显的成效。','2020-02-11','ck6hgxcd400mfs27c3djihgwy','人民日报','全国','2020-01-29','http://m.weibo.cn/2803301701/4466155161221831','','曾光：疫情控制到正月十五有明显的成效','2020-02-11'),('新加坡卫生部今天（29日）傍晚宣布，截止到当天下午2点，新加坡新增新型冠状病毒感染的肺炎确诊病例3例，累计确诊病例10例。卫生部公告说，确诊感染的三人均来自武汉。其中两人是一对年龄为56岁的夫妻，两人1月19日抵达新加坡，两人表示在飞机上没有出现症状，24日出现感染症状，27日乘坐出租车到陈笃生医院就诊。第十例是一名56岁男性，1月20日抵达新加坡。21日出现症状。目前三人均在国家传染病中心接受隔离治疗，状况稳定。截至今天（29日）下午2点，新加坡共有10例确诊病例，124例检测结果为阴性，70例还在检测中。','2020-02-11','ck6hgxcd400mgs27cee4pgit6','央视新闻','','2020-01-29','http://m.weibo.cn/2656274875/4466157631457801','','新加坡新增3例确诊病例','2020-02-11'),('2020年1月29日13时30分至16时，辽宁省朝阳市新增1例输入性新型冠状病毒感染的肺炎确诊病例，属普通型病例。截至2020年1月29日16时，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例39例，其中重型病例8例。确诊病例中，沈阳市9例、大连市5例、本溪市2例、丹东市5例、锦州市4例、营口市1例、辽阳市1例、铁岭市2例、朝阳市4例、盘锦市2例、葫芦岛市4例。目前39名患者均在定点医疗机构隔离治疗，病情平稳。其中，35例病例发病前有武汉居住史或旅行史，3例病例为武汉输入病例家属，1例为现有确诊病例的密切接触者。目前累计追踪到密切接触者537人，已解除医学观察73人，现有464人正在接受医学观察，其余正在追踪中。','2020-02-11','ck6hgxcd500mis27c87jlga6a','央视新闻','辽宁省','2020-01-29','http://m.weibo.cn/2656274875/4466146927172308','','辽宁新增1例累计39例','2020-02-11'),('香港特区政府卫生署卫生防护中心29日通报，一对来自武汉的夫妇初步确诊感染新型冠状病毒，香港的确诊个案总数增至10例。卫生署和香港医院管理局（医管局）介绍，两名患者分别为73岁女性和75岁男性，均为武汉居民，1月22日乘坐航班从武汉抵达香港探亲，入住过两家酒店，28日进入医院。香港过去24小时新增56例呈报疑似个案。呈报个案总计585例，包括之前的8例确诊个案和29日新增的2例初步确诊个案。之前的8例确诊个案患者中，7人情况稳定；1人情况严重，在玛嘉烈医院深切治疗部接受治疗。现有呈报疑似个案涉及12名医护人员，其中10人已经出院；2人仍在医院隔离，情况稳定。','2020-02-11','ck6hgxcd500mjs27c2k0jcu3f','央视新闻','香港','2020-01-29','http://m.weibo.cn/2656274875/4466145782866083','','香港确诊病例增至10例','2020-02-11'),('今天下午，广东省政府通报，目前广东确诊的新型冠状病毒感染的肺炎病例中，包括3名外籍人士和2名境外人士。3名外籍人士中，有2名是澳大利亚籍，1名是巴基斯坦籍，而2名境外人士均是香港籍，他们都曾有过武汉旅游或居住史。据介绍，巴基斯坦籍的确诊患者是一名留学生，在武汉上大学，1月21日来到深圳，24日到广州，26日就出现了症状后前往就医，确诊为新型冠状病毒感染的肺炎后，医院马上就对其采取了住院隔离措施，目前已经转到定点医院，病情也稳定，另外2名澳大利亚籍病例则有前往湖北旅游的经历。香港籍的其中1名患者长期在武汉工作，1月22日到了广东佛山，24日身体不适后到医疗机构去就诊，随后采取了隔离措施，另1名则去了湖北旅游，随后到了广东湛江，1月29日确诊确诊后立即采取了隔离措施，这五位患者目前病情稳定。','2020-02-11','ck6hgxcd500mks27c7venfnrc','央视新闻','广东省','2020-01-29','http://m.weibo.cn/2656274875/4466137187883240','','广东确诊5例外籍和境外人士感染','2020-02-11'),('最近有媒体报道口罩告急的消息，一些医院也就医用口罩紧缺的问题向外求救。工业和信息化部有关司局负责同志接受采访表示，我国口罩最大产能是每天2000多万只。随着疫情的蔓延，口罩的需求量爆发式增长。现在连很多偏远农村地区的群众都开始戴上口罩，如果人人都在用，每天还要更换，面对这么强大的刚需，短期内供给跟不上也在情理之中。工业和信息化部正在全力以赴克服种种困难，推动生产企业加班加点恢复产能。通过这段时间的努力，产量达到一天800万只以上，复工复产面达到了40%，但要看到，恢复乃至扩大产能毕竟需要时间。我们除了国内的生产，也在推动国际采购，以满足全国疫情防控需求。','2020-02-11','ck6hgxcd500mls27c52nh3p3g','人民日报','全国','2020-01-29','http://m.weibo.cn/2803301701/4466130460658905','','工信部回应口罩告急：目前产量达到一天800万只以上，紧张局面估计会渐渐缓解','2020-02-11'),('当地时间29日晚，澳大利亚昆士兰州卫生部门宣布，确诊昆士兰州首例新型冠状病毒感染肺炎病例。澳大利亚确诊病例上升到7例，其中新南威尔士州4例，维多利亚州2例，昆士兰州1例。据介绍，这名44岁的男子来自武汉，目前正在黄金海岸的医院隔离治疗，病情稳定。（总台央视记者林清辉）','2020-02-11','ck6hgxcd500mms27ccb0ncmnt','央视新闻','','2020-01-29','http://m.weibo.cn/2656274875/4466129097096724','','澳大利亚确诊第 7 例病例','2020-02-11'),('1月29日，山西省首例新型冠状病毒感染的肺炎患者在省级医疗救治专家组的指导和省级定点太原市第四人民医院医护人员救治下，已符合治愈标准，正式出院。该患者为男性，23岁，太原市人，1月12日在武汉旅游，1月15日返回太原。1月20日出现发烧症状，就诊于山西白求恩医院。1月21日确诊为新型冠状病毒感染的肺炎病例，转入省级定点医院太原市第四人民医院救治。据太原市第四人民医院医疗救治专家组组长范梦柏介绍，经山西省、太原市卫生健康委与太原市第四人民医院精心组织，医务人员按照国家诊疗方案全力救治，该患者目前体温恢复正常8天，2次病毒核酸检测均呈阴性，肺部阴影基本吸收，经省级专家组评估，符合国家卫生健康委新型冠状病毒感染的肺炎确诊病例解除隔离和出院标准。这是山西省首例成功治愈的新型冠状病毒感染的肺炎患者。（总台央视记者 宋云屹）','2020-02-11','ck6hgxcd900mns27cb4q16pgp','央视新闻','山西省','2020-01-29','http://m.weibo.cn/2656274875/4466125108376678','','好消息！山西首例患者治愈出院','2020-02-11'),('1月29日0时至12时，云南省报告新增新型冠状病毒感染的肺炎确诊病例4例。全省累计报告确诊病例55例，现有危重1例、重症5例，无死亡病例。其中，昆明市15例、丽江市6例、德宏州2例、保山市4例、曲靖市5例、玉溪市5例、红河州2例、西双版纳州10例、大理州3例、昭通市2例、普洱市1例。报告疑似病例179例。密切接触者医学观察874人。','2020-02-11','ck6hgxcd900mos27cbmgtguq8','央视新闻','云南省','2020-01-29','https://weibo.com/2656274875/IrJSOCjR3?type=comment#_rnd1580288537364','','云南新增 4 例，累计 55 例','2020-02-11'),('据广东省卫生健康委员会通报，截至1月29日12时，全省累计报告新型冠状病毒感染的肺炎确诊病例272例。29日0-12时，全省新增确诊病例31例，新增出院病例1例。新增确诊病例中，江门市1例为首次报告，深圳市17例、珠海市4例、佛山市3例、汕头市2例、湛江市2例、中山市1例、茂名市1例。有1286名密切接触者正在接受医学观察。确诊病例中，广州市63例、深圳市80例、佛山市21例、珠海市18例、惠州市12例、中山市13例、江门市1例、阳江市10例、东莞市7例、湛江市9例、汕头市8例、清远市6例、揭阳市6例、肇庆市5例、韶关市4例、梅州市4例、茂名市3例、河源市1例、汕尾市1例。男性133例，女性139例，年龄介于11月龄-85岁之间。（总台央视记者魏星）\n','2020-02-11','ck6hgxcd900mps27c7b6j4iem','央视新闻','广东省','2020-01-29','http://m.weibo.cn/2656274875/4466103353156915','','广东新增 31 例，累计 272 例','2020-02-11'),('今日上午11时许，4名新型冠状病毒感染的肺炎患者经过治疗，从武汉市金银潭医院出院。这4名患者为2名男性，2名女性，年龄在46岁-82岁。医务人员一直护送他们离开医院，祝福！','2020-02-11','ck6hgxcd900mqs27chaor9cwm','央视新闻','湖北省','2020-01-29','http://m.weibo.cn/2656274875/4466096155396758','','好消息！武汉金银潭医院又有 4 名患者出院，最大 82 岁','2020-02-11'),('根据香港特区政府公布的疫情防控措施，自2020年1月30日零时起，香港西九龙站及红磡车站口岸将关闭，因此，往来中国内地与香港间的列车（包括香港西九龙站至内地间的高铁列车，香港红磡站至内地间的普速列车）同时暂停跨境运营。已经购买了跨境车票的旅客，请及早安排行程调整，在办理退票时，免收手续费。（人民日报记者陆娅楠）\n','2020-02-11','ck6hgxcd900mrs27c0yo2dmop','人民日报','香港','2020-01-29','http://m.weibo.cn/2803301701/4466096641426231','','进出香港跨境列车暂停运营','2020-02-11'),('发现一些儿童婴幼儿病例，但是症状比较轻。主要还是中老年人，有基础病。疫情较重的地区要加强老年人、儿童保护。老年人要减少外出，做好防护。孩子减少外出，减少人员密集地区活动，做好对儿童幼儿的保护。\n','2020-02-11','ck6hgxcd900mss27c2nfzem6a','人民日报','湖北省','2020-01-29','http://m.weibo.cn/2803301701/4466091650601820','','冯子健回应老年人儿童易感：儿童婴幼儿病例症状较轻','2020-02-11'),('截至1月29日12时，福建省累计报告新型冠状病毒感染的肺炎输入性确诊病例84例（危重2例、重症12例，无死亡病例），其中福州市24例、厦门市6例、漳州市7例、泉州市13例、三明市9例、莆田市14例、南平市3例、龙岩市1例、宁德市7例；报告输入性疑似病例94例，其中福州市40例、厦门市4例、漳州市4例、泉州市15例、三明市7例、莆田市9例、龙岩市6例、宁德市9例。上述患者均为湖北、武汉返乡人员和来闽人员，目前正在接受治疗，病情总体稳定。（总台央视记者黄珊）\n','2020-02-11','ck6hgxcda00mus27c67xnhypx','央视新闻','福建省','2020-01-29','http://m.weibo.cn/2656274875/4466093294776386','','福建确诊病例增至 84 例','2020-02-11'),('澳大利亚墨尔本1月29日确认了维多利亚州第2例新型冠状病毒患者，也是澳大利亚全国范围内第6例被确诊的病例。该患者年龄在60多岁，曾到访过武汉。到达墨尔本两天多后出现症状。患者现在被收治在墨尔本一家医院，与他有密切接触的家人已经被隔离观察。澳大利亚现规定，不论是否有症状，只要到过湖北省的人都必须居家隔离14天。（总台央视记者费菲）','2020-02-11','ck6hgxcda00mvs27cgtm4h43a','央视新闻','','2020-01-29','http://m.weibo.cn/2656274875/4466089163227418','','澳大利亚确诊病例增至 6 例','2020-02-11'),('今天下午，国家卫生健康委于召开新闻发布会，介绍新型冠状病毒感染的肺炎疫情预防公众指导建议有关情况。总台记者直击发布会前的准备情况！现场提问专家，回应网友关切问题（总台央视记者杨弘杨）\n','2020-02-11','ck6hgxcda00mws27c9crb8s2t','央视新闻','湖北省','2020-01-29','http://m.weibo.cn/2656274875/4466084696355669','','直播国家卫健委召开新闻发布会','2020-02-11'),('上海市卫健委今天（29日）通报：2020年1月29日0—12时，上海市新增新型冠状病毒感染的肺炎确诊病例16例，其中，1例危重病例。新增确诊病例中，外地来沪人员7例，本市常住人口9例。截至1月29日12时，上海市累计发现确诊病例96例，其中，男性50例，女性46例；年龄最大88岁，最小7岁；71例有湖北居住或旅行史，1例有广东旅行史并曾食用野生动物，22例有相关确诊病例接触史，2例无湖北接触史；外地来沪人员47例，本市常住人员49例。截至1月29日14时，87例病情平稳，3例病情危重，5例治愈出院，1例死亡。已累计排除109例疑似病例，尚有185例疑似病例正在排查中。','2020-02-11','ck6hgxcda00mxs27cafrigijt','央视新闻','上海市','2020-01-29','http://m.weibo.cn/2656274875/4466084243385996','','上海新增 16 例，确诊 96 例','2020-02-11'),('2020年1月29日0—12时，山东省报告新型冠状病毒感染的肺炎新增确诊病例9例，其中:青岛市2例(即墨区、平度市各1例)，烟台市2例(牟平区、莱州市各1例)，威海市1例(环翠区)，日照市1例(东港区)，临沂市1例(河东区)，聊城市1例(临清市)，滨州市1例(邹平市)。目前有疑似病例61例，其中:青岛市28例，菏泽市6例，德州市5例，滨州市、威海市、聊城市各4例、枣庄市、潍坊市各3例，临沂市2例，泰安市、济宁市各1例。截至1月29日12时，山东省累计报告新型冠状病毒感染的肺炎确诊病例130例。备注:根据国家卫健委关于疫情信息报告新要求，按病例确诊时医院所在县区统计。\n','2020-02-11','ck6hgxcda00mys27c3x8zho88','央视新闻','山东省','2020-01-29','http://m.weibo.cn/2656274875/4466083832905352','','山东累计确诊增至 130 例','2020-02-11'),('2020年1月29日10时至13时30分，辽宁省沈阳市新增1例新型冠状病毒感染的肺炎确诊病例，该病例为现有确诊病例的密切接触者，属普通型病例。截至2020年1月29日13时30分，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例38例，其中重型病例6例。确诊病例中，沈阳市9例、大连市5例、本溪市2例、丹东市5例、锦州市4例、营口市1例、辽阳市1例、铁岭市2例、朝阳市3例、盘锦市2例、葫芦岛市4例。目前38名患者均在定点医疗机构隔离治疗，病情平稳。其中，34例病例发病前有武汉居住史或旅行史，3例病例为武汉输入病例家属，1例为现有确诊病例的密切接触者。目前累计追踪到密切接触者537人，已解除医学观察73人，现有464人正在接受医学观察，其余正在追踪中。（总台央视记者李承泽）\n','2020-02-11','ck6hgxcda00n0s27cb95vca3d','央视新闻','辽宁省','2020-01-29','http://m.weibo.cn/2656274875/4466081416535897','','辽宁新增 1 例，累计 38 例','2020-02-11'),('大兴安岭地区新型冠状病毒感染的肺炎疫情防控指挥部疫情通报：截至1月29日12时，大兴安岭确诊首例新型冠状病毒感染的肺炎输入性病例1例。其中：加格达奇区1例。','2020-02-11','ck6hgxcda00n1s27c2qq80u1v','大兴安岭卫健委','黑龙江省','2020-01-29','http://www.dxal.gov.cn/xwdt/xayw/content_76924','','大兴安岭确诊首例输入性病例','2020-02-11'),('山东首例新型冠状病毒感染的肺炎确诊病例是一名37岁男性患者，在专家组和隔离病房医护团队救治和护理下，该患者病情持续改善，呼吸道症状好转，肺部影像学显示病灶明显吸收，连续4天体温正常，各项化验指标均正常。两次核酸检测均为阴性，经医院专家组评估，目前该患者已经痊愈，符合国家卫生健康委新型冠状病毒感染的肺炎确诊病例解除隔离和出院标准。（总台央视记者窦效磊）','2020-02-11','ck6hgxcda00n3s27cgp5tbjvs','央视新闻','山东省','2020-01-29','https://m.weibo.cn/status/4466044426772701?','','山东首例确诊病例治愈','2020-02-11'),('今天，上海又一例新型冠状病毒感染的肺炎患者出院。上海已连续第三天有治愈患者出院，累计治愈出院5例。\n','2020-02-11','ck6hgxcda00n4s27ce9o7diqk','央视新闻','上海市','2020-01-29','http://m.weibo.cn/2656274875/4466060038273036','','上海新增治愈出院 1 例','2020-02-11'),('据阿联酋通讯社29日报道，阿联酋宣布发现首例新型冠状病毒感染的肺炎病例。阿联酋卫生和预防部强调，患者目前情况稳定，正在进行医疗检查。\n','2020-02-11','ck6hgxcda00n5s27c1rd9g52v','央视新闻','','2020-01-29','http://m.weibo.cn/2656274875/4466063171895950','','阿联酋发现首例病例','2020-02-11'),('新型肺炎确诊病例的密切接触者，应从和病人接触的最后一天起采取医学观察14天。在家观察期间，防护千万不能掉以轻心！了解病情观察和护理要点，希望你用不到，但一定要知道！ \n','2020-02-11','ck6hgxcdb00n6s27c8t78fbd3','央视新闻','全国','2020-01-29','http://m.weibo.cn/2656274875/4466054560345409','','如何正确居家医学观察','2020-02-11'),('至1月29日9时，天津市新增2例新型冠状病毒感染的肺炎确诊病例，确诊病例增至27例。截至目前，天津市累计发现新型冠状病毒感染的肺炎病例27例，其中男性21例，女性6例；重型17例，普通型10例；无危重及死亡病例。\n','2020-02-11','ck6hgxcdb00n7s27c2styf80a','人民日报','天津市','2020-01-29','http://m.weibo.cn/2803301701/4466058985822641','','天津新增确诊 2 例，累计确诊 27 例','2020-02-11'),('1月29日，安徽省卫健委发布疫情通报，歙县新增确诊新型冠状病毒感染的肺炎3例，其中一名患者为8个月婴儿。29日新增3例确诊病例，为28日通报的确诊病例汪某、颜某、汪某某的共同生活家庭成员。2020年1月27日，3人的采样标本送黄山市疾控中心检测，1月28日检测结果为新型冠状病毒核酸阳性。1月28日采样标本送安徽省疾控中心复核检测，结果为新型冠状病毒核酸阳性，确诊3人均患新型冠状病毒感染的肺炎。以上三人均于2020年1月26日 14:00集中收住歙县人民医院住院隔离治疗。\n','2020-02-11','ck6hgxcdb00n8s27cccbd097k','人民日报','安徽省','2020-01-29','http://m.weibo.cn/2803301701/4466046838506500','','安徽出现 8 个月大确诊婴儿，属于家庭聚集性病例','2020-02-11'),('截至1月28日24时，云南省累计报告新型冠状病毒感染的肺炎确诊病例51例，新增7例，现有危重1例、重症5例，无死亡病例。其中，昆明市15例、丽江市6例、德宏州2例、保山市4例、曲靖市5例、玉溪市5例、红河州2例、西双版纳州6例、大理州3例、昭通市2例、普洱市1例。报告疑似病例163例。密切接触者医学观察874人。\n','2020-02-11','ck6hgxcde00n9s27cf9il01ih','央视新闻','云南省','2020-01-29','http://m.weibo.cn/2656274875/4466044746299301','','云南新增 7 例，累计 51 例','2020-02-11'),('至1月29日9时，天津新增2例新型冠状病毒感染的肺炎确诊病例，确诊病例增至27例。截至目前，天津市累计发现新型冠状病毒感染的肺炎病例27例，其中男性21例，女性6例；重型17例，普通型10例；无危重及死亡病例。','2020-02-11','ck6hgxcde00nas27c65xrcs6b','天津发布微博','天津市','2020-01-29','https://m.weibo.cn/detail/4466051808761777','','天津新增 2 例确诊，累计确诊 27 例','2020-02-11'),('1月29日，经医护人员精心诊治和护理，安徽省立医院感染病院接诊的一例新型冠状病毒感染的肺炎患者救治情况良好，符合出院标准，于今日出院。此外，安徽省亳州市人民医院接诊的一例新型冠状病毒感染肺炎患者救治情况良好，经医护人员静心诊治和护理，也已符合出院标准正式出院。期待更多的患者治愈出院！\n','2020-02-11','ck6hgxcde00nbs27c9a2a7l5g','央视新闻','安徽省','2020-01-29','http://m.weibo.cn/2656274875/4466049141689039','','安徽 2 名确诊病例治愈出院','2020-02-11'),('1月28日12时至29日12时，北京市新增11例新型冠状病毒感染的肺炎病例，7例有湖北及其他省份接触史，7例为确诊病例的密切接触者，1例尚未完成流行病学调查，其中4例既有湖北接触史又是确诊病例的密切接触者。均已送至市级定点医疗机构进行救治。截至1月29日12时，北京市累计确诊病例102例。其中东城区2例、西城区9例、朝阳区19例、海淀区23例、丰台区8例、石景山区2例、门头沟1例、通州区7例、顺义区2例、大兴区10例、昌平区8例，外地来京人员11例。','2020-02-11','ck6hgxcdf00ncs27cb37b5v2g','央视新闻','北京市','2020-01-29','http://m.weibo.cn/2656274875/4466056711851472','','北京新增确诊 11 例，累计 102 例','2020-02-11'),('1月29日上午10点，经贵州医科大学附属医院医护人员的精心诊治和护理，贵州首例新型冠状病毒感染的肺炎确诊患者被治愈，符合出院标准，正式解除医学隔离。这也是贵州首例被治愈的新型冠状病毒感染的肺炎患者。','2020-02-11','ck6hgxcdf00nds27c6bby2pt7','央视新闻','贵州省','2020-01-29','http://m.weibo.cn/2656274875/4466050286494913','','贵州首例确诊病例被治愈','2020-02-11'),('1月29日临近中午，山东首例新型冠状病毒感染的肺炎确诊患者在青岛治愈出院。据山东省卫健委消息，该患者为37岁男性，武汉人，在日照市工作。因发热等症状，于1月17日在日照市就诊，当晚自行至青岛市就诊。1月21日，经国家卫生健康委疫情防控领导小组下设的诊断组专家评估确认，该病例为新型冠状病毒感染的肺炎确诊病例，该患者为山东第一例确诊病例。','2020-02-11','ck6hgxcdf00nhs27c6h5jfhl1','人民日报','山东省','2020-01-29','http://m.weibo.cn/2803301701/4466044364294528','','山东首例确诊患者治愈出院','2020-02-11'),('2020年1月29日0时至10时，辽宁省葫芦岛市新增1例输入性新型冠状病毒感染的肺炎确诊病例，属普通型病例。截至2020年1月29日10时，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例37例，其中重型病例6例。确诊病例中，沈阳市8例、大连市5例、本溪市2例、丹东市5例、锦州市4例、营口市1例、辽阳市1例、铁岭市2例、朝阳市3例、盘锦市2例、葫芦岛市4例。目前37名患者均在定点医疗机构隔离治疗，病情平稳。其中，34例病例发病前有武汉居住史或旅行史，3例病例为武汉输入病例家属。目前累计追踪到密切接触者485人，已解除医学观察21人，现有464人正在接受医学观察，其余正在追踪中。','2020-02-11','ck6hgxcdf00nis27c9exje4u6','央视新闻','辽宁省','2020-01-29','http://m.weibo.cn/2656274875/4466043634656206','','辽宁新增1例，累计37例','2020-02-11'),('四川省首例新型冠状病毒感染的肺炎确诊患者恢复情况良好，符合出院标准，于上午痊愈出院。患者杨某，男性，34岁，武汉某公司职员，1月21日，经国家疾控中心复核确诊为新型冠状病毒感染的肺炎，收入成都市公共卫生临床医疗中心隔离治疗，1月26日、28日经成都市疾控中心两次核酸检测阴性，符合解除隔离治疗标准。\n','2020-02-11','ck6hgxcdg00njs27c898l9eav','央视新闻','四川省','2020-01-29','http://m.weibo.cn/2656274875/4466038202767776','','四川首例病例治愈','2020-02-11'),('28日，一系列好消息从中国科学院武汉病毒研究所传出：该所刚研制出了用于研究的抗体检测试纸；同时，该所与军事医学科学院毒物药物研究所联合发现了在细胞层面上对新型冠状病毒(2019-nCoV)有较好抑制作用的雷米迪维或伦地西韦（ Remdesivir，GS-5734）、氯喹（Chloroquine,Sigma-C6628）、利托那韦（Ritonavir）等三种“老药物”。其后续的临床使用，正在走相关程序报批。\n','2020-02-11','ck6hgxcdg00nls27c3bqmfjv3','人民日报','湖北省','2020-01-29','http://m.weibo.cn/2803301701/4466030287548207','','3 种药物对病毒有较好抑制作用','2020-02-11'),('截至1月29日10时，陕西新增10例新型冠状病毒感染的肺炎确诊病例，新增疑似病例5例。新增确诊病例中，西安市3例、宝鸡市1例、咸阳市1例、延安市1例、汉中市2例、安康市2例。陕西累计报告新型冠状病毒感染的肺炎确诊病例56例，其中西安市18例、宝鸡市4例、咸阳市5例、铜川市5例、渭南市3例、延安市3例、汉中市6例、安康市10例、商洛市2例。全省新增密切接触者389人，累计1288人，均集中医学观察。','2020-02-11','ck6hgxcdg00nms27cg8g4e6ga','人民日报','陕西省','2020-01-29','http://m.weibo.cn/2803301701/4466025733128644','','陕西新增确诊 10 例，累计 56 例','2020-02-11'),('世界卫生组织28日表示，将尽快派遣国际专家团队赴中国进一步了解新型冠状病毒肺炎疫情，并就全球疫情防控予以指导。世卫组织在声明中称，正在中国访问的世卫组织总干事谭德塞与中国政府协商，双方同意世卫组织尽快派遣国际专家团队访华，与中国同行共同努力增进对疫情的了解，并指导全球疫情应对工作。\n','2020-02-11','ck6hgxcdg00nns27c47emdgjd','人民日报','','2020-01-29','http://m.weibo.cn/2803301701/4466022339703743','','世卫组织将派专家团队访华','2020-02-11'),('2020年1月28日0时至1月29日10时，内蒙古自治区报告新型冠状病毒感染的肺炎新增确诊病例3例、新增重症病例1例、新增危重病例1例、新增疑似病例2例。截至1月29日10时, 内蒙古自治区累计报告新型冠状病毒感染的肺炎确诊病例16例，危重病例1例，重症病例1例,疑似病例2例。','2020-02-11','ck6hgxcdg00nos27ca0qk199m','人民日报','内蒙古自治区','2020-01-29','http://m.weibo.cn/2803301701/4466019135863912','','内蒙古新增确诊 3 例，累计 16 例','2020-02-11'),('1月29日上午9时，宁夏应对新型冠状病毒感染肺炎疫情工作指挥部办公室发布，截至1月28日23时，经自治区新型冠状病毒感染的肺炎疗专家组研判确认，全区新增确诊病例1例，新增疑似病例2例。至此，全区累计报告确诊病例12例（银川市7例、吴忠市3例、固原市1例、中卫市1例）；疑似病例2例（吴忠市1例、中卫市1例）。','2020-02-11','ck6hgxcdg00nps27cdqljcyrg','人民日报','宁夏回族自治区','2020-01-29','http://m.weibo.cn/2803301701/4466017315347962','','宁夏新增确诊 1 例，累计 12 例','2020-02-11'),('2020年1月28日0时至1月29日10时，内蒙古自治区报告新型冠状病毒感染的肺炎新增确诊病例3例、新增重症病例1例、新增危重病例1例、新增疑似病例2例。其中：新增3例确诊病例中，呼和浩特市2例、巴彦淖尔市1例，均为两市首次确诊病例；新增呼伦贝尔市危重病例1例、锡林郭勒盟重症病例1例；新增疑似病例2例中，鄂尔多斯市1例、巴彦淖尔市1例；排除呼伦贝尔市疑似病例1例、锡林郭勒盟疑似病例1例。  其中，新增确诊病例3例中，呼和浩特市2例、巴彦淖尔市1例。\n','2020-02-11','ck6hgxcdh00nqs27c2ruvgpsn','央视新闻','内蒙古自治区','2020-01-29','http://m.weibo.cn/2656274875/4466018393340072','','内蒙古新增确诊 3 例，累计 16 例','2020-02-11'),('截至1月29日6时，天津市新增1例新型冠状病毒感染的肺炎确诊病例，确诊病例增至25例。患者张某，男，41岁，居住于湖北省武汉市江汉区。1月19日由武汉出发去马来西亚旅游，25日乘飞机到天津。27日出现发热、咳嗽，体温38.3°C，就诊于武清区人民医院，后经专家组确诊为我市第25例病例，为普通型病例。目前已转至海河医院治疗，生命体征平稳。该病例为马印航空公司隔离医学观察者，与第14例确诊病例系密切接触者。\n','2020-02-11','ck6hgxcdh00nts27ce3qchf67','央视新闻','天津市','2020-01-29','http://m.weibo.cn/2656274875/4466014382776533','','天津新增确诊 1 例，累计确诊 25 例','2020-02-11'),('据英国路透社援引知情人士的话称，当地时间1月28日，白宫当天在讨论应对新型冠状病毒爆发的方法时，选择暂不暂停中国飞往美国的航班。\n','2020-02-11','ck6hgxcdh00nvs27c68fda5oj','人民日报','','2020-01-29','http://m.weibo.cn/2803301701/4466008889183979','','白宫：暂不停飞中美航班','2020-02-11'),('国家卫健委主任马晓伟：根据近期的临床资料来看，病毒的传播力似乎有所增强，病毒的毒性和致病力需要更多的临床资料加以分析。专家预判现在疫情进入一个比较严重复杂的时期。 点击查看\n','2020-02-11','ck6hgxcdh00nws27c3zktd0vg','央视新闻','全国','2020-01-29','http://m.weibo.cn/2656274875/4466005138768564','','现在疫情处于什么阶段：6 个疫情必知点','2020-02-11'),('2020年1月28日0—24时，我省无新型冠状病毒感染的肺炎新增病例。截至28日24时，全省累计报告确诊病例9例（重症1例）：贵阳市1例，六盘水市1例，铜仁市2例，黔南州4例，黔西南州1例。其中，首例确诊病例（贵阳市）已治愈。26日报告原贵阳市修文县疑似病例经省级新型冠状病毒核酸检测两次复核结果为阴性，已排除。现有疑似病例3例（遵义市红花岗区新增1例、毕节市大方县新增1例，黔东南州凯里市新增1例）。目前，追踪到密切接触者281人，其中1人已确认为确诊病例，已解除医学观察19人，尚在接受医学观察261人。\n','2020-02-11','ck6hgxcdi00nxs27cevlu2lio','人民日报','贵州省','2020-01-29','http://m.weibo.cn/2803301701/4465989829697193','','贵州无新增病例，累计确诊9例','2020-02-11'),('2020年1月28日0-24时，青海省报告新型冠状病毒感染的肺炎新增确诊病例0例，新增重症病例0例，新增死亡病例0例，新增出院病例0例。 截至1月28日24时，青海省累计报告新型冠状病毒感染的肺炎确诊病例6例，重症病例0例，死亡病例0例，出院病例0例。其中，确诊病例中，西宁市6例，其他市州无报告病例。 目前，追踪到密切接触者76人，其中2人已解除医学观察。\n','2020-02-11','ck6hgxcdi00nzs27c4lu38uvc','人民日报','青海省','2020-01-29','http://m.weibo.cn/2803301701/4466007995650839','','青海无新增病例，累计6例','2020-02-11'),('1月28日15时—1月28日24时，我省报告新增新型冠状病毒感染的肺炎确诊病例2例，均为输入性病例。其中，厦门市1例（湖里区1例）；宁德市1例（古田县1例）。目前，确诊、疑似病例的密切接触者已解除医学观察53人，尚有1528人正在接受医学观察。\n','2020-02-11','ck6hgxcdi00o1s27ce1ch4lry','央视新闻','福建省','2020-01-29','http://m.weibo.cn/2656274875/4466003822287764','','福建新增2例，累计82例','2020-02-11'),('2020年1月28日00：00-24：00，海南省新型冠状病毒感染的肺炎新增确诊病例5例，新增重症病例4例，无新增死亡病例和出院病例。确诊病例中，海口市2例、万宁市1例、东方市1例、琼中县1例。截至1月28日24:00，追踪到密切接触者913人，已解除医学观察86人，尚有827人正在接受居家或集中医学观察。\n','2020-02-11','ck6hgxcdi00o2s27c3dkjgwd3','人民日报','海南省','2020-01-29','http://m.weibo.cn/2803301701/4466000206767810','','海南新增5例，累计43例','2020-02-11'),('2020年1月28日0—24时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例15例，新增重型病例3例，重型病例转普通型病例1例，新增危重型病例1例。渝中区为报