-02-11'),('2020年1月28日0-24时，湖南省报告新型冠状病毒感染的肺炎新增确诊病例78例，新增重症病例8例，新增死亡病例0例，新增出院病例0例。目前追踪到密切接触者3307人，已解除医学观察95人，尚有3212人正在接受医学观察。\n','2020-02-11','ck6hgxcdk00oas27c0n6u4v75','人民日报','湖南省','2020-01-29','http://m.weibo.cn/2803301701/4465993361673227','','湖南新增78例，累计221例','2020-02-11'),('截至1月28日24时，我省累计报告新型冠状病毒感染的肺炎确诊病例108例，涉及19个市（州）。其中成都市46例、绵阳市8例、自贡市7例、广安市7例、泸州市5例、南充市5例、内江市4例、达州市4例、遂宁市3例、甘孜州3例、德阳市2例、乐山市2例、宜宾市2例、巴中市2例、雅安市2例、资阳市2例、凉山州2例、广元市1例、眉山市1例。108名患者中，危重3人。正在接受医学观察1617人，已解除医学观察129人。\n','2020-02-11','ck6hgxcdk00obs27c3d9fgw4j','人民日报','四川省','2020-01-29','http://m.weibo.cn/2803301701/4465992430743106','','四川新增18例，累计108例','2020-02-11'),('2020年1月28日0-24时，浙江省报告新型冠状病毒感染的肺炎新增确诊病例123例，新增重症病例11例，新增出院病例2例。其中：新增确诊病例中，杭州市19例、宁波市3例、温州市54例、湖州市2例、嘉兴市3例、绍兴市12例、金华市6例、衢州市3例、舟山市2例、台州市18例、丽水市1例；新增重症病例中，杭州市6例、温州市1例、金华市1例、台州市1例、丽水市2例；新增出院病例中，温州市2例。目前，全省共追踪到密切接触者5885人，已解除医学观察316人，尚有5501人正在接受医学观察。\n','2020-02-11','ck6hgxcdk00ocs27c9ecfaq6x','央视新闻','浙江省','2020-01-29','http://m.weibo.cn/2656274875/4465991281070969','','浙江新增确诊123例，累计296例','2020-02-11'),('2020年1月28日0-24时，江苏省报告新型冠状病毒感染的肺炎新增确诊病例29例。其中8个设区市新增确诊病例中，南京市4例、无锡市3例、苏州市8例、淮安市1例、盐城市5例、扬州市3例、泰州市4例、宿迁市1例。\n','2020-02-11','ck6hgxcdk00ods27c47zp3z76','央视新闻','江苏省','2020-01-29','http://m.weibo.cn/2656274875/4465990248700975','','江苏新增29例确诊病例','2020-02-11'),('2020年1月28日0-24时，天津市报告新型冠状病毒感染的肺炎新增确诊病例1例，新增重症病例0例，新增死亡病例0例，新增出院病例0例。目前追踪到密切接触者191人，已解除医学观察2人，尚有183人正在接受医学观察。\n','2020-02-11','ck6hgxcdk00oes27c7nvfeapg','人民日报','天津市','2020-01-29','http://m.weibo.cn/2803301701/4465990227945179','','天津新增1例，累计24例','2020-02-11'),('2020年1月28日0-24时,安徽省新增报告新型冠状病毒感染的肺炎确诊病例46例。其中：合肥13例、亳州7例、宿州6例、阜阳2例、六安2例、马鞍山1例、芜湖2例、安庆6例、黄山3例、宿松4例。 累计医学观察密切接触者2884人，尚在接受医学观察410人。在医护团队精心诊治和护理下，安徽省两位新型冠状病毒感染的肺炎患者，于29日痊愈出院。这两位患者，前期分别在合肥和亳州定点医院住院治疗，目前体温恢复正常3天以上、呼吸道症状明显好转，连续两次(间隔1天以上)新型冠状病原核酸检测阴性。经省专家组评估，符合国家卫生健康委新型冠状病毒感染的肺炎诊疗方案（第四版）解除隔离及出院标准。\n','2020-02-11','ck6hgxcdl00ofs27chspj2bxq','央视新闻','安徽省','2020-01-29','http://m.weibo.cn/2656274875/4465987434611567','','安徽新增46例，累计152例','2020-02-11'),('2020年1月28日0-24时，自治区报告新型冠状病毒感染的肺炎新增确诊病例3例，新增重症病例2例，新增死亡病例0例，新增出院病例0例。其中：新增确诊病例中，乌鲁木齐市1例，伊犁州2例；新增重症病例中，乌鲁木齐市2例。目前累计追踪到密切接触者307人，已解除医学观察9人，现有298人正在接受医学观察。\n','2020-02-11','ck6hgxcdl00ogs27ca9efcrub','人民日报','新疆维吾尔自治区','2020-01-29','http://m.weibo.cn/2803301701/4465986076372871','','新疆新增确诊3例，新疆累计确诊13例','2020-02-11'),('1月28日0-24时，广西共新增新型冠状病毒感染的肺炎确诊病例7例，其中南宁2例、北海2例、防城港2例、桂林1例。目前全区累计报告确诊病例58例，累计出院病例2例。现有重症病例5例。无危重病例和死亡病例，无医务人员感染病例。\n','2020-02-11','ck6hgxcdl00ohs27cfx7kfk9d','央视新闻','广西壮族自治区','2020-01-29','http://m.weibo.cn/2656274875/4465982611743991','','广西新增7例累计58例','2020-02-11'),('1月28日0-24时，31个省（区、市）报告新增确诊病例1459例，新增重症病例263例，新增死亡病例26例（湖北省25例、河南省1例），新增治愈出院病例43例，新增疑似病例3248例（包括西藏1例）。','2020-02-11','ck6hgxcdl00ois27cerzkfo6w','央视新闻','西藏自治区','2020-01-29','http://m.weibo.cn/2656274875/4465983194136549','','西藏首次报告疑似病例1例','2020-02-11'),('2020年1月28日0-24时，12市（县）报告新型冠状病毒感染的肺炎新增确诊病例38例，新增重症病例4例、死亡1例、治愈1例。目前追踪到密切接触者3158人，已解除医学观察312人，诊断为疑似78人，尚有2768人正在接受医学观察。\n','2020-02-11','ck6hgxcdl00ojs27c83iwb14k','人民日报','河南省','2020-01-29','http://m.weibo.cn/2803301701/4465985417721321','','河南累计确诊206例，河南新增确诊38例','2020-02-11'),('2020年1月28日12—24时，山东省报告新型冠状病毒感染的肺炎新增确诊病例26例，目前累计追踪到密切接触者3171人，其中已解除医学观察46人，密切接触者中诊断为疑似或确诊30例，尚有3095人正在接受医学观察。\n','2020-02-11','ck6hgxcdl00oks27c04dwcysd','人民日报','山东省','2020-01-29','http://m.weibo.cn/2803301701/4465985686109158','','山东新增确诊26例，累计确诊121例','2020-02-11'),('2020年1月28日0—24时，上海市新增新型冠状病毒感染的肺炎确诊病例14例。其中，外地来沪人员7例，本市常住人口7例。截至1月28日24时，上海市累计发现确诊病例80例，其中，男性43例，女性37例；年龄最大88岁，最小7岁；61例有湖北居住或旅行史，1例有广东旅行史并曾食用野生动物，18例有相关确诊病例接触史；外地来沪人员40例，本市常住人员40例。目前，73例病情平稳，2例病情危重，4例治愈出院，1例死亡。已累计排除99例疑似病例，尚有167例疑似病例正在排查中。\n','2020-02-11','ck6hgxcdl00ols27c81wt5qdn','人民日报','上海市','2020-01-29','http://m.weibo.cn/2803301701/4465980157360961','','上海新增确诊14例累计80例','2020-02-11'),('2020年1月28日18时30分至24时，辽宁省新增2例输入性新型冠状病毒感染的肺炎确诊病例。其中朝阳市1例，葫芦岛市1例，均属普通型病例。截至2020年1月28日24时，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例36例，其中重型病例6例。确诊病例中，沈阳市8例、大连市5例、本溪市2例、丹东市5例、锦州市4例、营口市1例、辽阳市1例、铁岭市2例、朝阳市3例、盘锦市2例、葫芦岛市3例。目前36名患者均在定点医疗机构隔离治疗，病情平稳。其中，33例病例发病前有武汉居住史或旅行史，3例病例为武汉输入病例家属。目前累计追踪到密切接触者485人，已解除医学观察21人，现有464人正在接受医学观察，其余正在追踪中。\n','2020-02-11','ck6hgxcdl00oms27c3j6mgw25','人民日报','辽宁省','2020-01-29','http://m.weibo.cn/2803301701/4465981461845097','','辽宁新增2例累计36例','2020-02-11'),('据大连市新型冠状病毒感染的肺炎联防联控指挥部办公室消息，1月28日，网络及媒体报出日本奈良一载过来自中国大连游客的旅游大巴司机确诊为新型冠状病毒感染的肺炎消息后，大连市立即启动核查确认程序，最后查实该司机期间确曾载过大连某旅行社组织的赴日旅行团。目前，大连市新型冠状病毒感染的肺炎联防联控指挥部办公室已和全团27名团员全部取得联系，并采取相关医学措施。\n','2020-02-11','ck6hgxcdm00ons27c1hyf7kx9','人民日报','','2020-01-28','http://m.weibo.cn/2803301701/4465975825370805','','日本确诊大巴司机曾载大连旅行团，曾乘9C8722航班入境','2020-02-11'),('当地时间1月28日，根据美国媒体报道，两位美国政府官员向美媒透露，白宫考虑取消中美之间所有航班。白宫已经在28日告知美国多家航空公司高管，由于担心新型冠状病毒疫情，考虑取消中美间所有航班。\n','2020-02-11','ck6hgxcdm00oos27cggkcb9c8','央视新闻','','2020-01-28','http://m.weibo.cn/2656274875/4465975317998106','','白宫考虑取消中美间所有航班','2020-02-11'),('随着一些地区不断升级防控举措，限制外来车辆进入，大量外地车辆和人口扎堆聚集在高速公路服务区。由于服务区缺乏完备的防疫条件，容易成为疫情防控的盲区。当前疫情防控强调“居家隔离”，那些进不了异乡、归途遥远的游客，交叉感染的风险较大。','2020-02-11','ck6hgxcdm00ops27c3tn6a216','人民日报','全国','2020-01-28','http://m.weibo.cn/2803301701/4465973043860334','','返程高峰将至，警惕高速服务区成防疫盲区','2020-02-11'),('当地时间28日晚，法国卫生总局局长萨洛蒙在例行发布会上表示，法国新增1例确诊的新型冠状病毒感染病例，病患为一名将近80岁的男性中国游客，目前病情严重，正在巴黎的重症监护室接受治疗。这是法国确认的第4例新型冠状病毒感染病例。\n','2020-02-11','ck6hgxcdm00oqs27ccd5nd3fc','央视新闻','','2020-01-28','http://m.weibo.cn/2656274875/4465966869684494','','法国新增1例确诊病例','2020-02-11'),('德国巴伐利亚州卫生部当地时间28日晚宣布，该州当日新确诊3例新型冠状病毒肺炎患者，3人均属于第一例确诊感染者的密切接触人群。3名新确诊患者都是伟博思通的员工，目前已经被同一家医院收治隔离。该公司另有多名员工尚在检查中。 巴伐利亚州卫生部发言人表示，目前尚不清楚3名新确诊患者究竟是被第一例确诊患者感染，还是与第一例感染者一样，是被携带病毒的中国同事所感染。','2020-02-11','ck6hgxcdm00ors27cejehcno1','人民日报','','2020-01-28','http://m.weibo.cn/2803301701/4465962981889783','','德国新增3例确诊','2020-02-11'),('美国疾病控制和预防中心28日宣布，为应对新型冠状病毒，将把进行入境排查的美国机场数目从目前的5个扩大至20个。美国卫生与公众服务部长亚历克斯·阿扎在记者会上表示，与17年前非典疫情爆发时的情况相比，中国目前应对疫情的做法有了显著改善。阿扎赞赏中国此前将新型冠状病毒基因测序信息公开，强调这有助于病毒诊断方式研发。\n','2020-02-11','ck6hgxcdm00oss27c34cx240a','人民日报','','2020-01-28','http://m.weibo.cn/2803301701/4465957462748702','','美国将入境筛查机场增至20个','2020-02-11'),('昨天，钟南山在广东广州，通过视频为支援湖北的医疗队加油：“你们是去最艰苦的地方，最前线的地方，最困难的地方，最容易受感染地方进行战斗，我向你们致敬。要克服各种困难，要尽我们的责任，更要保护好自己，才能够救治别人！” ','2020-02-11','ck6hgxcdm00ots27cgce12t6e','央视新闻','全国','2020-01-28','https://weibo.com/2656274875/IrDmSdIFr?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment','','钟南山为一线医护人员加油','2020-02-11'),('近期，医用防护口罩、医用外科口罩、医用防护服等医院防护物品用量大，物资紧缺。目前，中国医科大学附属第一医院、苏州大学附属第一医院、江苏省人民医院（南京医科大学第一附属医院）等多家医院，先后发布接受社会捐赠的公告。','2020-02-11','ck6hgxcdm00ous27c0n8o62ll','央视新闻','全国','2020-01-28','https://weibo.com/2656274875/IrD8jeHzI?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1580250509109','','多家医院公布接受物资捐赠方式','2020-02-11'),('2020年1月28日0时-24时，湖北省新增新型冠状病毒感染的肺炎病例840例。截至2020年1月28日24时，湖北省累计报告新型冠状病毒感染的肺炎病例3554例（其中武汉市1905例、黄石市86例、十堰市88例、襄阳市131例、宜昌市63例、荆州市101例、荆门市142例、鄂州市84例、孝感市274例、黄冈市324例、咸宁市112例、随州市116例、恩施州51例、仙桃市32例、天门市34例、潜江8例，神农架林区3例），已治愈出院80例，死亡125例（其中武汉市104例，黄石市1例、宜昌市1例、荆州市2例、荆门市4例、鄂州市1例，孝感3例、黄冈市5例、天门3例，潜江1例）。\n','2020-02-11','ck6hgxcdm00ovs27c656h4x6b','央视新闻','湖北省','2020-01-28','http://m.weibo.cn/2656274875/4465955487309708','','湖北新增确诊840例，累计3554例','2020-02-11'),('2020年1月28日0时至24时，山西省报告新型冠状病毒感染的肺炎新增确诊病例7例。其中：晋中市4例（平遥县4例），大同市2例（平城区1例、云冈区1例），运城市1例（万荣县1例）。截至1月28日24时，山西省9个市累计报告新型冠状病毒感染的肺炎确诊病例27例。其中：晋中市9例（平遥县9例），运城市4例（芮城县2例、河津市1例、万荣县1例），太原市3例（小店区1例、迎泽区1例、万柏林区1例），大同市3例（平城区2例、云冈区1例），吕梁市3例（离石区1例、文水县1例、孝义市1例），朔州市2例（应县2例），长治市1例（长子县1例），阳泉市1例（城区1例），临汾市1例（乡宁县1例）。累计报告重症病例2例，其中：晋中市1例（平遥县1例），已安全转至省级定点医院（太原市第四人民医院）强化治疗；吕梁市1例（离石区1例），经省、市专家组和医护团队全力监护救治，病情趋于平稳。目前追踪到密切接触者603人，当日解除医学观察47人，1人诊断为确诊病例。\n','2020-02-11','ck6hgxcdn00ows27c6uyjbk6n','央视新闻','山西省','2020-01-28','http://m.weibo.cn/2656274875/4465949619008559','','山西新增7例累计确诊27例','2020-02-11'),('江西省报告新型冠状病毒感染的肺炎新增确诊病例37例，新增出院病例1例。新增确诊病例中，南昌市8例、新余市8例、九江市7例、赣州市6例、宜春市4例、上饶市2例、吉安市1例、抚州市1例。新增出院病例为新余市1例。截至1月28日24时，江西省累计报告新型冠状病毒感染的肺炎确诊病例109例（含重症病例11例），出院病例3例。确诊病例中，南昌市25例、九江市16例、赣州市16例、宜春市14例、新余市11例、上饶市9例、抚州市9例、吉安市4例、景德镇市2例、萍乡市2例、鹰潭市1例。出院病例中，萍乡市1例、新余市1例、吉安市1例。目前追踪到密切接触者3850人，解除医学观察123人，尚有3727人正在接受医学观察。\n','2020-02-11','ck6hgxcdn00oxs27cd9ts8o38','央视新闻','江西省','2020-01-28','http://m.weibo.cn/2656274875/4465888419716300','','江西新增37例累计确诊109例','2020-02-11'),('天津市卫生健康委员会二级巡视员王增田同志在新型冠状病毒感染的肺炎疫情防控工作中严重失职失责，造成严重不良影响。依据《中国共产党纪律处分条例》《中华人民共和国监察法》等有关规定，经中共天津市纪委常委会会议研究并报中共天津市委批准，决定给予王增田同志留党察看二年处分；由天津市监委给予其政务撤职处分。','2020-02-11','ck6hgxcdn00oys27c696607vd','人民日报','天津市','2020-01-28','http://m.weibo.cn/2803301701/4465869302425364','','天津卫健委一官员防控失职被问责','2020-02-11'),('北京市市场监督管理部门严肃查处借疫情防控之机囤积居奇、捏造散布涨价信息、哄抬物价等扰乱市场价格秩序的违法行为。1月23日以来，已累计对31件价格违法案件立案调查，其中1月28日立案15件。1月23日，丰台区市场监管局对北京济民康泰大药房有限责任公司丰台区第五十五分店大幅度抬高N95口罩价格行为立案调查。依据《价格法》等法律法规，丰台区市场监管局已向该药店送达《行政处罚听证告知书》，拟作出罚款300万元的行政处罚。\n','2020-02-11','ck6hgxcdn00ozs27ccuhh1w3y','人民日报','北京市','2020-01-28','http://m.weibo.cn/2803301701/4465862167444643','','北京重罚口罩涨价，拟开300万元罚单','2020-02-11'),('“疫情1周或10天左右达到高峰”，钟南山院士的这个判断，安定人心也温暖人心。他的坚毅给人信心，因连续作战而发红的双眼更让人心疼。\n','2020-02-11','ck6hgxcdn00p0s27cdiuq85a8','人民日报','全国','2020-01-28','http://m.weibo.cn/2803301701/4465858610785750','','疫情1周或10天左右达到高峰','2020-02-11'),('截至今晚，全国各地约6000人医疗队支援湖北！万众一心、同舟共济，一定会战胜这一次疫情！也请你们一定一定要平安！\n','2020-02-11','ck6hgxcdn00p1s27cb10daagf','人民日报','全国','2020-01-28','http://m.weibo.cn/2803301701/4465852080202615','','全国各地约6000人医疗队驰援湖北','2020-02-11'),('暂停各类群体性聚集活动。具有交叉感染风险的经营单位，如歌舞娱乐、游戏游艺、互联网上网服务场所、营业性麻将场所和大型儿童游乐设施、健身房、室内游泳场（馆）等暂停营业。暂时禁止群体性聚餐（含农村自办群体性宴席）。广大公众应正确佩戴口罩，自觉将废弃口罩进行毁损并按有害垃圾处置。','2020-02-11','ck6hgxcdn00p2s27cffna0o4y','四川省人民政府官网','四川省','2020-01-28','http://www.sc.gov.cn/zcwj/xxgk/NewT.aspx?i=20200128192811-452803-00-000','','四川要求麻将馆全部暂停营业','2020-02-11'),('据国家移民管理局：根据当前新型冠状病毒感染肺炎疫情防控工作需要，自即日起，全国公安机关出入境管理部门暂停受理、审批、签发内地居民赴香港、澳门团队旅游、个人旅游（含深圳“一周一行”）签注，恢复时间将另行发布。对暂停办理期间内地居民持有有效赴港澳地区旅游签注、但未能出行的人员，公安机关出入境管理部门将在赴港澳旅游政策恢复后，根据其本人意愿免费重新办理相同种类和有效期的旅游签注。\n','2020-02-11','ck6hgxcdn00p3s27ce5bm568k','央视新闻','全国','2020-01-28','http://m.weibo.cn/2656274875/4465844644204489','','港澳旅游签注暂停办理','2020-02-11'),('国家公务员局发布《关于推迟中央机关及其直属机构2020年度公务员考试录用、公开遴选和公开选调面试时间的公告》：为贯彻落实党中央、国务院关于新型冠状病毒感染的肺炎预防控制工作的有关要求，经研究，中央机关及其直属机构2020年度公务员考试录用、公开遴选和公开选调面试时间推迟，具体安排另行通知。\n','2020-02-11','ck6hgxcdo00p4s27c7i0f70yt','人民日报','全国','2020-01-28','http://m.weibo.cn/2803301701/4465838767229144','','国考面试推迟，具体时间安排另行通知','2020-02-11'),('1月28日，钟南山院士就新型冠状病毒感染的肺炎疫情接受采访，表示有信心防止疫情大爆发。','2020-02-11','ck6hgxcdo00p5s27c6jbj4pha','人民日报','全国','2020-01-28','http://m.weibo.cn/2803301701/4465828650860137','','钟南山最新采访：有信心防止疫情大爆发','2020-02-11'),('湖北省委副书记、武汉市委书记马国强：确诊病例大幅增加是因为国家将检测权力下放，检测速度提升。从24日起，有检测资质的9家医院加上武汉市疾控中心，都给予了检测资质，可以检测。检测能力的提升，导致了昨天武汉市新增892例病例，不是说突然一天增加这么多，并非疫情蔓延速度大幅度提升。 央视新闻的微博视频\n','2020-02-11','ck6hgxcdo00p6s27cbxzoe2ih','央视新闻','湖北省','2020-01-28','http://m.weibo.cn/2656274875/4465821420016809','','确诊病例大幅增加是否意味疫情加剧？官方回应','2020-02-11'),('“新型冠状病毒感染的肺炎”疫情发展情况是怎样的？怎么判断眼下的种种变化？今天《新闻1+1》邀请国家卫健委高级别专家组成员、中国工程院院士李兰娟进行权威解读。直播，有啥问题，#岩松帮你问#！\n','2020-02-11','ck6hgxcdo00p8s27c9ksa9k5z','央视新闻','全国','2020-01-28','http://m.weibo.cn/2656274875/4465823122581280','','《新闻1+1》邀请国家卫健委高级别专家组成员、中国工程院院士李兰娟进行权威解读','2020-02-11'),('中国医学科学院病原生物学研究所所长：蝙蝠很可能是病毒源头，水貂可能为病毒中间宿主。对于此次武汉新型冠状病毒的溯源研究，已有大量前期研究认为，蝙蝠是新型冠状病毒（2019-nCov）的起源，但目前尚不清楚中间传播媒介。除此之外，也有研究表明，通过比较脊椎动物宿主的所有病毒的感染模式，发现水貂病毒显示出与2019-nCov更为接近的感染模式。至于水貂是否为新型冠状病毒的中间宿主，有待于进一步确证。（邱超奕）\n','2020-02-11','ck6hgxcdt00p9s27chelhbmmd','人民日报','全国','2020-01-28','http://m.weibo.cn/2803301701/4465818723367266','','蝙蝠很可能是病毒源头，水貂可能为病毒中间宿主','2020-02-11'),('今晚，湖北省召开新型冠状病毒感染肺炎疫情防控工作新闻发布会，通报全省疫情和防控工作最新进展情况。看直播，关注！（总台央视记者佘利霞 王伟超） 央视新闻的微博直播 . \n','2020-02-11','ck6hgxcdu00pas27cdean0r7b','央视新闻','湖北省','2020-01-28','http://m.weibo.cn/2656274875/4465813866402022','','直播！湖北通报疫情和防控工作最新情况','2020-02-11'),('记者从国家移民局获悉，根据当前新型冠状病毒感染肺炎疫情防控工作需要，即日起，全国公安机关出入境管理部门暂停受理、审批、签发内地居民赴香港、澳门团队旅游、个人旅游（含深圳“一周一行”）签注，恢复时间将另行发布。对暂停办理期间内地居民持有有效赴港澳地区旅游签注、但未能出行的人员，公安机关出入境管理部门将在赴港澳旅游政策恢复后，根据其本人意愿免费重新办理相同种类和有效期的旅游签注。        国家移民管理局有关负责人表示，鉴于目前港澳地区实施的内地居民入境管理措施，持有有效往来港澳旅游签注的内地居民建议不再安排出行，其他人员如无特殊紧急需要，也合理安排出境时间。（张璁）\n','2020-02-11','ck6hgxcdu00pbs27c37un7hhn','人民日报','全国','2020-01-28','http://m.weibo.cn/2803301701/4465812692135001','','暂停办理港澳旅游签注','2020-02-11'),('我市2名在解放军总医院第五医学中心救治的新型冠状病毒感染的肺炎患者，经专家组会诊，达到出院标准，于1月28日痊愈出院。\n据悉，一名患者，女，湖北省武汉人，1月13日来京，21日初次就诊，经疾控中心检测、专家组会诊确诊为新型冠状病毒感染的肺炎，随后转入解放军总医院第五医学中心救治；另一患者，女，1月17日从武汉到京，1月20日初次就诊，经疾控中心检测、专家组会诊确诊为新型冠状病毒感染的肺炎，随后转入解放军总医院第五医学中心救治。上述2名患者经综合诊治，今日出院。我市已累计出院4人。\n','2020-02-11','ck6hgxcdu00pcs27c7d6r258s','北京市卫生健康委‍','北京市','2020-01-28','http://wjw.beijing.gov.cn/xwzx_20031/xwfb/202001/t20200128_1621494.html','','北京今日有2名新型冠状病毒感染的肺炎患者出院','2020-02-11'),('我市2名在解放军总医院第五医学中心救治的新型冠状病毒感染的肺炎患者，经专家组会诊，达到出院标准，于1月28日痊愈出院。\n据悉，一名患者，女，湖北省武汉人，1月13日来京，21日初次就诊，经疾控中心检测、专家组会诊确诊为新型冠状病毒感染的肺炎，随后转入解放军总医院第五医学中心救治；另一患者，女，1月17日从武汉到京，1月20日初次就诊，经疾控中心检测、专家组会诊确诊为新型冠状病毒感染的肺炎，随后转入解放军总医院第五医学中心救治。上述2名患者经综合诊治，今日出院。我市已累计出院4人。\n','2020-02-11','ck6hgxcdu00pds27cggi4db3k','北京市卫生健康委‍','北京市','2020-01-28','http://m.weibo.cn/2656274875/4465811579793594','','北京今日有2名新型冠状病毒感染的肺炎患者出院','2020-02-11'),('今晚，台湾“疫情流行指挥中心”公布台湾地区第8例新型冠状病毒感染的肺炎确诊病例，这也是当地首起家庭聚集性病例。患者为一名50多岁的男性，是先前第5例患者的同住家人，26日出现咳嗽症状就医，28日确诊。目前患者病情稳定，医院及地方卫生单位已依循相关处置流程进行接触者追踪等防治工作。\n','2020-02-11','ck6hgxcdu00pes27c2cbc91nl','央视新闻','台湾','2020-01-28','http://m.weibo.cn/2656274875/4465810456336993','','台湾累计8例确诊病例','2020-02-11'),('今天，火神山医院效果图发布。医院总建筑面积3.39万平方米，功能主要为病房、接诊室、ICU、医技部、网络机房、供应库房、垃圾暂存间、救护车消洗间等。提前1分钟交工，就能提前1分钟遏制疫情蔓延，武汉加油！ \n','2020-02-11','ck6hgxcdu00phs27cau37hp2a','央视新闻','湖北省','2020-01-28','http://m.weibo.cn/2656274875/4465800896930835','','火神山医院效果图发布','2020-02-11'),('今天8时—1月28日15时，福建报告新增新型冠状病毒感染的肺炎确诊病例7例，均为输入性病例。其中：福州市6例（连江县2例、长乐区2例、福清市1例、湖北省武汉市1例）；漳州市1例（东山县1例）。报告新增新型冠状病毒感染的肺炎疑似病例14例。其中：福州市5例（晋安区2例、仓山区1例、闽侯县1例、闽清县1例）；厦门市1例（集美区1例）；泉州市2例（丰泽区1例、安溪县1例）；三明市2例（永安市2例）；莆田市3例（城厢区1例、秀屿区1例、仙游县1例）；龙岩市1例（上杭县1例）。','2020-02-11','ck6hgxcdv00pis27ch4gyb4kx','央视新闻','福建省','2020-01-28','http://m.weibo.cn/2656274875/4465797953450850','','福建新增7例累计确诊80例','2020-02-11'),('日本奈良县政府28日晚举行记者会见称，家住该县的一名60多岁日本籍男子感染新型冠状病毒肺炎。这是日本首例没去过武汉感染者，也是首名被感染的日本人。该男子是一名大巴司机，没有去过武汉，本月8日-11日、12日-16日曾两次为从武汉来的游客驾驶大巴。该男子本月14日咳嗽，17日前往奈良县内医疗机构就诊，没有发现异常，22日出现关节痛、咳嗽加重，25日住进奈良县内医疗机构,28日确诊为新型冠状病毒肺炎。（刘军国）\n','2020-02-11','ck6hgxcdv00pks27c9sxc6r93','人民日报','','2020-01-28','http://m.weibo.cn/2803301701/4465796103013343','','首例日本人感染新型冠状病毒肺炎','2020-02-11'),('1月28日10时30分至18时30分，辽宁省锦州市新增4例输入性新型冠状病毒感染的肺炎确诊病例，均属普通型病例，属锦州市首发病例。截至2020年1月28日18时30分，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例34例。国家卫生健康委《新型冠状病毒感染的肺炎诊疗方案（试行第四版）》调整了诊断标准，将病例临床分型划分为普通型、重型和危重型。经专家组评估，目前，有28例普通型病例，6例重型病例。其中确诊病例中，沈阳市8例、大连市5例、本溪市2例、丹东市5例、锦州市4例、营口市1例、辽阳市1例、铁岭市2例、朝阳市2例、盘锦市2例、葫芦岛市2例。目前34名患者均在定点医疗机构隔离治疗，病情稳定。其中，31例病例发病前有武汉居住史或旅行史，3例病例为武汉输入病例家属。目前累计追踪到密切接触者485人，已解除医学观察21人，现有464人正在接受医学观察，其余正在追踪中。（总台央视记者  李承泽）\n','2020-02-11','ck6hgxcdv00pls27c5ob2epug','央视新闻','辽宁省','2020-01-28','http://m.weibo.cn/2656274875/4465792818674046','','辽宁新增4例累计确诊34例','2020-02-11'),('今天下午，温州市第六人民医院有两名新型冠状病毒患者康复出院。其中一名患者为男性，41岁，长期在武汉经商，于22日住院；另一名是女性，31岁，跟武汉来的患者有过接触。两名治愈患者从入院到出院仅用不到一周时间。据悉，浙江已有3名确诊患者康复，都是温州人。（总台央视记者高珧 李唐）\n','2020-02-11','ck6hgxcdv00pms27ce8c443st','央视新闻','浙江省','2020-01-28','http://m.weibo.cn/2656274875/4465792269374155','','浙江2名确诊患者治愈出院','2020-02-11'),('10到14天是一个很好的隔离观察期，潜伏期过去了，发病的及时治疗，没发病也就没病，所以不会因春运返程出现大传染，但排查的措施不能停。 \n','2020-02-11','ck6hgxcdv00pos27c8yibet56','人民日报','广东省','2020-01-28','http://m.weibo.cn/2803301701/4465789006054549','','钟南山：疫情1周或10天左右达到高峰，不会大规模增加了','2020-02-11'),('今天，广东省政府新闻办举行第二次新闻发布会，由广东省卫健委、省工信厅、省商务厅、省市场监管局等单位，通报广东省新型冠状病毒感染的肺炎疫情防控工作情况。看直播↓关注！（总台央视记者陈旭婷）\n','2020-02-11','ck6hgxcdw00pqs27c0d74c4c8','央视新闻','广东省','2020-01-28','http://m.weibo.cn/2656274875/4465770618586304','','直播！广东省疫情防控工作发布会','2020-02-11'),('截至28日12时，广东新增19例新型冠状病毒感染的肺炎确诊病例，累计确诊207例。\n','2020-02-11','ck6hgxcdw00prs27cad3w5e6g','央视新闻','广东省','2020-01-28','http://m.weibo.cn/2656274875/4465772166625562','','广东新增19例累计确诊207例','2020-02-11'),('据广西壮族自治区卫健委：今天，广西2例新型冠状病毒感染的肺炎确诊病例患者治愈出院。这也是广西首批出院的新型冠状病毒感染的肺炎患者。这两名患者分别是梧州病例和防城港病例。梧州患者，李某某，男，46岁，在梧州市工作，与武汉来梧州人员（此人回武汉后确诊为新型冠状病毒感染的肺炎病例）接触。于21日3时因“发热5天，咳嗽咳痰1天”收治于梧州定点医院，隔离治疗。予以对症、抗病毒及中药治疗。朱某某，男，29岁，湖北省鄂州市来防城港旅游人员。23日因“疑似新型冠状病毒感染的肺炎”收入防城港市定点医院治疗。经抗病毒等对症治疗。','2020-02-11','ck6hgxcdw00pss27cbjulgl3y','央视新闻','广西壮族自治区','2020-01-28','http://m.weibo.cn/2656274875/4465768173634250','','广西首批确诊患者治愈出院','2020-02-11'),('今天，日本厚生劳动大臣加藤胜信宣布，日本国内新型冠状病毒感染的肺炎确诊病例增加2例。其中1人为一名家住奈良的大巴司机，没有去过中国，本月曾两次为从武汉来的旅游团开车。另1人为从武汉来日的游客。截至目前，日本国内新型冠状病毒感染的肺炎病例已上升至6例。\n','2020-02-11','ck6hgxcdw00pts27c23zh9nk6','央视新闻','','2020-01-28','http://m.weibo.cn/2656274875/4465761466195918','','日本新增确诊 2 例，累计确诊 6 例','2020-02-11'),('28日下午17时，山东省援助湖北省防控新型冠状病毒感染的肺炎疫情第二批医疗队飞赴武汉。第二批队伍共138人，共有医师42人，护理人员93人，主要涉及呼吸、感染性疫病、医院感染管理、急诊、重症医学、护理等6个专业。此前，山东省已于组织第一批138名医护人员驰援湖北。\n','2020-02-11','ck6hgxcdw00pus27c80hiaq5p','人民日报','山东省','2020-01-28','http://m.weibo.cn/2803301701/4465763022597515','','山东第二批支援队 138 人飞赴武汉','2020-02-11'),('四川大学华西医院院长、医疗救治专家组组长李为民在28日举行的四川疫情防控工作首场新闻发布会上表示，成都第一例治愈病人将于近日出院。同时，广安在1月16日收治的危重病人，27日已从危重转为重型，到27日为止，四川危重病人从3例降为2例。\n','2020-02-11','ck6hgxcdw00pvs27c17iz8kak','人民日报','四川省','2020-01-28','http://m.weibo.cn/2803301701/4465752138343066','','成都第一例治愈病人将于近日出院','2020-02-11'),('1月28日下午，从我市第三人民医院传来好消息，经医护人员精心诊治和护理，市第三人民医院收治的一名新型冠状病毒感染的肺炎患者救治情况良好，符合出院标准，于当天出院。这是梧州市经过自治区专家组确认救治后成功治愈的首例新型冠状病毒感染的肺炎患者。','2020-02-11','ck6hgxcdw00pws27c3uez2v2u','广西梧州卫健委','广西壮族自治区','2020-01-28','http://wjw.wuzhou.gov.cn/gggs/20200128-2386155.shtml','','广西梧州首例确诊患者治愈出院','2020-02-11'),('28日下午，内蒙古自治区赴湖北首批医疗队139名医护人员从呼和浩特飞赴武汉。他们来自呼和浩特市、包头市、赤峰市、乌兰察布市的多个医疗机构，将在湖北开展医疗救治工作。疫情当前，向最勇敢的“逆行者”致敬！等你们平安凯旋！\n','2020-02-11','ck6hgxcdw00pxs27c8si34a1u','人民日报','内蒙古自治区','2020-01-28','http://m.weibo.cn/2803301701/4465745691755911','','内蒙古 139 名医护出征武汉','2020-02-11'),('28日上午，空军军医大学医疗队在武昌医院重症监护室救治的2名患者治愈出院。据悉，1月25日晚，空军军医大学医疗队进驻武昌医院，26日上午，重症救治医疗队专家进入武昌医院重症医学科指导救治，当时这2名患者仍然在接受无创呼吸机治疗，经过空军军医大学医疗队专家评估，改为高流量吸氧治疗，同时没有细菌感染指征，当天还对患者进行了新型冠状病毒核酸检测。在军地双方医护人员的共同努力下，近三天，患者体温、呼吸道症状恢复正常，经过加强营养，改为面罩吸氧。最终通过2次间隔24小时的新型冠状病毒核酸检测，达到最新版的临床出院标准，患者出院后在家继续休养。','2020-02-11','ck6hgxcdx00pys27c4s0o8tvj','人民日报','湖北省','2020-01-28','https://m.weibo.cn/status/4465741132349237','','武昌医院重症医学科两患者出院','2020-02-11'),('世卫组织在26日、27日的新型冠状病毒报告中，将新型冠状病毒疫情全球范围风险改为高风险。世卫组织表示，此前发布的报告中，错误地将新型冠状病毒疫情对全球风险总结为中等，其实为高风险。新型冠状病毒疫情对中国造成非常高风险，对区域造成高风险。\n','2020-02-11','ck6hgxcdx00pzs27c87i3asui','央视新闻','全国','2020-01-28','http://m.weibo.cn/2656274875/4465679133041663','','世卫组织：新型冠状病毒疫情对全球构成高风险','2020-02-11'),('据北京铁路 ，自1月28日至2月26日对部分旅客列车采取临时停运措施，已购买以下停运列车车票的旅客可在30日内（含当日）办理全额退票手续。点击查看详细车次','2020-02-11','ck6hgxcdx00q0s27c3z8r5xjv','人民日报','全国','2020-01-28','https://m.weibo.cn/status/4465676972765962','','1月28日起至2月底，北京铁路部分列车临时停运','2020-02-11'),('记者从市疾控中心获悉，至1月28日9时，天津市新增1例新型冠状病毒感染的肺炎确诊病例，确诊病例增至24例。患者刘某某，男，21岁，居住于天津市西青区，患者在武汉某高校上学，1月11日从武汉回津。1月23日患者发热，先后就诊于市人民医院、医科大学总医院，1月28日经市专家组确诊为第24例病例，为轻症病例。目前已转至市海河医院治疗，病情平稳。截至目前，我市累计发现新型冠状病毒感染的肺炎病例24例，其中男性19例，女性5例；重症17例，轻症7例；无危重及死亡病例。\n','2020-02-11','ck6hgxcdx00q1s27c9cuh6zcv','人民日报','天津市','2020-01-28','http://m.weibo.cn/2803301701/4465675684706033','','天津新增1例确诊病例，累计确诊24例','2020-02-11'),('2020年1月27日15时30分至1月28日10时30分，辽宁省新增3例输入性新型冠状病毒感染的肺炎确诊病例。其中沈阳市1例、丹东市1例、辽阳市1例，均属普通型病例。辽阳市属首发病例。截至2020年1月28日10时30分，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例30例，重型病例14例。其中确诊病例中，沈阳市8例、大连市5例、本溪市2例、丹东市5例、营口市1例、辽阳市1例、铁岭市2例、朝阳市2例、盘锦市2例、葫芦岛市2例。目前30名患者均在定点医疗机构隔离治疗，病情稳定。其中，27例病例发病前有武汉居住史或旅行史，3例病例为武汉输入病例家属。目前累计追踪到密切接触者449人，已解除医学观察21人，现有428人正在接受医学观察，其余正在追踪中。\n','2020-02-11','ck6hgxcdx00q2s27chz8r7t9s','人民日报','辽宁省','2020-01-28','http://m.weibo.cn/2803301701/4465674816422526','','辽宁新增确诊3例，累计确诊30例','2020-02-11'),('国家卫健委通报出院标准：临床症状缓解，体温正常，两次核酸检测都呈阴性才能确保出院没有传染性。','2020-02-11','ck6hgxcdx00q3s27c0e9c4dwb','人民日报','全国','2020-01-28','https://m.weibo.cn/detail/4465673071759541','','卫健委通报出院标准','2020-02-11'),('今天，华中科技大学附属协和医院的15名被感染医护人员经过治疗后，临床症状得到有效控制。经专家组讨论后，协和医院首批共有3名医护人员符合出院标准，于上午11时许出院。','2020-02-11','ck6hgxcdx00q4s27c74ro30qo','央视新闻','湖北省','2020-01-28','https://weibo.com/2656274875/IryoX4PUB?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1580184095474','','武汉协和医院首批3名被感染医护人员出院','2020-02-11'),('国家卫生健康委医政医管局副局长焦雅辉在28日新闻发布会上表示，截至今晚约有6000人医疗队支援湖北。若有战，召必回！','2020-02-11','ck6hgxcdx00q5s27c0p3a58kh','人民日报','全国','2020-01-28','https://m.weibo.cn/detail/4465666511453374','','截至今晚约6000人医疗队支援湖北','2020-02-11'),('截至1月27日24时，国家卫生健康委收到30个省（区、市）累计报告确诊病例4515例，现有重症病例976例，累计死亡病例106例，累计治愈出院60例。现有疑似病例6973例。','2020-02-11','ck6hgxcdx00q6s27c18z7crku','人民日报','全国','2020-01-28','https://m.weibo.cn/detail/4465663894906763','','全国累计治愈出院60例','2020-02-11'),('据斯里兰卡媒体报道，斯里兰卡卫生部27日宣布，一名目前在该国就医的43岁中国女性，新型冠状病毒测试呈阳性。该人员来自湖北，本月19日以游客身份入境斯里兰卡，并于本月25日入住当地传染病院。\n','2020-02-11','ck6hgxcdy00q7s27c8jt9gi51','央视新闻','','2020-01-28','http://m.weibo.cn/2656274875/4465661160296770','','斯里兰卡确诊首例病例','2020-02-11'),('1月27日0-24时，青海省报告新型冠状病毒感染的肺炎新增确诊病例2例，新增重症病例0例，新增死亡病例0例，新增出院病例0例。其中：西宁市报告2例新增确诊病例。其他市州无报告病例。截至1月27日24时，青海省累计报告新型冠状病毒感染的肺炎确诊病例6例，重症病例0例，死亡病例0例，出院病例0例。其中，确诊病例中，西宁市6例，其他市州无报告病例。目前追踪到密切接触者40人，尚有192人正在接受医学观察。青海省共排查来青人员7358人。\n','2020-02-11','ck6hgxcdy00q8s27cboen6ptp','人民日报','青海省','2020-01-28','http://m.weibo.cn/2803301701/4465658014272585','','青海新增确诊2例，累计6例','2020-02-11'),('1月27日0-24时，30个省（区、市）报告新增确诊病例1771例，新增重症病例515例，新增死亡病例26例（湖北省24例、北京市1例、海南省1例），新增治愈出院病例9例，新增疑似病例2077例。\n截至1月27日24时，国家卫生健康委收到30个省（区、市）累计报告确诊病例4515例，现有重症病例976例，累计死亡病例106例，累计治愈出院60例。现有疑似病例6973例。\n目前累计追踪到密切接触者47833人，当日解除医学观察914人，现有44132人正在接受医学观察。\n累计收到港澳台地区通报确诊病例：香港特别行政区8例，澳门特别行政区7例，台湾地区5例。','2020-02-11','ck6hgxcdy00q9s27c3eslgrkh','国家卫生健康委员会','全国','2020-01-28','http://www.nhc.gov.cn/xcs/yqfkdt/202001/ec9fe7ea987d467d9462e7db509079e6.shtml','','全国新增确诊病例1771例','2020-02-11'),('2020年1月27日0-24时，湖南省报告新型冠状病毒感染的肺炎新增确诊病例43例，新增重症病例10例，新增死亡病例0例，新增出院病例0例。其中：\n新增确诊病例中，长沙市2例、衡阳市3例、株洲市2例、湘潭市2例、邵阳市3例、岳阳市10例、常德市7例、益阳市3例、郴州市1例、永州市3例、怀化市5例、娄底市2例；新增重症病例中，长沙市1例、衡阳市1例、邵阳市2例、常德市2例、益阳市1例、怀化市2例、娄底市1例。\n截至1月27日24时，湖南省累计报告新型冠状病毒感染的肺炎确诊病例143例，重症病例31例（另有1例重症病例转归为普通病例），死亡病例0例，出院病例0例。其中：\n确诊病例中，长沙市24例、衡阳市7例、株洲市7例、湘潭市6例、邵阳市11例、岳阳市17例、常德市19例、益阳市10例、郴州市7例、永州市7例、怀化市16例、娄底市9例、湘西自治州3例；\n重症病例中，长沙市8例、衡阳市2例、株洲市1例、湘潭市1例、邵阳市3例、岳阳市1例、常德市4例、益阳市2例、永州市3例、怀化市5例、娄底市1例。目前追踪到密切接触者2387人，已解除医学观察51人，尚有2336人正在接受医学观察。','2020-02-11','ck6hgxcdy00qas27c8japgzni','人民日报','湖南省','2020-01-28','https://weibo.com/2803301701/IrxKDfmId?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1580176510364','','湖南新增确诊43例，湖南累计确诊143例','2020-02-11'),('中国疾控中心副主任冯子健表示，研究显示，新型冠状病毒的人际传播能力平均一个病人能够传染2到3个人。新型冠状病毒倍增时间比SARS短，SARS是9天左右的时间会倍增，新型冠状病毒大概6、7天的时间病例就会翻倍。它的一个衡量指标传代间隔，新型冠状病毒相对较短。','2020-02-11','ck6hgxcdy00qbs27cf0m28p55','央视新闻','全国','2020-01-27','https://weibo.com/2656274875/IrwRguSJH?filter=hot&root_comment_id=0&type=comment','','新型冠状病毒倍增时间比SARS短','2020-02-11'),('截至1月27日10时，陕西新增13例新型冠状病毒感染的肺炎确诊病例，新增重症患者2例。新增确诊病例中，西安市4例、咸阳市1例、渭南市1例、延安市1例、汉中市2例、安康市4例。陕西累计报告新型冠状病毒感染的肺炎确诊病例35例，其中西安市12例、咸阳市4例、铜川市5例、渭南市1例、延安市2例、汉中市3例、安康市7例、商洛市1例。','2020-02-11','ck6hgxcdy00qcs27ca4jcgniw','陕西省卫健委','陕西省','2020-01-27','http://sxwjw.shaanxi.gov.cn/art/2020/1/27/art_9_67483.html','','陕西新增 13 例新型肺炎确诊病例，累计 35 例','2020-02-11'),('1月26日，广东省报告新型冠状病毒感染的肺炎新增确诊病例48例，其中重症病例1例，危重病例1例。梅州1例、汕尾1例均为首次报告确诊病例。截至1月26日24时，广东省累计报告新型冠状病毒感染的肺炎确诊病例146例，其中重症病例20例，危重病例6例，无死亡病例，出院病例2例。','2020-02-11','ck6hgxcdy00qds27cao272o38','央视新闻','广东省','2020-01-27','http://m.weibo.cn/2656274875/4465271978762511','','广东新增确诊病例48例，累计146例','2020-02-11'),('1月26日0—24时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例35例，新增重症病例4例，减少危重病例1例。截至1月26日24时，重庆市累计报告新型冠状病毒感染的肺炎确诊病例110例，重症病例13例，危重病例1例。','2020-02-11','ck6hgxcdy00qes27cdane1hy7','央视新闻','重庆市','2020-01-27','http://m.weibo.cn/2656274875/4465270570063242','','重庆新增确诊病例35例，累计110例','2020-02-11'),('26日0—24时，贵州省新型冠状病毒感染的肺炎新增2例确诊病例，截至26日24时，全省累计报告新型冠状病毒感染的肺炎病例7例（重症1例）。其中，贵阳市1例，六盘水市1例，铜仁市2例，黔南州2例，黔西南州1例。疑似病例3例（贵阳市修文县、黔南州瓮安县、黔南州三都县）。','2020-02-11','ck6hgxcdz00qfs27chp2ec7q6','央视新闻','贵州省','2020-01-27','http://m.weibo.cn/2656274875/4465268958842261','','贵州新增确诊病例2例，累计7例','2020-02-11'),('1月26日0-24时，浙江省报告新型冠状病毒感染的肺炎新增确诊病例24例，新增重症病例4例。截至1月26日24时，浙江省累计报告新型冠状病毒感染的肺炎确诊病例128例，重症病例18例（累计20例，其中2例已转轻症）。','2020-02-11','ck6hgxcdz00qgs27cgf4nhmd2','人民日报','浙江省','2020-01-27','http://m.weibo.cn/2803301701/4465268643885710','','浙江新增新型肺炎24例，累计128例','2020-02-11'),('1月26日12—24时，山东省报告新型冠状病毒感染的肺炎新增确诊病例17例。截至1月26日24时，山东省累计报告新型冠状病毒感染的肺炎确诊病例63例','2020-02-11','ck6hgxcdz00qhs27c2a3j64d6','央视新闻','山东省','2020-01-27','http://m.weibo.cn/2656274875/4465264290991441','','山东新增确诊病例17例，累计63例','2020-02-11'),('1月26日0-24时，30个省（区、市）报告新增确诊病例769例，新增重症病例137例，新增死亡病例24例（湖北省24例），新增治愈出院病例2例，新增疑似病例3806例。截至1月26日24时，国家卫生健康委收到30个省（区、市）累计报告确诊病例2744例','2020-02-11','ck6hgxcdz00qis27cfrc8epyh','央视新闻','全国','2020-01-26','http://m.weibo.cn/2656274875/4465253255322200','','全国新增确诊病例769例，累计2744例','2020-02-11'),('国务院办公厅27日发布关于延长2020年春节假期的通知。经国务院批准，为加强新型冠状病毒感染的肺炎疫情防控工作，有效减少人员聚集，阻断疫情传播，更好保障人民群众生命和身体健康，现将延长2020 年春节假期的具体安排通知如下：一、延长2020年春...','2020-02-11','ck6hgxcdz00qjs27c5j5g67a3','央视新闻','全国','2020-01-26','http://m.weibo.cn/2656274875/4465171320000970','','国务院通知：春节假期延长至2月2日','2020-02-11'),('26日晚间，湖北新型冠状病毒感染的肺炎疫情防控工作新闻发布会召开。湖北省委副书记、省长王晓东，武汉市委副书记、市政府市长周先旺出席发布会，发布会上，周先旺戴口罩向媒体介绍疫情防控情况，说确诊病例可能再增加约1000例。','2020-02-11','ck6hgxcdz00qks27c3bp86luh','央视新闻','湖北省','2020-01-26','http://m.weibo.cn/2656274875/4465103473010025','','武汉确诊病例可能再增加约1000例','2020-02-11'),('近期，多地发生新型肺炎疫情，截至1月25日，全国红十字会接受爱心捐赠达3.4亿元。中国红十字会总会已向武汉等疫情较严重地区调拨价值1245.88万元的物资和1000万元现金，并将继续追加。中国红十字会总会累计接受网上捐赠30.17万余笔，捐赠总额688.72万余元。','2020-02-11','ck6hgxcdz00qls27c4knkab39','央视新闻','湖北省','2020-01-26','http://m.weibo.cn/2656274875/4464949205928131','','网友为抗击新型肺炎捐款超 30 万次','2020-02-11'),('2020年1月25日17:00-26日7:00，海南省新型冠状病毒感染的肺炎新增确诊病例3例，无重症病例、死亡病例和出院病例。确诊病例中，三亚市2例、澄迈县1例。 截至1月26日7:00，海南省累计报告新型冠状病毒感染的肺炎确诊病例22例，其中重症病例1例，无死亡病例和出院病例。 （总台央视记者 毛鑫 杨涛 何英平）','2020-02-11','ck6hgxcdz00qms27ceh2o3233','央视新闻','海南省','2020-01-26','https://m.weibo.cn/status/4464933893184455?','','海南新增 3 例确诊病例，累计 22 例','2020-02-11'),('2020年1月25日0-24时，江西省报告新型冠状病毒感染的肺炎新增确诊病例18例（含重症病例2例）。其中赣州市5例、宜春市4例、上饶市4例、抚州市2例、南昌市1例、萍乡市1例、吉安市1例。 　　截至1月25日24时，江西省累计报告新型冠状病毒感染的肺炎确诊病例36例（含重症病例6例）','2020-02-11','ck6hgxce000qns27c848c4leo','人民日报','江西省','2020-01-25','https://m.weibo.cn/status/4464878414755269','','江西新增新型肺炎18 例，江西累计新型肺炎 36 例','2020-02-11'),('2020年1月25日0-24时，湖北省报告新型冠状病毒感染的肺炎新增确诊病例323例，新增死亡病例13例，新增出院病例10例。截至1月25日24时，湖北省累计报告新型冠状病毒感染的肺炎确诊病例1052例，重症病例129例，死亡病例52例,出院病例85例。','2020-02-11','ck6hgxce000qos27c8edngi8z','人民日报','湖北省','2020-01-25','https: