http://m.weibo.cn/2803301701/4464681504462914','','陕西启动一级应急响应','2020-02-11'),('云南文山州新型冠状病毒感染的肺炎领导小组办公室提示：1月21日，由南宁经平果、广南、丘北往昆明的D3937次动车7号车厢的一名乘客，经百色市医疗机构诊断，已确诊为新型冠状病毒感染的肺炎病例，目前已被广西医疗机构收治。','2020-02-11','ck6hgxce100qws27c1zkd3uuz','人民日报','云南省','2020-01-25','http://m.weibo.cn/2803301701/4464653071506034','','紧急扩散！急寻21日D3937次7号车厢乘客','2020-02-11'),('香港特区政府卫生署通报，香港新增3例新型冠状病毒感染确诊个案，患者均来自武汉，已经入院隔离治疗。截至目前，香港共出现5例输入的确诊个案。','2020-02-11','ck6hgxce100qxs27c6r6512zx','人民日报','香港','2020-01-25','http://m.weibo.cn/2803301701/4464650378953692','','香港新增3例新型肺炎确诊病例','2020-02-11'),('今天，湖北省召开新型冠状病毒感染的肺炎疫情防控工作例行新闻发布会。会上，湖北省卫健委将通报全省疫情和防控工作最新进展情况。看直播↓关注！（总台央视记者潘巍）','2020-02-11','ck6hgxce100qys27cfbat11fo','央视新闻','湖北省','2020-01-25','t.cn/A6Pq5t4P .','','直播！湖北通报疫情和防控工作最新情况','2020-02-11'),('陕西省卫健委官方网站25日通报，截止1月25日14时，陕西新增10例新型冠状病毒感染的肺炎确诊病例；新增密切接触者54例；全省累计报告确诊病例15例，密切接触者179例，均集中医学观察。','2020-02-11','ck6hgxce100qzs27c6n38e238','央视新闻','陕西省','2020-01-25','http://m.weibo.cn/2656274875/4464640093906009','','陕西出现9岁新型肺炎感染者','2020-02-11'),('【四川新增13例新型肺炎确诊病例 累计28例】四川省卫健委通报：1月24日，四川省新型冠状病毒感染的肺炎病例确认专家组确认四川新增新型冠状病毒感染的肺炎病例13例。截至1月24日24时，四川累计报告新型冠状病毒感染的肺炎确诊病例28例','2020-02-11','ck6hgxce100r0s27cbf6xhv4b','人民日报','四川省','2020-01-25','http://m.weibo.cn/2803301701/4464569709464179','','四川新增 13 例新型肺炎确诊病例','2020-02-11'),('根据当前四川省防控工作需要，四川依法依规启动突发公共卫生事件一级应急响应。 ​​​','2020-02-11','ck6hgxce100r1s27cgdulf0cn','央视新闻','四川省','2020-01-24','https://weibo.com/2656274875/IqZhD0DTG?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579860802296','','四川启动一级响应','2020-02-11'),('今天11时，天津市新增1例新型冠状病毒感染的肺炎确诊病例。患者为女性，29岁，在武汉工作并于23日来津，24日出现发热到发热门诊就诊，经专家组确诊为天津市第7例病例。目前已转至定点医院接受隔离治疗，生命体征平稳。','2020-02-11','ck6hgxce100r2s27c8l5t00g5','央视新闻','天津市','2020-01-24','http://m.weibo.cn/2656274875/4464245485576951','','天津确诊第 7 例','2020-02-11'),('据黄石日报，1月23日晚记者从黄石市新型冠状病毒感染的肺炎疫情防控指挥部获悉，截至1月23日21:00，全市发热门诊共接诊发热病人1917例，经专家组判定已出现疑似病例，目前正按技术方案进行检测。高度疑似的10名患者已收至定点医疗机构隔离病区治疗，正按程序报省疾控中心复核确诊。','2020-02-11','ck6hgxce100r3s27c0qouhmjp','人民日报','湖北省','2020-01-23','https://m.weibo.cn/status/4464044838788193?','','湖北黄石 10 名疑似患者已隔离治疗','2020-02-11'),('央视记者从云南省卫健委获悉，昆明确诊第二例输入性新型冠状病毒感染的肺炎病例。','2020-02-11','ck6hgxce200r4s27cdlscgajw','央视新闻','云南省','2020-01-23','https://m.weibo.cn/status/4464047963266414?','','昆明确诊第 2 例新型肺炎病例','2020-02-11'),('1月27日20时至28日12时，北京市新增11例新型冠状病毒感染的肺炎病例，其中5例有湖北接触史，7例为此前确诊病例的密切接触者，均已送至市级定点医疗机构进行救治。截至1月28日12时，北京市累计确诊病例91例。其中东城区2例、西城区8例、朝阳区17例、海淀区21例、丰台区7例、石景山区2例、通州区7例、顺义区2例、大兴区7例、昌平区7例，外地来京人员11例。\n','2020-02-11','ck6hgxce200r5s27c0xlabr31','人民日报','北京市','2020-01-28','http://m.weibo.cn/2803301701/4465735751336832','','北京新增确诊 11 例，累计确诊 91 例','2020-02-11'),('2020年1月28日0—12时，山东省报告新型冠状病毒感染的肺炎新增确诊病例8例，其中：青岛市2例（市北区）、枣庄市3例（市中区）、烟台市2例（莱山区、芝罘区各1例），菏泽市1例（巨野县）。目前有疑似病例47例，其中：青岛市19例，威海、德州、滨州、菏泽市各5例，潍坊、泰安、聊城市各2例，枣庄、临沂市各1例。\n','2020-02-11','ck6hgxce200r7s27c7tkt2ceg','人民日报','山东省','2020-01-28','http://m.weibo.cn/2803301701/4465732773013064','','山东新增确诊 8 例，累计确诊 95 例','2020-02-11'),('1月28日上午，由142人组成的新疆首批医疗队集结完毕，驰援湖北。这是新疆第一批援助湖北应对新型冠状病毒感染的肺炎疫情的医疗队。医疗队队员中多人曾参与过非典疫情防治和汶川、玉树抗震救灾，具有丰富的应急救援经验。\n','2020-02-11','ck6hgxce200r8s27c1jpodikq','人民日报','新疆维吾尔自治区','2020-01-28','http://m.weibo.cn/2803301701/4465732580138929','','新疆首批医疗队 142 人出征湖北','2020-02-11'),('今天，内蒙古自治区新型冠状病毒感染肺炎防控工作指挥部发布，截至1月28日9时, 我区累计报告新型冠状病毒感染的肺炎确诊病例15例，疑似病例2例。其中：15例确诊病例中，呼和浩特市2例（新城区），包头市3例（昆都仑区），呼伦贝尔市2例（满洲里市1例、牙克石市1例），兴安盟1例（乌兰浩特市），通辽市1例（经济开发区），赤峰市2例（松山区、林西县），锡林郭勒盟2例（锡林浩特市1例、二连浩特市1例），鄂尔多斯市2例（东胜区1例、鄂托克前旗1例）。累计报告疑似病例2例，呼伦贝尔市额尔古纳市、巴彦淖尔市五原县各1例。目前，所有病例均在定点医院接受隔离治疗。追踪到的342名密切接触者正在接受医学观察，其他密切接触者正在紧急排查中。\n','2020-02-11','ck6hgxce200r9s27c0cje2kpo','央视新闻','内蒙古自治区','2020-01-28','http://m.weibo.cn/2656274875/4465726964761419','','内蒙古累计确诊病例 15 例','2020-02-11'),('截至1月28日14时，陕西新增11例新型冠状病毒感染的肺炎确诊病例。新增确诊病例中，西安市3例、宝鸡市3例、渭南市2例、汉中市1例、安康市1例、商洛市1例。陕西累计报告新型冠状病毒感染的肺炎确诊病例46例，其中西安市15例、宝鸡市3例、咸阳市4例、铜川市5例、渭南市3例、延安市2例、汉中市4例、安康市8例、商洛市2例。全省新增密切接触者340人，累计899人，均集中医学观察。','2020-02-11','ck6hgxce200ras27c8usl4oon','央视新闻','陕西省','2020-01-28','http://m.weibo.cn/2656274875/4465725144039280','','陕西新增 11 例，累计确诊 46 例','2020-02-11'),('截至1月28日12时，云南省累计报告新型冠状病毒感染的肺炎确诊病例44例，新增12例，均为输入病例，现有重症5例，无二代病例，无死亡病例。其中，昆明市12例、丽江市6例、德宏州2例、保山市4例、曲靖市2例、玉溪市5例、红河州2例、西双版纳州6例、大理州3例、昭通市2例。报告疑似病例125例。密切接触者医学观察558人。\n','2020-02-11','ck6hgxce200rbs27ce1y0gpag','人民日报','云南省','2020-01-28','http://m.weibo.cn/2803301701/4465718265403999','','云南新增确诊 12 例','2020-02-11'),('27日，北京师范大学心理学部联合该校学生心理咨询与服务中心，紧急开通心理支持热线和网络辅导服务。适用于急需情绪疏导和心理支持的人群。热线电话均由有丰富经验的咨询师接听，每次30分钟左右。热线电话 4001888976，开放时间为每天6时至24时。\n','2020-02-11','ck6hgxce300rcs27cf4zo21uw','人民日报','北京市','2020-01-28','http://m.weibo.cn/2803301701/4465716214789211','','北师大开通疫情心理支持热线','2020-02-11'),('今天，天津首批针对新型冠状病毒感染肺炎的“2019-nCoV病毒检测试剂盒”，共计1万人份已发往武汉。这些试剂盒经检测合格后，将用于一线检测。据介绍，生产企业目前试剂原材料供货稳定，正加班加点开足马力生产，计划1月底前完成5万人份的生产目标，全部无偿提供给湖北等地。\n','2020-02-11','ck6hgxce300rds27cg1bl9rav','央视新闻','天津市','2020-01-28','http://m.weibo.cn/2656274875/4465709994074745','','天津首批病毒检测试剂盒发往武汉','2020-02-11'),('28日，泰国卫生部向媒体透露，泰国新增6例新型冠状病毒肺炎确诊病例，目前总共确诊病例达到14例。\n','2020-02-11','ck6hgxce300res27c1u6j4xh9','央视新闻','','2020-01-28','http://m.weibo.cn/2656274875/4465705019492720','','泰国新增6例，累计14例','2020-02-11'),('1月28日，江西新余市人民医院接诊的一例新型冠状病毒感染的肺炎患者救治情况良好，符合出院标准，于当日中午出院。这也是江西第三例治愈新型冠状病毒感染的肺炎患者出院。据了解，该患者为女性，37岁，江西新余人，在武汉从事销售工作。1月13日回到江西新余，1月20日因发烧、咳嗽前往新余市人民医院就诊，后被确诊为新型冠状病毒感染的肺炎。\n','2020-02-11','ck6hgxce300rfs27cgnltfxka','人民日报','江西省','2020-01-28','http://m.weibo.cn/2803301701/4465704902378725','','江西第3例治愈患者出院','2020-02-11'),('记者28日从上海卫健委获悉，经上海市专家组会诊，上海第4例新型冠状病毒感染的肺炎患者痊愈出院。据悉，金某某，女，21岁，上海市户籍，有武汉居住史，因发热就诊，1月22日被确认为新型冠状病毒感染的肺炎确诊病例入住市公共卫生临床中心。经治疗，该例患者两次核酸检测为阴性，符合国家卫健委新型冠状病毒感染肺炎确诊病例解除隔离和出院标准。','2020-02-11','ck6hgxce300rgs27c0sk4fsgr','央视新闻','上海市','2020-01-28','http://m.weibo.cn/2656274875/4465700704335058','','上海第4例治愈病人出院','2020-02-11'),('1月27日15时—1月28日8时，福建省报告新增新型冠状病毒感染的肺炎确诊病例14例，均为输入性病例。其中：厦门市1例（湖北省武汉市1例）；泉州市3例（丰泽区1例、鲤城区1例、南安市1例）；三明市4例（沙县2例、宁化县1例、永安市1例）；莆田市4例（荔城区3例、湄洲湾北岸1例）；南平市1例（浦城县1例）；龙岩市1例（永定区1例）。报告新增新型冠状病毒感染的肺炎疑似病例37例。截至1月28日8时，福建省累计报告新型冠状病毒感染的肺炎确诊病例73例（危重症2例、重症5例，无死亡病例）。目前，确诊、疑似病例的密切接触者已解除医学观察15人，尚有1266人正在接受医学观察。\n','2020-02-11','ck6hgxce300rhs27cgfrkbi9k','人民日报','福建省','2020-01-28','http://m.weibo.cn/2803301701/4465692252819831','','福建新增确诊14例，累计73例','2020-02-11'),('1月27日0-24时，吉林省报告新增新型冠状病毒感染的肺炎确诊病例2例，其中吉林市1例，公主岭市1例。\n吉林市新增病例，男，57岁，常居深圳，1月19日从深圳坐高铁到天津途径武汉，停车数分钟，22日乘高铁到吉林市。1月27日收入定点医疗机构隔离治疗，初步诊断为普通轻型病例，目前患者病情尚平稳。\n公主岭市新增病例，女，50岁，1月17日从湖北省仙桃市乘车到公主岭市，中间在武汉汉口火车站换乘火车。1月27日收入定点医疗机构隔离治疗，初步诊断为普通轻型病例，目前病情稳定。\n截至1月27日24时，吉林省累计报告新型冠状病毒感染的肺炎病例8例，其中长春市1例，吉林市3例，松原市2例，四平市1例，公主岭市1例。目前累计追踪到密切接触者184人，均在接受医学观察。','2020-02-11','ck6hgxce300ris27cccs49f5v','央视新闻','吉林省','2020-01-28','https://weibo.com/2656274875/IrxHrh51G?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1580176024120','','吉林新增2例，累计确诊8例','2020-02-11'),('1月27日16:00-28日7:00，海南省新型冠状病毒感染的肺炎新增确诊病例7例，新增重症病例0例，新增死亡病例0例，新增出院病例0例。新增确诊病例中，海口市1例、三亚市3例、琼海市1例、东方市1例、琼中县1例。\n截至1月28日7:00，海南省累计报告新型冠状病毒感染的肺炎确诊病例40例，重症病例5例，死亡病例1例，出院病例0例。确诊病例中，海口市7例、三亚市14例、儋州市5例、万宁市7例、琼海市1例、东方市1例、临高县1例、陵水县1例、澄迈县2例、琼中县1例。截至1月28日7:00，追踪到密切接触者558人，已解除医学观察31人，尚有528人正在接受居家医学观察。','2020-02-11','ck6hgxce300rjs27ccrt482b7','央视新闻','海南省','2020-01-28','https://weibo.com/2656274875/IrxGth8KF?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1580175853068','','海南新增7例，累计确诊40例','2020-02-11'),('澳门新增第7例输入性新型冠状病毒感染病例，患者为67岁女性，武汉居民，退休人士。患者于1月22日从武汉乘坐高铁到广州，23日乘坐城轨由广州到珠海，经关闸口岸入境澳门，26日晚开始自觉有发热，27日早上由消防救护车送到仁伯爵综合医院特别急症室，下午其新型冠状病毒检测结果呈阳性。目前，患者情况一般。','2020-02-11','ck6hgxce300rks27c7u4jcumj','人民日报','澳门','2020-01-28','https://weibo.com/2803301701/IrxDLFQt3?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1580175537924','','澳门新增确诊1例，累计7例','2020-02-11'),('1月27日0-24时，内蒙古自治区报告新型冠状病毒感染的肺炎新增确诊病例2例。报告新增疑似病例1例。其中：新增2例确诊病例中包头市1例、赤峰市1例；呼伦贝尔市的额尔古纳市新增疑似病例1例。\n截至1月27日24时,内蒙古自治区累计报告新型冠状病毒感染的肺炎确诊病例13例，疑似病例2例。其中：13例确诊病例中包括,包头市昆都仑区3例，呼伦贝尔市2例（满洲里市1例、牙克石市1例），兴安盟乌兰浩特市1例，通辽市经济开发区1例，赤峰市2例（松山区1例、林西县1例），锡林郭勒盟2例（锡林浩特市1例，二连浩特市1例），鄂尔多斯市2例（东胜区1例、鄂托克前旗1例）​；疑似病例2例中呼伦贝尔市的额尔古纳市新增疑似病例1例、锡林郭勒盟苏尼特左旗疑似病例1例。\n均在定点医院接受隔离治疗。目前追踪到密切接触者334人，正在接受医学观察。','2020-02-11','ck6hgxce400rls27ch3qa3pn7','央视新闻','内蒙古自治区','2020-01-28','https://weibo.com/2656274875/IrxAu8RfW?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1580175057414','','内蒙古新增2例，累计确诊13例','2020-02-11'),('2020年1月27日0-24时，宁夏全区报告新型冠状病毒感染的肺炎新增确诊病例4例。\n截止1月27日24时，宁夏累计报告新型冠状病毒感染的肺炎确诊病例11例,其中银川市7例、吴忠市2例、固原市1例、中卫市1例，疑似病例0例。全区累计追踪到密切接触者471例，全部实行隔离医学观察。','2020-02-11','ck6hgxce400rms27chq9j8xrj','人民日报','宁夏回族自治区','2020-01-28','https://weibo.com/2803301701/Irxz9nfZb?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1580174841225','','宁夏新增确诊4例，宁夏累计确诊11例','2020-02-11'),('1月27日0-24时，新疆维吾尔自治区报告新型冠状病毒感染的肺炎新增确诊病例5例，新增重症病例1例，新增死亡病例0例，新增出院病例0例。其中：吐鲁番市、第七师、第八师石河子市为报告首例确诊病例；其他2个州市新增确诊病例中，乌鲁木齐市1例、伊犁州1例；新增重症病例中，伊犁州1例。\n截至1月27日24时，新疆累计报告新型冠状病毒感染的肺炎确诊病例10例，现有重症病例2例，累计死亡病例0例，累计出院病例0例。\n目前累计追踪到密切接触者204人，当日解除医学观察9人，现有195人正在接受医学观察。','2020-02-11','ck6hgxce400rns27c3eqseqjz','央视新闻','新疆维吾尔自治区','2020-01-28','https://weibo.com/2656274875/IrxxpdRx5?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1580174715525','','新疆新增5例，累计确诊10例','2020-02-11'),('    2020年1月27日，我省报告新型冠状病毒感染的肺炎新增确诊病例42例，其中新增重症病例3例，新增出院病例2例，无新增危重病例和死亡病例。\n    新增病例中，广州市12例、深圳市13例、汕头市3例、佛山市4例、梅州市2例、惠州市3例、中山市2例、清远市2例、揭阳市1例。\n    截至1月27日24时，我省累计报告新型冠状病毒感染的肺炎确诊病例188例，其中重症病例23例，危重病例6例，无死亡病例，出院病例4例。\n我省累计确诊的188例病例中，男性93例，女性95例，年龄介于11月龄-85岁之间。无医务 \n   人员感染病例。其中，广州市51例、深圳市49例、珠海市12例、汕头市5例、佛山市18例、韶关市4例、梅州市3例、惠州市11例、汕尾市1例、东莞市2例、中山市6例、阳江市8例、湛江市5例、肇庆市4例、清远市5例、揭阳市4例。\n　目前追踪到密切接触者1019人，均在进行医学观察。','2020-02-11','ck6hgxce400ros27cb3s4bo7f','人民日报','广东省','2020-01-28','https://weibo.com/2803301701/Irxvsowh0?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1580174338743','','广东新增确诊42例，广东累计确诊188例','2020-02-11'),('国家卫建委与国家中医药管理局公布《新型冠状病毒感染的肺炎诊疗方案（试行第四版）》：①潜伏期一般3-7天，最长不超过14天；②多数患者预后良好，儿童病例症状相对较轻；③儿童及婴幼儿也有发病；④新型冠状病毒与SARS同源性达85%。','2020-02-11','ck6hgxce400rps27cb1p0a9qa','人民日报','全国','2020-01-28','http://m.weibo.cn/2803301701/4465636312468420','','第四版诊疗方案公布：新型冠状病毒可通过接触传播','2020-02-11'),('2020年1月27日0-24时，浙江省报告新型冠状病毒感染的肺炎新增确诊病例45例，新增重症病例14例。其中：新增确诊病例中，杭州市5例、宁波市4例、温州市28例、嘉兴市3例、绍兴市1例、金华市2例、丽水市2例；新增重症病例中，杭州市6例、温州市3例、嘉兴市2例、绍兴市2例、舟山市1例。截至1月27日24时，浙江省累计报告新型冠状病毒感染的肺炎确诊病例173例，重症病例31例（累计34例，其中3例已转轻症）。其中：确诊病例中，杭州市32例、宁波市17例、温州市60例、湖州市3例、嘉兴市11例、绍兴市7例、金华市7例、衢州市5例、舟山市4例、台州市22例、丽水市5例；重症病例中，杭州市8例、宁波市1例、温州市7例、嘉兴市5例、绍兴市4例、衢州市1例、舟山市1例、台州市4例。\n目前，全省共追踪到密切接触者4952人，已解除医学观察182人，尚有4715人正在接受医学观察。\n','2020-02-11','ck6hgxce400rqs27c1eju2jqz','人民日报','浙江省','2020-01-28','http://m.weibo.cn/2803301701/4465635986243007','','浙江新增确诊45例，浙江累计报告173例','2020-02-11'),('2020年1月27日0-24时，甘肃省报告新型冠状病毒感染的肺炎新增确诊病例5例，新增重症病例1例。其中：金昌市、天水市为报告首例确诊病例，兰州市新增确诊病例3例，新增重症病例中，兰州市1例。截至1月27日24时，甘肃省累计报告新型冠状病毒感染的肺炎确诊病例19例，重症病例4例。其中：确诊病例中，兰州市11例、白银市1例、临夏州2例、定西市1例、张掖市1例、陇南市1例、金昌市1例、天水市1例；重症病例中，兰州市3例、定西市1例。\n目前，追踪到密切接触者277人，已解除隔离2人，其余均正在接受医学观察。\n','2020-02-11','ck6hgxce400rrs27cheegdgbs','人民日报','甘肃省','2020-01-28','http://m.weibo.cn/2803301701/4465634471323038','','甘肃新增确诊5例，甘肃累计确诊19例','2020-02-11'),('1月27日，按照《新型冠状病毒感染的肺炎诊疗方案》规定，根据病例临床表现，结合流行病学史和实验室检测结果，四川省新型冠状病毒感染的肺炎病例确认专家组确认此21例病例为四川省新增新型冠状病毒感染的肺炎病例。\n截至1月27日24时，四川省累计报告新型冠状病毒感染的肺炎确诊病例90例，涉及17个市（州）。其中成都市37例、绵阳市8例、自贡市7例、广安市7例、泸州市4例、南充市4例、遂宁市3例、内江市3例、达州市3例、甘孜州3例、乐山市2例、雅安市2例、资阳市2例、凉山州2例、德阳市1例、宜宾市1例、眉山市1例。\n90名患者中，危重2人。\n正在接受医学观察1264人，已解除医学观察80人。','2020-02-11','ck6hgxce900rss27c5r8b1tqm','人民日报','四川省','2020-01-28','https://weibo.com/2803301701/Irxpf3gky?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1580173892373','','四川新增确诊21例，四川累计报告90例','2020-02-11'),('2020年1月27日0-24时，河北省报告新型冠状病毒感染的肺炎新增确诊病例15例，其中，廊坊市4例、沧州市3例、邯郸市2例、石家庄市2例、衡水市2例、唐山市1例、邢台市1例。衡水、唐山为报告首例确诊病例。新增疑似病例38例，其中，石家庄市24例、沧州市3例、张家口市3例、保定市3例、唐山市2例、衡水市1例、廊坊市1例、邢台市1例。　　\n截至1月27日24时，河北省累计报告确诊病例33例，其中死亡1例。确诊病例中，石家庄市9例、廊坊市6例、沧州市5例、邯郸市4例、保定市3例、邢台市2例、衡水市2例、承德市1例、唐山市1例；死亡病例中，沧州市1例。累计报告疑似病例54例。　　目前追踪到密切接触者644人，均在接受隔离医学观察。','2020-02-11','ck6hgxce900rts27caenhapg5','人民日报','河北省','2020-01-28','http://m.weibo.cn/2803301701/4465632898392293','','河北新增确诊15例，河北累计确诊33例','2020-02-11'),('1月27日0—24时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例22例，新增危重型病例2例。黔江区、南岸区为报告首例确诊病例。\n新增确诊病例中，万州区1例、黔江区1例、江北区1例、九龙坡区1例、南岸区1例、渝北区1例、长寿区1例、合川区1例、綦江区1例、铜梁区1例、开州区2例、垫江县1例、忠县3例、云阳县2例、石柱县3例、两江新区1例；新增危重型病例中，江北区1例、九龙坡区1例。\n截至1月27日24时，重庆市累计报告新型冠状病毒感染的肺炎确诊病例132例，重型病例13例，危重型病例3例。\n确诊病例中，万州区15例、黔江区1例、涪陵区1例、大渡口区6例、江北区4例、九龙坡区5例、南岸区1例、渝北区6例、巴南区1例、长寿区7例、江津区2例、合川区4例、永川区3例、綦江区2例、大足区1例、璧山区3例、铜梁区2例、潼南区2例、开州区9例、梁平区1例、城口县1例、丰都县3例、垫江县5例、忠县9例、云阳县10例、奉节县3例、巫山县5例、巫溪县5例、石柱县6例、秀山县1例、两江新区8例；重型病例中，万州区2例、大渡口区2例、江北区1例、九龙坡区1例、长寿区2例、永川区1例、璧山区1例、垫江县1例、忠县1例、云阳县1例；危重型病例中，万州区1例、江北区1例、九龙坡区1例。\n目前追踪到密切接触者1447人，已解除医学观察2人，尚有1445人正在接受医学观察。','2020-02-11','ck6hgxce900rus27c1yzw0lqy','央视新闻','重庆市','2020-01-28','https://weibo.com/2656274875/Irxp1aPIL?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1580173466665','','重庆新增22例，累计确诊132例','2020-02-11'),('1月27日0-24时, 黑龙江省报告新型冠状病毒感染的肺炎新增确诊病例9例。新增疑似病例33例。\n截至1月27日24时,黑龙江省累计报告新型冠状病毒感染的肺炎确诊病例30例，其中：哈尔滨市10例、齐齐哈尔市2例、牡丹江市1例、佳木斯市1例、大庆市5例、双鸭山市1例、七台河市2例、绥化市8例；累计重症病例3例。死亡病例1例为绥化市确诊病例。累计报告疑似病例67例。\n全省当日发热门诊诊疗人数3744人。目前追踪到密切接触者833人, 已解除医学观察133人,尚有700人正在接受医学观察。','2020-02-11','ck6hgxce900rws27cfbbs9re2','央视新闻','黑龙江省','2020-01-28','https://weibo.com/2656274875/Irxp8yXIl?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1580173297720','','黑龙江新增9例，累计确诊30例','2020-02-11'),('2020年1月27日0-24时，安徽省新增报告新型冠状病毒感染的肺炎确诊病例36例。其中：阜阳11例、铜陵6例、合肥3例、芜湖3例、马鞍山3例、黄山3例、亳州2例、滁州2例、淮北1例、六安1例、宣城1例。\n新增疑似病例38例，其中：阜阳9例、合肥7例、六安4例、马鞍山3例、铜陵2例、宿州3例、芜湖3例、亳州2例、宿松2例、蚌埠1例、黄山1例、滁州1例。\n所有病例病情平稳，均在定点医院接受治疗。\n截至1月27日24时，全省累计报告新型冠状病毒感染的肺炎确诊病例106例，其中:阜阳21例、合肥16例、马鞍山10例、芜湖9例、铜陵9例、安庆8例、亳州8例、黄山4例、滁州4例、六安4例、宿州3例、蚌埠3例、淮南2例、宣城2例、淮北2例、池州1例。\n目前追踪到密切接触者1719人，均在接受医学观察。','2020-02-11','ck6hgxce900rys27c7alr2egs','人民日报','安徽省','2020-01-28','https://weibo.com/2803301701/IrxnatRYu?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1580173016241','','安徽新增确诊36例，安徽累计确诊106例','2020-02-11'),('2020年1月27日0时-24时，湖北省新增新型冠状病毒感染的肺炎病例1291例（武汉市新增892例、黄石市新增17例、十堰市新增25例、襄阳市新增34例、宜昌市新增20例、荆州市新增24例、荆门市新增24例、鄂州新增37例、孝感市新增73例、黄冈市新增59例、咸宁市新增27例、随州市新增18例、恩施州新增13例、仙桃市新增15例、天门市新增10例，潜江新增2例，神农架林区首发1例）。\n全省新增死亡24例，其中：武汉市22例，天门市2例。\n截至2020年1月27日24时，湖北省累计报告新型冠状病毒感染的肺炎病例2714例（其中武汉市1590例、黄石市53例、十堰市65例、襄阳市70例、宜昌市51例、荆州市71例、荆门市114例、鄂州市57例、孝感市173例、黄冈市213例、咸宁市91例、随州市70例、恩施州38例、仙桃市27例、天门市23例、潜江7例，神农架林区首发1例），已治愈出院47例，死亡100例(其中武汉市85例,黄石市1例、宜昌市1例、荆州市2例、荆门市3例、孝感1例、黄冈市4例、天门2例，潜江1例)。目前仍在院治疗2567例，其中重症563例、危重症127例，均在定点医疗机构接受隔离治疗。累计追踪密切接触者16904人，尚在接受医学观察15559人。','2020-02-11','ck6hgxcea00rzs27c4dpk3yoe','央视新闻','湖北省','2020-01-28','https://weibo.com/2656274875/IrxlWy3Io?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1580172818677','','湖北新增1291例确诊病例，累计确诊病例增至2714例','2020-02-11'),('1月27日0-24时，江苏省报告新型冠状病毒感染的肺炎新增确诊病例23例。其中9个设区市新增确诊病例中，南京市3例、无锡市2例、徐州市5例、常州市2例、苏州市4例、南通市2例、扬州市1例、泰州市2例、宿迁市2例。\n新增确诊病例中，9例有武汉居住史，12例有湖北旅行史。年龄最大的77岁，最小的19岁。女性9人，男性14人。均已在定点医院救治，病情稳定。已追踪到密切接触者149人，均在接受隔离医学观察。\n截至1月27日24时，江苏省累计报告新型冠状病毒感染的肺炎确诊病例70例，重症病例1例，出院病例1例。确诊病例中，南京市10例、无锡市6例、徐州市8例、常州市8例、苏州市12例、南通市6例、连云港市3例、淮安市2例、盐城市1例、扬州市5例、镇江市2例、泰州市4例、宿迁市3例；重症病例中，镇江市1例；出院病例中， 苏州市1例。\n目前，江苏省追踪到密切接触者1044人，已解除医学观察42人，尚有1002人正在接受医学观察。','2020-02-11','ck6hgxcea00s0s27cb3nvf867','央视新闻','江苏省','2020-01-28','https://weibo.com/2656274875/IrxiMoviY?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1580172403585','','江苏新增23例，累计确诊70例','2020-02-11'),('1月27日0—24时，贵州省新型冠状病毒感染的肺炎新增2例确诊病例，系1月26日报告的2例疑似病例。其中瓮安县1例，患者腾某某，男，24岁。三都县1例，患者荣某某，男，47岁。2例患者发病前均有武汉居住史，目前均在定点医疗机构接受隔离治疗，病情平稳。\n截至27日24时，全省累计报告新型冠状病毒感染的肺炎病例9例（重症1例）。其中，贵阳市1例，六盘水市1例，铜仁市2例，黔南州4例，黔西南州1例。疑似病例1例（贵阳市修文县）。\n目前，追踪到密切接触者185人，其中1人已确认为确诊病例，已解除医学观察2人，尚在接受医学观察182人。','2020-02-11','ck6hgxcea00s1s27c2f463j62','央视新闻','贵州省','2020-01-28','https://weibo.com/2656274875/Irxh59BD3?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1580172324211','','贵州新增2例，累计确诊9例','2020-02-11'),('2020年1月27日12—24时，山东省报告新型冠状病毒感染的肺炎新增确诊病例12例，其中：泰安市东平县首次报告1例确诊病例；济南市市中区新增确诊病例3例，德州市新增确诊病例2例（宁津县、乐陵县各1例），聊城市新增确诊病例2例（东昌府区、莘县各1例），威海市环翠区新增确诊病例1例，日照市东港区新增确诊病例1例，临沂市河东区新增确诊病例1例，滨州市惠民县新增确诊病例1例。\n目前追踪到密切接触者2110人，已解除医学观察11人，诊断为疑似或确诊6例，尚有2093人正在接受医学观察。备注：按报告病例就诊医疗机构所在地划分区县。\n','2020-02-11','ck6hgxcea00s2s27c68r3esaj','人民日报','山东省','2020-01-28','http://m.weibo.cn/2803301701/4465626753933206','','山东新增确诊12例，山东累计确诊87例','2020-02-11'),('上海市新增新型冠状病毒感染的肺炎确诊病例13例。\n截至1月27日24时，上海市累计发现确诊病例66例，其中，男性35例，女性31例；年龄最大88岁，最小7岁。\n累计确诊病例中，27例有湖北居住史、23例有湖北旅行史、16例有相关确诊病例接触史；外地来沪人员33例，本市常住人口33例。\n目前，60例病情平稳，2例病情危重，3例出院，1例死亡。已累计排除75例疑似病例，尚有129例疑似病例正在排查中。','2020-02-11','ck6hgxcea00s3s27ch7da7qf9','央视新闻','上海市','2020-01-28','https://weibo.com/2656274875/Irx4QDsyL?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1580170424702','','上海新增13例，累计确诊66例','2020-02-11'),('2020年1月27日0-24时，河南省12市（县）新型冠状病毒感染的肺炎新增确诊病例40例，新增重症病例11例、危重2例。其中：\n焦作市为报告首例确诊病例，确诊2例。其他地市新增确诊病例中，郑州市8例、开封市1例、安阳市4例、新乡市2例、许昌市1例、漯河市3例、南阳市7例、商丘市1例、周口市4例、信阳市6例、驻马店市1例。','2020-02-11','ck6hgxcea00s4s27cgbel50r2','人民日报','河南省','2020-01-28','https://weibo.com/2803301701/Irx8K6f6P?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1580170855070','','河南新增确诊40例，河南累计确诊168例','2020-02-11'),('1月27日0-24时，广西省共新增新型冠状病毒感染的肺炎确诊病例5例，其中北海2例、梧州2例、桂林1例。\n目前全区累计报告确诊病例51例，涉及9个市，其中南宁市5例、柳州市6例、桂林市15例、梧州市4例、北海市11例、防城港市3例、玉林市2例、百色市2例、河池市3例。全部病例在定点医院隔离治疗，现有重症病例5例（防城港1例，桂林2例，柳州2例），无医务人员感染病例。目前累计追踪到密切接触者492人，正在接受医学观察455人，解除观察26人，转为疑似病例或确诊病例11人。','2020-02-11','ck6hgxcea00s5s27c7y5y8ljm','人民日报','广西壮族自治区','2020-01-28','https://weibo.com/2803301701/Irx7clKcR?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1580170764217','','广西新增确诊5例，广西累计确诊51例','2020-02-11'),('天津将启动战时机制成立疫情医疗救治总医院。该院将由市卫生健康委主要负责人任院长，47家发热门诊定点及相关机构负责人任分院院长，以病区为单位建立500个战斗方阵，组建500个医护战斗小队，实行军事化管理。','2020-02-11','ck6hgxcea00s7s27c39e8c9qp','央视新闻','天津市','2020-01-28','https://weibo.com/2656274875/Irx3ebmT1?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1580170063326','','天津成立疫情医疗救治总医院','2020-02-11'),('1月27日上午，西藏自治区党委召开常委会会议，启动重大突发公共卫生事件Ⅱ级响应。\n为有效切断西藏病毒传播途径，西藏自治区将强化对客运站、机场、火车站等重点场所及汽车、火车、飞机等密闭交通工具通风、消毒、体温检测等措施，对疑似病例和密切接触者一律按医学要求进行隔离和检查，对其他包括旅游者等进藏人员一律逐一登记并在指定场所进行14天隔离观察。\n根据林芝市发布的相关规定，进藏人员14天留置医学观察期间，产生的食宿费用自理。','2020-02-11','ck6hgxcea00s8s27chmrs0xut','人民日报','西藏自治区','2020-01-27','https://weibo.com/2803301701/IrwWsxvPt?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1580169083575','','进藏者一律定点隔离观察14天','2020-02-11'),('民航局要求，在2020年1月28日0时前已购买机票、且乘机日期在此时限之后的民航旅客，如在航班起飞前提出退票申请，各航空公司及其客票销售代理应在客票有效期内为旅客办理免费退票，不得收取任何费用。此要求自2020年1月28日0时起执行。','2020-02-11','ck6hgxcea00s9s27cbu0o2sxu','人民日报','全国','2020-01-27','https://weibo.com/2803301701/IrwU29keE?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1580168803688','','1月28日前买的机票免费退','2020-02-11'),('中国疾控中心副主任冯子健表示，每个人年龄的原因，可能导致他的接触暴露机会不同，感染发生的人数就会不一样，发病率就会不一样。现在也看到整个不同年龄组都有发病的，证明新型冠状病毒对所有年龄组都易感。不过，孩子患病症状似乎比成人要轻，还没有发现孩子的病例中发展成非常严重的疾病。','2020-02-11','ck6hgxcea00sas27cffugdkhj','央视新闻','全国','2020-01-27','https://weibo.com/2656274875/IrwNJuXfZ?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment','','新型冠状病毒对所有年龄组都易感','2020-02-11'),('今晚23点左右，一名36岁男性治愈患者被允许出院。据介绍，今晚出院的两人均是深圳唯一一起家庭聚集性疫情中的患者。该家庭共有5人确诊新型冠状病毒感染，目前已有3人出院。','2020-02-11','ck6hgxcea00sbs27cckpzd2st','央视新闻','广东省','2020-01-27','https://m.weibo.cn/status/4465489395315367?','','深圳第4例确诊病例治愈出院','2020-02-11'),('据河南南阳市卫健委：河南首例新型冠状病毒感染的肺炎死者常某，男，79岁，唐河县人，长期武汉居住史。1月22日因咳嗽、气喘入院治疗，入院诊断社区获得性重症肺炎、脓毒血症、Ⅰ型呼吸衰竭，1月25日23：05抢救无效死亡。患者有慢性支气管炎、营养不良基础疾病。死亡诊断：社区获得性重症肺炎（细菌及新型冠状病毒感染）、脓毒血症、Ⅰ型呼吸衰竭。患者既往有慢性气管炎、营养不良基础病。','2020-02-11','ck6hgxcea00scs27cc3mda3n4','央视新闻','河南省','2020-01-27','http://m.weibo.cn/2656274875/4465597486027510','','河南首例死亡病例病情披露','2020-02-11'),('2020年1月27日0时至24时，山西省报告新型冠状病毒感染的肺炎新增确诊病例7例，新增重症病例2例。新增确诊的病例中，晋中市3例、吕梁市2例、太原市和运城市各1例；新增重症病例中，晋中市1例，吕梁市1例。\n截至1月27日24时，山西省9个市累计报告新型冠状病毒感染的肺炎确诊病例20例，重症病例2例。其中晋中市5例、运城市3例、太原市3例、吕梁市3例、朔州市2例、大同市1例、长治市1例、阳泉市1例、临汾市1例；重症病例中，晋中市1例，吕梁市1例。','2020-02-11','ck6hgxcea00sds27capyhf2jz','山西省卫生健康委员会','山西省','2020-01-27','http://wjw.shanxi.gov.cn/wjywl02/24363.hrh','','山西新增确诊病例7例','2020-02-11'),('1月27日0-24时，江西省报告新型冠状病毒感染的肺炎新增确诊病例24例，治愈出院病例2例。\n新增确诊病例中，南昌市9例、九江市5例、宜春市4例、赣州市3例、鹰潭市1例、上饶市1例、抚州市1例，鹰潭市为报告首例确诊病例。出院病例中，吉安市1例，萍乡市1例。','2020-02-11','ck6hgxcea00sfs27che5i2auv','央视新闻','江西省','2020-01-27','http://m.weibo.cn/2656274875/4465590205326565','','江西确诊病例增至72例','2020-02-11'),('新加坡卫生部当地时间1月27日晚11时发布公告称，新加坡出现第五起境外输入的新型冠状病毒肺炎确诊病例。该病例是一名56岁女性武汉居民，目前在新加坡国家传染病中心接受隔离治疗，情况稳定。\n据介绍，这名女子在本月18日同家人抵达新加坡，在赴新加坡的班机上并没有出现症状。她是在24日开始出现症状，并在26日被救护车送往陈笃生医院，27日被确诊感染新型冠状病毒肺炎。','2020-02-11','ck6hgxcea00sgs27c6igy4ptt','人民日报','','2020-01-27','http://m.weibo.cn/2803301701/4465588002643765','','新加坡确诊第5起病例','2020-02-11'),('27日，据泰国当地媒体报道，泰国曼谷一家医院成功分离新型冠状病毒肺炎毒株。据27日下午泰国卫生部门消息，泰国确诊8例新型冠状病毒感染的肺炎病例，是中国之外确诊病例最多的国家。目前，泰国已有5名患者治愈出院，另外3人正在接受隔离治疗，恢复情况较好。（总台央视记者陈林聪）','2020-02-11','ck6hgxcea00shs27c04ofbqji','央视新闻','','2020-01-27','http://m.weibo.cn/2656274875/4465504855267671','','泰国成功分离新型冠状病毒肺炎毒株','2020-02-11'),('记者从天津市疾控中心获悉，至1月27日22时23分，天津市新增1例新型冠状病毒感染的肺炎确诊病例，确诊病例增至23例。第23例患者陆某某，男，29岁，居住在河东区，近年在武汉工作，1月21日返回天津。目前其已转至海河医院治疗，生命体征平稳。（总台央视记者丁旭）','2020-02-11','ck6hgxcea00sis27c12nx9jnt','央视新闻','天津市','2020-01-27','http://m.weibo.cn/2656274875/4465497913299541','','天津确诊病例累计增至23例','2020-02-11'),('当地时间26日晚，厄瓜多尔卫生部发表声明称，厄瓜多尔发现一例新型冠状病毒感染的肺炎疑似病例，目前，相关部门正在展开研究进行确诊。\n患者为中国公民，今年49岁，长住福建省福清市，本月21日从香港飞往厄瓜多尔基多。患者在刚抵达基多时并未出现呼吸系统疾病症状，几天后开始出现发烧、咳嗽、多痰以及严重的肾脏和呼吸衰竭等症状。经检查，当地医生确定这是新型冠状病毒感染的肺炎疑似病例。目前，患者已被隔离至私人病房继续接受观察和治疗。（总台央视记者侯佳琦）','2020-02-11','ck6hgxceb00sjs27cghae5urn','央视新闻','','2020-01-27','http://m.weibo.cn/2656274875/4465497816679459','','厄瓜多尔出现首例疑似病例','2020-02-11'),('1月27日9时至20时，本市新增8例新型冠状病毒感染的肺炎病例，死亡1例；1月27日9时至20时，本市新增8例新型冠状病毒感染的肺炎病例，其中1例为此前确诊病例的密切接触者，已送至市级定点医疗机构进行救治。死亡1例，男，50岁，1月8日前往武汉，15日返京后出现发热症状，21日到医院就诊，22日确诊，今日病情恶化，因呼吸功能衰竭，经抢救无效死亡。截至1月27日20时，本市累计确诊病例80例，其中出院2例，病情平稳63例，重症12例，危重症2例，死亡1例。东城区2例、西城区7例、朝阳区17例、海淀区17例、丰台区4例、石景山区2例、通州区7例、顺义区1例、大兴区5例、昌平区7例，外地来京人员11例。','2020-02-11','ck6hgxceb00sks27c7cegdqj7','人民日报','北京市','2020-01-27','http://m.weibo.cn/2803301701/4465486845009579','','北京确诊病例增至80例，死亡1例','2020-02-11'),('人民日报社记者刘晓宇从福建省卫健委获悉，1月27日8时—1月27日15时，我省报告新增新型冠状病毒感染的肺炎确诊病例3例（2例为输入性病例，1例为武汉输入病例家属）。其中：福州市1例（福清市1例）；漳州市1例（云霄县1例）；\n莆田市1例（城厢区1例）。报告新增新型冠状病毒感染的肺炎疑似病例7例。其中：漳州市1例（东山县1例）；泉州市2例（丰泽区1例、安溪县1例）；三明市3例（沙县1例、明溪县1例、永安市1例）；南平市1例（邵武市1例）。','2020-02-11','ck6hgxceb00sls27c1apr7y7j','人民日报','福建省','2020-01-27','http://m.weibo.cn/2803301701/4465485791675678','','福建新增3例确诊病例，累计确诊59例','2020-02-11'),('医护人员冲在疫情防控阻击战的第一线，他们最需要充足的防护装备！@人民日报 @微公益 联合社会各界等共建“求助信息核实平台”，汇总部分医疗机构紧缺物资的种类、数量以及捐助方式。最近24小时核实的部分医院信息请见微博配图。','2020-02-11','ck6hgxceb00sms27c4s4qgns5','人民日报','全国','2020-01-27','http://m.weibo.cn/2803301701/4465473456373194','','医院物资求助清单汇总','2020-02-11'),('27日，西藏自治区党委召开常委会会议，决定成立由区党委书记和自治区主席任组长的自治区应对新型冠状病毒感染肺炎疫情工作领导小组。自即日起，全区启动重大突发公共卫生事件Ⅱ级响应。截至目前，西藏自治区尚未发现新型冠状病毒感染肺炎病例。#西藏保持零感染#','2020-02-11','ck6hgxceb00sns27cby6ta13a','人民日报','西藏自治区','2020-01-27','http://m.weibo.cn/2803301701/4465469316652366','','西藏启动二级响应','2020-02-11'),('人民日报记者贾丰丰从青海省疾控中心获悉，1月27日，青海省确认新增2例新型冠状病毒感染的肺炎确诊病例。患者马某某，男性，15岁，患者祁某某，男性，30岁，2名疑似病例，病例样本经疾病预防控制中心实验室复核检测，呈新型冠状病毒核酸阳性。','2020-02-11','ck6hgxceb00sos27c4j0ufutn','人民日报','青海省','2020-01-27','http://m.weibo.cn/2803301701/4465470604762184','','青海新增确诊2例，累计确诊6例','2020-02-11'),('27日晚，湖北省人民政府新闻办公室举行布会。湖北省副省长杨云彦指出，湖北在加快调配床位和定点医院建设，全省确定112家定点医院医疗机构，收治新型冠状病毒感染的肺炎患者，开放床位近10万张，武汉市第一批征用了7家定点医院，设置床位3000多张，下一步将分批动员24家医疗机构，逐步腾退床位来救治疑似确诊病例。','2020-02-11','ck6hgxceb00sps27c58hq3rv7','人民日报','湖北省','2020-01-27','http://m.weibo.cn/2803301701/4465462333025562','','湖北开设床位10万张','2020-02-11'),('头痛、流鼻涕、咳嗽、喉咙痛怎么办？如何判断是否发热？如何区分感冒流感和新型冠状病毒肺炎？一图了解！ ​','2020-02-11','ck6hgxceb00sqs27cg6u3918s','人民日报','全国','2020-01-27','http://m.weibo.cn/2803301701/4465457241243436','','有用！如何区分感冒流感和新型肺炎','2020-02-11'),('今天，湖北省召开新型冠状病毒感染的肺炎疫情防控工作例行新闻发布会。湖北省委副书记、武汉市委书记马国强，省政府副省长杨云彦，湖北省医疗救治组专家、湖北省人民医院呼吸科教授胡克，通报全省疫情和防控工作最新进展情况。','2020-02-11','ck6hgxceb00srs27c4yuqf7er','央视新闻','湖北省','2020-01-27','http://m.weibo.cn/2656274875/4465451314878981','','直播！湖北通报疫情和防控工作最新情况','2020-02-11'),('今晚，深圳又有一例确诊的新型冠状病毒感染的肺炎患者治愈出院。据介绍，出院的是一名60多岁女子，这名治愈患者的出院流程严格按照省、市专家组会诊后达到出院标准。此前，深圳已有两例确诊的患者治愈出院。','2020-02-11','ck6hgxceb00sss27c44on30ol','央视新闻','广东省','2020-01-27','http://m.weibo.cn/2656274875/4465448844218844','','深圳又一例确诊病例治愈出院','2020-02-11'),('当地时间1月27日，柬埔寨西哈努克港确诊一例新型冠状病毒肺炎病例。据悉该名确诊个案为中国公民，来自湖北武汉。','2020-02-11','ck6hgxceb00sts27chi8a9ujf','央视新闻','','2020-01-27','http://m.weibo.cn/2656274875/4465448013594831','','柬埔寨发现首例确诊病例','2020-02-11'),('至1月27日16时，天津新增4例新型冠状病毒感染的肺炎确诊病例，确诊病例增至22例。截至目前，天津累计发现新型冠状病毒感染的肺炎病例22例，其中男性17例，女性5例；重症17例，轻症5例；无危重及死亡病例。追踪到密切接触者185例，其中已确诊5人，已解除医学观察2人，尚有178人正在接受医学观察。','2020-02-11','ck6hgxceb00sus27c2m823oyw','人民日报','天津市','2020-01-27','http://m.weibo.cn/2803301701/4465444000015374','','天津新增确诊4例，天津确诊病例增至22例','2020-02-11'),('疫情面前如何保护自己？使用过的口罩怎样处理？近日，@央视新闻 联合国家卫健委宣传司推出系列宣传片，向网友和观众普及新型冠状病毒感染的肺炎防范知识。截至目前，公益短片共登陆全国50座城市的近40万块数字屏，不仅在各大机场、车站等循环播放，还覆盖到北京、上海等地的商圈、社区、企业和高校。','2020-02-11','ck6hgxceb00svs27caf5lc7t7','央视新闻','全国','2020-01-27','http://m.weibo.cn/2656274875/4465441151494916','','央视疫情防控宣传片登陆全国50城','2020-02-11'),('27日，国家医保局全面开展疫情防控再动员、再部署，强调会同财政部将此前针对确诊病人建立的综合保障政策覆盖范围扩大到卫生健康委诊疗指南明确的疑似病人，免除疑似病人个人负担。据了解，国家医保局结合全国特别是湖北武汉等地疫情防控形势，全面梳理工作进展，进一步研究加强患者医疗救治费用保障工作，抓实抓细，确保患者决不因费用问题耽误救治。','2020-02-11','ck6hgxceb00sws27c1rmfhs2s','北京青年报','全国','2020-01-27','https://weibo.com/1749990115/IrrYGhWzr?refer_flag=1001030103_&type=comment#_rnd1580124677483','','国家医保局：免除个人负担政策扩大至疑似病人','2020-02-11'),('2020年1月27日0时至12时，广东省报告新型冠状病毒感染的肺炎新增确诊病例5例。其中广州市2例、梅州市2例、中山市1例。截至1月27日12时，广东省累计报告新型冠状病毒感染的肺炎确诊病例151例。确诊病例中，广州41例、深圳36例、珠海12例、汕头2例、佛山14例、韶关4例、梅州3例、惠州8例、汕尾1例、东莞2例、中山5例、阳江8例、湛江5例、肇庆4例、清远3例、揭阳3例。','2020-02-11','ck6hgxceb00sxs27ccts2cf22','人民日报','广东省','2020-01-27','http://m.weibo.cn/2803301701/4465422256175032','','广东累计确诊151例，广东新增确诊病例5例','2020-02-11'),('据云南省卫健委：截至今天12时，云南省累计报告新型冠状病毒感染的肺炎确诊病例26例，均为输入病例，重症1例，无死亡病例。其中，昆明市7例、丽江市5例、德宏州2例、保山市3例、曲靖市2例、玉溪市1例、红河州2例、西双版纳州1例、大理州2例、昭通市1例。报告疑似病例90例。密切接触者医学观察496人。','2020-02-11','ck6hgxceb00sys27c5jmo8bcf','央视新闻','云南省','2020-01-27','http://m.weibo.cn/2656274875/4465410885615269','','云南确诊病例增至26例， 疑似病例90例','2020-02-11'),('据海南省卫健委消息：今天7:00至16:00，海南省新型冠状病毒感染的肺炎新增确诊病例2例，新增重症病例1例，新增死亡病例0例，新增出院病例0例。确诊病例中，三亚市1例、儋州市1例。','2020-02-11','ck6hgxceb00szs27cdwgq8ytw','央视新闻','海南省','2020-01-27','http://m.weibo.cn/2656274875/4465409988082704','','海南省新增确诊病例2例，累计确诊33例','2020-02-11'),('截至今天15时30分，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例27例，重症病例14例。其中确诊病例中，沈阳市7例、大连市5例、本溪市2例、丹东市4例、营口市1例、铁岭市2例、朝阳市2例、盘锦市2例、葫芦岛市2例。','2020-02-11','ck6hgxceb00t0s27c30nc14mr','央视新闻','辽宁省','2020-01-27','http://m.weibo.cn/2656274875/4465408105232482','','辽宁累计确诊27例病例','2020-02-11'),('世卫组织总干事谭德塞博士与西太平洋区域主任葛西健博士已于今日抵达北京，将与中国政府当局及卫生专家会面。谭德塞博士表示，他希望能够了解疫情的最新进展，并加强与中国的合作，以继续为此次疫情提供支持和防护。','2020-02-11','ck6hgxceb00t1s27cg7601d1o','世卫组织','北京市','2020-01-27','https://dxy.me/6sO3aK','','世卫组织总干事和区域主任今日抵京考察新型冠状病毒疫情最新进展','2020-02-11'),('据山东省药监局：山东艾克韦生物技术有限公司研发的2019新型冠状病毒核酸检测试剂盒，已于今天9点完成所有项目检验，产品符合技术要求，成为山东省法定检验机构检定合格的首个新型冠状病毒检测产品。在获得国家药监局的上市批件后，这种试剂盒将被发往各地医院，用于测定疑似患者的样本中是否有新型冠状病毒。','2020-02-11','ck6hgxceb00t2s27c65io504j','央视新闻','山东省','2020-01-27','https://weibo.com/2656274875/IrrjfzKyF?ref=home&rid=0_0_202_2606539046958183775_0_0_0','','山东首个新型冠状病毒检测产品通过检测！获上市批件后将发往各医院','2020-02-11'),('湖北民政厅27日发布公告称，鉴于目前严峻疫情，决定在全省范围内取消2月2日办理婚姻登记事宜。受新型肺炎疫情影响，上海、安徽、浙江、广东、江苏、山东、陕西、河北、重庆、福建、四川、海南等省市多地民政部门取消2月2日婚姻登记','2020-02-11','ck6hgxcec00t3s27c5yss4i81','人民日报','湖北省','2020-01-27','http://m.weibo.cn/2803301701/4465396058716071','','湖北取消2月2日办理婚姻登记','2020-02-11'),('为遏制武汉新型冠状病毒感染肺炎疫情蔓延扩散，河南郑州将在原郑州市第一人民医院港区医院老院区的基础上进行改造，建设隔离病房，建设内容包括现有门诊楼改造以及新建病区等。项目总体工期为10天，即自今天开工，至2月5日完工交付投入使用。','2020-02-11','ck6hgxcec00t4s27ch6ur0r7t','央视新闻','河南省','2020-01-27','http://m.weibo.cn/2656274875/4465395647403284','','郑州新型冠状病毒隔离病房开建，2月5日完工交付投入使用','2020-02-11'),('1月26日22时30分，记者从荆州市胸科医院获悉：荆州市首例新型肺炎（重症）患者王某，经专家组科学指导，医护人员精心诊治和护理，病情逐渐好转，体温正常，连续两次检测新型冠状病毒核酸阴性。经专家组评估，符合国家卫生健康委最新的新型肺炎确诊病例解除隔离和出院标准。','2020-02-11','ck6hgxcec00t5s27cfye0dh5v','荆州发布','湖北省','2020-01-26','https://m.weibo.cn/detail/4465136603329842','','荆州首例新型肺炎患者治愈','2020-02-11'),('27日下午，合肥市举行新闻发布会披露，截至1月26日24时合肥累计报告新型冠状病毒感染的肺炎确诊病例13例，无危重症和死亡病例，无出院病例，均在市级以上定点医院集中救治。13例确诊病例中，按病例来源分布，输入性10例，本地3例，以输入性为主；按居住地分布，本市9例（肥东3例，瑶海和高新区各2例，包河和庐江各1例），外市4例（马鞍山1例，武汉3例），以本市籍贯为主；','2020-02-11','ck6hgxcec00t6s27cgka7e09z','人民日报','安徽省','2020-01-27','http://m.weibo.cn/2803301701/4465394838640551','','合肥公布13例确诊病例信息','2020-02-11'),('27日，山东省人民政府新闻发布会：为严密防控新型冠状病毒引发的肺炎疫情进一步蔓延，山东省宣布叫停与野生动物相关一切交易和展演活动。下令加强野生动物与活禽交易管理。其中野生动物一律禁止交易，一律禁止进入市场；对于野生动物园、人工繁育场所加强疾病监测，暂停其中的野生动物出售、购买和展演活动，对其中的野生动物立即实施封控隔离措施。','2020-02-11','ck6hgxcec00t7s27c2s4z6x58','人民日报','山东省','2020-01-27','http://m.weibo.cn/2803301701/4465392158712523','','山东叫停野生动物交易展演','2020-02-11'),('今天举行的广东省新型冠状病毒感染的肺炎疫情联防联控发布会上，广东省副省长张光军表示，广东各地不会“封城”，但为了大家的健康，广东省在一些地方设置了检疫防疫站点，依法开展健康监测管理，公共交通工具要定期开展消毒，会降低一些通行效率，请大家理解配合。','2020-02-11','ck6hgxcec00t8s27c15am8n7q','央视新闻','广东省','2020-01-27','http://m.weibo.cn/2656274875/4465386869412728','','广东省副省长：广东各地不会封城','2020-02-11'),('台湾“流行疫情指挥中心”公布，新型冠状病毒感染的肺炎确诊病例今天(27日)又增加一例。台湾目前累计共5个确诊病例。新增一例为中部地区50多岁女性，去年10月下旬在大陆武汉工作，没有华南海鲜市场接触史。','2020-02-11','ck6hgxcec00t9s27cf4vdfs37','台湾卫生福利部','台湾','2020-01-27','https://www.cdc.gov.tw/Bulletin/Detail/gOZvd4ZaGpSDVoVRC2Qesg?typeid=9','','台湾中央流行疫情指挥中心公布确诊第5例确诊病例','2020-02-11'),('记者27日从山东省政府新闻办举行的全省新型冠状病毒感染的肺炎疫情防控工作新闻发布会上获悉，山东省首例确诊病例已经临床治愈，第一次核酸检测呈阴性、28日复查再次阴性后即可出院。','2020-02-11','ck6hgxcec00tas27c0h7t4krj','人民日报','山东省','2020-01-27','http://m.weibo.cn/2803301701/4465385308652598','','山东首例确诊病例已临床治愈','2020-02-11'),('1月26日，黄冈市卫健委发布疫情数据，两名新型冠状病毒感染的肺炎患者治愈出院。记者了解到，他们一人是黄冈市中心医院神经内二科28岁护士董春风，一人是黄冈51岁女市民贾晓红。','2020-02-11','ck6hgxcec00tbs27cet3b3ena','人民日报','湖北省','2020-01-27','http://m.weibo.cn/2803301701/4465382079294013','','好消息！黄冈两人治愈出院：其中一人是护士','2020-02-11'),('日前人社部党组召开专题会议，研究部署应对新型冠状病毒感染的肺炎疫情防控工作。提出，人社部门要充分发挥职能作用，做好因履行工作职责感染病毒的医护及相关工作人员有关保障工作，落实疫情防治人员临时性工作补助政策。密切监测研判就业形势特别是农民工就业情况，指导重点地区及时采取应对措施。稳妥做好技工院校学生返校开学和校园防控工作，妥善处理好疫情防控期间劳动关系等有关问题。','2020-02-11','ck6hgxcec00tcs27cdj45fdfe','人民日报','全国','2020-01-27','http://m.weibo.cn/2803301701/4465378522551723','','人社部要求落实疫情防治人员临时工作补助政策','2020-02-11'),('上海2例新型冠状病毒感染肺炎患者痊愈出院，这2例确诊患者是一对夫妻。据悉，这2例确诊患者来自湖北武汉，其中，姚某某，男，56岁，长期居住武汉，1月18日抵沪就诊后被确认为新型冠状病毒感染的肺炎确诊病例，入住上海市公共卫生临床中心。上海市对他进行流行病学调查和密切接触排摸中发现其妻李某某，女，58岁，有咳嗽症状，随即安排就诊，也确认为新型冠状病毒感染的肺炎确诊病例。经治疗，两人两次核酸检测呈阴性。','2020-02-11','ck6hgxcec00tds27c2kincntp','央视新闻','上海市','2020-01-27','http://m.weibo.cn/2656274875/4465365259930636','','上海2例确诊患者治愈出院','2020-02-11'),('26日21时至27日9时，北京市新增4例新型冠状病毒感染的肺炎病例，目前均已送至定点医疗机构进行救治。截至1月27日9时，北京截至1月27日9时，北京累计确诊病例72例，其中东城区1例、西城区7例、朝阳区11例、海淀区17例、丰台区4例、石景山区2例、通州区6例、顺义区1例、大兴区5例、昌平区7例，外地来京人员11例。','2020-02-11','ck6hgxcec00tfs27c24j58qsw','央视新闻','北京市','2020-01-27','http://m.weibo.cn/2656274875/4465361728673224','','北京新增4例确诊病例，其中包括一名4岁女童','2020-02-11'),('1 月 27 日 0～12 时，山东省报告新型冠状病毒感染的肺炎新增确诊病例 12 例，其中：枣庄市 2 例，为首次报告确诊病例；烟台市新增 4 例确诊病例、青岛市新增 3 例确诊病例、威海市新增 2 例确诊病例、菏泽市新增 1 例确诊病例。','2020-02-11','ck6hgxcec00ths27c5do4cauh','山东省卫健委','山东省','2020-01-27','http://wsjkw.shandong.gov.cn/ztzl/rdzt/qlzhfkgz/yqtb/202001/t20200127_2511989.html','','山东新增确诊病例 12 例，累计 75 例','2020-02-11'),('截至 1 月 27 日 8 时，福建省累计报告新型冠状病毒感染的肺炎确诊病例 56 例（危重症 1 例、重症 3 例，无死亡病例），均为输入性病例。','2020-02-11','ck6hgxcec00tis27c5rbt2peq','福建省委建委','福建省','2020-01-27','http://wjw.fujian.gov.cn/xxgk/gzdt/wsjsyw/202001/t20200127_5186532.htm','','福建新增确诊病例 21 例，累计 56 例','2020-02-11'),('2020 年 1 月 27 日 9 时至 11 时，辽宁省大连市新增 1 例新型冠状病毒感染的肺炎确诊病例，为武汉输入病例家属，该病例属重症病例。 截至 2020 年 1 月 27 日 11 时，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例 24 例，重症病例 14 例。','2020-02-11','ck6hgxcec00tjs27cghhw2y9j','辽宁省卫健委','辽宁省','2020-01-27','http://wsjk.ln.gov.cn/wst_zdzt/xxgzbd/yqtb/202001/t20200127_3729480.html','','辽宁新增 1 例确诊病例，累计 24 例','2020-02-11'),('1 月 26 日 0～24 时，宁夏新增 3 例确诊病例；截至 1 月 26 日 24 时，全区累计报告确诊病例 7 例，疑似病例 0 例，密切接触者 306 例，均居家隔离医学观察，未发现异常。','2020-02-11','ck6hgxcec00tks27c8uhuakpl','宁夏卫健委','宁夏回族自治区','2020-01-27','http://wsjkw.nx.gov.cn/info/1140/13291.htm','','宁夏新增 3 例确诊病例，累计 7 例','2020-02-11'),('26 日 16 时～27 日 7 时，海南省新型冠状病毒感染的肺炎新增确诊病例 9 例，重症病例 3 例，死亡病例 1 例，无出院病例。截至 1 月 27 日 7:00，海南省累计报告新型冠状病毒感染的肺炎确诊病例 31 例，重症病例 4 例，死亡病例 1 例，无出院病例。','2020-02-11','ck6hgxcec00tls27c5f7ncdio','央视新闻','海南省','2020-01-27','http://m.weibo.cn/2656274875/4465320406505044','','海南新增确诊病例 9 例，累计 31 例，死亡  1 例','2020-02-11'),('截至 1 月 27 日早 6 时，天津市新增 3 例新型冠状病毒感染的肺炎确诊病例，确诊病例增至 17 例。','2020-02-11','ck6hgxcec00tms27c18im22ro','央视新闻','天津市','2020-01-27','http://m.weibo.cn/2656274875/4465317616829488','','天津新增 3 例新型肺炎确诊病例，累计 17 例','2020-02-11'),('今天，山东省人民政府新闻办公室在济南召开发布会，通报山东省新型冠状病毒感染的肺炎疫情防治工作相关情况。山东省卫健委负责人介绍，1 例重症病例经规范治疗已经转为轻症病例，确诊病例全部处于轻症病例状态，首例确诊病例已经临床治愈。','2020-02-11','ck6hgxcec00tns27c6lqxg5f3','央视新闻','山东省','2020-01-27','http://m.weibo.cn/2656274875/4465313876246432','','山东首例确诊病例已临床治愈，明日再次复查','2020-02-11'),('27 日，经医护人员精心诊治和护理，南昌大学第一附属医院接诊的一例新型冠状病毒感染肺炎患者救治情况良好，符合出院标准，于今日出院。据悉，该患者为男性，38 岁，江西新干人。','2020-02-11','ck6hgxced00tps27cd23caf6f','人民日报','江西省','2020-01-27','http://m.weibo.cn/2803301701/4465313322604123','','江西首例治愈患者出院','2020-02-11'),('今天，青岛市政府新闻办召开疫情防控工作新闻发布会，通报：截至 1 月 26 日 24 时，青岛市共确诊新型冠状病毒感染的肺炎病例 10 例，其中男性 7 例，女性 3 例。年龄最大 67 岁，最小 24 岁，均在定点医院隔离治疗。','2020-02-11','ck6hgxced00tqs27c54tsdtlr','央视新闻','山东省','2020-01-27','http://m.weibo.cn/2656274875/4465308326464250','','青岛出现首起家庭聚集性病例','2020-02-11'),('1 月 27 日 0～9 时，辽宁省沈阳市新增 1 例输入性新型冠状病毒感染的肺炎确诊病例，该病例属重症病例。截至 1 月 27 日 9 时，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例 23 例，重症病例 13 例。','2020-02-11','ck6hgxced00trs27cfpvu8v20','央视新闻','辽宁省','2020-01-27','http://m.weibo.cn/2656274875/4465296943581420','','辽宁累计确诊病例增至 23 例','2020-02-11'),('据韩国媒体 27 日报道，韩国出现第四例新型冠状病毒肺炎确诊病例。此前韩国疾病管理本部分别于本月 20 日、24 日和 26 日通报了三起新型冠状病毒确诊病例。','2020-02-11','ck6hgxced00tss27c00vz5vi1','央视新闻','','2020-01-27','http://m.weibo.cn/2656274875/4465295172850087','','韩国出现第 4 例确诊病例','2020-02-11'),('香港卫生防护中心 27 日宣布，香港确诊一例输入型新型冠状病毒感染病例，累计病例增至 8 例。 ​','2020-02-11','ck6hgxced00tts27c86c70o3c','人民日报','香港','2020-01-27','http://m.weibo.cn/2803301701/4465287065633613','','香港累计确诊 8 例新型肺炎病例','2020-02-11'),('1月27日上午，福建首批医疗队驰援武汉！这是1月25日晚国家卫健委要求福建省组派医疗队援助湖北应对新型冠状病毒感染的肺炎疫情之后，短短24小时内即组建而成的医疗“精锐部队”。','2020-02-11','ck6hgxced00tus27cco3k38fn','人民日报','福建省','2020-01-27','http://m.weibo.cn/2803301701/4465290111134710','','福建 135 人医疗队驰援武汉','2020-02-11'),('1月26日，按照《新型冠状病毒感染的肺炎诊疗方案》规定，根据病例临床表现，结合流行病学史和实验室检测结果，四川省新型冠状病毒感染的肺炎病例确认专家组确认我省新增新型冠状病毒感染的肺炎病例25例。 截至1月26日24时，四川省累计报告新型冠状病毒感染的肺炎确诊病例69例，涉及17个市（州）。','2020-02-11','ck6hgxced00txs27c591ufk2l','人民日报','四川省','2020-01-27','http://m.weibo.cn/2803301701/4465279629164355','','四川新增新型肺炎25例，累计69例','2020-02-11'),('26日0-24时，新疆维吾尔自治区报告新型冠状病毒感染的肺炎新增确诊病例1例，其中新增确诊病例中，乌鲁木齐市1例；新增重症病例中，乌鲁木齐市1例。 截至1月26日24时，新疆累计报告新型冠状病毒感染的肺炎确诊病例5例，其中重症病例1例，累计死亡病例0例，累计出院病例0例。确诊病例中，乌鲁木齐市4例、伊犁州1例；重症病例中，乌鲁木齐市1例。','2020-02-11','ck6hgxced00tys27cd5kh6bq9','央视新闻','新疆维吾尔自治区','2020-01-27','https://m.weibo.cn/status/4465279133991665?','','新疆新增确诊病例1例，累计5例','2020-02-11'),('记者从国家发改委获悉，按照中央应对新型冠状病毒感染肺炎疫情工作领导小组总体部署，国家发展改革委依据联防联控工作机制，紧急下达中央预算内投资3亿元，专项补助收治新型冠状病毒感染肺炎患者的武汉火神山医院和武汉雷神山医院项目建设，重点用于购买重要医疗设备，为实现“集中患者、集中专家、集中资源、集中救治”提供设施保障。','2020-02-11','ck6hgxced00tzs27c4v6h9zi7','央视新闻','全国','2020-01-27','http://m.weibo.cn/2656274875/4465278463489420','','发改委：紧急下达中央预算内投资3亿元支持湖北疫情应对','2020-02-11'),('1月26日0-24时，河北省报告新型冠状病毒感染的肺炎新增确诊病例5例，其中，廊坊市2例、石家庄市2例、邢台市1例。廊坊市、邢台市为报告首例确诊病例。新增疑似病例11例，其中，沧州市3例、邢台市3例、廊坊市2例、衡水市2例、邯郸市1例。 截至1月26日24时，河北省累计报告确诊病例18例，死亡1例。','2020-02-11','ck6hgxced00u0s27c26m49ttm','央视新闻','河北省','2020-01-27','http://m.weibo.cn/2656274875/4465277498767595','','河北新增新确诊病例5例，累计18例','2020-02-11'),('今天，福建137人组成的医疗队集结，驰援湖北开展新型冠状病毒感染的肺炎医疗救治工作。医疗队队员来自多家医院的呼吸科、感染性疾病科、医院感染管理科、危重症医学科等科室。盼平安归来！','2020-02-11','ck6hgxced00u1s27cbe9j5lqj','央视新闻','福建省','2020-01-27','http://m.weibo.cn/2656274875/4465276751608772','','福建医疗队137人驰援湖北','2020-02-11'),('1月26日0-24时，青海省报告新型冠状病毒感染的肺炎新增确诊病例3例，新增重症病例0例，新增死亡病例0例，新增出院病例0例。截至1月26日24时，青海省累计报告新型冠状病毒感染的肺炎确诊病例4例，重症病例0例，死亡病例0例，出院病例0例。其中，确诊病例中，西宁市4例，其他市州无报告病例。','2020-02-11','ck6hgxced00u2s27cfv6z6mk8','央视新闻','青海省','2020-01-27','http://m.weibo.cn/2656274875/4465274030292693','','青海新增确诊病例3例，累计4例','2020-02-11'),('1月26日0-24时，内蒙古自治区报告新型冠状病毒感染的肺炎新增确诊病例4例，报告新增疑似病例1例。其中：新增4例确诊病例中包头市2例、兴安盟1例、通辽市1例，且均为三市首次确诊病例；锡林郭勒盟新增1例疑似病例。截至1月26日24时，内蒙古自治区累计报告新型冠状病毒感染的肺炎确诊病例11例，疑似病例1