和呼吸道症状，20日在本市医疗机构就诊，21日确诊为新型冠状病毒感染的肺炎病例；二、鲁某某，男，1月10日赴武汉出差，11日返京，14日出现发热症状，20日在本市医疗机构就诊，21日确诊为新型冠状病毒感染的肺炎病例；三、阎某，男，1月3日至10日曾到大连、吉林白山、长春等地旅行，14日参加会议','2020-02-11','ck6hgxcel00wrs27c8bs974qt','央视新闻','北京市','2020-01-25','https://m.weibo.cn/status/4464865911441959?','','北京证实三名医生感染新型肺炎','2020-02-11'),('2020年1月25日17时30分至23时，辽宁营口市新增1例输入性新型冠状病毒感染的肺炎确诊病例，该病例属轻症病例。 截至2020年1月25日23时，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例17例，重症病例12例。','2020-02-11','ck6hgxcel00wws27cgewrfbj1','央视新闻','辽宁省','2020-01-25','http://m.weibo.cn/2656274875/4464775566482183','','辽宁累计确诊病例17例','2020-02-11'),('截至2020年1月25日20时，黄石市累计报告疑似病例49例。根据省防控指挥部统一部署，对我市新型冠状病毒样本进行采样和检测，并于25日正式确诊病例31例，其中死亡1例。','2020-02-11','ck6hgxcel00wxs27c7u5k76ei','人民日报','湖北省','2020-01-25','http://m.weibo.cn/2803301701/4464766217073743','','湖北黄石确诊31例新型肺炎','2020-02-11'),('云南省文山州新型冠状病毒感染的肺炎领导小组办公室消息，1月21日，由南宁市经平果、广南、丘北往昆明市的D3937次动车7号车厢的一名乘客，经百色市医疗机构诊断，已确诊为新型冠状病毒感染的肺炎病。D3937次动车7号车厢共有57名乘客在云南文山境内下车，在文山下车的各位乘客，请您主动与所在县（市）疾病预防控制中心联系，配合当地部门做好医学观察。','2020-02-11','ck6hgxcel00wys27cahze1uh5','央视新闻','云南省','2020-01-25','http://m.weibo.cn/2656274875/4464766170755187','','急寻21日D3937次动车7号车厢在云南文山境内下车的57名乘客','2020-02-11'),('近日，受新型肺炎疫情影响，部分高校推迟开学，@上海大学 @湖北工业大学 @华中农业大学 等高校纷纷发布通知，推迟开学时间','2020-02-11','ck6hgxcel00wzs27c3bk855vr','人民日报','北京市','2020-01-25','http://m.weibo.cn/2803301701/4464762157381911','','部分高校延长寒假推迟开学','2020-02-11'),('今天，内蒙古自治区锡林浩特市新型冠状病毒感染的肺炎防控工作领导小组提示：1月23日经锡林郭勒盟疾控中心检测，1月25日自治区疾控中心复核，一名自武汉市来锡林浩特市探亲人员确诊为新型冠状病毒感染的肺炎患者。患者曾于1月22日下午在锡林浩特市德克隆贝子庙超市（原大地超市）购物；2020年1月23日上午从报社站至盟医院站乘坐3路公交汽车。','2020-02-11','ck6hgxcel00x0s27c4ulza78g','央视新闻','内蒙古自治区','2020-01-25','http://m.weibo.cn/2656274875/4464761394044511','','急寻内蒙古锡林浩特染病交通工具乘客','2020-02-11'),('1月20日乘坐11：40由吉林松原长途客运站出发至乾安的客运班车乘客请注意：1月20日11时40分由松原长途客运站出发至乾安的客运班车（吉JG4666）于12时52抵达，车上发现1名由武汉疫区回乡人员，已确诊为新型冠状病毒感染的肺炎患者','2020-02-11','ck6hgxcel00x1s27c4obqa68m','人民日报','吉林省','2020-01-25','http://m.weibo.cn/2803301701/4464759606442642','','急寻20日吉林JG4666大巴乘客','2020-02-11'),('根据中国旅行社协会官方发布的消息：即日起，全国旅行社及在线旅游企业暂停经营团队旅游及“机票＋酒店”产品。已出行的旅游团队，可按合同约定继续完成行程。行程中，密切关注游客身体状况，做好健康防护。同时要妥善处理旅游合同纠纷。','2020-02-11','ck6hgxcel00x2s27cb9672cgk','央视新闻','湖北省','2020-01-25','https://weibo.com/2656274875/Ira0ec40o','','全国旅行社团队游全部暂停','2020-02-11'),('今晚20：00，山东首批138人医疗队在济南遥墙机场集结后乘专机出发，支援湖北。他们分别来自各大医院呼吸科、感染性疾病科、医院感染管理科、重症医学科和护理部门等。','2020-02-11','ck6hgxcel00x3s27cbqnshaux','央视新闻','山东省','2020-01-25','https://weibo.com/2656274875/Ir9rP4NQ8','','山东首批 138 人医疗队驰援武汉','2020-02-11'),('香港特区行政长官林郑月娥25日宣布，香港对新型冠状病毒感染疫情的应变级别由“严重”提升为最高的“紧急”，并将采取一系列措施加强疫情防控，包括暂停所有来往武汉的航班和高铁，推迟春节后中小学和幼儿园开学时间等。','2020-02-11','ck6hgxcem00x4s27c0scz7sx7','新华网','香港','2020-01-25','https://weibo.com/2810373291/Ir9RtoWXp?from=page_1002062810373291_profile&wvr=6&mod=weibotime','','香港将新型冠状病毒感染疫情应变级别提升至最高级','2020-02-11'),('中国科学院上海药物研究所和上海科技大学免疫化学研究所抗2019-nCoV病毒感染联合应急攻关团队发现了30种可能对2019-nCoV有治疗作用的药物、活性天然产物和中药。候选药物包括蛋白酶抑制剂茚地那韦、沙奎那韦、洛匹那韦、卡非佐米、利托那韦等12种抗HIV药物，2种抗呼吸道合胞病毒药物，1种抗人巨噬病毒药物，1种抗精神分裂症药物，1种免疫抑制剂以及2种其他类药物。','2020-02-11','ck6hgxcem00x6s27c35uu1udu','人民日报','上海市','2020-01-25','http://m.weibo.cn/2803301701/4464714450554337','','科学家发现 30 种可能对新型肺炎有治疗作用的药物','2020-02-11'),('山西省长治市卫生健康委员会提示：2020年1月18日由武昌发出抵达大同的K1366次列车4号车厢，发现1名由武汉疫区回乡人员高某（男性，26岁，武汉某大学学生，为长子县丹朱镇人），现已确诊为新型冠状病毒感染肺炎患者，该车厢乘客。','2020-02-11','ck6hgxcem00x7s27c83sr6owf','央视新闻','山西省','2020-01-25','https://m.weibo.cn/status/4464709820183222?','','急寻 18 日 K1366 次列车 4 号车厢乘客','2020-02-11'),('2020年1月24日00:00至24:00，我市新型冠状病毒感染的肺炎确诊病例1例（宜城1例）；新增疑似病例29例（其中枣阳4例，襄城3例，樊城7例，南漳4例，宜城4例，谷城1例，老河口3例，保康2例，高新区1例）。','2020-02-11','ck6hgxcem00x8s27c8dxzcopa','襄阳市人民政府网站','湖北省','2020-01-25','http://www.xf.gov.cn/zxzx/xwzt/gzxxgzbd/zxtb/202001/t20200125_2017192.shtml','','襄阳新型肺炎确诊病例 1 例','2020-02-11'),('2020年1月25日9：00-17：00，海南省新型冠状病毒感染的肺炎新增确诊病例2例，无重症病例、死亡病例和出院病例。确诊病例中，三亚市1例、陵水县1例。 截至1月25日17：00，海南省累计报告新型冠状病毒感染的肺炎确诊病例19例，无重症病例、死亡病例和出院病例。确诊病例中，海口市3例、三亚市6例、儋州市3例、万宁市5例、临高县1例、陵水县1例。','2020-02-11','ck6hgxcem00x9s27cb90yenzt','人民日报','海南省','2020-01-25','https://m.weibo.cn/status/4464704464396974?','','海南新增新型肺炎确诊病例 2 例','2020-02-11'),('截至25日17时北京市新增的5例新型冠状病毒感染的肺炎病例，均已送至定点医疗机构进行救治。这5名新增患者为3男2女，年龄在36岁-45岁之间，其中3人有湖北接触史，2人有其他省份接触史。这是北京首次报告确诊无湖北接触史的患者。（央视记者 牟媞媞）','2020-02-11','ck6hgxcem00xas27cffttasle','央视新闻','北京市','2020-01-25','http://m.weibo.cn/2656274875/4464699989399581','','北京首次报告无湖北接触史病例','2020-02-11'),('25日3点半，在武汉蔡甸火神山医院之外，将再建一个小汤山医院——武汉雷神山医院，新增床位1300张。','2020-02-11','ck6hgxcem00xbs27ccm6o8bjt','人民日报','湖北省','2020-01-25','http://m.weibo.cn/2803301701/4464693852469862','','武汉将再建一个小汤山医院','2020-02-11'),('为加强新型冠状病毒感染的肺炎防控工作，有效防止疫情传播，保障人民群众的身体健康和生命安全，根据《中华人民共和国传染病防治法》等有关法律法规的规定，省人民政府决定自2020年1月25日启动突发公共卫生事件Ⅰ级应急响应。','2020-02-11','ck6hgxcem00xcs27c2amuf206','人民日报','吉林省','2020-01-25','https://m.weibo.cn/status/4464687154357461?','','吉林启动一级应急响应','2020-02-11'),('为加强新型冠状病毒感染的肺炎防控工作，有效防止疫情传播，保障人民群众的身体健康和生命安全，根据《中华人民共和国传染病防治法》等有关法律法规的规定，省人民政府决定自2020年1月25日启动突发公共卫生事件Ⅰ级应急响应。','2020-02-11','ck6hgxcem00xds27c7vscfanh','人民日报','吉林省','2020-01-25','http://m.weibo.cn/2803301701/4464687154357461','','吉林启动一级应急响应','2020-02-11'),('青海省人民政府发布通告，针对我省当前新型冠状病毒感染的肺炎疫情防控形势，为加强新型冠状病毒感染的肺炎疫情防控工作，有效防止疫情扩散和蔓延，保障人民群众的身体健康和生命安全，根据《中华人民共和国传染病防治法》和《青海省突发公共卫生事件应急预案》等有关法律法规规定，省人民政府决定，从2020年1月25日24时起，启动青海省重大突发公共卫生事件一级响应，依法依规科学实施防控措施。','2020-02-11','ck6hgxcem00xes27c7q5o86vf','央视新闻','青海省','2020-01-25','http://m.weibo.cn/2656274875/4464686324136869','','青海启动一级应急响应','2020-02-11'),('2020年1月25日，云南省报告输入性新型冠状病毒感染的肺炎新增确诊病例6例，新增重症病例1例（昆明）。新增确诊病例中：曲靖市、玉溪市、红河州、大理州为报告首例确诊病例，丽江市新增确诊病例1例、昆明市新增确诊病例1例，均已转入定点医院治疗，目前病情稳定。','2020-02-11','ck6hgxcen00xgs27c469fajb7','央视新闻','云南省','2020-01-25','https://m.weibo.cn/status/4464694486320817?','','云南新增 6 例新型肺炎病例','2020-02-11'),('截至25日17时，北京市新增5例新型冠状病毒感染的肺炎病例，均已送至定点医疗机构进行救治。目前在院治疗39人。截至25日17时，北京市累计确诊病例41例，其中西城区4例、朝阳区6例、海淀区8例、丰台区2例、石景山区1例、通州区3例、顺义区1例、大兴区2例、昌平区3例，外地来京人员11例。','2020-02-11','ck6hgxcen00xhs27c7y5cbxej','央视新闻','北京市','2020-01-25','http://m.weibo.cn/2656274875/4464691851839942','','北京新型肺炎确诊病例 41 例','2020-02-11'),('2020年1月25日10时至17时30分，辽宁大连新增1例输入性新型冠状病毒感染的肺炎确诊病例，该病例属轻症病例。  截至2020年1月25日17时30分，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例16例，重症病例12例。其中确诊病例中，沈阳市5例、大连市4例、本溪市1例、铁岭市2例、朝阳市2例、葫芦岛市2例。目前16名患者均在定点医疗机构隔离治疗，病情稳定。（总台央视记者 李承泽）','2020-02-11','ck6hgxcen00xis27c0hvj1s6c','央视新闻','辽宁省','2020-01-25','https://m.weibo.cn/status/4464686655338673?','','辽宁累计确诊病例 16 例','2020-02-11'),('记者从天津市疾控中心获悉，2020年1月25日16时，天津市新增1例新型冠状病毒感染的肺炎确诊病例，确诊病例增至10例。   第10例患者胡某某，男，30岁，北京人。1月18日至20日在武汉逗留，24日抵津时发热，到天津医院发热门诊就诊。1月25日16时经天津市专家组确诊为我市第10例病例，为轻症病例。目前已转至海河医院治疗，生命体征平稳。','2020-02-11','ck6hgxcen00xjs27c349y7thz','央视新闻','天津市','2020-01-25','http://m.weibo.cn/2656274875/4464681265155125','','天津确诊病例增至 10 例','2020-02-11'),('据@首都健康 ，北京今日有1名新型冠状病毒肺炎患者出院。据悉，该男士现居于北京市大兴区。1月8日从湖北返回后出现发热，头痛，乏力，咳嗽等症状，随后转入北京地坛医院隔离治疗。按程序经疾控中心检测发现新型冠状病毒阳性，经专家组会诊确诊为新型冠状病毒感','2020-02-11','ck6hgxcet00xks27cgu8q7tx4','人民日报','北京市','2020-01-25','http://m.weibo.cn/2803301701/4464677712709430','','北京2例新型肺炎患者治愈','2020-02-11'),('今天下午，武汉市防疫指挥部举行调度会，决定在武汉蔡甸火神山医院之外，半个月之内再建一所“小汤山医院”——武汉雷神山医院，新增床位1300张。','2020-02-11','ck6hgxcet00xls27cezemao04','人民日报','湖北省','2020-01-25','https://m.weibo.cn/status/4464672692280254?','','武汉决定再建一个小汤山医院','2020-02-11'),('青海省卫健委今天发布消息，根据国家卫生健康委关于各省首例新型冠状病毒感染的肺炎最新确诊程序，以及《新型冠状病毒感染的肺炎诊疗方案（试行第三版）》规定，青海省首例疑似病例陈某某，病例样本经省疾病预防控制中心实验室检测，中国疾病预防控制中心实验室复核检测，均呈新型冠状病毒核酸阳性。','2020-02-11','ck6hgxcet00xns27cc8eshlxs','央视新闻','青海省','2020-01-25','http://m.weibo.cn/2656274875/4464675578654799','','青海确认1例新型肺炎病例','2020-02-11'),('为缓解医疗资源不足，发热病人长久排队问题，武汉市要求从明日零时起，所有医院发热门诊24小时接诊。发热病人中确诊和高度疑似新型肺炎的患者，医院必须“应收尽收”，统一受制。武汉市决定将全市医疗床位统一调度，首批已新增1438张床位','2020-02-11','ck6hgxcet00xos27ce7ov068s','人民日报','湖北省','2020-01-25','http://m.weibo.cn/2803301701/4464672310959721','','明日起，武汉所有医院发热门诊24小时接诊','2020-02-11'),('澳大利亚悉尼所在的新南威尔士州今天确诊三例新型冠状病毒感染病例，其中包括两名男子，一名三十多岁，另一名五十多岁，都有武汉旅行史。澳大利亚确诊的病例总数达到四例。','2020-02-11','ck6hgxcet00xqs27c527bfwkr','央视新闻','','2020-01-25','http://m.weibo.cn/2656274875/4464652144572613','','澳大利亚新增3例确诊病例','2020-02-11'),('武汉市新型肺炎防控指挥部通报， 为控制人员流动引发的传染风险，自2020年1月26日0时始，除经许可的保供运输车、免费交通车、公务用车外，中心城区区域实行机动车禁行管理。市民确有通行需求的，按指挥部第8号通告执行，各社区配备足够车辆保障需求。','2020-02-11','ck6hgxcet00xss27cauyab24l','央视新闻','湖北省','2020-01-25','http://m.weibo.cn/2656274875/4464649204200558','','武汉中心城区实行机动车禁行','2020-02-11'),('今天，湖北省召开新型冠状病毒感染的肺炎疫情防控工作例行新闻发布会。会上，湖北省卫健委将通报全省疫情和防控工作最新进展情况。看直播↓关注！（总台央视记者潘巍） t.cn/A6Pq5t4P .','2020-02-11','ck6hgxcet00xus27c2z26bw5q','央视新闻','湖北省','2020-01-25','http://m.weibo.cn/2656274875/4464643407719539','','直播！#湖北通报疫情和防控工作最新情况','2020-02-11'),('日本25日确认第三例新型冠状病毒肺炎。该患者为30多岁女性，于18日从中国湖北省武汉市前往日本神奈川县旅游。','2020-02-11','ck6hgxcet00xvs27ccdvo397l','央视新闻','','2020-01-25','http://m.weibo.cn/2656274875/4464640459652310','','日本确诊3例新型肺炎病例','2020-02-11'),('针对新型冠状病毒引发的肺炎疫情，中国驻尼泊尔使馆25日发布相关提示，全文如下: 近期，国内出现新型冠状病毒肺炎疫情，根据尼泊尔卫生与人口部24日对外公布消息称，一名尼泊尔人确认感染新型冠状病毒，此系尼泊尔发现的首例输入性病例。','2020-02-11','ck6hgxcet00xxs27c5qivcvy3','央视新闻','','2020-01-25','http://m.weibo.cn/2656274875/4464638379027746','','尼泊尔确诊首例新型肺炎病例','2020-02-11'),('1月25日，辽宁省新型冠状病毒感染的肺炎疫情联防联控工作领导小组决定，立即启动辽宁省重大突发公共卫生事件Ⅰ级响应，实行最严格的防控措施。终止日期另行公告。','2020-02-11','ck6hgxceu00xys27cb15igcpn','央视新闻','辽宁省','2020-01-25','http://m.weibo.cn/2656274875/4464634923072330','','辽宁启动一级响应','2020-02-11'),('福建省卫健委通报：1月25日10时，福建省报告新增输入性新型冠状病毒感染的肺炎确诊病例8例。其中，福州市1例（长乐区）、漳州市3例（芗城区1例、龙文区1例、诏安县1例）、泉州市2例（洛江区1例、安溪县1例）、三明市1例（三元区）','2020-02-11','ck6hgxceu00xzs27c97xia0w9','人民日报','福建省','2020-01-25','http://m.weibo.cn/2803301701/4464634813681668','','福建新增8例新型肺炎确诊病例','2020-02-11'),('据甘肃省卫健委消息，截至1月24日24时，甘肃省已累计确诊4例新型冠状病毒感染的肺炎病例。1月24日新增2例确诊病例，均已隔离治疗，并对密切接触者开展追踪和隔离医学观察。','2020-02-11','ck6hgxceu00y0s27cg4bveubc','央视新闻','甘肃省','2020-01-25','http://m.weibo.cn/2656274875/4464630291922122','','甘肃公布两例新增病例具体情况','2020-02-11'),('今天9时，天津市新增1例新型冠状病毒感染的肺炎确诊病例，确诊病例增至9例。','2020-02-11','ck6hgxceu00y1s27cetwq1rjt','央视新闻','天津市','2020-01-25','http://m.weibo.cn/2656274875/4464629113599955','','天津公布9例确诊患者情况','2020-02-11'),('1月25日上午，河南宣布启动新型冠状病毒肺炎疫情防控一级应急响应。','2020-02-11','ck6hgxceu00y2s27cbzz9boia','人民日报','河南省','2020-01-25','http://m.weibo.cn/2803301701/4464616673761317','','河南启动一级响应','2020-02-11'),('1月25日下午，山东省卫生健康委员会发布关于新型冠状病毒感染的肺炎情况通报，2020年1月25日0-12时，山东省报告新型冠状病毒感染的肺炎新增确诊病例6例，其中：滨州、菏泽市各首次报告1例确诊病例，济南、日照市各新增1例确诊病例，青岛市新增2例确诊病例','2020-02-11','ck6hgxceu00y3s27cf7bpgir9','央视新闻','山东省','2020-01-25','http://m.weibo.cn/2656274875/4464616215833931','','山东新增6例确诊病例','2020-02-11'),('经研究决定，1月25日黑龙江省启动突发公共卫生事件一级响应机制。黑龙江省委、省政府主要领导担任新型冠状病毒感染的肺炎疫情防控工作领导小组组长。','2020-02-11','ck6hgxceu00y4s27caams0i2j','央视新闻','黑龙江省','2020-01-25','http://m.weibo.cn/2656274875/4464603716934020','','黑龙江启动突发公共卫生事件一级响应','2020-02-11'),('武汉市卫健委消息，为确保新型肺炎疑似病例、确诊病例得到及时收治救治，武汉在早期两家定点医院和61家发热门诊的基础上，第一批、第二批、第三批分别征用7家、3家、14家综合医院，临时改造成为发热病人收治医院，目前收治疑似和确诊病例的床位达4000余张','2020-02-11','ck6hgxceu00y5s27c6hmlg6ci','人民日报','湖北省','2020-01-25','http://m.weibo.cn/2803301701/4464601003334770','','武汉征用24家医院万张床位收治发热病人','2020-02-11'),('当地时间25日，马来西亚卫生部宣布确诊3例新型冠状病毒肺炎患者。这3名患者全部是新加坡首名确诊的66岁武汉男子的亲属。','2020-02-11','ck6hgxceu00y6s27cax4t90m6','央视新闻','','2020-01-25','http://m.weibo.cn/2656274875/4464590253130109','','马来西亚确诊 3 例病例','2020-02-11'),('2020年1月25日凌晨1时，广西壮族自治区卫生健康委发布通报，河池市新增2例新型冠状病毒感染的肺炎确诊病例。  患者钟某，女，2岁，武汉市人，常住武汉，2020年1月21日从武汉飞往南宁后乘坐汽车到金城江，1月22日下午4时出现发热，打喷嚏。于23日凌晨1时到河池市人民医院就诊，予以住院隔离治疗，目前病情稳定。  目前，当地累计报告新型冠状病毒感染的肺炎确诊病例3例。','2020-02-11','ck6hgxceu00y7s27c4sl6g00e','央视新闻','广西壮族自治区','2020-01-25','http://m.weibo.cn/2656274875/4464573899858585','','广西出现2岁新型肺炎确诊病例','2020-02-11'),('1月24日0-24时,湖南省报告新型冠状病毒感染的肺炎新增确诊病例19例。新增重症病例9例,新增死亡病例0例,新增出院病例0例。其中:衡阳市、邵阳市、常德市、益阳市为报告首例确诊病例。新增确诊病例中,衡阳市3例、湘潭市1例、邵阳市2例、岳阳市2例、常德市3例、益阳市4例、怀化市2例、娄底市2例;新增重症病例中,长沙市1例,衡阳市2例,湘潭市1例,永州市4例,怀化市1例。','2020-02-11','ck6hgxceu00y8s27c2fathpuh','央视新闻','湖南省','2020-01-25','http://m.weibo.cn/2656274875/4464585618931168','','湖南新增19例确诊病例','2020-02-11'),('经北京市专家组会诊，北京1名新型冠状病毒肺炎男患者于1月25日痊愈出院。据悉，该男士现居于北京市大兴区。1月8日从湖北返回后出现发热，头痛，乏力，咳嗽等症状，随后转入北京地坛医院隔离治疗。按程序经疾控中心检测发现新型冠状病毒阳性，经专家组会诊...','2020-02-11','ck6hgxceu00y9s27cazh10oos','央视新闻','北京市','2020-01-25','http://m.weibo.cn/2656274875/4464576223073059','','北京又一名新型肺炎患者痊愈出院','2020-02-11'),('交通运输部发出通知，部署按国家应对新型冠状病毒感染的肺炎疫情联防联控工作机制、各省级人民政府指令，对疫情防治应急物资及医患等人员运输（简称应急运输）的车辆跨省通行高速公路实行免收通行费政策，并保障优先通行。','2020-02-11','c