当地时间24日晚，法国卫生部长布赞确认，法国确诊两例新型冠状病毒感染病例。第1例在波尔多、第2例在巴黎发现，这是欧洲范围内首次发现新型冠状病毒感染病例。 据介绍，波尔多的病人48岁，不久前刚从武汉返回法国，23日发现症状后被送医并隔离，自返法以来与十多余人有过接触。另一名在巴黎发现的病人目前相关信息较少，只知道曾经前往中国旅行过，目前已在医院被隔离。','2020-02-11','ck6hgxcev00yws27cdubsd9l1','人民日报','','2020-01-24','https://m.weibo.cn/status/4464513665466775?','','法国确诊2例新型肺炎病例，欧洲范围内首次发现','2020-02-11'),('2020年1月24日0时—24时，辽宁新增8例输入性新型冠状病毒感染的肺炎确诊病例，其中6例为重症病例。 截至2020年1月24日24时，辽宁省累计报告输入性新型冠状病毒感染的肺炎确诊病例12例，重症病例9例。其中确诊病例中，沈阳市3例、大连市2例、本溪市1例、铁岭市2例、朝阳市2例、葫芦岛市2例。目前12名患者均在定点医疗机构隔离治疗，病情稳定。全部248名密切接触者均在实施医学观察中。','2020-02-11','ck6hgxcev00yxs27c7o3ze6z5','央视新闻','辽宁省','2020-01-24','https://m.weibo.cn/status/4464507306976233?','','辽宁新增8例确诊病例，累计报告输入性新型冠状病毒感染的肺炎确诊病例12例','2020-02-11'),('1月25日记者从山西省卫健委获悉，2020年1月23日18时至1月24日24时，山西省报告新型冠状病毒感染的肺炎新增确诊病例5例，其中太原市1例、大同市1例、长治市1例、运城市2例，且大同市、长治市、运城市为首次报告确诊病例。 截至1月24日24时，山西省累计报告新型冠状病毒感染的肺炎确诊病例6例。其中太原市2例、大同市1例、长治市1例、运城市2例。目前已追踪到密切接触者30人，正在接受医学观察。','2020-02-11','ck6hgxcev00yys27c9yum9s5s','央视新闻','山西省','2020-01-24','https://m.weibo.cn/status/4464499886960966?','','山西新增5例新型肺炎确诊病例','2020-02-11'),('2020年1月24日0时-24时，湖北省新增新型冠状病毒感染的肺炎病例180例（武汉市新增77例、十堰市新增4例、荆门市新增13例、孝感市新增4例、黄冈市新增52例、荆州市新增2例、仙桃市新增8例，随州市首次发现5例、恩施州首次发现11例、鄂州市首次发现1例、天门市首次发现3例）。全省新增死亡15例,全为武汉市病例。武汉市治愈出院1例。','2020-02-11','ck6hgxcev00yzs27c2kcl1y9m','央视新闻','湖北省','2020-01-24','https://m.weibo.cn/status/4464497211305006?','','湖北新增180例新型肺炎确诊病例，肺炎病例729例','2020-02-11'),('据空军发布：1月24日22时20分，空军1架伊尔-76飞机从西安咸阳机场紧急起飞，运载空军军医大学143名医护人员飞赴武汉，支援湖北地区防控新型冠状病毒感染的肺炎疫情。空军航空兵某师派出3架军用运输机，连夜分赴上海、西安、重庆执行医疗队员和医疗物资器材紧急空运任务。','2020-02-11','ck6hgxcev00z0s27c7eu77exg','人民日报','陕西省','2020-01-24','https://m.weibo.cn/status/4464425757239056?','','除夕夜空军3架运输机飞抵武汉','2020-02-11'),('截至1月25日0时，甘肃累计确诊4例新型冠状病毒感染的肺炎病例，比23日增加两例。1月24日新增2例确诊病例，新增病例均已隔离治疗，并对密切接触者开展追踪和隔离医学观察','2020-02-11','ck6hgxcev00z1s27c8z9w1poa','央视新闻','甘肃省','2020-01-24','https://weibo.com/2656274875/Ir2gr0bZ0?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579888179453','','甘肃新增2例，甘肃累计确认4例','2020-02-11'),('1月24日0-24时，江西省报告新型冠状病毒感染的肺炎新增确诊病例11例。其中抚州市3例、赣州市2例、上饶市2例、南昌市1例、九江市1例、景德镇市1例、宜春市1例。截至1月24日24时，江西省累计报告新型冠状病毒感染的肺炎确诊病例18例（含重症病例4例）。','2020-02-11','ck6hgxcev00z2s27c3ng32wtj','央视新闻','江西省','2020-01-24','https://weibo.com/2656274875/Ir236dQuh?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579886083751','','江西新增确诊病例11例','2020-02-11'),('1月24日0-24时，广西报告新型冠状病毒感染的肺炎新增确诊病例10例。目前全区累计报告新型冠状病毒感染的肺炎确诊病例23例，其中柳州市3例、桂林市6例、梧州市1例、北海市6例、百色市1例、河池市3例、玉林市1例、防城港市2例。','2020-02-11','ck6hgxcew00z3s27cc8205070','央视新闻','广西壮族自治区','2020-01-24','https://weibo.com/2656274875/Ir21c32jA?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579887050277','','广西新增确诊10例','2020-02-11'),('根据《江苏省突发公共卫生事件应急预案》，为加强新型冠状病毒感染的肺炎疫情防控工作，有效防止疫情扩散和蔓延，保障人民群众的身体健康和生命安全，省人民政府决定，自2020年1月24日24时起，启动突发公共卫生事件一级响应，实行最严格的科学防控措施。终止日期由省人民政府另行公告。','2020-02-11','ck6hgxcew00z4s27c5x8l237z','人民日报','江苏省','2020-01-24','https://m.weibo.cn/status/4464415472371628?','','江苏启动一级响应','2020-02-11'),('2020年1月24日，云南省报告新型冠状病毒感染的肺炎新增确诊病例3例。其中：西双版纳州1例、丽江市1例为本地首例确诊病例，昆明市新增确诊病例1例，均已转入定点医院治疗，目前病情稳定。','2020-02-11','ck6hgxcew00z5s27c8chg7fit','人民日报','云南省','2020-01-24','https://m.weibo.cn/status/4464403249912789?','','云南新增新冠肺炎3例','2020-02-11'),('根据《中华人民共和国传染病防治法》《广西壮族自治区突发公共卫生事件应急预案》等有关法律法规的规定，为加强全区新型冠状病毒感染的肺炎疫情防控工作，有效遏制新型冠状病毒感染的肺炎疫情蔓延，切实保障人民群众的身体健康和生命安全，自治区新型冠状病毒感染的肺炎疫情联防联控工作领导小组决定于2020年1月24日23时起启动重大突发公共卫生事件I级响应。','2020-02-11','ck6hgxcew00z7s27cfv7td5cs','人民日报','广西壮族自治区','2020-01-24','https://m.weibo.cn/status/4464399895225955?','','广西启动一级响应','2020-02-11'),('今天，除夕夜，来自上海市第一人民医院、瑞金医院、华山医院、中山医院等医疗机构的135名医疗队成员集结出发，奔赴武汉支援抗击肺炎前线。','2020-02-11','ck6hgxcew00z8s27c0yvuhrlq','央视新闻','上海市','2020-01-24','https://m.weibo.cn/status/4464396141360740?','','上海135名医护人员驰援武汉','2020-02-11'),('24日，根据《福建省突发公共卫生事件应急预案》，经研究，福建省启动重大突发公共卫生事件一级响应，各级各部门要严格按照国家关于新型冠状病毒感染的肺炎“乙类传染病，采取甲类管理”的要求，制定周密方案，层层压实责任，确保最严格的科学防控措施落实到位，全力维护人民群众健康安全。','2020-02-11','ck6hgxcew00z9s27ccac532tk','人民日报','福建省','2020-01-24','https://m.weibo.cn/status/4464390864449824?','','福建启动一级响应','2020-02-11'),('2020年1月24日20时，天津市新增1例新型冠状病毒感染的肺炎确诊病例。患者为男性，39岁，系天津动车客车段工作人员，近日去过武汉。目前已转至定点医院接受隔离治疗，生命体征平稳。截至目前，天津市累计发现新型冠状病毒感染的肺炎病例8例，其中重症6例，轻症2例，无危重病例，患者病情均平稳。','2020-02-11','ck6hgxcew00zas27c1ubj8zqz','人民日报','天津市','2020-01-24','https://m.weibo.cn/status/4464377615340049?','','天津确诊第8例新冠肺炎病例','2020-02-11'),('从1月24日17时至20时，北京市新增2例新型冠状病毒感染的肺炎病例，均有湖北接触史，经疾控中心检测和专家组评估确诊，均已送至定点医疗机构进行救治。截至24日20时，北京累计确诊病例36例，其中西城区4例、朝阳区5例、海淀区6例、丰台区2例、石景山区1例、通州区2例、顺义区1例、大兴区2例、昌平区3例，外地来京人员10例。今日已有3名密切接触者解除医学隔离观察。','2020-02-11','ck6hgxcew00zbs27c7zf7gs06','央视新闻','北京市','2020-01-24','http://m.weibo.cn/2656274875/4464368308023871 ​ http://m.weibo.cn/2656274875/4464368308023871','','北京新增确诊2例','2020-02-11'),('武汉市新型肺炎防控指挥部通告（第8号）：为解决市民居家出行不便等问题，全市紧急征集6000台出租车，分配给中心城区。每个社区3-5台，由社区居委会统一调度使用，自2020年1月25日中午始，为辖区居民出行提供免费服务。社区居委会为生活不便居民上门免费提供送餐、送菜、送药等居家服务。','2020-02-11','ck6hgxcew00zcs27ch3wa2e83','人民日报','湖北省','2020-01-24','https://m.weibo.cn/status/4464365283419763?','','武汉紧急征集出租车为居民提供免费服务','2020-02-11'),('依据《山东省突发公共卫生事件应急预案》，报经山东省人民政府研究决定，启动重大突发公共卫生事件Ⅰ级响应。山东省严格按照国家关于新型冠状病毒感染的肺炎“乙类传染病、采取甲类管理”的要求，进一步加强组织领导，落实防控责任，实行最严格的科学防控措施，第一时间摸排、发现、严控传染源，阻断潜在的传播途径，坚决遏制疫情传播扩散蔓延势头，全力保障人民群众生命安全和身体健康。','2020-02-11','ck6hgxcew00zds27c9fz94wxj','人民日报','山东省','2020-01-24','https://m.weibo.cn/status/4464355044954493?','','山东启动一级响应','2020-02-11'),('上海市卫健委今晚通报：上海市首例新型冠状病毒感染的肺炎病例陈某，入院后经专家组科学指导，医护人员精心诊治和护理，病情逐步改善，已连续体温正常6天，呼吸道症状明显好转，肺部影像学显示炎症明显吸收，两次新型冠状病毒核酸检测阴性，经专家组评估，符合国家卫生健康委最新的新型冠状病毒感染的肺炎确诊病例解除隔离和出院标准，已于今日治愈出院。','2020-02-11','ck6hgxcew00zes27c82vj6g3e','人民日报','上海市','2020-01-24','https://m.weibo.cn/status/4464354512805408?','','上海首例确诊新冠肺炎病例治愈','2020-02-11'),('根据《贵州省突发公共卫生事件应急预案》，为加强新型冠状病毒感染的肺炎疫情防控工作，有效防止新型冠状病毒感染的肺炎传播，保障人民群众的身体健康和生命安全，结合贵州省当前新型冠状病毒感染的肺炎疫情防控形势，自1月24日20:00，贵州省人民政府决定启动突发公共卫生事件一级响应。','2020-02-11','ck6hgxcew00zfs27cffbm7tn6','央视新闻','贵州省','2020-01-24','https://m.weibo.cn/status/4464352557920672?sudaref=login.sina.com.cn','','贵州启动Ⅰ级响应','2020-02-11'),('今天14时，浙江温州市第六人民医院，温州首例确诊新型肺炎患者杨先生痊愈出院。据了解，46岁的杨先生17日入院治疗，经治疗恢复正常体温，并在1月18日、20日的呼吸道病原核酸检测阴性，现已痊愈，康复出院。','2020-02-11','ck6hgxcew00zgs27ce63x1zig','央视新闻','浙江省','2020-01-24','https://m.weibo.cn/status/4464344400362582?','','好消息！浙江首例确诊新型肺炎患者痊愈出院','2020-02-11'),('1月23日下午，武汉市城建局紧急召集中建三局等单位举行专题会议，要求参照2003年抗击非典期间北京小汤山医院模式，在武汉职工疗养院建设一座专门医院——武汉蔡甸火神山医院，集中收治新型冠状病毒肺炎患者。医院建筑面积2.5万平方米，可容纳1000张床位，由中建三局牵头，武汉建工、武汉市政、汉阳市政等3家企业参与。','2020-02-11','ck6hgxcew00zhs27c1q068hnq','人民日报','湖北省','2020-01-24','https://m.weibo.cn/status/4464343440078292?','','武汉小汤山医院定名火神山医院，可容纳1000张床位','2020-02-11'),('根据《贵州省突发公共卫生事件应急预案》，为加强新型冠状病毒感染的肺炎疫情防控工作，有效防止新型冠状病毒感染的肺炎传播，保障人民群众的身体健康和生命安全。结合贵州省当前新型冠状病毒感染的肺炎疫情防控形势，自2020年1月24日20:00，省人民政府决定启动突发公共卫生事件一级响应。','2020-02-11','ck6hgxcew00zis27c1ahyf62c','人民日报','贵州省','2020-01-24','https://weibo.com/2803301701/IqZLy6Zap?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1579865154844','','贵州启动一级响应','2020-02-11'),('截至24日17时，北京市新增5例新型冠状病毒感染的肺炎病例，均有湖北接触史。#北京累计确诊34例新型肺炎#，其中西城区4例、朝阳区5例、海淀区4例、丰台区2例、石景山区1例、通州区2例、顺义区1例、大兴区2例、昌平区3例，外地来京人员10例。','2020-02-11','ck6hgxcew00zjs27c4a0e02m3','央视新闻','北京市','2020-01-24','https://weibo.com/2656274875/IqZFw3fVM?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579864714325','','北京新增新型肺炎5例','2020-02-11'),('截至1月24日16时，陕西新增2例新型冠状病毒感染的肺炎确诊病例；新增密切接触者72例；全省累计报告确诊病例5例，密切接触者125例，均集中医学观察。','2020-02-11','ck6hgxcew00zks27c8v78alzq','人民日报','陕西省','2020-01-24','https://m.weibo.cn/status/4464334383801217?','','陕西新增2例新冠肺炎病例','2020-02-11'),('为认真贯彻落实习主席重要指示精神和中央军委部署要求，军委后勤保障部牵头展开军队应对突发公共卫生事件联防联控工作，组织军队专业医疗力量投入新型冠状病毒感染肺炎疫情的防控。前期，军队已组织驻武汉地区部队医院派出40名医护人员，在武汉肺科医院重症监护室展开救治工作。','2020-02-11','ck6hgxcex00zls27cedd14obw','人民日报','北京市','2020-01-24','https://wap.peopleapp.com/article/5073380/4967919','','军队部署展开应对突发公共卫生事件联防联控工作','2020-02-11'),('根据《云南省突发公共卫生事件应急预案》，云南省新型冠状病毒感染的肺炎疫情防控工作','2020-02-11','ck6hgxcex00zms27c3u6ce9wo','人民日报','云南省','2020-01-24','https://weibo.com/2803301701/IqZlWaeD3?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1579861293575','','云南启动一级响应','2020-02-11'),('今天下午，江西省新型冠状病毒感染的肺炎疫情防控工作调度会在南昌召开。江西省宣布，江西启动重大突发公共卫生事件一级响应。','2020-02-11','ck6hgxcex00zns27c106oheps','央视新闻','江西省','2020-01-24','https://weibo.com/2656274875/IqZhJfdHC?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579860925688','','江西启动一级响应','2020-02-11'),('青海省卫健委1月24消息，患者陈某某，27岁，男性，在湖北省武汉市工作，2020年1月21日自武汉来宁探亲，现暂居青海省西宁市。','2020-02-11','ck6hgxcex00zps27cefx7ext8','央视新闻','青海省','2020-01-24','http://m.weibo.cn/2656274875/4464314100677910','','青海发现首例新型肺炎疑似病例','2020-02-11'),('据意大利《24小时太阳报》报道，意大利南部城市巴里出现一例新型冠状病毒感染肺炎疑似病例。据报，巴里乔瓦尼第二十三医院急诊室接待的这名女性患者是一名歌手，患者自称曾去过中国武汉演出。','2020-02-11','ck6hgxcey00zqs27c8upq0wbp','人民日报','','2020-01-24','http://m.weibo.cn/2803301701/4464287806121766','','意大利出现新冠肺炎疑似病例，患者曾赴武汉演出','2020-02-11'),('今日14时，福建省报告新增输入性新型冠状病毒感染的肺炎确诊病例1例和疑似病例2例。其中：福州市新增确诊病例1例，漳州市、三明市疑似病例各1例。截至1月24日14时，福建累计确诊新型肺炎10例。','2020-02-11','ck6hgxcey00zrs27c4mh40bo1','央视新闻','福建省','2020-01-24','http://m.weibo.cn/2656274875/4464277568378388','','福建新增 1 例病例','2020-02-11'),('1月24日，上海启动重大突发公共卫生事件一级响应机制','2020-02-11','ck6hgxcey00zss27cec0t3goi','人民日报','上海市','2020-01-24','http://m.weibo.cn/2803301701/4464275537960579','','上海启动一级响应','2020-02-11'),('经北京市专家组会诊，北京1名新型冠状病毒感染肺炎女患者于1月24日痊愈出院。据悉，该女士现居住于北京市大兴区。1月8日从湖北返回后出现发热、头痛、乏力、发热等症状，随后转入北京地坛医院隔离治疗。按程序经疾控中心检测，发现新型冠状病毒阳性，经专家组会诊，确诊为新型冠状病毒感染的肺炎。入院后给予对症和中药治疗，症状逐渐好转，体温正常，连续监测呼吸道分泌物病毒核酸阴性，符合国家制定的出院标准，今日出院。','2020-02-11','ck6hgxcey00zus27cfvzn160p','人民日报','北京市','2020-01-24','http://m.weibo.cn/2803301701/4464259805726673','','北京 1 新冠肺炎确诊患者出院','2020-02-11'),('国务院办公厅从即日起在国务院“互联网+督查”平台面向社会征集有关地方和部门在疫情防控工作中责任落实不到位、防控不力、推诿扯皮、敷衍塞责等问题线索，以及改进和加强防控工作的意见建议。 对涉及缓报、瞒报、漏报疫情，落实防控措施不力，导致疫情扩散等严重后果的重要问题线索，国务院办公厅督查室将直接派员进行督查。经查证属实的，将依法依规严肃处理。','2020-02-11','ck6hgxcey00zvs27cbw6o1x9x','中国政府网','北京市','2020-01-24','https://mp.weixin.qq.com/s/vQ-m0wW2cVZGYfJtAAMeiQ','','国务院征集新冠肺炎疫情防控工作问题线索','2020-02-11'),('根据《天津市应对新型冠状病毒感染的肺炎应急预案》，结合天津市当前疫情的防控形势，市防控领导小组发布指挥部令，决定自2020年1月24日零时起，启动《天津市应对新型冠状病毒感染的肺炎应急预案》一级响应。 ​​​','2020-02-11','ck6hgxcey00zxs27ce0zdf10v','人民日报','天津市','2020-01-24','http://m.weibo.cn/2803301701/4464245166727843','','天津启动一级响应','2020-02-11'),('记者从安徽省卫建委了解到，根据《安徽省突发公共卫生事件应急预案》、《安徽省新型冠状病毒感染的肺炎疫情防控应急预案》，结合安徽当前新型冠状病毒感染的肺炎疫情防控形势，安徽省新型冠状病毒感染的肺炎疫情防控应急指挥部决定，启动安徽省重大公共卫生事件一级响应。','2020-02-11','ck6hgxcey00zys27c9kescdrm','人民日报','安徽省','2020-01-24','http://m.weibo.cn/2803301701/4464244898679663','','安徽启动一级响应','2020-02-11'),('武汉大学人民医院新冠肺炎患者识别“升级版” 1月24日发布，提醒医护人员及公众，高度警惕以非呼吸系统症状为首发症状的隐形传染源，发热咳嗽并非新型肺炎的唯一首发症状。','2020-02-11','ck6hgxcey00zzs27c2bm059lz','人民日报','湖北省','2020-01-24','http://m.weibo.cn/2803301701/4464244348901450 ​','','重磅！发热咳嗽非新冠肺炎唯一首发症状','2020-02-11'),('昨天0-24时，宁夏报告新型冠状病毒感染的肺炎新增确诊病例1例，新增疑似病例1例。截至1月23日24时，宁夏累计报告新型冠状病毒感染的肺炎确诊病例2例(重症病例1例)，其中银川市1例、中卫市1例；疑似病例1例。','2020-02-11','ck6hgxcey0100s27chkjyfsuw','央视新闻','宁夏回族自治区','2020-01-24','http://m.weibo.cn/2656274875/4464239232497670','','宁夏新增确诊1例疑似1例','2020-02-11'),('2020年1月24日0-12时，山东省报告新型冠状病毒感染的肺炎新增确诊病例6例。其中：济南市2例、烟台市2例、济宁市1例，均为首次报告确诊病例；青岛市新增1例确诊病例。截至1月24日12时，山东省累计报告新型冠状病毒感染的肺炎确诊病例15例。','2020-02-11','ck6hgxcey0101s27c9qg20wbg','人民日报','山东省','2020-01-24','http://m.weibo.cn/2803301701/4464230751473157','','山东今日新增确诊 6 例，山东累计确诊 15 例','2020-02-11'),('2020年1月24日10时，福建省报告新增输入性新型冠状病毒感染的肺炎确诊病例4例和疑似病例2例。其中：福州市新增确诊病例2例，厦门市新增确诊病例2例、疑似病例2例。截至1月24日10时，福建省累计报告新型冠状病毒感染的肺炎确诊病例9例，疑似病例2例。','2020-02-11','ck6hgxcey0102s27cdj220byr','人民日报','福建省','2020-01-24','http://m.weibo.cn/2803301701/4464229795391738','','福建新增确诊 4 例，福建累计确诊 9 例','2020-02-11'),('1月23日0-24时，内蒙古自治区报告新型冠状病毒感染的肺炎新增确诊病例1例，新型冠状病毒感染的肺炎疑似病例新增2例。满洲里市疑似病例确诊，乐某，患者男，30岁，家住武汉市，从事服装生意，21日自驾游到达满洲里市后，直接到满洲里市人民医院急诊科就诊，经内蒙古自治区综合疾控中心实验室复核，确认该病例为新型冠状病毒感染的肺炎确诊病例，为内蒙古自治区报告的首例确诊病例。','2020-02-11','ck6hgxcey0103s27c25at2ulg','人民日报','内蒙古自治区','2020-01-24','http://m.weibo.cn/2803301701/4464216926774457 ​','','内蒙古确诊首例新冠肺炎','2020-02-11'),('为减少人员流动，降低感染风险，现就桥隧通行管理有关事项通告如下：自2020年1月25日0时起，过江隧道关闭，三环内（含三环）过江桥梁通行实施体温检测管控。取消时间另行通告。（人民日报记者田豆豆）','2020-02-11','ck6hgxcey0104s27c3q7c5zww','人民日报','湖北省','2020-01-24','http://m.weibo.cn/2803301701/4464223541240916','','武汉关闭过江隧道','2020-02-11'),('1月23日0-24时，内蒙古自治区报告新型冠状病毒感染的肺炎新增确诊病例1例，新型冠状病毒感染的肺炎疑似病例新增2例。 　　满洲里市疑似病例确诊，乐某，患者男，30岁，家住武汉市，从事服装生意，21日自驾游到达满洲里市后，直接到满洲里市人民医院急诊科就诊，经内蒙古自治区综合疾控中心实验室复核，确认该病例为新型冠状病毒感染的肺炎确诊病例，为内蒙古自治区报告的首例确诊病例。','2020-02-11','ck6hgxcey0105s27c9dr6gdht','人民日报','内蒙古自治区','2020-01-24','https://m.weibo.cn/status/4464216926774457?display=0&retcode=6102','','内蒙古确诊首例新冠肺炎','2020-02-11'),('2020年1月23日11时至24时，辽宁新增1例输入性新型冠状病毒感染的肺炎确诊病例。患者男性，朝阳凌源市人，42岁，1月18日由武汉乘坐高铁至北京西，后自行开车至朝阳凌源市。1月19日，出现周身酸痛等症状，1月22日在朝阳凌源市一医院发热门诊就诊并被收治入院隔离治疗。目前，患者属重症病例，生命体征平稳。其密切接触者38人均在医学观察中。','2020-02-11','ck6hgxcey0106s27cdyrf3k4a','人民日报','辽宁省','2020-01-24','https://m.weibo.cn/status/4464213823072059?display=0&retcode=6102','','辽宁新增确诊1例','2020-02-11'),('国家卫健委专家组成员、中国疾病预防控制中心主任高福特别提醒：新冠肺炎已走过三个阶段，动物到人，有限人到人，再到人到人传播。要加强防护措施，民众应该意识到春节不要聚会，尽量居家，就可以很好的防护，口罩非常重要。电子拜年云聚会，支持请转！ ​','2020-02-11','ck6hgxcey0107s27c76083k1b','人民日报','北京市','2020-01-24','http://m.weibo.cn/2803301701/4464209549089465','','转发提醒：这个春节尽量不聚会！','2020-02-11'),('2020年1月23日0-24时，湖南省报告新型冠状病毒感染的肺炎新增确诊病例15例、疑似病例3例，新确诊病例中均有武汉暴露史或病例接触史。新增重症病例2例，新增死亡病例0例，新增出院病例0例。其中：株洲市、湘潭市、岳阳市、娄底市为报告首例确诊病例。','2020-02-11','ck6hgxcey0108s27c8j4p4w18','湖南省卫健委','湖南省','2020-01-24','http://dxys.com/xyJAVU','','湖南新增确诊 15 例：湖南累计确诊 24 例','2020-02-11'),('截至1月23日24时，海南省累计报告新型冠状病毒感染的肺炎确诊病例8例，无重症病例、死亡病例和出院病例。确诊病例中，海口市3例、三亚市2例、万宁市2例、临高县1例。23日通报的32例可疑病例已全部排除。','2020-02-11','ck6hgxcey0109s27ceuaydv1b','央视新闻','海南省','2020-01-24','https://m.weibo.cn/2803301701/4464204335127376','','海南新增确诊病例4例，海南累计确诊病例8例','2020-02-11'),('1月23日0-24时，吉林省报告新型冠状病毒感染的肺炎新增确诊病例2例，其中吉林市1例，松原市1例。截至1月23日24时，吉林省累计报告新型冠状病毒感染的肺炎病例3例（均为武汉输入病例）。','2020-02-11','ck6hgxcez010as27cciii2jfd','央视新闻','吉林省','2020-01-24','https://m.weibo.cn/status/4464191185997393?','','吉林新增2例新型肺炎确诊病例，吉林省累计报告新型冠状病毒感染的肺炎病例3例','2020-02-11'),('2020年1月23日0—24时，重庆市报告新型冠状病毒感染的肺炎新增确诊病例18例，新增重症3例；新增危重1例。','2020-02-11','ck6hgxcez010bs27c81f62b7n','人民日报','重庆市','2020-01-24','https://m.weibo.cn/status/4464192578727481?','','重庆新增确诊病例18例，重庆累计确诊病例27例','2020-02-11'),('2020年1月23日18-24时，江苏省报告新型冠状病毒感染的肺炎新增确诊病例4例。其中：无锡市、南通市为报告首例确诊病例。其他2个设区市新增确诊病例中，南京市1例，苏州市1例。截至1月23日24时，江苏省累计报告新型冠状病毒感染的肺炎确诊病例9例，无重症病例。','2020-02-11','ck6hgxcez010cs27c1ct18qe5','人民日报','江苏省','2020-01-24','https://m.weibo.cn/status/4464192113565122?','','江苏新增新冠肺炎确诊病例4例，江苏累计新冠肺炎9例','2020-02-11'),('韩联社报道称，韩国出现第二例新型冠状病毒肺炎确诊病例。韩国疾病管理本部24日表示，该患者几天前从武汉乘飞机至韩国仁川机场入境，经检查呈新型冠状病毒阳性。','2020-02-11','ck6hgxcez010ds27c8ev1673j','人民日报','','2020-01-24','https://m.weibo.cn/status/4464190838721454?','','韩联社报道称，韩国出现第二例新型冠状病毒肺炎确诊病例','2020-02-11'),('1月23日0-24时，自治区报告新型冠状病毒感染的肺炎新增确诊病例2例，新增重症病例0 例，新增死亡病例0例，新增出院病例0例。其中：乌鲁木齐市为报告首例确诊病例。','2020-02-11','ck6hgxcez010es27c6tiw6q9k','人民日报','新疆维吾尔自治区','2020-01-24','https://m.weibo.cn/status/4464190448434604?','','新疆新冠肺炎确诊病例2例','2020-02-11'),('1月23日，按照《新型冠状病毒感染的肺炎诊疗方案》规定，根据病例临床表现，结合流行病学史和实验室检测结果，四川省新型冠状病毒感染的肺炎病例确认专家组确认四川省新增新型冠状病毒感染的肺炎病例7例。','2020-02-11','ck6hgxcez010fs27c3whz4m8j','人民日报','四川省','2020-01-24','https://m.weibo.cn/status/4464188997392969?','','四川新增新冠肺炎7例，四川累计新冠肺炎确诊病例15例','2020-02-11'),('江西省卫生健康委23日晚间通报称，该省报告新型冠状病毒感染的肺炎新增确诊病例4例，截至1月23日23时，江西累计报告新型冠状病毒感染的肺炎确诊病例7例。2020年1月23日0—23时，江西省报告新型冠状病毒感染的肺炎新增确诊病例4例(含重症病例2例)。其中南昌市1例、吉安市1例、九江市1例、新余市1例。','2020-02-11','ck6hgxcez010gs27cer42gup8','人民日报','江西省','2020-01-24','https://m.weibo.cn/status/4464189785453818?','','江西新增4例新冠肺炎病例，江西累计确诊病例7例','2020-02-11'),('浙江省报告新型冠状病毒感染的肺炎新增确诊病例16例，新增重症病例4例，新增出院病例1例。其中：嘉兴市为报告首例确诊病例。其他市新增确诊病例中，嘉兴市 3 例、 衢州市1 例、台州市12例；新增重症病例中，嘉兴市1例、台州市3例。新增出院病例中，温州市1例。','2020-02-11','ck6hgxcez010hs27c5wzu1qvf','人民日报','浙江省','2020-01-24','https://weibo.com/2803301701/IqVPiqaGC?ref=home&rid=3_536870912_8_3384416826043960173_0_0_0&type=comment#_rnd1579829048882','','浙江新增确诊病例16例，浙江累计确诊病例43例','2020-02-11'),('1月23日0时-24时，湖北省新增新型冠状病毒感染的肺炎病例105例（其中武汉市新增70例、荆门市新增7例、荆州市新增2例，孝感市首次发现22例、仙桃市首次发现2例、宜昌市首次发现1例、十堰市首次发现1例）。全省新增死亡7例（其中武汉市6例，宜昌市1例）。武汉市治愈出院3例。','2020-02-11','ck6hgxcez010is27cdk7tf66f','央视新闻','湖北省','2020-01-24','https://m.weibo.cn/status/4464187650423052?','','1月23日0时-24时，湖北省新增新型冠状病毒感染的肺炎病例105例','2020-02-11'),('日本厚生劳动省24日宣布，已确认从中国湖北省武汉市前往日本旅游的40多岁男性感染新型冠状病毒肺炎。这是日本国内确认的第二例新型病毒感染，首例为住在神奈川县的中国籍男性。','2020-02-11','ck6hgxcez010js27c5nnx6io5','央视新闻','','2020-01-24','https://m.weibo.cn/status/4464186283758930?','','日本确诊2例新型肺炎病例','2020-02-11'),('昨天0-24时，黑龙江省报告新型冠状病毒感染的肺炎新增确诊病例2例，死亡病例1例。其中绥化市为报告首例确诊病例，大庆市为报告首例确诊病例。截至23日24时，黑龙江省累计报告新型冠状病毒感染的肺炎确诊病例4例，其中哈尔滨市1例、牡丹江市1例、大庆市1例、绥化市1例；死亡病例1例为绥化市确诊病例。目前追踪到密切接触者380人，已解除医学观察114人，尚有487人正在接受医学观察。','2020-02-11','ck6hgxcez010ks27cadtee3w5','央视新闻','黑龙江省','2020-01-24','https://m.weibo.cn/status/4464184127847534?','','1月23日0-24时，黑龙江省报告新型冠状病毒感染的肺炎新增确诊病例2例，死亡病例1例','2020-02-11'),('截至1月23日24时，安徽省累计报告新型冠状病毒感染的肺炎确诊病例15例,无重症病例、死亡病例和出院病例。其中:合肥市6例，六安市2例、阜阳市2例、滁州市1例、亳州市1例、安庆市1例、池州市1例、蚌埠市1例。目前追踪到密切接触者310人,均在接受医学观察。','2020-02-11','ck6hgxcez010ls27cd6mk4wa9','央视新闻','安徽省','2020-01-24','https://m.weibo.cn/status/4464183024267897?','','1月23日10时至24时，安徽省报告新型冠状病毒感染的肺炎新增确诊病例6例','2020-02-11'),('2020年1月23日0-24时，山东省报告新型冠状病毒感染的肺炎新增确诊病例3例。其中：潍坊、日照市各首次报告1例确诊病例，威海市新增1例确诊病例。截至1月23日24时，山东省累计报告新型冠状病毒感染的肺炎确诊病例9例。其中：青岛市3例，潍坊市1例，威海市2例，日照市1例，临沂市2例。目前追踪到密切接触者238人，238人正在接受医学观察。','2020-02-11','ck6hgxcez010ms27c8prc3pya','央视新闻','山东省','2020-01-24','https://weibo.com/2656274875/IqVDCt7bx?ref=home&rid=1_0_202_2666905757148172369_0_0_0','','山东新增3例新型肺炎确诊病例','2020-02-11'),('截至1月23日24时，广东省累计报告新型冠状病毒感染的肺炎确诊病例53例，其中重症病例12例，危重病例3例，无死亡病例，出院病例2例。其中：确诊病例中，广州7例、深圳15例、珠海8例、佛山6例、韶关3例、惠州5例、中山2例、阳江3例、湛江2例、肇庆1例、清远1例；重症病例中，深圳8例、珠海1例、佛山1例、韶关1例、惠州1例；危重病例中，深圳2例、珠海1例。','2020-02-11','ck6hgxcez010ns27c0bck2po8','人民日报','广东省','2020-01-24','https://weibo.com/2803301701/IqVDxtTVg?ref=home&rid=2_0_202_2666905757148172369_0_0_0','','广东新冠肺炎新增确诊病例21例','2020-02-11'),('截至1月23日24时，河南省卫生健康委收到省内6市（县）累计报告新型冠状病毒感染的肺炎确诊病例9例，重症病例1例，无死亡病例。其中：确诊病例中，郑州市3例、洛阳市1例、三门峡市1例、信阳市1例、周口市1例、巩义市2例；重症病例中，周口市1例。目前追踪到密切接触者306人，已解除医学观察3人，尚有303人正在接受医学观察。','2020-02-11','ck6hgxcez010os27c3fmzhela','人民日报','河南省','2020-01-24','https://weibo.com/2803301701/IqVxI77w5?ref=home&rid=10_0_202_2666905757148172369_0_0_0','','河南新冠肺炎新增确诊病例4例','2020-02-11'),('日前，国家卫健委专家高福在接受采访时表示，病毒不光在感染的人体内看到了 。在华南海鲜市场非法销售野生动物的这些摊位上，也分离到了病毒。新冠肺炎病毒来自野生动物这应该说是证据确凿。','2020-02-11','ck6hgxcf3010qs27c0fyb8q2x','人民日报','北京市','2020-01-24','https://mp.weixin.qq.com/s/WCP6DMCA_BotYRbyd2GP2A','','证据确凿！新冠肺炎病毒来自野生动物','2020-02-11'),('截至1月23日24时，国家卫健委收到29个省（区、市）累计报告新型冠状病毒感染的肺炎确诊病例830例，其中重症177例，死亡25例,其中湖北省24例、河北省1例。已治愈出院34例。20个省（区、市）累计报告疑似病例1072例。','2020-02-11','ck6hgxcf3010rs27cgevvbe2k','央视新闻','北京市','2020-01-24','https://weibo.com/2656274875/IqVnfb1Hm?from=page_1002062656274875_profile&wvr=6&mod=weibotime','','全国确诊830例新型肺炎病例','2020-02-11'),('2020年1月23日0—24时，上海市新增新型冠状病毒感染的肺炎确诊病例4例，其中1例危重症病例，为68岁男性患者，合并慢性阻塞性肺气肿。截至1月23日24时，上海市累计发现确诊病例20例，其中18例目前病情平稳，2例病情危重。另有34例疑似病例正在排查中。','2020-02-11','ck6hgxcf3010ss27c7kxy1n8m','人民日报','上海市','2020-01-23','https://weibo.com/2803301701/IqVhVnT9w?ref=home&rid=0_0_202_2676202729256023214_0_0_0','','上海新增4例新冠肺炎确诊病例','2020-02-11'),('据武汉市新冠肺炎防控指挥部，为加强对新冠肺炎患者救治，将参照北京小汤山医院模式建设面积达2.5万平方米的专门医院。负责人称该医院建筑面积达2.5万平方米，可容纳1000张病床，相关设计方案将在24日完成，预计武汉小汤山模式医院2月3日前建成。','2020-02-11','ck6hgxcf3010ts27c5kp2by12','人民日报','湖北省','2020-01-23','https://weibo.com/2803301701/IqV7dq2sm?ref=home&rid=5_0_202_2669530798209442133_0_0_0','','武汉将以小汤山模式建医院','2020-02-11'),('23晚，世卫组织召开新闻发布会：目前宣布“国际关注的公共卫生紧急事件”为时尚早，当前新型冠状病毒感染肺炎疫情对中国是一个紧急事件，但还不能认定为是国际紧急事件，因为当前疫情较为复杂，目前感染数量仍然达不到宣布紧急事件的标准，世卫组织将密切关注新冠肺炎。','2020-02-11','ck6hgxcf3010us27cev155r9m','人民日报','湖北省','2020-01-23','https://m.weibo.cn/status/4464150224652866?sudaref=login.sina.com.cn','','世卫组织：新型肺炎不构成国际突发卫生事件','2020-02-11'),('从1月23日14时至24时，北京市新增4例新型冠状病毒感染的肺炎病例，均为男性，均有湖北接触史，经疾控中心检测和专家组评估确诊，均已送至定点医疗机构进行救治。截至23日24时，北京市累计确诊病例26例，其中西城区3例、朝阳区3例、海淀区3例、丰台区2例、石景山区1例、通州区2例、顺义区1例、大兴区2例、昌平区2例，外地来京人员7例。','2020-02-11','ck6hgxcf3010vs27cfvkydhs2','央视新闻','北京市','2020-01-23','https://m.weibo.cn/status/4464099343625924?','','北京新增4例新型肺炎确诊病例，累计确诊病例26例','2020-02-11'),('23日23时30分，天津市新增1例新型冠状病毒感染的肺炎确诊病例，患者男性，46岁。现已转至定点医院接受隔离治疗，目前生命体征平稳。截至目前，天津市累计发现新型冠状病毒感染的肺炎病例5例。','2020-02-11','ck6hgxcf3010ws27ca2ir9evr','央视新闻','天津市','2020-01-23','http://m.weibo.cn/2656274875/4464091609170082','','天津新增1例新型肺炎确诊病例','2020-02-11'),('2020年1月23日0—24时，广西报告新型冠状病毒感染的肺炎新增确诊病例8例。目前全区累计报告新型冠状病毒感染的肺炎确诊病例13例，其中柳州市2例、桂林市2例、梧州市1例、北海市6例、百色市1例、河池市1例。目前追踪到密切接触者113人，正在接受医学观察。','2020-02-11','ck6hgxcf3010xs27c9o9a1zrb','人民日报','广西壮族自治区','2020-01-23','https://www.weibo.com/2803301701/IqSJAANR5?from=page_1002062803301701_profile&wvr=6&mod=weibotime','','广西新增新冠肺炎确诊病例8例','2020-02-11'),('①湖北旅行社暂停经营活动，不再组团收客；已经组团的一律取消或延期。②湖北大专院校推迟开学时间、中小学、幼儿园推迟开学时间。③省内党政机关、企事业单位、驻军及武警部队所属人员出差取消。④各地招商引资活动一律暂停。⑤省内进出武汉的客运航班、旅客列车、客运汽车、客轮一律暂时停运。','2020-02-11','ck6hgxcf3010ys27c9dmwf2db','人民日报','湖北省','2020-01-23','https://www.weibo.com/2803301701/IqSEcDHtL?from=page_1002062803301701_profile&wvr=6&mod=weibotime','','【湖北省新冠肺炎疫情防控指挥部通告】','2020-02-11'),('根据《湖南省突发公共卫生事件应急预案》,结合我省当前新型冠状病毒感染的肺炎疫情防控形势，省新型冠状病毒感染的肺炎疫情防控工作领导小组决定，启动湖南省重大突发公共卫生事件一级响应。','2020-02-11','ck6hgxcf3010zs27c4iv7h908','人民日报','湖北省','2020-01-23','https://www.weibo.com/2803301701/IqSwMxPd0?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1579799979519','','湖南启动重大突发公共卫生事件一级响应','2020-02-11'),('文化和旅游市场一线从业人员要掌握相关城市疾控中心及医院的名称、地址和联系电话；要密切关注游客身体状况，发现疑似病症后及时就近联系医院，按指导送医；按要求对疑似病人及时采取临时隔离措施，就地停止旅游活动。实行旅游团队跟踪监测，完善旅游团队人员和行程资料信息，对旅游团队人员进行排查，及时将当地卫生健康部门确诊的或疑似团队游客病例报告。','2020-02-11','ck6hgxcf30110s27c4od36q3o','中国政府网','北京市','2020-01-23','https://mp.weixin.qq.com/s/cICSHZNVynQj7m63RSAv1Q','','文化和旅游部、国家文物局：出现疑似病人就地停止旅游活动','2020-02-11'),('1月23日，河北省确诊第2例新型冠状病毒感染的肺炎病例。患者陈某，男，80岁，沧州市南皮县人，在武汉探亲居住2月余，返回南皮县后出现胸闷、呼吸困难，入院隔离治疗，伴有高血压、慢性支气管炎、肺气肿等基础疾病，1月22日抢救无效死亡。','2020-02-11','ck6hgxcf30112s27c91yf60fm','央视新闻','河北省','2020-01-23','https://weibo.com/2656274875/IqSjFocrm?from=page_1002062656274875_profile&wvr=6&mod=weibotime','','河北 1 例新型肺炎病例死亡','2020-02-11'),('据江西省卫健委，2020年1月23日0—23时，江西省报告新型冠状病毒感染的肺炎新增确诊病例4例（含重症病例2例）。其中南昌市1例、吉安市1例、九江市1例、新余市1例。','2020-02-11','ck6hgxcf30113s27c6gohd85x','央视新闻','江西省','2020-01-23','https://m.weibo.cn/status/4464049040965675?','','江西新增 4 例新型肺炎病例','2020-02-11'),('1月23日，按照国务院部署，财政部紧急下拨湖北省新型冠状病毒感染的肺炎疫情防控补助资金10亿元，支持湖北省开展疫情防控相关工作。（人民日报记者李忱阳） ​','2020-02-11','ck6hgxcf30116s27c8v79eia8','人民日报微博','湖北省','2020-01-23','http://m.weibo.cn/2803301701/4464041822671982','','财政部拨10亿补助湖北防控疫情','2020-02-11'),('武汉市新冠肺炎防控指挥部通告：自 2020 年 1 月 24 日 12 时起，武汉全市网约出租车停止运营；巡游出租车实行单双号限行。恢复时间另行通告。','2020-02-11','ck6hgxcf30117s27cbhbtbqg6','人民日报微博','湖北省','2020-01-23','http://m.weibo.cn/2803301701/4464035300562048','','武汉网约出租停运，巡游出租单双号限行','2020-02-11'),('国家卫健委专家高福表示，病毒不光在感染的人体内看到了，在华南海鲜市场非法销售野生动物的这些摊位也分离到了病毒，这应该说是证据确凿。','2020-02-11','ck6hgxcf30119s27c0z9cgwz0','人民日报','湖北省','2020-01-23','t.cn/A6Pw9Nt9 ​ http://m.weibo.cn/2803301701/4464039793147643','','证据确凿！新冠肺炎病毒来自野生动物','2020-02-11'),('1月23日，根据国家卫生健康委关于各省首例新型冠状病毒感染的肺炎最新确诊程序，以及《新型冠状病毒感染的肺炎诊疗方案（试行第三版）》规定，甘肃省确认2例新型冠状病毒感染的肺炎确诊病例。  甘肃省首例疑似病例吴某某，经中国疾控中心实验室复核检测，呈新型冠状病毒核酸阳性，结合患者临床表现、流行病学史，确认为新型冠状病毒感染的肺炎确诊病例。','2020-02-11','ck6hgxcf3011as27c40i6cs4r','人民日报','甘肃省','2020-01-23','https://wap.peopleapp.com/article/5071498/4965957','','甘肃省确认2例新型冠状病毒感染的肺炎确诊病例','2020-02-11'),('1月23日，赤壁市新型冠状病毒感染的肺炎防控指挥部发布通告：为全力做好新型冠状病毒感染的肺炎疫情防控工作，有效切断病毒传播途径，坚决遏制疫情蔓延势头，确保人民群众生命安全和身体健康，自2020年1月24日0时起，赤壁市城市公交、农村客运、省县级客运暂停运营，恢复时间另行通告。','2020-02-11','ck6hgxcf4011bs27c41ki9rkt','人民日报','湖北省','2020-01-23','https://weibo.com/2803301701/IqRwg0asp?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1579789568714','','湖北赤壁公交客运暂停运营','2020-02-11'),('①仙桃启动突发公共卫生事件二级响应；②市内所有公交车、渡船，包括农村客运车全部停运；③市内高速出口、火车站体温检测排查点全部设置到位；④取消一切群体性宴席集会，包括群众自发组织的聚会；⑤取消全市农(集)贸市场活禽交易；关闭全市所有游乐场所、娱乐场所、室内运动场所（包括电影院、卡拉OK、书店、网吧等）。','2020-02-11','ck6hgxcf4011cs27ce74q7ye6','人民日报','湖北省','2020-01-23','https://weibo.com/2803301701/IqRqTgOEe?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1579788703283','','湖北仙桃新冠肺炎疫情防控指挥部1号令','2020-02-11'),('根据四川省卫健委的安排，将派出135人组建的第一批援助湖北的医疗队。其中包括四川大学华西医院、省人民医院，川北医学院附属医院、西南医科大学附属医院、省第四人民医院、成都中医药大学附属医院、西南医科大学附属中医医院和省第二中医医院的专家。各医院重点安排呼吸科，感染科，重症医学科或呼吸科重症医学专业的医生。','2020-02-11','ck6hgxcf4011ds27c4swp9qhq','人民日报','四川省','2020-01-23','https://weibo.com/2803301701/IqRnp1phi?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1579788480715','','四川派出135人组建第一批援助湖北医疗队','2020-02-11'),('为全力做好新型冠状病毒肺炎疫情联防联控工作，民航局要求，自2020年1月24日0时起，此前已购买民航机票的旅客自愿退票的，各航空公司及其客票销售代理机构应免费办理退票，不得收取任何费用。','2020-02-11','ck6hgxcf4011es27c8kmuccuz','央视新闻','北京市','2020-01-23','https://weibo.com/2656274875/IqRnAwyjG?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579788183733','','民航机票免收退票费','2020-02-11'),('新加坡卫生部今晚确认，新加坡确认首例新型冠状病毒病例。患者是一位66岁男子。另有一名53岁女子初步测试结果呈阳性，目前正在等待最终的检测结果。','2020-02-11','ck6hgxcf4011fs27cawlsftid','央视新闻','','2020-01-23','https://weibo.com/2656274875/IqR3d2Gm5?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579786576906','','新加坡确认首例新型冠状病毒病例','2020-02-11'),('1月23日0-18时，江苏省报告新型冠状病毒感染的肺炎新增确诊病例4例。其中，南京市2例、连云港市和扬州市各1例，为南京市、连云港市和扬州市首次报告确诊病例。4例病例均有近期武汉旅行史。','2020-02-11','ck6hgxcf4011gs27cc707fwz4','央视新闻','江苏省','2020-01-23','https://weibo.com/2656274875/IqR8LyMDn?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579786167508','','江苏新增新型肺炎病例 4 例','2020-02-11'),('1月23日，教育部再发通知，要求教育系统做好新型冠状病毒感染的肺炎疫情防控应急预案工作。要求密切关注疫情发展情况，提前对春季开学有关情况做出科学研判，必要时对学校教学安排及相关工作做出调整。有关高校必须做好开学前疫情防控工作预案。','2020-02-11','ck6hgxcf4011hs27cf7w8f72a','人民日报','北京市','2020-01-23','https://weibo.com/2803301701/IqQYfowAq?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1579784552681','','教育部要求高校做好开学前疫情防控预案','2020-02-11'),('根据《广东省突发公共卫生事件应急预案》，结合我省当前新型冠状病毒感染的肺炎疫情防控形势，省新型冠状病毒感染的肺炎疫情防控工作领导小组决定，启动广东省重大突发公共卫生事件一级响应。','2020-02-11','ck6hgxcf4011is27c5lyj984s','人民日报','广东省','2020-01-23','https://weibo.com/2803301701/IqQU86jsH?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1579783822682','','广东启动重大突发公共卫生事件一级响应','2020-02-11'),('人民日报记者从省教育厅获悉，今年春季湖北省中小学开学确定延期，但具体何时开学有待后续公布。 ​​​','2020-02-11','ck6hgxcf4011js27c49os5c6z','人民日报','湖北省','2020-01-23','https://weibo.com/2803301701/IqQisx7uW?refer_flag=1001030103_&type=comment#_rnd1579781802613','','湖北中小学开学确定延期','2020-02-11'),('人社部、财政部、卫健委今天印发有关人员因履职感染新型肺炎保障通知，明确在新型冠状病毒肺炎预防和救治工作中，医护及相关工作人员因履行工作职责，感染新型冠状病毒肺炎或因感染新型冠状病毒肺炎死亡的，应认定为工伤，依法享受工伤保险待遇。','2020-02-11','ck6hgxcf4011ls27c9a37fi97','人民日报','北京市','2020-01-23','https://weibo.com/2803301701/IqQE5tZla?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1579781604946','','人社部：医护人员感染新型肺炎应认定工伤','2020-02-11'),('湖北省新冠肺炎防控再升级，湖北省文旅厅提出6条措施','2020-02-11','ck6hgxcf4011ms27c9hys135h','人民日报','湖北省','2020-01-23','https://weibo.com/2803301701/IqQyi8CcR?from=page_1002062803301701_profile&wvr=6&mod=weibotime','','武汉文娱场所暂停营业，湖北省A级景区星级饭店活动一律取消','2020-02-11'),('北京市文化和旅游局发布：根据市委市政府防控工作领导小组总体部署，即日起，北京市取消包括庙会在内的大型活动。请市民朋友们加强防范，予以支持。随着疫情变化，我们将随时对全市相关活动举办情况进行通报。大型活动取消后，活动主办单位将积极做好相关善后工作。','2020-02-11','ck6hgxcf4011ns27ceh5bchcj','人民日报','北京市','2020-01-23','https://weibo.com/2803301701/IqQwkolbL?ref=home&rid=2_0_202_2606538780623294377_0_0_0','','北京取消大型活动','2020-02-11'),('武汉慈善总会负责接受捐款和通用物资、红十字会负责接受医用耗材、防护用品等专项物资。当前急需物资包括：医用设备、医疗设备、试剂、药品、防护设备、消洗设备、耗材（口罩需求量较大）等。','2020-02-11','ck6hgxcf4011os27cd65ueun7','人民日报','湖北省','2020-01-23','https://weibo.com/2803301701/IqQpK3Vtc?ref=home&rid=0_0_202_1413096853739001444_0_0_0','','武汉新冠肺炎防控指挥部第4号通告','2020-02-11'),('刚刚，香港电台网站援引香港卫生署消息称，香港2例高度疑似新型冠状病毒感染的肺炎病例被确诊。 ​​​','2020-02-11','ck6hgxcf4011ps27cg6eh56wu','人民日报','香港','2020-01-23','https://weibo.com/2803301701/IqQaBzbk5?ref=home&rid=3_0_202_2606570211193007993_0_0_0','','香港确诊2例新型肺炎病例','2020-02-11'),('据襄阳市新型冠状病毒感染的肺炎防控领导小组办公室通报：截至2020年1月22日20:00，襄阳市新增新型冠状病毒感染的肺炎疑似病例28例，累计达到31例（其中襄城区20例，樊城区5例，枣阳市3例，南漳县3例）。襄阳市已按照国家卫健委关于新型冠状病毒感染的肺炎防控工作方案的要求，采取了在当地定点医疗机构隔离诊断救治的措施。同时，对疑似患者迅速开展了流行病学调查，并对其密切接触者实施医学观察。','2020-02-11','ck6hgxcf4011qs27c7xljgxcf','人民日报','湖北省','2020-01-23','https://weibo.com/2803301701/IqQ5yiMWI?ref=home&rid=1_0_202_2669688664026705533_0_0_0','','襄阳发现新冠肺炎疑似病例31例','2020-02-11'),('1月23日，新疆维吾尔自治区卫生健康委首次确认全区2例新型冠状病毒感染的肺炎确诊病例。','2020-02-11','ck6hgxcf4011rs27c3jnq88vt','央视新闻','新疆维吾尔自治区','2020-01-23','https://weibo.com/2656274875/IqPPzg76l?ref=home&rid=3_0_202_2667274531628325700_0_0_0','','新疆确诊2例新型肺炎病例','2020-02-11'),('1月23日，根据国家卫健委关于各省首例新型冠状病毒感染的肺炎最新确诊程序以及《新型冠状病毒感染的肺炎诊疗方案》（试行第三版）规定，经省级医疗救治专家组会商，来自武汉或与武汉病例有接触并出现发热等呼吸道症状4例患者中，确认3例输入性新型冠状病毒感染的肺炎确诊病例。','2020-02-11','ck6hgxcf4011ss27cctmtgl8s','人民日报','陕西省','2020-01-23','https://weibo.com/2803301701/IqPMidEzh?from=page_1002062803301701_profile&wvr=6&mod=weibotime','','陕西确诊3例新型肺炎病例','2020-02-11'),('北京市卫健委：截至今日14时北京市新增8例新型冠状病毒感染的肺炎病例，累计病例22人。 ​​​​','2020-02-11','ck6hgxcf4011ts27c6x2pfc6h','央视新闻','北京市','2020-01-23','https://weibo.com/2656274875/IqPL9kMxK?from=page_1002062656274875_profile&wvr=6&mod=weibotime','','北京新增8例新型肺炎病例','2020-02-11'),('深圳市第三人民医院通报：截至今天下午四点，深圳市第三人民医院收治的第一批新型冠状病毒感染患者中，有2例确诊的患者已经痊愈出院，1例密切接触者也已经痊愈出院。流程严格按照省、市专家组的会诊后，达到出院的标准。 ​​​','2020-02-11','ck6hgxcf4011us27c1xy6ckgi','央视新闻','广东省','2020-01-23','https://weibo.com/2656274875/IqPDmef1r?ref=home&rid=1_0_202_2669548356034745105_0_0_0','','好消息！深圳两新型肺炎确诊患者出院','2020-02-11'),('今日16时，福建省报告新增输入性新型冠状病毒感染的肺炎1例确诊病例和2例疑似病例。其中：福州市新增1例确诊病例，厦门市新增2例疑似病例。新增患者均为武汉返乡人员，目前患者病情平稳，正在接受隔离治疗，追踪到的密切接触者正在接受医学观察。','2020-02-11','ck6hgxcf4011vs27c1n2e4cv4','央视新闻','福建省','2020-01-23','https://weibo.com/2656274875/IqPu3mldD?ref=home&rid=0_0_202_2632724216972980252_0_0_0','','福建新增1例新型肺炎确诊病例，另新增2例疑似病例','2020-02-11'),('鄂州市新型冠状病毒感染的肺炎疫情防控指挥部：为全力做好新型冠状病毒感染的肺炎疫情防控工作，有效切断病毒传播途径，坚决遏制疫情蔓延势头，确保人民群众生命安全和身体健康，现将有关事项通告如下：自2020年1月23日11:20起，全市铁路车站通道暂时关闭，恢复时间另行通知。','2020-02-11','ck6hgxcf4011ws27c0vigcjx7','人民日报','湖北省','2020-01-23','https://weibo.com/2803301701/IqPqkikC5?ref=home&rid=0_0_202_1413096458600052330_0_0_0','','湖北鄂州铁路车站关闭','2020-02-11'),('为全力做好新型冠状病毒感染的肺炎疫情防控工作，有效切断病毒传播途径，坚决遏制疫情蔓延势头，确保人民群众生命安全和身体健康，湖北黄冈新型冠状病毒感染的肺炎防控工作指挥部发布通告。','2020-02-11','ck6hgxcf4011xs27c5cjdfppu','人民日报','湖北省','2020-01-23','https://weibo.com/2803301701/IqPnwhj3U?ref=home&rid=0_0_202_793502698364441048_0_0_0','','湖北黄冈新型冠状病毒感染的肺炎防控工作指挥部通告','2020-02-11'),('今天上午，浙江省政府紧急召开全省新型冠状病毒感染的肺炎疫情防控工作视频会议，根据《浙江省突发公共卫生事件应急预案》，会议决定启动重大公共突发卫生事件一级响应。','2020-02-11','ck6hgxcf5011ys27c9lgx8suk','央视新闻','浙江省','2020-01-23','https://weibo.com/2656274875/IqPjriPxp?ref=home&rid=1_0_202_2669526159643354715_0_0_0','','浙江重大公共突发卫生事件一级响应启动','2020-02-11'),('根据温州市中心医院的消息，1月22日，温州市诊治专家组会诊，温州首例新型冠状病毒感染的肺炎确诊患者杨某某体温恢复正常已达3天以上，各项生命体征平稳，肺部影像学显示炎症明显吸收，1月18日、1月20日连续两次呼吸道病原核酸检测阴性，已基本痊愈。','2020-02-11','ck6hgxcf5011zs27c5dhagdyx','人民日报','浙江省','2020-01-23','https://mp.weixin.qq.com/s/SMyWlpFu8K8NQCxptU8V9g','','好消息！温州首例新型肺炎患者基本痊愈','2020-02-11'),('据海南省卫健委通报，截至1月23日7时，海南省新型冠状病毒感染的肺炎新增确诊病例1例。海南省累计报告确诊病例5例，无重症病例、死亡病例和出院病例。确诊病例中，三亚市2例、海口市1例、万宁市1例、临高县1例。目前追踪到密切接触者329人，已解除医学观察0人，尚有329人正在接受医学观察。','2020-02-11','ck6hgxcf50120s27c4ti20rww','央视新闻','海南省','2020-01-23','https://weibo.com/2656274875/IqOZA1ovA?from=page_1002062656274875_profile&wvr=6&mod=weibotime','','海南新增1例新型肺炎确诊病例','2020-02-11'),('武汉市文化和旅游局今天通报，为遏制新型冠状病毒感染的肺炎疫情蔓延，全市所有旅游团队一律取消。全市所有旅行社企业不得以任何方式推诿，并做好团队取消的后续工作。由于不可抗力不能成行而取消旅游合同的，旅行社和游客均不需要支付违约金，旅行社应退回游客前期所交的预付金。','2020-02-11','ck6hgxcf50121s27cc2fw1yup','央视新闻','湖北省','2020-01-23','https://m.weibo.cn/2656274875/4463917416272052','','武汉所有旅游团队一律取消','2020-02-11'),('武汉市新型肺炎防控指挥部通报：为做好社会各界捐赠武汉市抗击疫情的医用耗材、防护用品等物质接收调配工作，现开通 24 小时电话接收社会各界爱心捐赠。武汉市红十字会电话：027-82788599，027-82210181，027-82812604，027-82858499，027-82856122','2020-02-11','ck6hgxcf50122s27cftuu46sm','央视新闻','湖北省','2020-01-23','https://m.weibo.cn/2656274875/4463902358582553','','武汉开通 24 小时电话接收捐赠','2020-02-11'),('1月22日12时至1月23日12时，浙江省新增新型冠状病毒感染的肺炎确诊病例17例。其中杭州5例、宁波2例、温州2例、绍兴1例、金华1例、衢州1例、台州5例。 ​​​​','2020-02-11','ck6hgxcf50123s27cg0sabs5s','央视新闻微博','浙江省','2020-01-23','http://dxys.com/8dHLoV','','浙江新增 17 例新型肺炎确诊病例','2020-02-11'),('国家卫生健康委确认，黑龙江省大庆市肇州县发现1名新型冠状病毒感染的肺炎疑似病例。目前，黑龙江省共有2例新型冠状病毒感染的肺炎确诊病例。','2020-02-11','ck6hgxcf50124s27cabzwedhj','央视新闻微博','黑龙江省','2020-01-23','http://dxys.com/aem9vw','','黑龙江发现 1 例新型肺炎疑似病例','2020-02-11'),('国家卫生健康委确认，黑龙江省大庆市肇州县发现2名新型冠状病毒感染的肺炎疑似病例。刘某某（男、73岁），张某某（女、72岁），2人为夫妇，夫妇二人于1月8日、14日到泰国旅游，往返途中分别经停武汉10小时和5小时。','2020-02-11','ck6hgxcf50125s27c46hhhsth','央视新闻微博','黑龙江省','2020-01-23','http://dxys.com/zkp9cU','','黑龙江发现 2 例新型肺炎疑似病例','2020-02-11'),('1月22日16时至1月23日10时,安徽省报告新型冠状病毒感染的肺炎新增确诊病例8例。其中六安市、滁州市、阜阳市、亳州市为报告首例确诊病例，合肥市新增确诊病例4例。截至1月23日10时,安徽省累计报告新型冠状病毒感染的肺炎确诊病例9例','2020-02-11','ck6hgxcf50126s27c3344e4h1','央视新闻微博','安徽省','2020-01-23','http://dxys.com/IYMXJ9','','安徽新增 8 例新型肺炎确诊病例','2020-02-11'),('甘肃省卫健委消息，甘肃省发现首例新型冠状病毒感染的肺炎疑似病例。根据病例临床表现、流行病学史、实验室检测结果，判定为新型冠状病毒感染的肺炎疑似病例。','2020-02-11','ck6hgxcf50127s27c0ci60dfp','央视新闻微博','甘肃省','2020-01-23','http://dxys.com/pxboAu','','甘肃发现首例新型肺炎疑似病例','2020-02-11'),('1月22日0—24时，江西省报告新型冠状病毒感染的肺炎新增确诊病例1例，属重症病例。新增病例为南昌市报告首例确诊病例。截至1月22日24时，江西省累计报告新型冠状病毒感染的肺炎确诊病例3例，其中重症病例2例，死亡病例0例，出院病例0例。','2020-02-11','ck6hgxcf50128s27c20zh5p8s','央视新闻微博','江西省','2020-01-23','http://dxys.com/25jQWV','','江西新增 1 例新型肺炎确诊病例','2020-02-11'),('据贵州卫健委，1月22日，贵州新增2例新型冠状病毒感染的肺炎确诊病例，截至1月23日12:00，贵州共确诊3例新型冠状病毒感染的肺炎病例。所有病例均有武汉居住史、旅行史和密切接触史，目前均在定点医疗机构接受隔离治疗，病情平稳，无重症病例。当地卫生健康等部门已对密切接触者进行追踪随访。','2020-02-11','ck6hgxcf50129s27c3liq1n7e','央视新闻微博','贵州省','2020-01-23','http://dxys.com/0QYxTk','','贵州新增新型肺炎确诊病例 2 例','2020-02-11'),('1月23日凌晨，内蒙古自治区满洲里市发现1例新型冠状病毒感染的肺炎疑似病例。患者男，30岁，家住武汉市，从事服装生意，21日自驾游到满洲里市后，直接到满洲里市人民医院急诊科就诊。目前该患者已在定点医院接受隔离治疗，病情平稳，密切接触者已实行医学观察。患者实验室检验结果正在按规定复核中，一旦确诊，将及时向社会公布。','2020-02-11','ck6hgxcf5012bs27c9mql7i0g','央视新闻微博','内蒙古自治区','2020-01-23','http://dxys.com/VEgUax','','内蒙古发现 1 例新型肺炎疑似病例','2020-02-11'),('今天，湖南省新增5例新型冠状病毒感染的肺炎确诊病例,其中长沙市3例,永州市1例,郴州市1例。5名患者均有武汉暴露史。目前,5名患者病情稳定,正在当地定点医院隔离治疗,密切接触者目前无发热等异常状况。','2020-02-11','ck6hgxcf5012cs27cg6xk86t2','央视新闻微博','湖南省','2020-01-23','http://dxys.com/vMGNUk','','湖南新增新型肺炎确诊病例 5 例','2020-02-11'),('辽宁省卫健委：今天，辽宁新增1例输入性新型冠状病毒感染的肺炎确诊病例。==目前，患者症状平稳，其密切接触者37人均在医学观察中。截至1月23日11时，辽宁省累计报告新型冠状病毒感染的肺炎确诊病例3例。目前3名患者均在定点医院隔离治疗，病情稳定。全部密切接触者均实施医学观察。','2020-02-11','ck6hgxcf5012ds27c6e4ha8fx','央视新闻微博','辽宁省','2020-01-23','http://dxys.com/FCBKxS','','辽宁新增 1 例新型肺炎确诊病例','2020-02-11'),('今天11时，福建省报告新增输入性新型冠状病毒感染的肺炎3例。其中厦门市、泉州市、宁德市分别报告1例确诊病例，均为当地首例确诊病例。新增患者均为武汉返乡人员，目前患者病情平稳，正在接受隔离治疗，追踪到的密切接触者正在接受医学观察。','2020-02-11','ck6hgxcf5012es27c0bq071w5','央视新闻微博','福建省','2020-01-23','http://dxys.com/EWimM2','','福建新增 3 例新型肺炎确诊病例','2020-02-11'),('吉林卫健委：昨天，长春市一名自武汉返乡的疑似病例经国家卫生健康委评估确认为我省首例输入性新型冠状病毒感染的肺炎确诊病例。','2020-02-11','ck6hgxcf5012fs27cfgu86yeo','央视新闻微博','吉林省','2020-01-23','http://dxys.com/cyoeNB','','吉林确诊首例新型肺炎病例','2020-02-11'),('据广东省卫健委：1月22日0-24时，广东省报告新型冠状病毒感染的肺炎新增确诊病例6例。其中中山、肇庆各有1例为首例确诊病例。其他2个地市新增确诊病例中，广州3例、深圳1例。','2020-02-11','ck6hgxcf5012gs27c5bif1n5c','央视新闻微博','广东省','2020-01-23','http://dxys.com/e2Wok6','','广东新增 6 例新型冠状病毒肺炎确诊病例','2020-02-11'),('四川省卫健委发布：截至今天8时，四川省累计报告新型冠状病毒感染的肺炎确诊病例8例（其中成都4例、绵阳2例、广安1例、达州1例），疑似病例4 例（其中成都2例，遂宁1例，广安1例），以上12人均在定点医疗机构接受诊治，病情稳定。已对密切接触者实施医学观察，目前均无发热等异常情况','2020-02-11','ck6hgxcf5012hs27c7ojp3eg5','央视新闻微博','四川省','2020-01-23','http://dxys.com/gQ7vXn','','四川新增确诊3例新型肺炎病例','2020-02-11'),('据山东省卫健委：22日0至24时，山东省报告新型冠状病毒感染的肺炎新增确诊病例4例。其中：临沂市首次报告2例确诊病例，青岛市新增2例确诊病例。','2020-02-11','ck6hgxcf5012is27c4lpp8m5j','央视新闻','山东省','2020-01-23','http://dxys.com/klrdJ8','','山东新增4例新型肺炎确诊病例','2020-02-11'),('1 月 22 日，同济医院专家组编写《新型冠状病毒肺炎诊疗快速指南》，以及来自华中科技大学同济医学院附属协和医院的《武汉协和医院处置 2019 新型冠状病毒感染策略及说明》对外发布（点击次条可跳转查看具体内容）。','2020-02-11','ck6hgxcf5012js27c3iwq9j8u','丁香园','湖北省','2020-01-22','https://mp.weixin.qq.com/s/lo_Yd1ikwVWeCB59UJtTTQ','','武汉同济、武汉协和同时发布新型冠状病毒肺炎快速诊疗指南','2020-02-11'),('自1月22日下午5时至1月23日上午8时，西安、咸阳、延安发现4例来自武汉或与武汉病例有接触并出现发热等呼吸道症状患者，其中西安2例，咸阳1例，延安1例，目前均在定点医院隔离治疗，病情稳定，密切接触者已实行医学观察。患者实验室检验结果正在按规定复核中，一旦确诊，将及时向社会公布。','2020-02-11','ck6hgxcf5012ks27cduj03kbz','央视新闻','陕西省','2020-01-23','http://dxys.com/gTAnvn','','陕西新增 4 例疑似病例','2020-02-11'),('1月22日0时—24时，本市新增7例新型冠状病毒感染的肺炎确诊病例，均已在定点医院接受隔离治疗。患者中男性4例、女性3例，均有武汉流行病学关联。其中，1例88岁男性患者合并心肺功能不全，病情危重。密切接触者正在接受医学观察。','2020-02-11','ck6hgxcf6012ls27c119e543p','上海市卫健委','上海市','2020-01-23','http://dxys.com/g8Vhk6','','上海新增7例新型冠状病毒感染的肺炎确诊病例','2020-02-11'),('截至1月22日24时，国家卫健委收到国内25个省（区、市）累计报告新型冠状病毒感染的肺炎确诊病例571例，其中重症95例，死亡17例（均来自湖北省）。13个省（区、市）累计报告疑似病例393例。全国共有25个省（区、市）报告疫情，新增河北、辽宁、江苏、福建4个省。','2020-02-11','ck6hgxcf6012ms27c96ne5fsd','央视新闻','湖北省','2020-01-23','https://m.weibo.cn/2656274875/4463810716443567','','截至1月22日24时，国内累计571例新型肺炎','2020-02-11'),('针对近日新型冠状病毒感染的肺炎疫情加重，导致相关类型口罩需求量暴增的情况，工信部正按照重大传染病联防联控工作机制要求，紧急协调各省、市、自治区工信部门组织本地口罩生产企业克服春节期间用工困难，尽快抓紧生产，有效保障市场供应。','2020-02-11','ck6hgxcf6012ns27c4cms5jgm','央视新闻','湖北省','2020-01-22','https://www.weibo.com/2656274875/IqHv2736b?refer_flag=1001030103_','','工信部紧急协调口罩生产确保市场供应','2020-02-11'),('武汉市新型冠状病毒感染的肺炎疫情防控指挥部发布通告：自2020年1月23日10时起，武汉全市城市公交、地铁、轮渡、长途客运暂停运营；无特殊原因，市民不要离开武汉，机场、火车站离汉通道暂时关闭。','2020-02-11','ck6hgxcf6012os27ccwu29422','人民日报','湖北省','2020-01-22','https://www.weibo.com/2803301701/IqJCvwRuB?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1579731711822','','武汉公交地铁轮渡长途客运23日起停运','2020-02-11'),('目前，广西已确诊5例新型肺炎病例（北海3例、梧州1例、柳州1例），均有武汉居住史、工作史或武汉病例接触史。（总台央视记者张卉 尹智磊）','2020-02-11','ck6hgxcf6012ps27c76zj0kbt','央视新闻','广西壮族自治区','2020-01-22','https://www.weibo.com/2656274875/IqJdjB2oy?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579713810933','','广西新增3例新型肺炎病例','2020-02-11'),('1月21日，国家市场监管总局、农业农村部、国家林业和草原局下发《关于加强野生动物市场监管 积极做好疫情防控工作的紧急通知》，要求各地林草、农业农村和市场监管部门依照《中华人民共和国野生动物保护法》规定和职责分工，突出饲养、繁育、运输、出售、购买等环节，加强检验检疫力度。','2020-02-11','ck6hgxcf6012qs27c5ztm1pey','央视新闻客户端','湖北省','2020-01-22','http://m.news.cctv.com/2020/01/22/ARTI5g3qj3fWm34yoBvb5Sgy200122.shtml','','三部门发紧急通知：加强野生动物市场监管 积极做好疫情防控','2020-02-11'),('国家卫生健康委确认黑龙江省首例输入性新型冠状病毒感染的肺炎确诊病例。患者为男性，69岁，牡丹江市人。1月12日从武汉市返回牡丹江市后，因发热、咳嗽咳痰、周身乏力于牡丹江市第二医院隔离治疗。目前，患者病情较重，正处于全力救治中。该患者密切接触者正在医学观察，目前暂无异常。','2020-02-11','ck6hgxcf6012rs27c8zlx8wkw','央视新闻','黑龙江省','2020-01-21','https://m.weibo.cn/2656274875/4463700323132715','','黑龙江确诊首例新型肺炎病例','2020-02-11'),('22日，国家卫健委确认苏州一例新型冠状病毒感染的肺炎确诊病例。患者为男性，37岁，现居苏州市工业园区，1月10日从武汉市返苏，至发热门诊就医，当日转至定点医疗机构隔离治疗。该病例为江苏首例新型冠状病毒感染的肺炎确诊病例。目前该患者生命体征比较平稳，体温恢复正常。','2020-02-11','ck6hgxcf6012ss27ce2iof8f7','央视新闻微博','江苏省','2020-01-22','http://dxys.com/cLPSeF','','江苏确诊首例新型病毒肺炎病例','2020-02-11'),('今天，北京新确诊 4 例新型冠状病毒感染的肺炎病例。目前，4 名患者病情平稳，在定点医院接受隔离治疗。现已对 35 名密切接触者开展医学观察，目前无发热等异常情况。截至今天 18 时，北京确诊 14 例新型肺炎病例','2020-02-11','ck6hgxcf6012ts27ch2370537','央视新闻微博','北京市','2020-01-22','http://dxys.com/ouXa91','','北京新增 4 例新型肺炎病例','2020-02-11'),('22日，国家卫生健康委确认河北省首例新型冠状病毒感染的肺炎确诊病例。患者李某，男，72岁，武汉市人。当前，患者继续在定点医院隔离治疗，病情平稳。河北省已对6名密切接触者开展了隔离医学观察，目前无发热等异常情况。','2020-02-11','ck6hgxcf6012us27cceui8ywo','人民日报','河北省','2020-01-22','https://weibo.com/2803301701/IqIgXzszS?filter=hot&root_comment_id=0&type=comment#_rnd1579704801559','','河北确诊首例新型肺炎病例','2020-02-11'),('截至1月21日24时，武汉市累计报告新型冠状病毒感染肺炎病例363例，已治愈出院28例，死亡9例。其中，武汉新增确诊新型肺炎105例，新增死亡病例3例。','2020-02-11','ck6hgxcf6012vs27cb4ac00e0','人民日报','湖北省','2020-01-22','https://weibo.com/2803301701/IqIdQBHpP?filter=hot&root_comment_id=0&type=comment','','武汉确诊新型肺炎363例死亡9例','2020-02-11'),('湖北省政府召开新闻发布会，截至今天晚上8点，湖北省累计报告新型冠状病毒感染病例444例，17人死亡。 ​​​','2020-02-11','ck6hgxcf6012ws27c7bi12037','人民日报','湖北省','2020-01-22','https://m.weibo.cn/2803301701/4463659813970854','','新型肺炎已致湖北17人死亡','2020-02-11'),('1月22日，山东省威海市确认1例输入性新型冠状病毒感染的肺炎确诊病例。 患者为38岁男性，在浙江省舟山市工作，曾密切接触过新型冠状病毒感染的肺炎确诊病人，1月18日赴威海乳山市探亲，1月20日因发烧在威海市就诊后被收入院隔离治疗。','2020-02-11','ck6hgxcf6012xs27c0t1m4p81','人民日报','山东省','2020-01-22','https://wap.peopleapp.com/article/5068189/4962549','','山东省威海市确认1例输入性新型肺炎确诊病例','2020-02-11'),('为有效应对新型冠状病毒感染的肺炎疫情，武汉市决定即日起（22日）全市启动进出城道口重大疫情排查防控工作，依法依规对过往车辆及人员实施疫情排查防控。市指挥部要求各区依托全市公安检查站设置疫情检测点，严格筛查检测，坚决防止疫情输出扩散风险。不漏一车不漏一人！','2020-02-11','ck6hgxcf6012ys27chfrn1kju','人民日报','湖北省','2020-01-22','https://weibo.com/2803301701/IqHKm9Vds?filter=hot&root_comment_id=0&type=comment#_rnd1579700622631','','武汉对进出城车辆人员实施疫情排查','2020-02-11'),('22日晚，香港特区政府食物及卫生局局长陈肇始表示，香港发现一例高度怀疑新型冠状病毒肺炎个案。初步化验结果为阳性。该患者39岁，21日晚乘高铁抵港，曾到过武汉，现在在当地医院传染病中心接受隔离治疗。','2020-02-11','ck6hgxcf6012zs27chf64g659','人民日报','香港','2020-01-22','https://weibo.com/2803301701/IqHjqh1E7?filter=hot&root_comment_id=0&type=comment#_rnd1579696477039','','香港发现1例高度怀疑为新型肺炎个案','2020-02-11'),('新型肺炎疫情最新汇总：截至1月22日19时20分，全国新型冠状病毒感染肺炎确诊473例。 ​​​','2020-02-11','ck6hgxcf60130s27cdjw39poo','人民日报','北京市','2020-01-22','https://weibo.com/2803301701/IqH09DyCi?filter=hot&root_comment_id=0&type=comment#_rnd1579693620799','','全国已确诊473例新型肺炎病例','2020-02-11'),('截至2020年1月22日18时，河南累计报告新型冠状病毒感染的肺炎病例5例（郑州市2例、洛阳市1例、三门峡市1例、巩义市1例）。所有病例均有武汉居住史，目前均在定点医疗机构接受隔离治疗。无死亡病例。','2020-02-11','ck6hgxcf60131s27c5io013sv','人民日报','河南省','2020-01-22','https://weibo.com/2803301701/IqGV4lCay?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1579692531310','','河南新增4例新型肺炎确诊病例，均有武汉居住史','2020-02-11'),('首例确诊病例黄某，女，66岁，武汉市民，2020年1月12日，黄某跟随家人从武汉市出发自驾旅行，1月16日下午到达北海市，自觉身体不适，1月17日就诊并收住院治疗，现患者体温正常，生命体征平稳，38名密切接触者正在医学观察中。此外柳州市新增疑似病例1例。','2020-02-11','ck6hgxcf60132s27c3m8dgvfe','人民日报','广西壮族自治区','2020-01-22','https://weibo.com/2803301701/IqGTwh0C1?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1579692168196','','广西确诊2例新型肺炎病例','2020-02-11'),('今天，国家卫健委确认宁夏首例输入性新型冠状病毒感染的肺炎确诊病例。患者为男性，29岁，宁夏人，在武汉工作。1月19日乘飞机抵达银川，当晚在自治区人民医院就诊后隔离治疗。专家组确认该病例为新型冠状病毒感染的肺炎确诊病例。现患者病情稳定。 ​​​','2020-02-11','ck6hgxcf60133s27cfpln0uc7','央视新闻','宁夏回族自治区','2020-01-22','https://weibo.com/2656274875/IqGRMsgUh?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579691823662','','宁夏确诊首例新型肺炎病例：在武汉工作','2020-02-11'),('截止22日16时，四川累计报告新型冠状病毒感染的肺炎确诊病例5例（其中成都2例、绵阳2例、广安1例），疑似病例2例（均在成都），以上7人均在定点医疗机构接受诊治，病情稳定。已对密切接触者实施医学观察，目前均无发热等异常情况。','2020-02-11','ck6hgxcf60134s27ccah6gla8','央视新闻','四川省','2020-01-22','https://weibo.com/2656274875/IqGDxbyp4?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579690172738','','四川新增3例新型肺炎病例','2020-02-11'),('今天，国家卫健委确认山西省首例新型冠状病毒感染的肺炎确诊病例。患者，男，太原市人，1月12日至15日在武汉旅游。19日出现发热伴头痛症状。20日到山西白求恩医院发热门诊就诊。21日转至山西省定点医院（太原市第四人民医院）隔离治疗。目前患者病情稳定。已对6名密切接触者进行了追踪和医学观察，目前无异常。','2020-02-11','ck6hgxcf60135s27c05csafm7','央视新闻','山西省','2020-01-22','https://weibo.com/2656274875/IqGCB0OTO?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579689880506','','山西确诊首例新型肺炎病例','2020-02-11'),('1月21日18时-1月22日12时，重庆市新增1例输入性新型冠状病毒感染的肺炎确诊病例，累计报告确诊病例6例（万州2例、巫山2例、长寿1例、垫江1例），均有在武汉居住史或工作史，其中重症2例。所有患者均在定点医院接受治疗，目前病情平稳。所有密切接触者81人正在接受医学观察。','2020-02-11','ck6hgxcf60136s27c32sob0x1','央视新闻','重庆市','2020-01-22','https://weibo.com/2656274875/IqGziv9jc?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579691145918','','重庆共确诊6例新型肺炎病例','2020-02-11'),('湖南省新增3例新型冠状病毒感染的肺炎确诊病例，患者均为怀化市鹤城区人。患者杨某某，女，35岁；李某某，女，40岁；彭某某，男，30岁，3人为同一公司同事。杨某某与李某某12月下旬到过武汉，彭某某与其中1人是密切接触者。目前，3名患者病情稳定，正在怀化市定点医院隔离治疗，当地卫生健康等部门已对密切接触者进行追踪随访，密切接触者目前无发热等异常状况。','2020-02-11','ck6hgxcf60137s27c6jm8a31s','央视新闻','湖南省','2020-01-22','https://weibo.com/2656274875/IqGxKc0Bq?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579688920401','','湖南新增3例新型肺炎病例','2020-02-11'),('今天，国家卫健委确认贵州首例输入性新型冠状病毒感染的肺炎确诊病例。患者为51岁，男性，现居贵阳，发病前一周有武汉居住史，1月14日因发热就诊。经省疾控中心初步检测，按规定程序报中国疾控中心病毒核酸检测，检测结果为阳性。当前，患者在定点医院隔离治疗，病情平稳。','2020-02-11','ck6hgxcf60138s27cgznr8b9b','央视新闻','贵州省','2020-01-22','https://weibo.com/2803301701/IqGtrCQPF?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1579688463221','','贵州确诊首例新型肺炎病例','2020-02-11'),('1月22日，国家卫生健康委确认福建省首例输入性新型冠状病毒感染的肺炎确诊病例。患者为男性，70岁，福州市连江县人，在武汉市工作，1月17日返回连江县，1月20日至连江县医院就诊并收治入院隔离治疗。目前，患者病情稳定，其在闽密切接触者正在接受医学观察。','2020-02-11','ck6hgxcf70139s27c48aq09s9','人民日报','福建省','2020-01-22','https://weibo.com/2803301701/IqGpc5njk?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1579687678831','','福建确诊首例新型肺炎病例','2020-02-11'),('22日16时，经国家卫生健康委确认，安徽省收到合肥市报告的首例新型冠状病毒感染的肺炎为确诊病例。另截至1月22日16时，省卫生健康委收到省内2市累计报告新型冠状病毒感染的肺炎疑似病例4例（合肥市3例，六安市1例）','2020-02-11','ck6hgxcf7013as27c337vdoec','人民日报','安徽省','2020-01-22','https://weibo.com/2803301701/IqG2VvjtS?ref=home&rid=0_0_8_2704774672808346954_0_0_0&type=comment#_rnd1579684374015','','安徽确诊首例新型肺炎病例','2020-02-11'),('湖北荆州已发现新型冠状病毒感染的肺炎确诊病例6例，襄阳、宜昌、十堰、荆门、咸宁、鄂州、恩施、仙桃、天门、潜江等多地发现疑似病例。 各地严防死守、严阵以待，但均不同程度出现医用口罩、防护服、测温仪等防疫物资短缺现象。湖北省拟向国家请求紧急支援，调拨医用口罩、防护服、红外测温仪等防疫物资。','2020-02-11','ck6hgxcf7013bs27c2mc5crec','人民日报','湖北省','2020-01-22','https://weibo.com/2803301701/IqFXe9Jj5?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1579685469593','','湖北多地发现新型肺炎疑似和确诊病例，湖北拟请求紧急支援口罩等医用物资','2020-02-11'),('截至今天，海南省共确诊4例新型冠状病毒感染的肺炎病例，均为输入性病例。4例患者病情平稳，体温已恢复正常，正在定点医院隔离治疗，当地卫生健康部门已对其密切接触者进行追踪随访，密切接触者目前无发热等异常状况。','2020-02-11','ck6hgxcf7013cs27cfzaxei3u','央视新闻','海南省','2020-01-22','https://weibo.com/2656274875/IqFIDEm8X?ref=home&rid=0_0_8_3071520091955001893_0_0_0&type=comment#_rnd1579681405323','','海南确诊4例新型肺炎病例','2020-02-11'),('截至1月21日24时，我委收到国内13省（区、市）累计报告新型冠状病毒感染的肺炎确诊病例440例（北京市10例、天津市2例、上海市9例、浙江省5例、江西2例、山东省1例、河南省1例、湖北省375例、湖南省1例、广东省26例、重庆市5例、四川省2例和云南省1例），其中重症102例，死亡9例（均来自湖北省）；除湖北省外，12省（区、市）累计报告疑似病例37例。','2020-02-11','ck6hgxcf7013ds27c7vhrgjt1','卫生应急办公室','北京市','2020-01-22','http://www.nhc.gov.cn/yjb/s3578/202001/a3c8b5144067417889d8760254b1a7ca.shtml','','2020年1月22日新型冠状病毒感染的肺炎疫情情况','2020-02-11'),('截至今天14时，辽宁省共确认2例新型冠状病毒感染的肺炎确诊病例。患者男性，33岁，在武汉工作，目前，患者属重症病例，生命体征平稳，其密切接触者56人均在医学观察中。患者男性，40岁，在湖北省仙桃市工作，目前，患者症状较轻，其密切接触者31人均在医学观察中。','2020-02-11','ck6hgxcf7013es27c0m44a313','央视新闻','辽宁省','2020-01-22','https://weibo.com/2656274875/IqFFYc2Gv?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579681472425','','辽宁确认2例新型肺炎病例','2020-02-11'),('截至22日12时，天津市新增2例新型冠状病毒感染的肺炎确诊病例，均已在定点医院接受隔离治疗，生命体征平稳。患者中女性1例，67岁；男性1例，40岁，均有武汉工作史。密切接触者正在接受医学观察。截至目前，天津累计发现新型肺炎病例4例。','2020-02-11','ck6hgxcf7013fs27cd9ez16wp','央视新闻','天津市','2020-01-22','https://m.weibo.cn/status/4463540671056698?','','天津新增2例新型肺炎确诊病例','2020-02-11'),('今天，泰国副总理兼卫生部长阿努霆表示，截至目前，在泰国共发现4例感染新型冠状病毒肺炎病例，其中3人是中国籍，1人是泰国籍，均与高风险地区人员有接触史。两位中国患者已经治愈，分别在18日、21日回国。另两位患者正在泰国接受治疗。','2020-02-11','ck6hgxcf7013gs27c9ltc19or','央视新闻','','2020-01-22','https://weibo.com/2656274875/IqEwEpvsJ?ref=home&rid=3_536870912_8_4726744129282722366_0_0_0&type=comment#_rnd1579670618259','','泰国共发现4例新型肺炎病例','2020-02-11'),('截至21日24:00，广东省新增报告9例新型冠状病毒感染的肺炎确诊病例。新增病例分布如下：广州2例、深圳4例、佛山1例、韶关2例；男性4例、女性5例；重症2例，均收治在当地定点医疗机构隔离治疗。','2020-02-11','ck6hgxcf7013hs27cab5fer34','央视新闻','广东省','2020-01-22','https://m.weibo.cn/status/4463511738486595?','','广东新增9例新型肺炎确诊病例','2020-02-11'),('截至今日12时，浙江省累计报告新型冠状病毒感染的肺炎病例10例，其中杭州1例、宁波3例、温州4例、舟山1例、台州1例。','2020-02-11','ck6hgxcf7013is27chx6l5tfp','央视新闻','浙江省','2020-01-22','https://m.weibo.cn/status/4463510434284981?','','浙江累计报告新型肺炎病例10例','2020-02-11'),('同济医院专家组迅速反应，根据包括同济医院在内的武汉各大医疗机构诊治的第一批患者的第一手资料，第一时间制定了《新型冠状病毒肺炎诊疗快速指南》。','2020-02-11','ck6hgxcf7013js27cglzohyoc','武汉晚报','湖北省','2020-01-22','https://mp.weixin.qq.com/s/6We-i_DzgnjUMcYaHLM-wQ','','同济专家组制定《新型冠状病毒肺炎诊疗快速指南》','2020-02-11'),('中国科学院院士、中国疾病预防控制中心主任高福表示，病毒和人类的关系就像“猫鼠游戏”。新型冠状病毒可能是从野生动物及被污染的环境中来，一开始是动物传人，但病毒在适应突变。目前证据确实显示儿童、年轻人对病毒不易感。 ​','2020-02-11','ck6hgxcf7013ks27c6ysce4lf','央视新闻','湖北省','2020-01-22','https://weibo.com/2656274875/IqDTFgnJI?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579665720969','','儿童年轻人对病毒不易感，但病毒在适应突变','2020-02-11'),('澳门新型冠状病毒感染应变协调中心今天 11 时召开新闻发布会。会上发布消息称，澳门出现首例确诊新型冠状病毒感染的案例，患者为一名来自武汉的 52 岁女子，其咽痛、咳嗽约一周，昨日到医院求诊，即时隔离。','2020-02-11','ck6hgxcf7013ls27cdndg1n5d','央视新闻','澳门','2020-01-22','https://weibo.com/2656274875/IqDIS0pET?from=page_1002062656274875_profile&wvr=6&mod=weibotime&type=comment#_rnd1579663328836','','澳门确诊首例新型肺炎感染案例','2020-02-11'),('国家卫健委介绍新型冠状病毒肺炎感染情况：截至 21 日 24 时，国内新型肺炎确诊 440 例，死亡 9 例。','2020-02-11','ck6hgxcf7013ms27c2hlldrmg','央视新闻','北京市','2020-01-22','https://m.weibo.cn/2656274875/4463476765896816','','国内新型肺炎确诊 440 例','2020-02-11'),('1月21日19时—24时，上海新增3例新型冠状病毒感染的肺炎确诊病例，均已在定点医院接受隔离治疗。截至1月21日24时，上海累计发现确诊病例9例，患者目前病情平稳，无重症病例。','2020-02-11','ck6hgxcf7013ns27c3mu38lgk','上海发布','上海市','2020-01-22','https://mp.weixin.qq.com/s/0DW5LLu6AVZK_qMW6ypgHQ','','上海新增3例新型冠状病毒感染的肺炎确诊病例','2020-02-11'),('截止昨天18:00，合肥市新增2例新型冠状病毒感染的肺炎疑似病例。患者目前已在定点医院接受隔离治疗，病情平稳。截至目前，合肥市累计发现新型冠状病毒感染的肺炎疑似病例3例。','2020-02-11','ck6hgxcf7013os27c1048hsku','央视新闻','安徽省','2020-01-22','https://m.weibo.cn/2656274875/4463461490814361','','合肥新增 2 例新型肺炎疑似病例','2020-02-11'),('记者从北京大学第一医院获悉，呼吸和危重症医学科主任王广发疑似感染新型冠状病毒肺炎，目前正在隔离治疗。王广发是新型肺炎专家组成员，曾随国家卫健委专家组前往武汉。2003年SARS疫情期间，王广发始终奋战第一线。','2020-02-11','ck6hgxcf7013ps27c25sbbmva','央视新闻','湖北省','2020-01-22','https://weibo.com/2656274875/IqCSrAXel?from=page_1002062656274875_profile&wvr=6&mod=weibotime','','国家卫健委专家组成员疑似感染#新型肺炎，在隔离治疗中','2020-02-11'),('22 日凌晨，湖北发布加强新型肺炎防控通告：根据《中华人民共和国传染病防治法》等有关法律法规的规定，省人民政府决定启动突发公共卫生事件 II 级应急响应。通告包括严格实行属地管理制度、严格实施隔离措施等7部分。','2020-02-11','ck6hgxcf7013qs27ceilf8ga0','人民日报','湖北省','2020-01-21','https://www.weibo.com/2803301701/IqClL8Mv4?from=page_1002062803301701_profile&wvr=6&mod=weibotime&type=comment#_rnd1579651850071','','湖北启动突发公共卫生事件二级应急响应','2020-02-11'),('美国疾病预防控制中心证实，华盛顿州的一名男子被确诊感染新型冠状病毒。这是美国确诊的首例新型肺炎病例。这名男子是华盛顿州斯诺霍米什县居民，他从中国武汉周边地区旅行回来后出现了症状。','2020-02-11','ck6hgxcf7013rs27ccoun908q','央视新闻','','2020-01-21','https://weibo.com/2656274875/IqAGbbtmh?from=page_1002062656274875_profile&wvr=6&mod=weibotime','','美国确诊首例新型冠状病毒肺炎','2020-02-11'),('昨天，国家卫生健康委确认江西首例输入性新型冠状病毒感染的肺炎确诊病例。患者罗某某，男，56岁，抚州市东乡区人。2019年12月20日赴武汉市进货，2020年1月9日返回东乡区。1月10日，因发热、咳嗽等症状入院隔离治疗。昨天，经专家确认为新型冠状病毒感染的肺炎确诊病例。','2020-02-11','ck6hgxcf7013ss27c2ao75ybs','央视新闻','江西省','2020-01-21','https://weibo.com/2656274875/IqAcyp3Jr?from=page_1002062656274875_profile&wvr=6&mod=weibotime','','江西确诊 2 例新型肺炎病例','2020-02-11'),('2020年1月22日，四川省卫生健康委通报我市新增3例输入性新型冠状病毒感染的肺炎疑似病例，皆由武汉来蓉，目前均在定点医疗机构隔离治疗，病情稳定。','2020-02-11','ck6hgxcf7013ts27c58m03sa8','成都卫健委官方微博','四川省','2020-01-21','https://m.weibo.cn/status/4463347036420665?','','四川省新增3例输入性新型冠状病毒感染的肺炎疑似病例','2020-02-11'),('据四川卫健委，四川已确诊第二例输入性新型冠状病毒感染的肺炎病例。患者为57岁男性，常住武汉，1月15日乘火车返回四川广安，因发热、咳嗽于16日至广安市某医院就诊，医院随即收治隔离。四川省新发现5例疑似病例，均证实为武汉返回人员，其中成都3例，绵阳2例。','2020-02-11','ck6hgxcf9013us27capqw0s6o','央视新闻','四川省','2020-01-21','https://weibo.com/2656274875/IqzRU3150?from=page_1002062656274875_profile&wvr=6&mod=weibotime','','四川确诊第 2 例新型肺炎病例','2020-02-11'),('21日，国家卫健委确认湖南长沙市首例输入性新型冠状病毒感染的肺炎确诊病例。患者罗某某，女，57岁，武汉市青山区人，来长沙市探亲，因出现发热、咳嗽等症状， 1月16日至医院就诊后被收至定点医院隔离治疗。目前，该患者病情平稳，体温已恢复正常。卫生健康部门已对其密切接触者进行追踪随访，所有密切接触者均无发热等异常状况。','2020-02-11','ck6hgxcf9013vs27c26fa5e3k','湖南省卫健委','湖南省','2020-01-21','http://dxys.com/10qE5r','','湖南确诊 1 例新型肺炎病例','2020-02-11'),('今天，国家卫健委确认昆明市首例输入性新型冠状病毒感染的肺炎确诊病例。患者为51岁男性，湖北省武汉市户籍。15日自武汉来昆。因发热、乏力等症状，16日到云南省第三人民医院就诊，17日转诊到云南省传染病医院隔离治疗。今天，经国家卫生健康委疫情应对处置领导小组的专家评估确认，该病例为新型冠状病毒感染的肺炎确诊病例。','2020-02-11','ck6hgxcf9013ws27ce29s06ds','央视新闻微博','云南省','2020-01-21','http://dxys.com/4oWkYo','','云南确诊 1 例新型肺炎病例','2020-02-11'),('今天，山东确诊1例新型冠状病毒感染的肺炎患者。患者为37岁男性，武汉人，在山东日照市工作。因发热等症状，于17日在日照市就诊，当晚自行至青岛市就诊。经预检分诊了解到其发病前两周内有武汉居住史，立即被收治入院隔离治疗。目前，患者生命体征平稳。青岛市8名、日照市45名密切接触者正接受医学观察。（总台央视记者窦效磊）','2020-02-11','ck6hgxcf9013xs27cd3p81a6q','央视新闻微博','山东省','2020-01-21','http://dxys.com/wzDWjR','','山东确诊1例新型肺炎病例','2020-02-11'),('记者从黑龙江省牡丹江市卫生健康委获悉，今天，黑龙江牡丹江市第二医院呼吸科收治一位去武汉探亲返回的69岁男性危重肺炎患者，初步判定新型冠状病毒感染可疑病人，按诊断程序，需进一步确诊。（总台央视记者王跃军 张艺馨） ​​​​','2020-02-11','ck6hgxcf9013ys27ccr4t3uhk','央视新闻微博','黑龙江省','2020-01-21','http://dxys.com/NE3zI6','','黑龙江牡丹江发现 1 例疑似新型肺炎患者','2020-02-11'),('根据临床症状和流行病学调查，经疾病预防控制中心检测、专家组评估，以上5名患者今日确诊为新型冠状病毒感染的肺炎病例。5名患者病情平稳，在定点医院接受隔离治疗。现已对21名密切接触者开展医学观察，目前无发热等异常情况。 截至1月21日18时，我市共确诊10例新型冠状病毒感染的肺炎病例，其中西城区1例、海淀区2例、丰台区1例、通州区1例、大兴区2例、昌平区2例，武汉来京人员1例。','2020-02-11','ck6hgxcf9013zs27cg3nkbcxt','北京市卫生健康委员会','北京市','2020-01-21','http://dxys.com/iMaKm3','','北京新增 5 例新型冠状病毒感染的肺炎病例','2020-02-11'),('截至今天18:00，广东省新增3例新型冠状病毒感染的肺炎确诊病例。新增病例分布如下：深圳、珠海、湛江各1例，均收治在当地定点医疗机构隔离治疗。其中，男性1例、女性2例。3例均有湖北居住史或旅行史，为散发病例，其中，重症1例。广东已对密切接触者进行追踪随访，目前暂无异常。截至目前，#广东确诊新型肺炎病例17例#，其中重症5例，危重2例，无死亡病例，另有4例疑似病例正在排查中。','2020-02-11','ck6hgxcf90140s27c0kov00me','央视新闻微博','广东省','2020-01-21','http://dxys.com/gb23sc','','广东省新增 3 例确诊新型肺炎病例','2020-02-11'),('今天，国家卫健委确认四川省首例输入性新型冠状病毒感染的肺炎确诊病例。患者为34岁男性，武汉某公司职员。从武汉到达成都后，11日因发热前往成都市某医院就诊，医院随即收治隔离。目前，患者在定点医院隔离治疗，病情平稳。（总台央视记者庞丁丁） ​​​​','2020-02-11','ck6hgxcf90141s27c656z36uf','央视新闻微博','四川省','2020-01-21','http://dxys.com/4W6FSz','','四川确诊首例新型肺炎病例','2020-02-11'),('1月21日晚，国家卫生健康委确认重庆市首例输入性新型冠状病毒感染的肺炎确诊病例。截至1月21日18时，我市累计报告新型冠状病毒感染的肺炎确诊病例5例，其中：巫山县2例、万州区2例、长寿区1例。所有病例均有武汉工作史或居住史。目前5名患者在定点医疗机构接受诊治，病情稳定。对72名密切接触者实施医学观察，目前无发热等异常情况。','2020-02-11','ck6hgxcf90142s27c7x4ca5nk','重庆市卫健委','重庆市','2020-01-21','http://dxys.com/mxDA6W','','重庆市确诊5例输入性新型冠状病毒感染的肺炎病例','2020-02-11'),('国家卫生健康委确认我省首例输入性新型冠状病毒感染的肺炎确诊病例','2020-02-11','ck6hgxcf90143s27cg0si1jb8','河南省卫生健康委微博','河南省','2020-01-21','http://dxys.com/B17WAO','','国家卫生健康委确认河南省郑州市首例输入性新型冠状病毒感染的肺炎确诊病例。','2020-02-11'),('截至今天12时，香港共发现疑似感染新型冠状病毒肺炎患者117人。今天香港公立医院向卫生部门通报，过去24小时共接收11名（5男6女、年龄由8岁至82岁）疑似感染新型冠状病毒肺炎患者。医院已经实施限制探病措施。（总台央视记者骆群）','2020-02-11','ck6hgxcf90144s27ccq71c11f','央视新闻微博','香港','2020-01-21','https://m.weibo.cn/2656274875/4463253767857045','','香港发现117名疑似感染新型肺炎患者','2020-02-11'),('截至今天19：00，上海市新增4例新型冠状病毒感染的肺炎确诊病例。患者中男性3例、女性1例，上海户籍2例、武汉户籍2例。其中，3例有武汉居住史或旅行史，1例从密切接触者中发现，均已在定点医院接受隔离治疗。目前，上海累计发现确诊病例6例，患者病情平稳，无重症病例。另有3例疑似病例正在排查中。（总台央视记者陈雯）','2020-02-11','ck6hgxcf90145s27cayzr1l0n','央视新闻微博','上海市','2020-01-21','https://m.weibo.cn/2656274875/4463252362843374','','上海新增4例新型肺炎确诊病例','2020-02-11'),('据央视，台湾省“流行疫情指挥中心”证实，一名50岁左右的台湾女性确诊感染2019新型冠状病毒。这是此次新型冠状病毒肺炎疫情扩散以来，第一起移入台湾的病例。据了解，这名患者是在武汉工作，在返台时主动告知机场检疫人员，目前正在隔离治疗中。','2020-02-11','ck6hgxcf90146s27c7vcudg1l','人民日报微博','台湾','2020-01-21','https://m.weibo.cn/2803301701/4463238236280907','','台湾省确诊1例新型冠状病毒肺炎患者，患者在武汉工作','2020-02-11'),('目前，两名患者生命体征平稳，其在津密切接触者正在接受医学观察。','2020-02-11','ck6hgxcf90147s27cc8pkhwdk','人民日报微博','天津市','2020-01-21','https://m.weibo.cn/2803301701/4463235401268457','','天津确诊2例新型冠状病毒感染肺炎病例','2020-02-11'),('1月21日，该患者经国家卫生健康委疫情领导小组下设的诊断组专家评估确认为新型冠状病毒感染的肺炎确诊病例。现患者病情稳定，其密切接触者均在医学观察中。','2020-02-11','ck6hgxcfa0148s27cdna2h8hf','健康浙江','浙江省','2020-01-21','https://mp.weixin.qq.com/s/rQalqPahvPjdOw6uA1gRuA','','浙江省确认首例输入性新型冠状病毒感染的肺炎确诊病例','2020-02-11'),('截至1月20日24时，国家卫生健康委收到国内4省（区、市）累计报告新型冠状病毒感染的肺炎确诊病例291例（湖北省270例，北京市5例，广东省14例，上海市2例）；14省（区、市）累计报告疑似病例54例（湖北省11例，广东省7例，四川省3例，云南省1例，上海市7例，广西壮族自治区1例，山东省1例，吉林省1例，安徽省1例，浙江省16例，江西省2例，海南省1例，贵州省1例，宁夏回族自治区1例）。','2020-02-11','ck6hgxcfa0149s27c4loveikd','央视新闻','湖北省','2020-01-21','https://news.sina.cn/gn/2020-01-21/detail-iihnzahk5604684.d.html?cre=tianyi&mod=whome&loc=3&r=82&rfunc=91&tj=cx_wap_whome&tr=82&wm=4007&vt=4&pos=108&his=0','','2020年1月21日新型冠状病毒感染的肺炎疫情情况','2020-02-11'),('据大连市卫健委，1月17日，大连市发现1例武汉来连并出现发热等呼吸道症状患者，疑似新型冠状病毒肺炎病例。目前，该患者在大连市定点医疗机构隔离治疗，病情稳定。','2020-02-11','ck6hgxcfa014as27c3j8x48kr','央视新闻','辽宁省','2020-01-21','https://m.weibo.cn/status/4463195500648886?display=0&retcode=6102','','大连发现 1 例疑似新型冠状病毒肺炎病例','2020-02-11'),('1 月 21 日，贵阳市发现 1 例疑似新型冠状病毒感染患者。该患者 1 月 12 日从武汉返回贵阳，1 月 21 日凌晨，省疾控中心对该患者送检样本的病毒实验室检测显示为新型冠状病毒核酸阳性。','2020-02-11','ck6hgxcfa014bs27c2tae520a','贵阳市卫生健康局','贵州省','2020-01-21','http://wsjkj.guiyang.gov.cn/tzgg/202001/t20200121_44328899.html','','贵阳市发现一例疑似新型冠状病毒感染肺炎病例','2020-02-11'),('为坚决遏制新型冠状病毒感染引起的肺炎疫情扩散，武汉市对进出武汉人员加强管控。武汉市旅游团队不组团外出，公安交管部门对进出武汉的私家车辆进行抽检，检查后备箱是否携带活禽、野生动物等。','2020-02-11','ck6hgxcfa014cs27c3bn83y1p','人民日报','湖北省','2020-01-21','https://m.weibo.cn/2803301701/4463178593103691','','武汉实施进出武汉人员管控','2020-02-11'),('报国务院批准同意，国家卫生健康委决定将新型冠状病毒感染的肺炎纳入法定传染病乙类管理，采取甲类传染病的预防、控制措施。','2020-02-11','ck6hgxcfa014ds27c1tse1z2d','国家卫健委官方微博','上海市','2020-01-21','https://m.weibo.cn/2834480301/4463087468076122','','新型冠状病毒感染的肺炎纳入法定传染病管理','2020-02-11'),('武汉市共有 15 名医务人员确诊为新型冠状病毒，另有 1 名为疑似病例。16 例患者中，危重症 1 例，其余病情稳定，均已隔离治疗。','2020-02-11','ck6hgxcfa014es27cg4nk0hco','武汉市卫健委官方微博','湖北省','2020-01-20','https://m.weibo.cn/7344184293/4462986360502253','','武汉 15 名医务人员感染新型冠状病毒','2020-02-11'),('钟南山：根据目前的资料，新型冠状病毒肺炎是肯定的人传人，在广东有 2 个病例，没去过武汉，但家人去了武汉后染上了新型冠状病毒肺炎，现在可以说，肯定的，有人传人现象。','2020-02-11','ck6hgxcfa014fs27c18ehhxtr','央视新闻','北京市','2020-01-20','https://m.weibo.cn/2656274875/4462928671836931','','钟南山肯定新型冠状病毒肺炎人传人','2020-02-11'),('新增病例分布如下：深圳8例、珠海3例、湛江、惠州各1例，均收治在当地定点医疗机构隔离治疗。其中，男性 8 例、女性 5 例；60 岁以上老人 8 例，青壮年 4 例，10 岁儿童 1 例。','2020-02-11','ck6hgxcfa014gs27c3wyx5mtp','广东省卫健委官方微博','广东省','2020-01-20','https://weibo.com/1962787713/IqomkCWan?from=page_1001061962787713_profile&wvr=6&mod=weibotime','','广东省确认新增 13 例新型冠状病毒感染的肺炎确诊病例','2020-02-11'),('1 月 20 日，经国家卫健委疫情应对处置领导小组的专家评估确认，该病例为新型冠状病毒感染的肺炎确诊病例。现患者体温正常，生命体征平稳，其 2 名在沪密切接触者正在医学观察。','2020-02-11','ck6hgxcfa014hs27c3tw52qy2','上海市卫健委官方微博','上海市','2020-01-20','https://weibo.com/2372649470/IqogQhgfa?from=page_1001062372649470_profile&wvr=6&mod=weibotime','','国家卫健委确认上海首例新型冠状病毒感染的肺炎确诊病例','2020-02-11'),('全市发热门诊 61 家、全市定点医疗机构 9 家、省市联合医疗救治专家 25 人。','2020-02-11','ck6hgxcfa014is27c2frwe0zg','武汉市卫健委','湖北省','2020-01-20','http://wjw.wuhan.gov.cn/front/web/showDetail/2020012009078','','武汉市设置发热门诊医疗机构和定点救治医疗机构名单','2020-02-11'),('19 日，国家卫健委确认深圳首例病例。现医院组织全力救治，患者病情稳定。另有 8 例观察病例在定点医院隔离治疗。','2020-02-11','ck6hgxcfa014js27c50m884zv','深圳市卫健委','广东省','2020-01-20','http://wjw.sz.gov.cn/wzx/202001/t20200120_18987787.htm','','深圳市确诊 1 例新型冠状病毒感染的肺炎病例','2020-02-11'),('17 日以来，浙江省温州、舟山、台州、杭州陆续发现 5 例武汉来浙并出现发热等呼吸道症状患者，目前病情稳定，密切接触者已实行医学观察。','2020-02-11','ck6hgxcfa014ks27c1qsebm0m','浙江省卫健委','浙江省','2020-01-20','http://www.zjwjw.gov.cn/art/2020/1/20/art_1202101_41763414.html','','浙江省发现 5 例疑似新型冠状病毒感染的肺炎病例','2020-02-11'),('大兴区医疗机构接诊的两名有武汉旅行史的发热患者，根据临床症状和流行病学调查，经疾病预防控制中心检测及专家组评估，确认为新型冠状病毒感染的肺炎病例。','2020-02-11','ck6hgxcfa014ls27cd59pa2iu','北京市大兴区卫健委','北京市','2020-01-19','https://weibo.com/2703012010/IqhwfsbDU?from=page_1001062703012010_profile&wvr=6&mod=weibotime&type=comment','','北京大兴区确诊 2 例新型冠状病毒感染的肺炎病例','2020-02-11'),('18 日，治愈出院 5 例，新增死亡 1 例；19 日，治愈出院 1 例。截至 19 日 22 时，武汉市累计报告新型冠状病毒感染的肺炎病例 198 例，已治愈出院 25 例，死亡 3 例。','2020-02-11','ck6hgxcfa014ms27c68vpa8ov','武汉市卫健委','湖北省','2020-01-19','http://wjw.wuhan.gov.cn/front/web/showDetail/2020012009077','','武汉 18 日新增病例 59 例，19 日新增病例 77 例','2020-02-11'),('截至 1 月 20 日 18 时，境内累计报告新型冠状病毒感染肺炎确诊 217 例（武汉市 198 例，北京市 5 例，广东省 14 例）；疑似病例 7 例（四川省 2 例，云南省 1 例，上海市 2 例，广西壮族自治区 1 例，山东省 1 例）。','2020-02-11','ck6hgxcfa014ns27chalmfkka','国家卫健委','湖北省','2020-01-19','http://www.nhc.gov.cn/wjw/xwdt/202001/6be45fe493804bb6b96a3ed6c92ddb0f.shtml','','境内累计报告新型冠状病毒感染的肺炎病例 224 例','2020-02-11'),('治愈出院 4 例，无新增死亡病例。累计报告新型冠状病毒感染的肺炎病例 62 例，已治愈出院 19 例，在治重症 8 例，死亡 2 例，其余患者病情稳定','2020-02-11','ck6hgxcfa014os27cep7cg6aq','武汉市卫健委','湖北省','2020-01-18','http://wjw.wuhan.gov.cn/front/web/showDetail/2020011909074','','武汉 17 日新增 17 例新型冠状病毒感染的肺炎病例','2020-02-11'),('治愈出院 3 例，无新增死亡病例。累计报告新型冠状病毒感染的肺炎病例 45 例，已治愈出院 15 例，在治重症 5 例，死亡 2 例，其余患者病情稳定。','2020-02-11','ck6hgxcfa014ps27c6iep80ea','武汉市卫健委','湖北省','2020-01-17','http://wjw.wuhan.gov.cn/front/web/showDetail/2020011809064','','武汉 16 日新增 4 例新型冠状病毒感染的肺炎病例','2020-02-11'),('今天，国家卫健委确认#浙江确诊首例新型冠状病毒肺炎#。患者为男性，46岁，长期居住武汉市。1月3日自武汉自驾前往温州，1月4日出现发热症状遂就诊，于1月17日在温州定点医院进行隔离治疗。现患者病情稳定，其密切接触者均在医学观察中。中午12时，除首例确诊病例外，经省诊断专家组确诊新型冠状病毒感染的肺炎病例4例，累计报告新型冠状病毒感染的肺炎确诊病例5例，其中：杭州1例、温州2例、舟山1例、台州1例','2020-02-11','ck6hgxcfa014qs27c5e7j1gcd','央视新闻微博','浙江省','2020-01-17','https://m.weibo.cn/2656274875/4463224931926244','','【#浙江确诊5例新型冠状病毒肺炎#】','2020-02-11'),('治愈出院 5 例，新增死亡病例 1 例。累计报告新型冠状病毒感染的肺炎病例 41 例，已治愈出院 12 例，在治重症 5 例，死亡 2 例，其余患者病情稳定。','2020-02-11','ck6hgxcfa014rs27cdnqc8pxe','武汉市卫健委','湖北省','2020-01-16','http://wjw.wuhan.gov.cn/front/web/showDetail/2020011609057','','武汉 15 日无新增新型冠状病毒感染的肺炎病例','2020-02-11'),('截至目前，武汉市累计报告新型冠状病毒感染的肺炎病例 41 例，已治愈出院 7 例，在治重症 6 例，死亡 1 例，其余患者病情稳定，患者均在武汉市定点医疗机构接受隔离治疗。','2020-02-11','ck6hgxcfa014ss27cb3ct3u2t','武汉市卫健委','湖北省','2020-01-15','http://wjw.wuhan.gov.cn/front/web/showDetail/2020011509046','','武汉 14 日无新增新型冠状病毒感染的肺炎病例','2020-02-11'),('截至目前，武汉市累计报告新型冠状病毒感染的肺炎病例 41 例，已治愈出院 7 例，在治重症 6 例，死亡 1 例，其余患者病情稳定，患者均在武汉市定点医疗机构接受隔离治疗。','2020-02-11','ck6hgxcfa014ts27c8rtwgv2r','武汉市卫健委','湖北省','2020-01-14','http://wjw.wuhan.gov.cn/front/web/showDetail/2020011409039','','武汉 13 日无新增新型冠状病毒感染的肺炎病例','2020-02-11'),('截至目前，武汉市累计报告新型冠状病毒感染的肺炎病例 41 例，已治愈出院 7 例，在治重症 6 例，死亡 1 例，其余患者病情稳定，患者均在武汉市定点医疗机构接受隔离治疗。','2020-02-11','ck6hgxcfa014us27c9evidrw7','武汉市卫健委','湖北省','2020-01-13','http://wjw.wuhan.gov.cn/front/web/showDetail/2020011309038','','武汉 12 日无新增新型冠状病毒感染的肺炎病例','2020-02-11'),('累计报告新型冠状病毒感染的肺炎病例 41 例，已治愈出院 6 例，在治重症7例，死亡1例，其余患者病情稳定，患者均在武汉市定点医疗机构接受隔离治疗。','2020-02-11','ck6hgxcfa014vs27c4d24fu8c','武汉市卫健委','湖北省','2020-01-12','http://wjw.wuhan.gov.cn/front/web/showDetail/2020011209037','','武汉 11 日无新增新型冠状病毒感染的肺炎病例','2020-02-11'),('其中已出院 2 例、重症 7 例、死亡 1 例，其余患者病情稳定。所有密切接触者 739 人，其中医务人员 419 人，均已接受医学观察，没有发现相关病例。','2020-02-11','ck6hgxcfb014ws27c18051gtw','武汉市卫健委','湖北省','2020-01-10','http://wjw.wuhan.gov.cn/front/web/showDetail/2020011109035','','武汉初步诊断有新型冠状病毒感染的肺炎病例 41 例','2020-02-11'),('截止 8 时，共报告符合不明原因的病毒性肺炎诊断患者 59 例，其中重症患者 7 例，其余患者生命体征总体稳定，目前所有患者均在武汉市医疗机构接受隔离治疗，无死亡病例。','2020-02-11','ck6hgxcfb014xs27ceca631sr','武汉市卫健委','湖北省','2020-01-05','http://wjw.wuhan.gov.cn/front/web/showDetail/2020010509020','','武汉共发现病毒性肺炎诊断患者 59 例','2020-02-11'),('截止 8 时，共发现符合不明原因的病毒性肺炎诊断患者 44 例，其中重症 11 例，其余患者生命体征总体稳定。目前所有病例均在武汉市医疗机构接受隔离治疗，已经追踪到 121 名密切接触者并行医学观察。','2020-02-11','ck6hgxcfb014ys27c26fbgkl7','武汉市卫健委','湖北省','2020-01-03','http://wjw.wuhan.gov.cn/front/web/showDetail/2020010309017','','武汉共发现病毒性肺炎诊断患者 44 例','2020-02-11'),('近期部分医疗机构发现接诊的多例肺炎病例与华南海鲜城有关联。目前已发现 27 例病例，其中 7 例病情严重，其余病例病情稳定可控，有 2 例病情好转拟于近期出院。','2020-02-11','ck6hgxcfb014zs27chg64a9uo','武汉市卫健委','湖北省','2019-12-31','http://wjw.wuhan.gov.cn/front/web/showDetail/2019123108989','','武汉发现 27 例肺炎病例','2020-02-11'),('    \n        市卫健委今日（11日）通报：2020年2月11日0—12时，上海市排除新型冠状病毒肺炎疑似病例43例；新增治愈出院4例；新增确诊病例1例，为外地来沪人员。\n         \n     \n       ','2020-02-11','ck6hiq0u60000ve7cfrwc7r6x','上海卫健委','上海市','2020-02-11','http://wsjkw.sh.gov.cn/xwfb/20200211/2eba2df4d8af4c5489443a528a1c9bea.html','','上海新增1例新冠肺炎确诊病例','2020-02-11'),('2020年2月10日0—24时，宁夏报告新增确诊病例4例；新增治愈出院病例1例；无新增疑似病例。','2020-02-11','ck6hiq1170001ve7cuvin4neb','宁夏卫健委','宁夏回族自治区','2020-02-11','https://m.weibo.cn/status/4470721726609147?sudaref=login.sina.com.cn','','宁夏新增确诊 4，累计确诊 53','2020-02-11'),('\n         \n2020年2月10日14时至2月11日14时，辽宁省无新增新型冠状病毒肺炎确诊病例。新增出院病例5例,其中沈阳市2例、营口市1例、朝阳市2例。\n截至2020年2月11日14时，辽宁省累计报告新型冠状病毒肺炎确诊病例108例，治愈出院17例。\n\n                   \n    \n                \n                  \n                    \n                     \n                  \n                \n      \n        ','2020-02-11','ck6hjsqrw0000l07ccl2kpvo0','辽宁卫健委','辽宁省','2020-02-11','http://wsjk.ln.gov.cn/wst_zdzt/xxgzbd/yqtb/202002/t20200211_3738942.html','','辽宁省无新增新型冠状病毒肺炎确诊病例，新增出院病例5例','2020-02-11'),('\n 截至2月11日12时，天津市新增新冠肺炎确诊病例2例，累计确诊病例104例。\n','2020-02-11','ck6hll7gu00008c7cr2cb06gn','天津卫健委','天津市','2020-02-11','http://wsjk.tj.gov.cn/art/2020/2/11/art_87_70760.html','','天津市新增2例新冠肺炎确诊病例 累计确诊病例104例','2020-02-11'),('2月11日0时至12时，云南省报告新型冠状病毒肺炎新增确诊病例4例（昭通市2例，昆明市、曲靖市各1例）。全省累计报告确诊病例153例，除治愈出院者外，现均在定点医院接受隔离治疗。现有危重2例，重症16例，治愈出院20例，疑似病例85例，密切接触者医学观察3139人，无死亡病例。\n				','2020-02-11','ck6hnq2ml0000wl7cowb161lg','云南卫健委','云南省','2020-02-11','http://ynswsjkw.yn.gov.cn/wjwWebsite/web/doc/UU158140985445278423','','云南省报告新型冠状病毒肺炎新增确诊病例4例','2020-02-11'),('\n         \n2020年2月11日14时至2月11日16时，辽宁省新增3例新型冠状病毒肺炎确诊病例。其中沈阳市1例、葫芦岛市2例（为无症状感染者确诊病例），均为普通型病例。铁岭市治愈出院1例。\n\n截至2020年2月11日16时，辽宁省累计报告新型冠状病毒肺炎确诊病例111例，治愈出院18例。\n                   \n    \n                \n                  \n                    \n                     \n                  \n                \n      \n        ','2020-02-11','ck6hpia8z0001w77ci0921jrc','辽宁卫健委','辽宁省','2020-02-11','http://wsjk.ln.gov.cn/wst_zdzt/xxgzbd/yqtb/202002/t20200211_3739138.html','','辽宁省新增3例新型冠状病毒肺炎确诊病例','2020-02-11'),('今天下午，江苏援黄石医疗支援队共310名队员从南京禄口机场出发，奔赴湖北省黄石市开展对口支援新冠肺炎防治工作。310名队员来自58家医疗机构，其中年龄最大的60岁，年龄最小的23岁。','2020-02-11','ck6hqxn1x0000aj7c1gmq1z7z','央视新闻','江苏省','2020-02-11','http://m.weibo.cn/2656274875/4470842181956240','','江苏援黄石医疗队出征','2020-02-11'),('11日，湖北武汉协和医院西院，广东医疗队武汉前方ICU团队与后方广州医科大学附属第一医院举行远程视频会诊。会诊期间，钟南山院士通过连线回答公众关切问题。钟南山表示，我估计2月中下旬到峰值，至于拐点，要看二次返程情况。\n','2020-02-11','ck6hqxn700001aj7co86wu5uw','人民网','全国','2020-02-11','http://m.weibo.cn/2286908003/4470839414027388','','钟南山估计2月中下旬峰值到来','2020-02-11'),('今天下午，宁夏第四人民医院再次传来好消息，经过专家组和医护人员的精心治疗、护理，又有8名确诊患者治愈出院。年龄最大的患者76岁，最小的11岁。截至目前，宁夏共有22例新型肺炎确诊患者治愈出院，治愈率达到41.5%。\n','2020-02-11','ck6hqxndu0002aj7cixp3xhro','人民日报','宁夏回族自治区','2020-02-11','http://m.weibo.cn/2803301701/4470839045474471','','宁夏治愈率41.5%：累计治愈22人','2020-02-11'),('2020年2月11日0—14时，全省新型冠状病毒肺炎新增确诊病例9例,新增治愈出院病例3例。其中：新增确诊病例中，遵义市1例，黔南州8例。新增治愈出院病例中，贵阳市1例、六盘水市1例、黔西南州1例。\n            \n        ','2020-02-11','ck6hqxnkt0003aj7c8n8z8b1h','贵州卫健委','贵州省','2020-02-11','http://www.gzhfpc.gov.cn/ztzl_500663/xxgzbdgrdfyyqfk/yqdt/202002/t20200211_48421135.html','','贵州省新增确诊病例9例,新增治愈出院病例3例','2020-02-11'),('教育部、财政部近日发出通知，要求各地各校对受到疫情影响的家庭经济困难学生及时予以资助。通知说，各地各校学生资助管理部门要根据有关部门及学校掌握的疫情信息，及时了解本地本校家庭经济困难学生的身体和生活等情况。要重点聚焦疫情严重地区、贫困地区、农村地区、边远地区，重点关注建档立卡、低保、特困救助供养、残疾等特殊困难学生群体。各地各校应充分考虑疫情期间家庭经济困难学生的实际需求，及时足额发放国家助学金等资助资金。\n','2020-02-11','ck6htsgp80000437cx9t1d0ae','央视新闻','全国','2020-02-11','http://m.weibo.cn/2656274875/4470849602518152','','受疫情影响的家庭困难学生将获资助','2020-02-11'),('今天上午，仅三个月大的女婴甜甜（化名）从海口市人民医院出院，这是海南首个治愈出院的新冠肺炎确诊儿童病例。甜甜是海南第7号确诊病例，常住地为湖北汉川市。1月20日随家人自驾到武汉，1月27日被确诊为新冠肺炎。\n','2020-02-11','ck6hvxs6b0001ud7cfpba9e90','央视新闻','海南省','2020-02-11','http://m.weibo.cn/2656274875/4470881747314179','','三个月大入院女婴治愈出院','2020-02-11'),('2020年2月11日12—24时，重庆市报告新冠肺炎新增确诊病例16例，新增出院病例7例。截至2月11日24时，重庆市累计报告新冠肺炎确诊病例505例；现有重型病例29例，危重型病例24例，死亡病例3例，出院病例79例。累计追踪到密切接触者17910人，已解除医学观察11262人，尚有6648人正在接受医学观察。\n','2020-02-11','ck6iihych0484pg7cqt9mypb5','人民日报','重庆市','2020-02-11','http://m.weibo.cn/2803301701/4471038396258707','','重庆新增确诊16例，累计确诊505例','2020-02-11'),('2020年2月11日0时-24时，湖北省新增新冠肺炎病例1638例，新增出院417例，截至2020年2月11日24时，湖北省累计报告新冠肺炎病例33366例，全省累计治愈出院2639例。全省累计死亡1068例，病死率3.20%，目前仍在院治疗26121例。累计追踪密切接触者152251人，尚在接受医学观察77195人。\n','2020-02-11','ck6iihyk00485pg7ctj61bqgb','人民日报','湖北省','2020-02-11','http://m.weibo.cn/2803301701/4471026996430384','','湖北新增病例1638例，累计病例33366例','2020-02-11'),('2020年2月11日0时至24时，山西省报告新增新型冠状病毒肺炎确诊病例2例，累计确诊病例124例。新增治愈出院4例，累计治愈出院30例。现有在院隔离治疗94例，其中重症9例，危重症3例。目前累计追踪到密切接触者3475人，当日解除医学观察227人，共有899人正在接受医学观察。','2020-02-11','ck6iihyqj0486pg7cextn7wbq','山西卫健委','山西省','2020-02-11','http://wjw.shanxi.gov.cn:80/wjywl02/24841.hrh','','山西新增2例，累计124例','2020-02-11'),('2020年2月11日0-24时,黑龙江省报告新型冠状病毒感染的肺炎新增确诊病例18例。截至2月11日24时,黑龙江省报告新型冠状病毒感染的肺炎确诊病例378例。治愈出院病例28例。全省当日发热门诊诊疗人数1979人。目前追踪到密切接触者12736人, 已解除医学观察8024人，尚有4606人正在接受医学观察。','2020-02-12','ck6ijvud50000po7cxb2k3o76','黑龙江卫健委','黑龙江省','2020-02-11','http://wsjkw.hlj.gov.cn/index.php/Home/Zwgk/show/newsid/7772/navid/42/stypeid/','','黑龙江新增18例，累计378例','2020-02-12'),('2020年2月11日0—24时，河北省报告新型冠状病毒肺炎新增确诊病例12例，新增治愈出院病例7例，新增疑似病例20例。截至2月11日24时，河北省累计报告确诊病例251例，其中死亡2例，现有重症病例22例，累计治愈出院48例。目前累计追踪到密切接触者8771人，当日解除隔离医学观察534人，现有3716人正在接受隔离医学观察。','2020-02-12','ck6ijvups0001po7c0sm732ju','河北卫健委','河北省','2020-02-11','http://www.hebwst.gov.cn/index.do?id=398018&templet=content&cid=3714','','河北新增12例，累计251例','2020-02-12'),('2月11日0-24时，我区共新增新型冠状病毒肺炎确诊病例7例。目前全区累计报告确诊病例222例，累计出院病例31例。目前累计追踪到密切接触者12519人，正在接受医学观察3803人。家庭是社区综合防控新冠肺炎疫情扩散和蔓延的重要内容之一。','2020-02-12','ck6ik94h50000sd7c1oe6iyhb','广西卫健委','广西壮族自治区','2020-02-12','http://wsjkw.gxzf.gov.cn/zhuantiqu/ncov/ncovyqtb/2020/0212/68697.html','','广西新增确诊7例，累计222例','2020-02-12'),('2020年2月11日0-24时，河南省新增新型冠状病毒肺炎确诊病例30例，新增出院病例33例，新增死亡病例1例。截至2月11日24时，全省累计报告新型冠状病毒肺炎确诊病例1135例。目前累计追踪到密切接触者27752人，2月11日已解除观察4618人，诊断为疑似60人，共有10432人正在接受医学观察。','2020-02-12','ck6ilbl8o0001yi7cgr5amnzs','央视新闻','河南省','2020-02-12','http://m.weibo.cn/2656274875/4471058893419811','','河南新增30例新冠肺炎，累计确诊1135例','2020-02-12'),('2月11日0—24时，湖南省报告新型冠状病毒肺炎新增确诊病例34例。截至2月11日24时，湖南省累计报告新型冠状病毒肺炎确诊病例946例，累计报告重症病例125例，现有重症病例62例，死亡病例2例，出院病例263例。目前追踪到密切接触者23698人，已解除医学观察16913人，尚有6785人正在接受医学观察。','2020-02-12','ck6imrkfe0000j37c2nk5ux3c','央视新闻','湖南省','2020-02-12','http://m.weibo.cn/2656274875/4471068749741094','','湖南累计确诊946例，新增34例新冠肺炎','2020-02-12'),('2020年2月11日0-24时，江西省报告新型冠状病毒肺炎新增确诊病例40例，新增治愈出院病例25例。截至2月11日24时，江西省累计报告新型冠状病毒肺炎确诊病例844例，其中治愈出院病例152例，死亡病例1例，现有重症病例53例。目前追踪到密切接触者21693人，解除医学观察12624人，尚有9069人正在接受医学观察。    \n','2020-02-12','ck6imrkmn0001j37ctwugp6dx','江西卫健委','江西省','2020-02-12','http://hc.jiangxi.gov.cn/doc/2020/02/12/138684.shtml','','江西新增40例，累计844例','2020-02-12'),('2020年2月11日0－24时，天津市报告新型冠状病毒感染的肺炎新增确诊病例11例，截至2月11日24时，天津市累计报告新型冠状病毒感染的肺炎确诊病例106例，危重型病例4例，重型病例29例，死亡病例2例，出院病例10例。目前追踪到密切接触者1041人，已解除医学观察291人，尚有720人正在接受医学观察。','2020-02-12','ck6imrktz0002j37ciy1g39bj','天津卫健委','天津市','2020-02-12','http://wsjk.tj.gov.cn/art/2020/2/12/art_87_70784.html','','天津新增确诊11例，累计106例','2020-02-12'),('2020年2月11日0-24时，江苏省报告新型冠状病毒肺炎新增确诊病例28例。截至2月11日24时，江苏省累计报告新型冠状病毒肺炎确诊病例543例。目前，江苏省追踪到密切接触者11302人，已解除医学观察6345人，尚有4957人在接受医学观察。','2020-02-12','ck6imrl0v0003j37clpxuoutm','央视新闻','江苏省','2020-02-12','http://m.weibo.cn/2656274875/4471063998082964','','江苏新增28例，累计确诊新冠肺炎543例','2020-02-12'),('2020年2月11日0-24时，青海省报告新型冠状病毒肺炎新增确诊病例0例，新增重症病例0例，新增死亡病例0例，新增出院病例2例。当日无新增确诊病例和疑似病例。截至2月11日24时，青海省累计报告新型冠状病毒肺炎确诊病例18例，目前累计追踪到密切接触者435人，已解除医学观察68人，尚有367人正在接受医学观察。\n','2020-02-12','ck6in3nzw00000t7c2gglj060','人民日报','青海省','2020-02-12','http://m.weibo.cn/2803301701/4471073942815205','','青海连续6天无新增病例','2020-02-12'),('2020年2月11日0-24时，湖南省报告新型冠状病毒肺炎新增确诊病例34例，截至2月11日24时，湖南省累计报告新型冠状病毒肺炎确诊病例946例，累计报告重症病例125例，现有重症病例62例，死亡病例2例，出院病例263例。目前追踪到密切接触者23698人，已解除医学观察16913人，尚有6785人正在接受医学观察。  ','2020-02-12','ck6in3o5s00010t7c4hlk8kvz','湖南卫健委','湖南省','2020-02-12','http://wjw.hunan.gov.cn/wjw/xxgk/gzdt/zyxw_1/202002/t20200212_11176787.html','','湖南新增34例，累计946例','2020-02-12'),('2020年2月11日0-24时，浙江省报告新型冠状病毒肺炎新增确诊病例14例，新增出院病例28例。截至2月11日24时，浙江省累计报告新型冠状病毒肺炎确诊病例1131例，累计出院279例。全省共追踪到密切接触者33462人，当日解除医学观察1564人，尚有11631人正在接受医学观察。\n   \n','2020-02-12','ck6in3ogk00040t7ctf3ainmr','浙江卫健委','浙江省','2020-02-12','https://www.zjwjw.gov.cn/art/2020/2/12/art_1202101_41903468.html','','浙江新增14例，累计1131例','2020-02-12'),('2020年2月11日9时至12日9时，内蒙古自治区报告新增新冠肺炎确诊病例2例。截至2月12日9时，内蒙古自治区累计报告新冠肺炎确诊病例60例，重症病例3例，危重病例5例，出院病例5例。目前，尚在接受医学观察的密切接触者988人。当日解除医学观察333人。','2020-02-12','ck6ingcto00027y7cgpa3btav','内蒙古卫健委','内蒙古自治区','2020-02-12','http://wjw.nmg.gov.cn/doc/2020/02/12/291760.shtml','','内蒙古自治区新增2例，累计60例','2020-02-12'),('2020年2月11日0-24时，新疆（含兵团）报告新型冠状病毒肺炎新增确诊病例4例，截至2月11日24时，新疆（含兵团）累计报告新型冠状病毒肺炎确诊病例59例（新疆维吾尔自治区41例、新疆生产建设兵团18例），累计出院病例3例，累计死亡病例0例，目前尚有4133人正在接受医学观察。','2020-02-12','ck6ingdmd00047y7c9ri37qr7','新疆卫健委','新疆维吾尔自治区','2020-02-12','http://www.xjhfpc.gov.cn/info/2070/18331.htm','','新疆(含兵团)新增4例，累计59例','2020-02-12'),('截至2月11日24时，全省累计报告新冠肺炎确诊病例1219例。11日当天全省新增确诊病例42例，新增出院60例，累计出院241例截至2月11日24时，在院的977例确诊病例中，轻型74例，普通型785例，重型79例，危重型39例。\n                            \n                        ','2020-02-12','ck6inge6y00067y7c79kjyl60','广东卫健委','广东省','2020-02-12','http://wsjkw.gd.gov.cn/xxgzbdfk/yqtb/content/post_2892322.html','','广东新增42例，累计1219例','2020-02-12'),('2020年2月11日0-24时，全区报告新增确诊病例5例，新增出院病例8例，截至2月11日24时，全区累计报告确诊病例58例，累计解除隔离医学观察1517人，尚集中隔离医学观察1432人。','2020-02-12','ck6io61g90000ul7c1xmrnq9m','宁夏卫健委','宁夏回族自治区','2020-02-12','','','宁夏新增确诊病例5例，累计报告确诊病例58例','2020-02-12'),(' 2020年2月11日12—24时，上海市排除新型冠状病毒肺炎疑似病例80例；新增治愈出院1例；新增确诊病例3例。截至2月11日24时，上海市已累计排除疑似病例1309例，发现确诊病例306例。目前，233例病情平稳，10例病情危重，9例重症，53例治愈出院，1例死亡。尚有177例疑似病例正在排查中。\n                        ','2020-02-12','ck6io61vm0001ul7cr2lwfp8g','上海卫健委','上海市','2020-02-12','http://wsjkw.sh.gov.cn/xwfb/20200212/50b579229a114580bc41aaf5f04af92e.html','','上海新增3例，累计306例','2020-02-12'),('2月11日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告，新增确诊病例2015例（湖北1638例），解除医学观察的密切接触者30068人。截至2月11日24时，据31个省（自治区、直辖市）和新疆生产建设兵团报告，现有确诊病例38800例（其中重症病例8204例），累计治愈出院病例4740例，累计死亡病例1113例，累计报告确诊病例44653例，现有疑似病例16067例。\n','2020-02-12','ck6iow9r50001dx7cj5u5fxkf','央视新闻','全国','2020-02-12','http://m.weibo.cn/2656274875/4471084944727955','','全国新增2015例新冠肺炎，累计44653例','2020-02-12'),('据国家卫健委数据统计，2月11日0-24时，全国湖北以外地区新增确诊病例377例，连续第8日呈下降态势。而过去8日这一数据分别为：890例(3日)、731例(4日)、707例(5日)、696例(6日)，558例（7日），509（8日），444例（9日），381例（10日）。 \n','2020-02-12','ck6ipz0kv0001tv7cjyrpy6b2','人民网','全国','2020-02-12','http://m.weibo.cn/2286908003/4471089470309615','','湖北以外地区新增确诊病例八连降','2020-02-12'),('据湖北省卫健委数据统计，2月9日—2月11日，湖北省新增新冠肺炎病例连续下降2天，2月9日为2618例，2月10日为2097例，2月11日为1638例。','2020-02-12','ck6iqbdbp00005v7c4k5wmf5j','人民日报','湖北省','2020-02-12','http://m.weibo.cn/2803301701/4471095925393575','','湖北新增病例2连降','2020-02-12'),('今天下午，西藏唯一确诊新冠肺炎���例张某某，办理完所有治愈出院手续，离开西藏自治区第三人民医院。据西藏自治区第三人医院肺二科主任、救治组组长花德米介绍说，该病例2月9日第一次检测结果为是阴性，2月11日重新检测结果依然是阴性，目前包括CT等临床证据都显示已病愈，临床组经过讨论并上报医院和西藏自治区卫健委，经过自治区和上海北京专家评估后，该病例达到治愈出院标准。','2020-02-12','ck6iyf6310000ip7c972pkmb0','人民日报','西藏自治区','2020-02-12','http://m.weibo.cn/2803301701/4471151104967663','','西藏唯一确诊病例治愈出院','2020-02-12'),('国务院举行联防联控机制发布会，国家卫生健康委新闻发言人、宣传司副司长米锋：当前疫情形势依然十分严峻，但在一系列有利措施的推动下，疫情形势总体上也出现了一些积极变化。新增报告的病例波动下降，治愈出院人数较快增长。治愈比例由最低时1月27日1.3%，上升到2月11日的10.6%。\n','2020-02-12','ck6j1mngd00007d7cqy9rgfed','央视新闻','全国','2020-02-12','http://m.weibo.cn/2656274875/4471161914001154','','治愈比例上升至10.6%','2020-02-12'),('2月12日0时至12时，云南省报告新型冠状病毒肺炎新增确诊病例为零。全省累计报告确诊病例154例，除治愈出院者外，现均在定点医院接受隔离治疗。现有危重2例，重症15例，治愈出院23例，疑似病例69例，密切接触者医学观察2839人，无死亡病例。','2020-02-12','ck6j3f0io0002b17c1k2f94vx','云南卫健委','云南省','2020-02-12','http://ynswsjkw.yn.gov.cn/wjwWebsite/web/doc/UU158149724685341457','','云南省新增确诊病例为零','2020-02-12'),('2020年2月12日0—12时，重庆市报告新冠肺炎新增确诊病例4例，新增出院病例8例。新增确诊病例中，万州区1例、南岸区1例、綦江区2例；新增出院病例中，万州区1例、开州区1例、梁平区1例、忠县1例、云阳县1例、巫溪县2例、两江新区1例。截至2月12日12时，重庆市累计报告新冠肺炎确诊病例509例；现有重型病例29例，危重型病例24例，死亡病例3例，出院病例87例。累计追踪到密切接触者18092人，已解除医学观察11349人，尚有6743人正在接受医学观察。具体情况如下：\n            \n        ','2020-02-12','ck6j3f0rw0003b17c8i54qt01','重庆卫健委','重庆市','2020-02-12','http://wsjkw.cq.gov.cn/yqxxyqtb/20200212/253777.html','','重庆市新增确诊4例，累计确诊509例；新增治愈8例，累计治愈87例。','2020-02-12'),('2月12日6时至15时，天津市新增新冠肺炎确诊病例3例，累计确诊病例110例。目前已对判定的密切接触者进行隔离医学观察，其他密切接触者排查和流行病学调查工作正在进行中。\n','2020-02-12','ck6j3f0yn0004b17cyjg5pkfu','天津卫健委','天津市','2020-02-12','http://wsjk.tj.gov.cn/art/2020/2/12/art_87_70801.html','','天津市新增确诊3例，累计确诊110例','2020-02-12'),('西藏唯一新冠肺炎患者治愈出院，实现确诊病例和疑似病例清零。2月12日下午，自治区卫生健康委党组书记王云亭在自治区第三人民医院现场接受央视网、新华网、人民日报、西藏卫视等媒体采访。王云亭书记表示，西藏唯一新冠肺炎患者治愈出院，标志着在全国31个省（自治区、直辖市）中，我区首先实现确诊病例和疑似病例清零。\n            \n        \n    ','2020-02-12','ck6jbmgrr0001ho7cx929y5kj','西藏卫健委','西藏自治区','2020-02-12','http://wjw.xizang.gov.cn/xwzx/wsjkdt/202002/t20200212_132187.html','','西藏唯一新冠肺炎患者治愈出院','2020-02-12'),('人民日报记者姜峰从青海省卫健委获悉，2月12日下午，四例新冠肺炎患者从青海省第四人民医院治愈出院，其中包括全省首例确诊患者。至此，青海省确诊的18例患者中已有9例出院，治愈率达50%。','2020-02-12','ck6jbmgxo0002ho7c1gu3bg30','人民日报','青海省','2020-02-12','http://m.weibo.cn/2803301701/4471214594432686','','青海四名患者出院','2020-02-12'),('上海市卫生健康委今日（13日）通报：5例新型冠状病毒肺炎病例，经定点医疗机构医护人员精心诊治和护理，专家组评估，认为符合国家卫生健康委最新的新型冠状病毒肺炎确诊病例解除隔离和出院标准，于今日出院。\n                        ','2020-02-13','ck6kfebr604805r7cggrokoox','上海卫健委','上海市','2020-02-13','http://wsjkw.sh.gov.cn/xwfb/20200213/0fecc6450e794d47b134ed359a3813c8.html',NULL,'上海有5例确诊病例2月13日出院','2020-02-13'),('【#日本钻石公主号新增44例确诊# #日本钻石公主号累计确诊218例#】据中国日报网，日本放送协会(NHK)报道，日本政府表示，正停泊在日本横滨近海的游轮“钻石公主”号上，新增44例新型冠状病毒感染病例。报道称，游轮上累计确诊病例已达218例。 \n','2020-02-13','ck6kfebze04815r7cs6qljmt3','人民日报','','2020-02-13','http://m.weibo.cn/2803301701/4471471021256196',NULL,'日本钻石公主号新增44例确诊，累计确诊218例','2020-02-13'),('截至2月13日6时，天津市新增1例新冠肺炎确诊病例，累计确诊病例113例。第113例患者，男，85岁，现居天津市北辰区瑞景街，无武汉旅行或工作史，系本市第100例确诊病例的丈夫、103例确诊病例的岳父、108例确诊病例的父亲。\n','2020-02-13','ck6kfec4r04825r7ccb66fipu','天津卫健委','天津市','2020-02-13','http://wsjk.tj.gov.cn/art/2020/2/13/art_87_70821.html',NULL,'截至2月13日6时 天津市新增确诊1例，累计113例','2020-02-13'),('据河南省教育厅新冠肺炎疫情防控工作领导小组关于近期严禁师生返校的紧急通知：各地、各级各类学校在接到河南省疫情防控指挥部教育系统工作专班批准开学前，不得安排学生返校。除需要返校参加本校疫情防控工作的教职工外，不得安排其他教职工返校。各级各类学校开学时间，以河南省疫情防控指挥部教育系统工作专班正式批准的方案为准。\n','2020-02-13','ck6kfeca904835r7ckuk62cgw','央视新闻','河南省','2020-02-13','http://m.weibo.cn/2656274875/4471463434306967',NULL,'河南近期严禁师生返校，开学时间待定','2020-02-13'),('2月12日12时至24时，云南省报告新型冠状病毒肺炎新增确诊病例1例（昆明市）。全省累计报告确诊病例155例，除治愈出院者外，现均在定点医院接受隔离治疗。现有危重2例，重症15例，治愈出院23例，疑似病例100例，无死亡病例。','2020-02-13','ck6kfecqa04845r7cdjhutcan','云南卫健委','云南省','2020-02-13','http://ynswsjkw.yn.gov.cn/wjwWebsite/web/doc/UU158156146086517844',NULL,'云南省新增确诊病例1例，累计155例','2020-02-13');
