DROP TABLE IF EXISTS `ProvinceRecord`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `ProvinceRecord` (
  `confirmedCount` int NOT NULL DEFAULT '0',
  `country` varchar(30) NOT NULL,
  `createdAt` date NOT NULL DEFAULT '1970-01-01',
  `curedCount` int NOT NULL DEFAULT '0',
  `deadCount` int NOT NULL DEFAULT '0',
  `id` varchar(30) NOT NULL,
  `province` varchar(30) NOT NULL,
  `recordAt` date NOT NULL DEFAULT '1970-01-01',
  `sourceUrl` varchar(500) NOT NULL DEFAULT '',
  `suspectedCount` int NOT NULL DEFAULT '0',
  `updatedAt` date NOT NULL DEFAULT '1970-01-01',
  `virus` varchar(30) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `province` (`province`),
  KEY `virus` (`virus`),
  KEY `country` (`country`),
  CONSTRAINT `ProvinceRecord_ibfk_1` FOREIGN KEY (`province`) REFERENCES `Province` (`id`) ON DELETE RESTRICT,
  CONSTRAINT `ProvinceRecord_ibfk_2` FOREIGN KEY (`virus`) REFERENCES `VirusInfo` (`id`) ON DELETE RESTRICT,
  CONSTRAINT `ProvinceRecord_ibfk_3` FOREIGN KEY (`country`) REFERENCES `Country` (`id`) ON DELETE RESTRICT
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

