INSERT INTO `Rumor` VALUES ('与宠物接触后，用肥皂和水洗手可以显著减少其他常见细菌在宠物和人类之间的传播，如大肠杆菌和沙门氏菌。」但如果宠物在外面明确接触到新型冠状病毒肺炎患者，谨慎起见，还是需要将宠物进行隔离观察。请大家爱惜宠物，不要随意遗弃。','2020-02-11','ck6hfs3y90000s87c6p1w1s4i','2020-01-31','世界卫生组织回应：目前没有证据显示狗猫等宠物会感染新型冠状病毒','人会传染宠物？宠物染病会传染人？','2020-02-11'),('目前尚无证据证明喝茶可以预防新冠病毒。尽量保持室内空气流通，注意卫生，勤洗手，吃熟食，远离人群就是最好的预防手段了。','2020-02-11','ck6hfs3yb0003s87c880tf796','2020-01-31','丁香医生团队辟谣：补水挺好，预防病毒没用','喝茶可以预防新冠病毒？','2020-02-11'),('在国家卫健委印发的《新型冠状病毒感染的肺炎诊疗方案（试行第四版）》中显示，新型冠状病毒经呼吸道飞沫传播是主要的传播途径，亦可通过接触传播。而眼神对视不属于前述任何一种。\n另外，造谣网民已被依法处罚。','2020-02-11','ck6hfs3yb0004s87c4nxxem5w','2020-01-31','丁香医生团队辟谣：系编造，造谣网民已被依法处罚。','新冠病毒通过眼神对视传播？','2020-02-11'),('太阳的照射温度达不到56℃，且日照紫外线也达不到紫外线消毒灯的强度，不论从哪一个角度都不能达到杀灭病毒的要求。若要外出晒太阳，仍需戴好口罩，做好必要防护。','2020-02-11','ck6hfs3yb0005s87c2iq92peg','2020-01-31','丁香医生团队辟谣：太阳的照射温度达不到 56℃，且日照紫外线也达不到紫外线消毒灯的强度','晒太阳可以杀灭新型冠状病毒？','2020-02-11'),('浓度为60%～80%的乙醇是一种有效的杀毒剂，可以灭活所有亲脂病毒和许多亲水性病毒。但是，90%的酒精浓度可能会降低消毒效力，因为病毒中含有的基本物质蛋白质，在无水的情况下不容易发生变异。','2020-02-11','ck6hfs3yc0008s87c9kl8ddc5','2020-01-31','丁香医生团队辟谣：浓度为 60% - 80% 的乙醇才有效','酒精浓度越高，消毒效果越好？','2020-02-11'),('在普通家居、出行生活中，不必考虑衣物材质和静电问题对病毒吸附的影响，舒适为主。病毒通过飞沫传播，并不是单独在空气中，其可能在任何材质的衣物上停留，双手勿接触口鼻眼等、回家及时洗手、做好外套的消毒与吹风，比材质选择更重要。','2020-02-11','ck6hfs3yc0009s87cgbd21gtr','2020-01-31','丁香医生团队辟谣：从流感病毒的性质推测，病毒更喜欢光滑无孔的表面，在毛织品上留存时间更短。','带毛领或绒线的外套容易吸附病毒？','2020-02-11'),('现金流通渠道复杂，确实会有很多细菌病毒等病原体，但并不是接触了就一定会感染，而是不洗手又揉眼睛、拿东西吃或摸伤口等。无论是否防范新型冠状病毒，都建议大家在使用现金后，注意洗手、正确洗手，避免脏手接触眼睛、口鼻。','2020-02-11','ck6hfs3yc000as87c284u8yfh','2020-01-31','丁香医生团队：无论何时，接触了现金都要洗手','不要收现金，会感染新冠病毒？','2020-02-11'),('无论是用微波炉、电烤箱还是蒸锅加热口罩，一方面口罩内部结构破坏，口罩无法再次使用；另一方面，微波炉、电烤箱和蒸锅由于处理医疗垃圾，也不能继续加热食物。','2020-02-11','ck6hfs3yc000bs87camuob7h6','2020-01-31','丁香医生团队辟谣：不可以，不然微波炉和口罩都废了','用微波炉加热口罩可以消毒？','2020-02-11'),('再次强调，杀死新型冠状病毒至少需要56℃，30分钟，可用于物体表面消毒等，不能作用于人体。人体通过产热和散热，会将体温维持在一个正常的范围。真保持体温56℃半小时的话，那杀死的怕不只是病毒了。','2020-02-11','ck6hfs3yc000cs87cdpq08bmy','2020-01-31','丁香医生团队辟谣：人体是恒温的，会散热。真保持体温 56℃ 半小时的话，那杀死的怕不只是病毒了','喝60℃的水可以杀死病毒？','2020-02-11'),('「看到鄂A牌照（或湖北牌照）车辆就拨打110或长沙市疾控值班电话或12345市民热线」是错误说法。上述电话均不承担此职能。大量电话打入，已严重影响上述电话原职能履行，请广大市民不再随意拨打上述电话。正确做法是报属地社区，协助做好信息登记、体温检查、防病监测等工作。','2020-02-11','ck6hfs3yc000es87c1cy12bll','2020-01-31','长沙市新型冠状病毒肺炎防控指挥部辟谣：错误说法','看到鄂牌车辆就打长沙疾控电话？','2020-02-11'),('近日，网上出现的关于「将有6万武汉人员从境外来杭」「杭州于26日中午12点开始封城」「政府安排飞机洒消毒药水」等，均为不实信息。公安部门对不实信息发布者肖某某等7人依法进行了处理，责令其删除不实信息。','2020-02-11','ck6hfs3yd000fs87c55ma5g7c','2020-01-31','杭州市「冠状病毒肺炎」防控指挥部：不实信息','将有6万武汉人员来杭?','2020-02-11'),('解放日报·上观新闻记者就此咨询12122路政服务热线。客服人员告诉记者，上海不存在「限制外牌车辆进入」的情况，车辆通行正常。\n此外，记者从上海市公安局相关人员处了解到，公安部门目前并未接到有关「限制外牌车辆进沪」的通知。','2020-02-11','ck6hfs3yd000gs87c52uy2jjk','2020-01-31','12122 路政服务热线核实：不存在「限制外牌车辆进入」的情况','上海已限制外牌车辆进沪?','2020-02-11'),('最近，有人网传南京高速公路禁止外地车辆驶入，据南京交管部门，这种说法纯属谣言，交警只是针对外地车辆，配合卫生部门做好防疫工作。南京交警从未在高速公路设卡阻止外牌车进城，也从未收到过「封城」、「封路」的命令。','2020-02-11','ck6hfs3yd000hs87cbgz59cwg','2020-01-31','南京发布辟谣：从未收到过相关命令','南京封城、封路?','2020-02-11'),('目前新型冠状病毒感染已经超出人兽范围，可以人传人，以呼吸道传播为主，亦可通过接触传播。','2020-02-11','ck6hfs3yd000js87c8rxre8tj','2020-01-31','丁香医生团队辟谣：目前新冠病毒的感染已超出人兽范围','不吃野味就不会被感染?','2020-02-11'),('新型冠状病毒感染的肺炎疫情发生后，有网友翻出2018年「科学家发现新型冠状病毒」的旧闻，怀疑「是否两年前就已发现如今正在肆虐的新型冠状病毒」。记者今天向中科院求证，该院武汉病毒研究所称2018年报道的“病毒”，与此次引发肺炎疫情的2019-nCov并非「同一种病毒」。','2020-02-11','ck6hfs3yd000ls87c1uunc8qc','2020-01-31','中科院辟谣：并非同一种','新冠病毒2018年就发现了？','2020-02-11'),('广州医科大学附属第一医院相关负责人表示，钟南山院士从未提出「全中国人民在家隔离两周」的建议。但钟南山院士强调注意防护，早发现、早隔离，尽可能减少传播，减少出现「超级传播者」的概率。重视防护，但也不必恐慌。尽量减少走亲访友，少去人员密集的场所，出门戴口罩，在室内注意通风，勤洗手，多运动，少熬夜。','2020-02-11','ck6hfs3yd000ns87cc7g1eh3j','2020-01-31','广州医科大学附属第一医院辟谣：情况不实','钟南山：全国人民在家隔离两周？','2020-02-11'),('遇到此类谣言该怎么办？\n请务必记住这个「灵魂三拷问」\n1、有没有单号？\n2、包裹寄到那个地区？\n3、哪家快递公司承运的？\n\n无论对方提供与否，大家都可以第一时间向官方求证，并提供相关情况，切勿在网上进行二次传播。','2020-02-11','ck6hfs3yd000os87c6figavny','2020-01-31','上海海关辟谣：海关不会征用你的口罩！','私人邮寄口罩被海关征用？','2020-02-11'),('网络上流传2张截图，配文分别称「钟南山发布多喝单枞茶对防止肺炎有重大效果」「国家卫生局发布多吃草莓对防止肺炎有重大效果」。这2张截图都是假的。钟南山院士曾就肺炎疫情接受过媒体采访，并没有提到过前述的信息。目前我国并没有「国家卫生局」这个机构，只有国家卫健委。国家卫健委也并没发布过前述的信息。','2020-02-11','ck6hfs3yd000ps87c4ps63t10','2020-01-31','经查证：系编造','多喝单枞茶多吃草莓可防肺炎？','2020-02-11'),('SARI是英文severeacuterespiratoryinfections的缩写，中文意思为严重急性呼吸道感染。此次爆发于的新冠疫情，目前暂时被命名为新型冠状病毒，英文为2019NovelCoronavirus(2019-nCoV)。2019-nCoV可以导致SARI，但并不是所有的SARI都是2019-nCoV引起的。','2020-02-11','ck6hfs3ye000rs87cagapbair','2020-01-31','丁香医生团队辟谣：SARI 是「严重急性呼吸道感染」的英文缩写','新冠病毒定名为SARI？','2020-02-11'),('在国家卫健委印发的《新型冠状病毒感染的肺炎诊疗方案（试行第四版）》中提到「病毒对紫外线和热敏感，56℃30分钟、乙醚、75%乙醇、含氯消毒剂、过氧乙酸和氯仿等脂溶剂均可有效灭活病毒。」紫外线消毒灯要严格按照说明书的要求使用。且人和宠物都要离开正在消毒的房间，以免对皮肤和眼睛造成损伤。','2020-02-11','ck6hfs3ye000ss87cchbr2d0k','2020-01-31','国家卫健委：冠状病毒对紫外线敏感','紫外线消毒灯能杀灭新冠病毒？','2020-02-11'),('针对此次新型病毒感染，WHO尚未发表中国为「疫区」的声明。很多人在讨论的PHEIC翻译过来是「国际公共卫生紧急事件」，是世卫组织发出的警示信息。根据《国际卫生条例（2005）》规定，PHEIC只是给各国的建议，不是强制措施。','2020-02-11','ck6hfs3ye000ws87c2hg03e7c','2020-01-31','丁香医生团队辟谣：根本没有「疫区国」的概念','中国被列入疫区国？','2020-02-11'),('根据SARS病毒的特点，推测新型冠状病毒可在金属、塑料上存活2～3天，但存活不代表可达到传染条件。\n手机、电梯按键存在的细菌和病毒数量种类众多，不管是否沾染上带有冠状病毒的飞沫，接触后都需好好洗手。不要用脏手碰口鼻、揉眼睛，更不要一边吃东西一边玩手机。\n无症状密切接触史者和轻微症状居家隔离者的手机，需好好消毒，不要触碰。','2020-02-11','ck6hfs3ye000zs87cg70i9ruo','2020-01-31','丁香医生团队：接触手机、电梯按键后，需要及时洗手','病毒会存在手机和电梯按键上？','2020-02-11'),('杀死新型冠状病毒至少需要56℃，30分钟，可用于物体表面消毒等。人在56℃的水里洗半小时，可能会得热射病，有生命危险。人体的体温是相对恒定的，洗热水澡也无法提升体内温度，无法预防病毒。','2020-02-11','ck6hfs3yf0015s87ccibc92wd','2020-01-30','丁香医生团队辟谣：洗热水澡也无法提升体内温度，不能对抗病毒，还可能会有生命危险。','用56℃的热水洗澡能对抗病毒？','2020-02-11'),('医用外科口罩摸上去比较薄，但过滤效率却很高。阻水层、过滤层、吸湿层这三层有效阻挡了病毒入侵。而市面上的一般棉布口罩，虽然厚实，但基本上不具备预防传染病的作用，不可靠。','2020-02-11','ck6hfs3yf0019s87cb2w30zbs','2020-01-30','丁香医生团队辟谣：口罩厚度不等同于防护效果，医用外科口罩摸上去比较薄，但过滤效率却很高。','口罩越厚，防病毒效果越好？','2020-02-11'),('青海、南宁、丽江等各城市版本的均为编造。另外，此次新型冠状病毒来源是非法销售的野生动物，目前未明确中间宿主。但正规渠道售卖的各类肉制品仍可彻底煮熟后食用。','2020-02-11','ck6hfs3yf001as87c45ncbbwe','2020-01-30','丁香医生团队查证：青海、南宁、丽江等各城市版本的均为编造。正规渠道售卖的仍可放心吃。','别吃草鱼，某地有121个鱼塘感染？','2020-02-11'),('国家邮政局市场监管司副司长侯延波表示：“我们要求邮政和快递企业严格落实对邮件、快件、运输车辆、生产作业场所的消毒、通风等措施，严格落实安全查验的制度，严禁收寄野生动物。因此大家不用担心，正常的快件不用拒收，收完快件请及时洗手。”','2020-02-11','ck6hfs3yf001bs87c0sec5zwf','2020-01-30','丁香医生团队辟谣：病毒通过快件传播的风险极低，收完快件请及时洗手','武汉来的快递要拒收？','2020-02-11'),('一般情况下，飞沫传播只有与传染源近距离接触时才可能实现。飞沫传播在1～2米之间，距离传染源1米以外相对安全，2米开外就很安全了。\n打喷嚏、咳嗽要比讲话时飞沫喷出的距离远许多，新型冠状病毒主要经飞沫传播。但是这并不意味着会导致空气中到处都是新型冠状病毒，也尚未证实其可以通过空气传播。即使与人接触时保持距离，也请带好口罩做好防护。','2020-02-11','ck6hfs3yg001gs87c4x087l24','2020-01-30','丁香医生团队：交流要保持距离；尚未证实新冠病毒可以通过空气传播。','喷嚏一打几米远，病毒可悬浮一天？','2020-02-11'),('网上出现了武汉市第九医院的一个紧急通知，说是散步会感染新型冠状病毒肺炎。\n\n对此，武汉市第九医院院长刘明瑜表示：“这是谣言，我们根本没出这样的通知，请大家不要相信。\"','2020-02-11','ck6hfs3yg001ks87c1pl3ckb3','2020-01-30','武汉市第九医院辟谣：我院没出过这样的通知','散步会感染新型冠状病毒肺炎？','2020-02-11'),('暂时还没有证据表明，风油精里的成分对预防或杀灭新冠病毒有任何效果。不过在家宅久了，闻下凉凉的风油精，还是有助提神的。','2020-02-11','ck6hfs3yg001ns87c6haleobt','2020-01-30','丁香医生团队辟谣：对预防新冠病毒没有作用','在人中涂风油精可以预防感染？','2020-02-11'),('大蒜提取物是能杀菌，但是从大蒜变成大蒜提取物差距很大。而且目前还没有临床试验数据证明大蒜的抗病毒效果，就不要指望它能杀灭新型冠状病毒啦。','2020-02-11','ck6hfs3yh001zs87c45fxgwlo','2020-01-29','丁香医生团队辟谣：不管是直接吃、榨汁喝还是炖冰糖都没用','吃大蒜可以杀灭新冠病毒吗？','2020-02-11'),('此次冠状病毒的来源是野生动物，暂无证据证明会传染猫狗，而犬冠状病毒和猫冠状病毒暂无证据表明会传染给人。家里养宠物的人不用太担心，更不要随便遗弃宠物。','2020-02-11','ck6hfs3yi0021s87cfxb624od','2020-01-29','丁香医生团队辟谣：暂无证据证明会传染猫狗','家里的宠物会传播病毒?','2020-02-11'),('一瓶醋里的醋酸含量最多也只有5%。将醋里的醋酸蒸发到空气中的做法，提升空气酸度的空间十分有限。\n另外，熏醋还会带来副作用。醋酸挥发到房间后，可能对人体的呼吸道粘膜产生刺激作用，导致咽喉不适、恶心及呼吸困难。\n对呼吸道敏感的儿童、老人，以及有哮喘病史的人而言，熏醋很有可能诱发呼吸系统疾病。','2020-02-11','ck6hfs3yi0022s87cgxkt7ue1','2020-01-29','丁香医生团队辟谣：熏醋杀不死新型冠状病毒','熏醋可以预防新冠病毒？','2020-02-11'),('酒精的确能杀死病毒。但得是75%浓度以上的酒精消毒产品，而且只能用来体表消毒。喝进身体的高度酒，只会被吸收代谢，不会作用于病毒。\n','2020-02-11','ck6hfs3yi0023s87cfdef3k6j','2020-01-29','丁香医生团队辟谣：喝进去不会作用于病毒','喝高度酒能抵抗新冠病毒?','2020-02-11'),('杀死冠状病毒至少需要56℃，30分钟，可用于物体表面消毒等。桑拿房内温度的确较高，但人体的体温是相对恒定的，无法预防病毒。并且桑拿汗蒸的地方通风差、人多，反而增加疾病传播的几率。\n且长时间桑拿、汗蒸，可能会出现脱水甚至休克等症状。','2020-02-11','ck6hfs3yi0024s87c8zao8aff','2020-01-29','丁香医生团队辟谣：杀死新冠病毒至少需要 56℃，30 分钟','桑拿、汗蒸能预防新冠病毒?','2020-02-11'),('乳铁蛋白是哺乳动物乳汁中天然存在的一种蛋白质，目前没有证据表明它可以提高免疫力，更不能预防新型冠状病毒。别再交「智商税」了','2020-02-11','ck6hfs3yi0025s87ccv4yh2g8','2020-01-29','丁香医生团队辟谣：无证据表明乳铁蛋白对病毒有用','吃乳铁蛋白能预防新冠病毒?','2020-02-11'),('香蕉并不是新型冠状病毒的宿主，1月23 日，中国科学院院士中国疾控中心主任高福在央视新闻采访中表示，病毒来源就是武汉华南海鲜市场非法销售的野生动物。比起香蕉，野味才应该被杜绝。','2020-02-11','ck6hfs3yi0026s87c1gi3dp36','2020-01-29','丁香医生团队辟谣：香蕉并不是新型冠状病毒的宿主','新冠肺炎是香蕉导致的?','2020-02-11'),('新型冠状病毒，是一种先前尚未在人类中发现的冠状病毒。\n而奥司他韦是治疗流感的特效药，作用靶点与流感病毒相关，目前尚没有证据显示其对于新型冠状病毒具有临床疗效。','2020-02-11','ck6hfs3yi0028s87cao7w854h','2020-01-29','丁香医生团队辟谣：适用于流感治疗，对新冠病毒无效','吃奥司他韦可以预防新冠病毒?','2020-02-11'),('迄今为止，和板蓝根有关的提取物研究，无一进入临床试验阶段。\n也就是说，即使是对预防流感病毒，板蓝根也没有被证明有预防效果，更别说预防新型冠状病毒了。','2020-02-11','ck6hfs3yi0029s87c5pya8cqe','2020-01-29','丁香医生团队辟谣：板蓝根对新型冠状病毒无效','吃板蓝根可以预防新冠病毒？','2020-02-11'),('利巴韦林无法作用于新型冠状病毒。传统的抗流感药物并不能有效预防新型冠状病毒，而且随便用药还会造成一定的健康风险。','2020-02-11','ck6hfs3yi002as87c19wu9mc1','2020-01-29','丁香医生团队辟谣：利巴韦林无法作用于新型冠状病毒','吃利巴韦林可以预防新冠病毒?','2020-02-11'),('抗生素作用于细菌，对病毒无效。在武汉同济、武汉协和同时发布新型冠状病毒肺炎快速诊疗指南中，也明确指出要避免盲目或不恰当的抗菌药物治疗，尤其是联合应用广谱抗菌药物。','2020-02-11','ck6hfs3yi002bs87c92xs2kqn','2020-01-29','丁香医生团队辟谣：抗生素作用于细菌，对病毒无效。','吃抗生素可以预防新冠病毒?','2020-02-11'),('尚无证据表明熏艾对预防新型冠状病毒感染有效，而且在密闭的室内可能会造成一氧化碳中毒','2020-02-11','ck6hfs3yi002ds87ccmcq72dt','2020-01-29','丁香医生团队辟谣：没用，甚至可能中毒','熏艾可以预防新冠肺炎？','2020-02-11'),('非典时期，激素治疗使部分患者留下股骨头坏死的后遗症，这是药物的一种副作用。现在发生的大量的病人根本就不用激素，所以不会引起股骨头坏死。','2020-02-11','ck6hfs3yj002hs87c8y01hp2h','2020-01-29','李兰娟院士辟谣：现在发生的大量的病人根本就不用激素','治疗主要靠激素，大概率会成为废人？','2020-02-11'),('美国疾控中心指出N95口罩在特殊情况下（比如口罩供应不足等），可在严格规范下“延长使用期限”以及“有限重复使用”。前者指一次佩戴不取下来，去接触不同的病人；后者指在满足一定条件下，可重复使用一定次数。若厂家说明了可重复使用次数，那以厂家说的为准；若没说明，那“不超过5次”。7天大大超过了这个次数。吹风机吹或者喷洒酒精，都可能会破坏口罩的保护作用。','2020-02-11','ck6hfs3yj002js87c9z3q8bh1','2020-01-29','丁香医生团队辟谣：吹风机吹或者喷洒酒精，都可能会破坏口罩的保护作用。','用了7天的N95口罩酒精消毒可继续用？','2020-02-11'),('网上自制口罩的教程，基本材料都是推荐棉纱、毛线、帆布等。这些材料空隙较大，无法有效过滤病毒。除了保暖，阻挡病菌作用十分有限。','2020-02-11','ck6hfs3yk002qs87c8mulgndt','2020-01-29','丁香医生团队辟谣：自制口罩不靠谱','买不到口罩可以自制？','2020-02-11'),('杀死冠状病毒至少需要56℃，30分钟，可用于物体表面消毒等，电吹风的温度即使能达到56℃甚至更高，对着手和面部持续吹30分钟，容易造成烫伤等伤害，还是好好洗手，做好清洁吧。','2020-02-11','ck6hfs3ym002ss87c7e51bdjy','2020-01-29','丁香医生团队辟谣：30秒太短，真吹半小时容易受伤。','电吹风对手和面部吹30秒就能消毒？','2020-02-11'),('中国工程院院士李兰娟在接受浙江新闻客户端记者采访时表示，不能这样做，病毒对于外界抵抗力不强，75%的酒精就可以消毒，但是这是对于有可能被污染的一些物体的消毒，并不是在家里针对人也要这样消毒。\n\n人在外面接触主要是手，用流水冲洗，多洗手，这是最重要的办法。','2020-02-11','ck6hfs3ym002vs87c1axv8k8x','2020-01-29','李兰娟院士辟谣：不能这样做','全身喷洒酒精可起到消毒效果？','2020-02-11'),('根据卫健委最新数据，截至1月27日24时，国家卫生健康委收到30个省(区、市)累计报告确诊病例4515例，现有重症病例976例，累计死亡病例106例，累计治愈出院60例。现有疑似病例6973例。','2020-02-11','ck6hfs3yn002ys87chdcq2a1s','2020-01-28','国家卫健委回应：不实消息','网传感染病例在10万例左右？','2020-02-11'),('近日，境外社交媒体流传一条据称是武汉野生动物交易市场的视频，这条4分41秒的视频发于1月26日，画面中蛇、蝙蝠、鼠类等各类野生动物在市场中进行售卖。1月27日，法新社发文辟谣，称该视频截图后经视频核实工具查验，实为印尼的苏拉威西岛的野生动物市场，去年7月20日发布。目前，该视频已被脸书软件标注为假消息。','2020-02-11','ck6hfs3yn0032s87cddy305rc','2020-01-28','法新社辟谣：实为印尼的苏拉威西岛的野生动物市场','外网传武汉野生动物市场视频属实？','2020-02-11'),('大蒜提取物是能杀菌，但是从大蒜变成大蒜提取物差距很大。而且目前还没有临床试验数据证明大蒜的抗病毒效果，就不要指望它能杀灭新型冠状病毒啦。','2020-02-11','ck6hfs3yo0033s87c4qzt2rqz','2020-01-28','丁香医生团队辟谣：没有证据证明大蒜有抗病毒效果','吃大蒜、喝大蒜水可以杀灭新冠吗？','2020-02-11'),('中国交通广播记者从十堰交管部门了解到，这则消息为假消息！\n据十堰市新型肺炎疫情指挥部17号指令，禁止车辆通行。但是，批准300辆客运出租车辆运行。此外，医护工作者、执行公务、水电气等特殊保障部门人员必须驾车出行的，要予以保障。所有运输货物车辆不限行。警车属特种车辆不限行。','2020-02-11','ck6hfs3yo0035s87cape4fw6r','2020-01-28','十堰交管部门辟谣：假消息','十堰为限行全城开启红灯？','2020-02-11'),('近日，有网友反映收到一份“关于新型冠状病毒的肺炎疫情感染期间公交线路营运安排调整的通告”，此消息不属实，该消息中提及的线路并非北京市公交线路。目前，北京公交集团市域内线路总体运营正常。如有相关调整，将第一时间通过正规渠道向社会公布。','2020-02-11','ck6hfs3yo0036s87c46v5cta3','2020-01-28','北京公交集团辟谣：消息不属实','北京公交线路营运安排调整？','2020-02-11'),('SARI是英文severeacuterespiratoryinfections的缩写，中文意思为严重急性呼吸道感染。此次爆发于的新冠疫情，目前暂时被命名为新型冠状病毒，英文为2019NovelCoronavirus(2019-nCoV)。2019-nCoV可以导致SARI，但并不是所有的SARI都是2019-nCoV引起的。','2020-02-11','ck6hfs3yo0038s87c2nwk4a7a','2020-01-28','丁香医生团队辟谣：SARI是「严重急性呼吸道感染」的英文缩写','新冠定名为 SARI？','2020-02-11'),('武汉、杭州、郑州等各城市版本的「飞机喷洒消毒药水」都是谣言！','2020-02-11','ck6hfs3yo0039s87cddws4dbm','2020-01-28','人民日报辟谣：各城市版本的都是谣言！','某某城市飞机喷洒消毒药水？','2020-02-11'),('据黑龙江高速交警微博消息，黑龙江省高速公路通行正常，无封闭情况，有谣言说黑龙江省高速公路封闭，请大家不传谣、不信谣，积极配合政府相关部门做好疫情防范工作。','2020-02-11','ck6hfs3yp003bs87c5goxd92b','2020-01-28','黑龙江高速交警：系谣言','黑龙江省高速公路封闭？','2020-02-11'),('该情况系嘉陵籍孙某贵(男，57岁，嘉陵吉安人)之前未遵守隔离规定，目前已经收治并确诊。','2020-02-11','ck6hfs3yp003cs87c8uwfetws','2020-01-28','南充网警辟谣：已经收治','医院一老人被感染新冠肺炎跑了？','2020-02-11'),('经核实，湖北省政协原副主席郑心穗没有儿子，此消息不属实。','2020-02-11','ck6hfs3yp003ds87c7xj64ilg','2020-01-28','湖北政协辟谣：消息不属实','华南海鲜老板是政协原副主席儿媳?','2020-02-11'),('据@青岛交通运输27日消息：官方辟谣！部分微信群中所传的“2020年1月27日起，公交线路停运安排调整”的消息不属实。\n目前，青岛市市区（市南、市北、李沧、崂山、城阳）公交车均正常运营，请广大市民朋友不信谣、不传谣。','2020-02-11','ck6hfs3yp003es87can0vhiq6','2020-01-28','青岛交通运输局辟谣：消息不属实','青岛公交线路停运安排调整？','2020-02-11'),('截至目前，广西各地均没有发布任何“封收费站”、“封高速”的信息，广西区内高速公路及城市道路都能够正常通行。在广西各高速公路收费站、省道国道，交警部门正全力配合相关部门，开展联勤检疫工作。在此，警方呼吁请大家配合检查人员工作，驾车下高速进入收费站前最好提前打开车窗，关闭空调，以便于提高检查效率。排队待检时要耐心等待，有序缓行不要扰乱秩序，加塞抢行。','2020-02-11','ck6hfs3yp003fs87c5qd2cyb5','2020-01-28','广西公安辟谣：区内高速及城市道路都能够正常通行','疫情致广西多地封路、封高速？','2020-02-11'),('1月28日，武汉建工集团路桥分公司项目经理周攀驳斥污水污染谣言：现场全部都会用砂垫层、土工布、HDPE防渗膜进行保护，上面还有一层土工布和30到80公分的混泥土，水会流入污水处理中心。','2020-02-11','ck6hfs3yp003gs87c4mzs535j','2020-01-28','武汉建工集团路桥分公司回应：多层保护，保证污水流入处理中心','火神山项目污染水源？','2020-02-11'),('钟南山院士团队公开辟谣：\n\n「盐水漱口有利于清洁口腔和咽喉，对于咽喉炎有帮助。但是新型冠状病毒侵犯的部位在呼吸道，漱口没有办法清洁呼吸道。其次，目前尚无任何研究结果提示盐水对新型冠状病毒有杀灭作用。」','2020-02-11','ck6hfs3yq003hs87c6jd9e0d7','2020-01-28','钟南山院士团队辟谣：漱口没有办法清洁呼吸道','盐水漱口能预防感染？','2020-02-11'),('香油在鼻子里走个过场，既阻隔不了病毒进来，也影响不了病毒繁衍。\n\n除了随身携带香油味，啥效果也不会有。\n\n再强调一下，能有效灭活新型冠状病毒的物质是乙醚、75%乙醇、含氯消毒剂、过氧乙酸和氯仿等脂溶剂。但它们也只能用于体表和物体表面的清洁，不能滴鼻孔。','2020-02-11','ck6hfs3yq003is87c5d6600vp','2020-01-28','丁香医生团队辟谣：啥效果也不会有','香油滴鼻孔可防病毒传播？','2020-02-11'),('摄入VC通常只是作为辅助治疗手段，并不具备预防和抵抗新型冠状病毒的作用，过度服用还会导致腹泻、皮疹等中毒现象。','2020-02-11','ck6hfs3yq003js87chc8g1x87','2020-01-28','丁香医生团队辟谣：没有预防作用','服用 VC 可以预防感染？','2020-02-11'),('迄今为止，和板蓝根有关的提取物研究，无一进入临床试验阶段。\n也就是说，即使是对预防流感病毒，板蓝根也没有被证明有预防效果，更别说预防新型冠状病毒了。','2020-02-11','ck6hfs3yq003ks87cg51y89bl','2020-01-28','丁香医生团队辟谣：板蓝根对新型冠状病毒无效','吃板蓝根可以预防新冠？','2020-02-11'),('此次新型冠状病毒来源是非法销售的野生动物，目前未明确中间宿主。但正规渠道售卖的各类肉制品仍可食用。','2020-02-11','ck6hfs3yq003ls87c5gpc0ydp','2020-01-28','丁香医生团队辟谣：正规家畜家禽海鲜都能吃','家畜家禽海鲜都不能吃了？','2020-02-11'),('呼吸疾病国家重点实验室办公室25日表示，钟南山院士正在开会；前述被传染的传闻系谣言。','2020-02-11','ck6hfs3yr003ps87c0gtl2iwm','2020-01-28','呼吸疾病国家重点实验室办公室：系谣言','钟南山院士被传染?','2020-02-11'),('不需要佩戴多层口罩。建议选择N95/KN95或普通外科口罩，并且一层就够，其他口罩防护效果不如这三种。佩戴多层口罩还可能造成呼吸不畅。\n','2020-02-11','ck6hfs3yr003qs87c4w4ycri4','2020-01-28','丁香医生团队辟谣：佩戴多层口罩可能造成呼吸不畅','戴多层口罩才能防住病毒?','2020-02-11'),('香蕉并不是新型冠状病毒的宿主，1月23 日，中国科学院院士中国疾控中心主任高福在央视新闻采访中表示，病毒来源就是武汉华南海鲜市场非法销售的野生动物。比起香蕉，野味才应该被杜绝。','2020-02-11','ck6hfs3yr003rs87c7zgfde87','2020-01-28','丁香医生团队辟谣：香蕉并不是新型冠状病毒的宿主','新型肺炎是香蕉导致的?','2020-02-11'),('武汉市城建局24日晚表示，火神山医院将于2月1日建成，然后进行医疗设备安装调试，2月3日交付投用。','2020-02-11','ck6hfs3yr003ss87c39pf6p8b','2020-01-28','武汉市城建局辟谣：正常建设中','武汉「小汤山」将停工?','2020-02-11'),('全年龄段的人都需要做防护。新型冠状病毒对所有年龄组都易感。目前，新型冠状病毒已经确定可以人传人，经呼吸道飞沫传播是主要传播途径，亦可通过接触传播。','2020-02-11','ck6hfs3yr003ts87cbqox69mz','2020-01-28','丁香医生团队辟谣：新冠病毒对所有年龄组都易感','病毒感染的都是老年人?','2020-02-11'),('酒精的确能杀死病毒。但得是75%浓度以上的酒精消毒产品，而且只能用来体表消毒。喝进身体的高度酒，只会被吸收代谢，不会作用于病毒。\n','2020-02-11','ck6hfs3z9003ws87c1irqgn22','2020-01-28','丁香医生团队辟谣：喝进去不会作用于病毒','喝高度酒能抵抗冠状病毒?','2020-02-11'),('吸烟不仅无法对病毒感染产生任何的预防作用，还会刺激呼吸道。烟草中的有害物质还会损伤肺功能、减低身体抵抗力，而增加受到感染的可能，呼出的二手烟雾也会危害到周边人的健康。\n\n另外，吸烟时无法戴口罩，手部会触碰口鼻，会增加病毒感染风险。','2020-02-11','ck6hfs3z9003xs87ccist6y9z','2020-01-28','丁香医生团队辟谣：吸烟没有任何好处','吸烟就能预防病毒?','2020-02-11'),('护目镜是针对一线临床医生的，普通人出门不需要佩戴护目镜。\n但大家都要注意，不要揉眼睛，因为手可能接触到病毒，再接触到眼睛会导致结膜感染。\n','2020-02-11','ck6hfs3za003ys87cdhpreuut','2020-01-28','丁香医生团队辟谣：普通人出门没必要戴','出门要戴护目镜?','2020-02-11'),('无论有没有疫情，都建议戴口罩出门。\n时值春运，很多病毒携带者可能出现在全国各地，而部分携带者可能身上还没有症状。这意味着，我们都有可能会接触到携带者。\n合理佩戴口罩，可有效挡住飞沫，能阻断病毒直接进入人体内。\n首选医用外科口罩或N95/KN95口罩。其他口罩，效果不如这三种好。','2020-02-11','ck6hfs3za003zs87c7jxz823j','2020-01-28','丁香医生团队辟谣：无论有没有疫情，出门都建议戴','身边没有疫情不用戴口罩?','2020-02-11'),('燃放烟花爆竹产生的气体并不能杀死新型冠状病毒，除此之外，燃放烟花爆竹产生的二氧化硫还对人体健康有害，如对呼吸系统产生刺激，还有消防隐患，危机生命财产安全。','2020-02-11','ck6hfs3za0040s87c180x93tu','2020-01-28','丁香医生团队辟谣：不仅不能「杀毒」，还对健康有害','燃放烟花可以预防感染?','2020-02-11'),('口罩正着戴才有用，戴反了，防护力会大大减弱。正确的操作是颜色较深的一面朝外，颜色较浅的朝自己，有金属条的部分戴在鼻子上，用手捏紧，使口罩上端紧贴鼻梁。','2020-02-11','ck6hfs3za0043s87cf0pxbldh','2020-01-28','丁香医生团队辟谣：口罩正着戴才有用','没感冒时，口罩反着戴?','2020-02-11'),('口罩只是起到阻挡飞沫的作用，病毒在口罩上残留的时间和量并不明确。脱口罩时，用手勾住绳子，脱下来直接丢弃即可，不需要做其他处理。如果用手直接接触口罩面，反而会增加感染风险。','2020-02-11','ck6hfs3za0044s87caoq2f7w4','2020-01-28','丁香医生团队辟谣：口罩用过后直接丢弃即可','口罩用过要剪碎或消毒?','2020-02-11'),('经首发信息中心核实，没有路段采取封闭措施。此外，据北京市交管局相关知情人士介绍，目前，北京市交管部门没有采取任何高速公路封路措施。','2020-02-11','ck6hfs3za0045s87c7urs8r6b','2020-01-28','经首发信息中心核实：没有路段采取封闭措施','北京高速封路?','2020-02-11'),('据四川网警消息，1月25日，自贡市网民孙某在微信群内传播不实言论，称“此次疫情系解放军传播病毒导致”。目前，孙某因散布谣言属地公安机关处以行政拘留处罚。网警重申：网络不是法外之地，对于编造，散布谣言，扰乱公共秩序违法行为，公安机关将依法查处。','2020-02-11','ck6hfs3zb0049s87c7ykc8mj9','2020-01-28','四川网警辟谣：不实言论！','此次疫情系解放军导致?','2020-02-11'),('实际情况是，泰国政府和移民局秉承人道主义精神，针对中国因新冠肺炎疫情关闭个别机场，致使部分要回国却滞留泰国的中国游客，实行免除逾期滞留的罚款和惩罚措施。但仅适用于其返程机票和目的地的确是已被被关闭的机场周边城市的游客，和真正受影响地区的游客，其他没有被关闭机场地区的中国游客，还是会被照常处以罚金。','2020-02-11','ck6hfs3zb004as87c3a4c5mnn','2020-01-28','泰移民局辟谣：纯属谣言！','泰签可续签15-60天?','2020-02-11'),('医疗队医师组组长、上海市第一人民医院呼吸与危重症医学科医师组组长周新教授，做出回应：政府安排得很好，上海医疗队到武汉这两天，没有吃过一盒方便面。','2020-02-11','ck6hfs3zb004bs87c0cqz1ur2','2020-01-28','医疗队医师组组长回应：不实信息','沪援鄂医疗队只能吃方便面?','2020-02-11'),('据微博「山西公安」消息，从1月25日夜间开始，山西局部地区降雪，因不具备安全通行条件，多地高速公路临时交通管制。目前，因降雪临时封闭的路段已陆续恢复正常通行。为加强疫情防控，省内高速公路出入口均设置了司乘人员体温检测点，并非交通管制。','2020-02-11','ck6hfs3zb004cs87c6zr876ew','2020-01-28','山西公安：系谣言','山西高速因疫情封闭?','2020-02-11'),('据武汉市红十字会官方微博@博爱江城，武汉市红十字会负责接收捐赠物资，具体的发放和分配由市卫健委统一根据各个医院的实际需求调拨安排，来运送的车辆由各个医院自行安排，市红十字会的转运车辆也是通过与武汉市交通委员会协调后，免费运送。武汉市红十字会至今为止的所有工作流程中，均不存在任何收费现象。','2020-02-11','ck6hfs3zb004ds87c4j7x9c08','2020-01-28','武汉市红十字会官方微博辟谣：不存在任何收费现象','武汉红十字会收服务费？','2020-02-11'),('中科院武汉病毒所的石正丽教授团队经过多年研究发现，SARS病毒的基因与来自云南山洞里的菊头蝠99%吻合。SARS爆发主要集中在中国和亚洲地区，是因为病毒的传播依赖人传人，如果没有感染的人去到其他洲，病毒是没有办法跨越大洋传播的。','2020-02-11','ck6hfs3zb004es87c2swyfatr','2020-01-28','勿怪幸医学博士查证：营销号胡扯','SARS是美国的生物战？','2020-02-11'),('杭州市新冠肺炎防控指挥部发布公告称，自采取公共卫生事件一级响应以来，杭州市防控「冠状病毒肺炎」各项工作有序、有力、有效，尽管病例数仍在增加，但均为输入性病例，并且均按医学隔离标准和诊疗规范实施有效管控。为了减少输入性病例，在一些入城口采取了体温监测措施，但不存在“封城”等说法。','2020-02-11','ck6hfs3zb004fs87cc7q5c8ql','2020-01-28','杭州新冠肺炎防控指挥部辟谣：均为输入性病例，不存在封城','杭州为控制疫情将封城？','2020-02-11'),('网传「武汉将断网，禁止医务人员分享相关信息」。就此，省通信管理局和三大运营商相关权威人士均明确回复，此传言纯属子虚乌有，完全是谣言。相反，目前省通管局和运营商正在进一步强化措施保障通信畅通。','2020-02-11','ck6hfs3zb004gs87cc1945nqx','2020-01-28','湖北通信管理局和三大运营商辟谣','武汉将断网？','2020-02-11'),('北京市新型冠状病毒感染的肺炎疫情防控工作新闻发布会召开，就网络上流传的“北京市为防控疫情采取封城措施”的消息，北京市交通委副主任容军表示，目前，北京市对外交通基本正常，没有封城也不会封城，但将严防疫情通过交通工具传播。','2020-02-11','ck6hfs3zb004is87cdw73dqry','2020-01-28','北京市交通委辟谣：情况不实','北京为防控疫情将封城？','2020-02-11'),('新型冠状病毒感染的肺炎疫情发生后，有网友翻出2018年“科学家发现新型冠状病毒”的旧闻，怀疑“是否两年前就已发现如今正在肆虐的新型冠状病毒”。记者今天向中科院求证，该院武汉病毒研究所称2018年报道的“病毒”，与此次引发肺炎疫情的2019-nCov并非“同一种病毒”。','2020-02-11','ck6hfs3zc004js87chc9a46wv','2020-01-28','中科院辟谣：并非同一种','新冠2018年就发现了？','2020-02-11'),('经核实此传言不实，为防治新型冠状病毒感染的肺炎疫情，有关部门为减少人员密集场所人流量，仅对个别大型商业综合体的非群众日常生活必需品销售场所进行了临时管理，与市民群众生活密切相关的超市（含大型商场附设超市）、农贸市场、便利店、连锁店、配送店、菜店和各类粮油副食供应点均照常营业，且各类货品准备充足。','2020-02-11','ck6hfs3zc004ks87cfwhpclvd','2020-01-28','西宁官方辟谣：不属实','西宁将关闭超市菜场？','2020-02-11'),('有网友称，从武汉回到大溪镇的一千多人，被公安局全抓走，需隔离15天，政府包了10个宾馆。\n台州网警对此表示，经与属地核实，并无此事。','2020-02-11','ck6hfs3zc004ls87c0t2cdgk7','2020-01-28','台州网警辟谣：纯属谣言','从武汉回大溪镇被抓走？','2020-02-11'),('有消息称：新加坡拒逾百名武汉旅客入境。新加坡移民局与关卡局25日表示消息并不是真的，这件事情没有发生','2020-02-11','ck6hfs3zc004ms87c0r3lg3qn','2020-01-28','新加坡移民局辟谣：假的','新加坡拒武汉旅客入境?','2020-02-11'),('北京协和医院经过多方调查核实，该患者并未失联。因新型冠状病毒感染病例的确诊或疑似病例的排除，需要经过多次复核复验。该病例后经北京市CDC复核检验为阴性。','2020-02-11','ck6hfs3zc004ns87c7hwa7sks','2020-01-28','北京协和医院辟谣：该患者并未失联','北京一确诊患者逃跑？','2020-02-11'),('有微信群内网友传言称，此次由武汉开始传播的肺炎疫情，已经导致北京300多人死亡。对此，北京市政府新闻办公室官方微博@北京发布回应@捉谣记指出，该传言是假的。','2020-02-11','ck6hfs3zc004os87c48iaa9xd','2020-01-28','北京政府新闻办官微回应：假的','北京三百多人死亡？','2020-02-11'),('1月26日下午从深圳市新型冠状病毒感染的肺炎疫情防控工作领导小组办公室获悉，有关深圳市将要“封城”的信息，是谣言！','2020-02-11','ck6hfs3zc004ps87c3dvt42o4','2020-01-28','深圳市互联网信息办公室：是谣言','深圳要封城？','2020-02-11'),('27日下午，网上流传一张日本媒体报道武汉肺炎疫情的截图，配文称“日本派了1000名医疗工作者去武汉”。其实，这是误解了截图配文的意思，原意是日本媒体报道中国政府派了1000名医疗工作者去武汉，却被解读为日本派了1000名医疗工作者去武汉。','2020-02-11','ck6hfs3zc004qs87c197g1ehc','2020-01-28','其实是误解','日本派出千名医疗人员？','2020-02-11'),('呼吸阀的气流是单向向外的，不影响使用者的防护效果。但已经有症状的人，建议不要使用带有呼吸阀的防护口罩，它无法阻挡病毒飞沫溢出。','2020-02-11','ck6hfs3zc004rs87c74j27swf','2020-01-28','丁香医生团队辟谣：口罩上有呼吸阀不用担心','带呼吸阀的口罩没有用？','2020-02-11'),('27日下午，一则消息称，自2020年1月28日24时起，市区网约车，出租车一律停止运营。东方网记者致电大众、强生等叫车服务热线，均得到否定的答案。滴滴出行、美团出行等网约车平台也对该说法予以否定。此外，这则消息的落款为“上海市城市交通客运管理处”，而上海并没有这一部门。','2020-02-11','ck6hfs3zf004ts87c3rgjfrfm','2020-01-28','多个平台回复：不实消息','上海出租车网约车停运？','2020-02-11'),('有传言称「即便吸入了病毒，如果喉咙湿润的话，病毒大多会沿食道进入胃部，而不是沿呼吸道进入肺部。胃里有胃酸，能有效杀死病毒，所以要多喝水」其实新冠病毒通过侵染呼吸道黏膜上皮细胞，并在细胞中大量增殖完成侵染，多喝水并不能阻止细胞进入呼吸道。胃酸虽可杀死病毒，但不是全部病毒，新冠病毒存在侵染胃部细胞的可能性。水喝太多可能使体内电解质失衡，对肾脏等器官造成额外负担！','2020-02-11','ck6hiq1ch0000u77c8ejadqjg','2020-02-11','剑桥大学病毒学助理研究员韩越：没有研究显示频繁喝水能预防新冠病毒感染','保持喉咙湿润可以预防病毒？','2020-02-11'),('有肺炎的话，你会咳嗽、呼吸急促，甚至喘不过气，很容易就能认得出，必要时还有 CT 识别手段。就算毫无肺炎表现，只要有发热以及相关密切接触史，也得尽快就医，并不是没有肺炎就安全。假如你一切良好，看到这则谣言不由自主做几次深吸气检查也没关系，会稍稍刺激迷走神经，还可能让气道高敏的人忍不住咳几声，这并不会有明显危害，记得别连续深吸气「复查」就行了。','2020-02-11','ck6hiq1mu0001u77c9ofxc74j','2020-02-11','丁香医生团队辟谣：真没必要用这样的方式去检查有没有肺炎','深呼吸再憋十秒可测是否有肺炎？','2020-02-11'),('目前没有证据证明洋葱有预防新冠肺炎的功效。不过，炒菜吃还是很美味的，闻就算了吧，不嫌辣眼睛和鼻子吗。','2020-02-11','ck6hiq2c10005u77c9fc1fn7i','2020-02-11','丁香医生团队辟谣：无论是吃还是闻都不能预防新冠肺炎','洋葱可以预防新冠肺炎？','2020-02-11'),('由国家卫健委高级别专家组组长钟南山领衔的「中国 2019 年新型冠状病毒感染的临床特征」研究，在预印本网站 medRxiv 上发表。钟南山等人对 1099 例（截至 1 月 29 日）新冠肺炎确诊患者的临床特征进行了回顾性研究。研究发现，新冠肺炎的中位潜伏期为 3.0 天，最长可达 24 天。丁香医生在此提醒，潜伏期长是个案，要重视，但无需恐慌。','2020-02-11','ck6hiq2i40006u77c3uzl36ft','2020-02-11','钟南山领衔新论文：新冠肺炎的中位潜伏期为 3.0 天，最长可达 24 天','新冠肺炎潜伏期最长24天？','2020-02-11'),('蔬菜、肉、水果买回家后先用流水冲洗。蔬菜、肉类应烧熟吃，水果尽量削皮，处理生食和熟食的切菜板及刀具要分开。病毒在 56℃、30 分钟就能被杀死，炒菜经常能达到 100℃ 以上的高温，炒熟炒透后不用担心病毒。处理过后注意及时洗手。目前新型冠状病毒是否经粪-口途径（消化道）传播，虽尚待进一步明确，但通过将食物洗净煮熟，饭前便后洗手等方法可预防病毒经消化道传播。','2020-02-11','ck6hiq2ny0007u77c3omr2d1w','2020-02-11','中国疾病预防控制中心研究员冯录召：病毒通过飞沫、直接接触等方式污染到蔬菜、肉和水果的几率很低','吃果蔬和肉蛋会感染新冠病毒？','2020-02-11'),('在口罩内部垫纸巾不能起到延长口罩寿命的效果，反而会让气体从纸巾旁边通过，影响气密性，导致口罩失效。一般来讲，一次性口罩不建议重复使用，N95 口罩在保存得当的情况下，可以考虑多次使用，但最好不要超过 5 次。','2020-02-11','ck6hiq3390008u77c6rle8pol','2020-02-11','丁香医生团队辟谣：在口罩里垫纸巾不能延长口罩寿命，反而影响使用效果','口罩里垫一张纸巾，就能反复使用？','2020-02-11'),('气溶胶颗粒通常>10微米，一般医用口罩就能阻挡。半径<0.1微米的气溶胶微粒，重量轻，主要在高空，会随风飘走，呼吸到的概率不大。气溶胶质点比表面能很大，又有电荷，病毒很容易被破坏，存活度不高。非医务人员在日常只有达到极高数量级的阈值，部分病毒才能由黏膜进入人体。由气溶胶形式悬停在衣物、皮肤的病毒，只有极微小的比例能通过接触传播。这样的病毒量不太会引发疾病。','2020-02-11','ck6hiq3bf0009u77c7d38f7ek','2020-02-11','丁香医生团队：暂不明确。要重视，但不必恐慌','新冠病毒可通过气溶胶传播？','2020-02-11'),('有传闻「某药方打粉，用鸡蛋清调匀。将药分成两份，敷于双脚底涌泉穴。平躺 16 小时，期间不能坐，不能站。口含咬破大蒜一天一夜。可以考虑戴成人尿不湿。晚上开始敷，16 小时内可以不用吃饭。可抑制病毒 / 治疗肺炎」丁香医生再次强调，到目前为止，还没有专门用于预防和治疗新冠病毒的药物。别浪费钱折腾了，少出门，勤洗手，做好家居外出防护，才是最好的方法.','2020-02-12','ck6j3f181000lgg7c7zmehu66','2020-02-12','丁香医生团队辟谣：到目前为止，还没有专门用于预防和治疗新冠病毒的药物','把某些药物敷在脚底可以防病毒？','2020-02-12'),('世卫组织总干事谭德塞博士表示：「开发疫苗和疗法需要时间，与此同时，我们也不是束手无策。我们现在可以采用许多基本公共卫生干预措施预防感染。第一支疫苗可能在 18 个月后才能投入使用。所以，在筹划长远安排的同时，我们今天必须全力使用现有各种武器对付这一病毒。」','2020-02-12','ck6j3f1s4000mgg7c9gn6a19j','2020-02-12','世卫组织总干事谭德塞博士：开发疫苗和疗法需要时间','新冠病毒的疫苗研制要 18 个月？','2020-02-12'),('经查证，钟南山院士并没有说过此话。相反，1 月 31 日，钟南山院士在接受北京卫视《养生堂》采访时提到：到现在我没有发现有很明显的后遗症，治愈的可能以后会大量增加。','2020-02-12','ck6j3f283000ogg7c0przarwy','2020-02-12','丁香医生团队查证：钟南山院士没有说过此话','钟南山：新冠肺炎治愈也有后遗症？','2020-02-12'),('9 日，湖北省召开第 19 场疫情防控工作新闻发布会，华中农业大学教授陈焕春介绍，「分析发现，新型冠状病毒属于 SARS 冠状病毒。」新京报记者刚刚向陈焕春核实到，该说法属于口误。他表示，应为「新型冠状病毒属于 SARS 相关冠状病毒」。这意味着「新冠」病毒与 SARS 冠状病毒相似。该结论是基于中科院武汉病毒所石正丽研究员的工作得出的。','2020-02-12','ck6j3f2dl000pgg7cg0jb8vzs','2020-02-12','华中农业大学教授陈焕春解释：完全属于口误','新冠病毒属于 SARS 病毒？','2020-02-12'),('相比于哺乳动物，鱼类、鸟类和爬行类成为新冠肺炎中间宿主的可能性非常小。新冠病毒主要利用细胞表面受体 ACE2 感染哺乳动物，鸟类目前没有被检测出具备大量 ACE2 受体，被病毒侵染概率很低。','2020-02-12','ck6j7coh10078gg7c0mktfnk7','2020-02-12','剑桥大学病毒学助理研究员韩越：相比于哺乳动物，鱼类、鸟类和爬行类成为新冠肺炎中间宿主的可能性非常小','候鸟迁徙会携带传播新冠病毒？','2020-02-12'),('网传「武汉盘龙城一小区男子把口罩喷酒精戴，坐电梯时遇 84 消毒，瞬间晕倒死亡」，楚天都市报记者多方证实，系谣言。属地派出所表示，他们未接到或者处置过类似的警情。据悉，武汉市相关部门已联系上帖主核实情况，帖主表示系「道听途说」，已自行删帖。「有害物质有可能导致肺水肿，但没有听到过晕倒的。」医生表示，酒精遇84消毒液是会产生有害物质，但马上致死不太可能。','2020-02-13','ck6kfed5j011o567cfeav4k4r','2020-02-13','楚天都市报记者从多方证实：该消息系谣言','口罩上喷酒精遇电梯 84 消毒瞬间死亡？','2020-02-13'),('青海、南宁、丽江等各城市版本的均为编造。另外，此次新型冠状病毒来源是非法销售的野生动物，正规渠道售卖的各类肉制品仍可彻底煮熟后食用。','2020-02-13','ck6kfedcu011x567c8hqf6dgg','2020-02-13','丁香医生团队查证：青海、南宁、丽江等各城市版本的均为编造。正规渠道售卖的仍可放心吃','别吃鱼，某地有 121 个鱼塘感染？','2020-02-13');
